INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(1, 18, 'di permukaannya naskah carol garapan phyllis nagy mungkin tidak sampai serumit romansa provokatif sejenis tidak ada momen emosional tidak ada pertentangan besar dari lingkungan ruang lingkupnya dipersempit pada tokoh carol dan konflik internalnya namun bagaimana cara haynes memperlakukan kesederhanaan narasinya menjadi sajian yang intim dan personal nada-nada depresi dan dingin menghiasi menit durasinya ada begitu banyak cinta nafsu sekaligus rasa putus asa di udara yang dibungkus oleh visual cantik dan detail desain produksi yang sempurna serta iringan scoring lembut carter burwell yang sanggup menghasilkan sisi sentimentil tersendiri namun yang terpenting adalah bagaimana haynes berhasil memaksimalkan daya pikat dua cast utamanya yang bermain gemilang guna memperkuat narasinya', 'permukaannya naskah carol garapan phyllis nagy serumit romansa provokatif sejenis momen emosional pertentangan lingkungan ruang lingkupnya dipersempit tokoh carol konflik internalnya haynes memperlakukan kesederhanaan narasinya sajian intim personal nada-nada depresi dingin menghiasi menit durasinya cinta nafsu putus asa udara dibungkus visual cantik detail desain produksi sempurna serta iringan scoring lembut carter burwell sanggup menghasilkan sisi sentimentil tersendiri terpenting haynes berhasil memaksimalkan daya pikat cast utamanya bermain gemilang memperkuat narasinya', 'muka naskah carol garap phyllis nagy rumit romansa provokatif jenis momen emosional tentang lingkung ruang lingkup sempit tokoh carol konflik internal haynes laku sederhana narasi saji intim personal nada depresi dingin hias menit durasi cinta nafsu putus asa udara bungkus visual cantik detail desain produksi sempurna serta iring scoring lembut carter burwell sanggup hasil sisi sentimentil sendiri penting haynes hasil maksimal daya pikat cast utama main gemilang kuat narasi'),
(2, 19, 'meski terdiri dari banyak cerita dan karakter namun semuanya mendapatkan perlakuan dan jatah seimbang setiap tokohnya berjuang menyembuhkan luka dalam diri mereka dengan sebuah keberanian menghadapi ketakutan setiap konflik berhasil menyedot perhatian sama besarnya dan bagaimana akhirnya seperti kembali lagi ke awal itu adalah menjadi bagian paling berkesan semuanya berhasil dibungkus golubovic bersama dukungan sinematografi cantik silent moment penuh renungan kekuatan akting fantastis dan kandungan tema filosofis yang tergambar dalam kepedihan puitis dalam menit durasinya', 'cerita karakter perlakuan jatah seimbang tokohnya berjuang menyembuhkan luka keberanian menghadapi ketakutan konflik berhasil menyedot perhatian besarnya berkesan berhasil dibungkus golubovic dukungan sinematografi cantik silent moment penuh renungan kekuatan akting fantastis kandungan tema filosofis tergambar kepedihan puitis menit durasinya', 'cerita karakter laku jatah imbang tokoh juang sembuh luka berani hadap takut konflik hasil sedot perhati besar kesan hasil bungkus golubovic dukung sinematografi cantik silent moment penuh renung kuat akting fantastis kandung tema filosofis gambar pedih puitis menit durasi'),
(3, 20, 'ada banyak ledakan besar mobil-mobil terbalik dilema moral dan pertarungan hebat di klimaksnya yang kemudian berakhir dengan suara penuh kekaguman dari penonton dan tentu saja pertanyaan menarik seperti bagaimana mereka melakukannya ya biayanya hanya juta dollar tapi chronicle punya cita rasa spesial efek dan magis seperti film-film blockbuster mahal yang dananya puluhan kali lipat sekali lagi semua itu berkat ide brilian dan kemampuan luar biasa dua sineas mudanya yang mampu membuat manusia bisa terbang dengan serealistis itu ', 'ledakan mobil-mobil terbalik dilema moral pertarungan hebat klimaksnya suara penuh kekaguman penonton menarik melakukannya ya biayanya juta dollar chronicle cita spesial efek magis film-film blockbuster mahal dananya puluhan kali lipat berkat ide brilian kemampuan sineas mudanya manusia terbang serealistis ', 'ledak mobil balik dilema moral tarung hebat klimaks suara penuh kagum tonton tarik laku ya ya biaya juta dollar chronicle cita spesial efek magis film blockbuster mahal dana puluh kali lipat berkat ide ide brilian mampu sineas muda manusia terbang realistis  '),
(4, 21, 'compliance sekali lagi membuktikan bahwa thriller kecil pun dapat memberikan sebuah efek teror yang besar dengan efektif saya sarankan untuk tidak mencari info terlalu banyak soal film ini karena ini adalah jenis thriller yang semakin sedikit kamu tahu tentangnya semakin bagus', 'compliance membuktikan thriller efek teror efektif sarankan mencari info film jenis thriller tentangnya bagus', 'compliance bukti thriller efek teror efektif saran cari info film jenis thriller tentang bagus'),
(5, 22, 'meski tampil dengan raut muka menyebalkan di sepanjang film michael b jordan sukses menjadi hero baru berdampingan dengan mentornya rocky tua yang ternyata mampu dimainkan dengan sangat baik oleh stallone penuh kerut wajah tanpa harus melibatkan otot dan tinju', 'tampil raut muka menyebalkan film michael b jordan sukses hero berdampingan mentornya rocky tua dimainkan stallone penuh kerut wajah melibatkan otot tinju', 'tampil raut muka sebal film michael b jordan sukses hero damping mentor rocky tua main stallone penuh kerut wajah libat otot tinju'),
(6, 23, 'dog day afternoon sukses menyuguhkan dirinya sebagai salah satu crime thriller paling hebat sepanjang masa bukan hanya karena terinspirasi dari kisah nyata saja namun juga bagaimana seorang sidney lumet menyajikannya dengan sangat luar biasa dengan adegan demi adegan di dalamnya dan semuanya menjadi terasa semakin lengkap dengan dukungan akting kuat dari seorang al pacino', 'dog day afternoon sukses menyuguhkan salah crime thriller hebat terinspirasi kisah nyata sidney lumet menyajikannya adegan adegan dalamnya lengkap dukungan akting kuat al pacino', 'dog day afternoon sukses suguh salah crime thriller hebat inspirasi kisah nyata sidney lumet saji adegan adegan dalam lengkap dukung akting kuat al pacino'),
(7, 24, 'sepertinya sudah cukup lama sebuah tidak ada sebuah fiksi ilmiah yang mampu tampil beda dan luar biasa dan sepertinya district mampu mengobati kerinduan para penontonnya akan hal tersebut dengan keorisinalan cerita maupun penggarapannya membuat district menjadi salah satu yang terbaik di genrenya dan tidak usah heran jika di masa yang akan datang bakal ada film-film fiksi ilmiah lain yang meniru gaya yang ditampilkan oleh district ', 'fiksi ilmiah tampil beda district mengobati kerinduan penontonnya keorisinalan cerita penggarapannya district salah terbaik genrenya heran film-film fiksi ilmiah meniru gaya ditampilkan district ', 'fiksi ilmiah tampil beda district obat rindu tonton orisinal cerita garap district salah baik genre heran film fiksi ilmiah tiru gaya tampil district '),
(8, 25, 'kudos buat stephen lang yang bermain sebagai the blind man dengan sangat fantastis karakter si buta dengan segala ancamannya adalah pusat gravitasi buat dont breathe ia adalah mimpi buruk buat para maling dan penyusup yang nekat', 'kudos stephen lang bermain the blind man fantastis karakter si buta ancamannya pusat gravitasi dont breathe mimpi buruk maling penyusup nekat', 'kudos stephen lang main the blind man fantastis karakter si buta ancam pusat gravitasi dont breathe mimpi buruk maling susup nekat'),
(9, 26, 'film ini secara di luar dugaan mampu menghibur saya lebih dari yang saya perkirakan sebelumnya sebuah horror modern dengan sentuhan klasik dari sam raimi yang berhasil membuat sebuah film horror yang berkelas dari opening scene saja saya sudah bakalan menduga kalau film ini bakalan memberikan suasana yang berbeda dari film-film horor kebanyakan ', 'film dugaan menghibur perkirakan horror modern sentuhan klasik sam raimi berhasil film horror berkelas opening scene menduga film suasana berbeda film-film horor kebanyakan ', 'film duga hibur kira horror modern sentuh klasik sam raimi hasil film horror kelas opening scene duga film suasana beda film horor banyak '),
(10, 27, 'berbicara soal pemainnya tidak seperti mumblecore pada umumnya swanberg melakukan seperti yang dilakukan koleganya duplass bersaudara mengisinya dengan nama-nama besar macam oliva wilde dan anna kendrick tetapi bukan berarti kehadiran mereka hanya sekedar bahan jualan semata wilde yang mendominasi bersama johnson yang karismatik tampil energik dan percaya diri sebagai kate sementara kendrick tampil kalem seperti biasa memberikan sedikit kerapuhan akan komitmen kepada karakternyadrinking buddies punya kualitas bagus untuk ukuran drama mikro budget teknik penyutradaraan minimalis swanberg mampu menangkap momen-momen manis di dalam maupun di luar plot yang lalu dipoles dengan visual intim dari sinematografer beasts of the southern wild ben richardson dan scoring pop indie lembut kris swanson', 'berbicara pemainnya mumblecore swanberg koleganya duplass bersaudara mengisinya nama-nama oliva wilde anna kendrick kehadiran sekedar bahan jualan wilde mendominasi johnson karismatik tampil energik percaya kate kendrick tampil kalem kerapuhan komitmen karakternyadrinking buddies kualitas bagus ukuran drama mikro budget teknik penyutradaraan minimalis swanberg menangkap momen-momen manis plot dipoles visual intim sinematografer beasts of the southern wild ben richardson scoring pop indie lembut kris swanson', 'bicara main mumblecore swanberg kolega duplass saudara isi nama oliva wilde anna kendrick hadir sekedar bahan jual wilde dominasi johnson karismatik tampil energik percaya kate kendrick tampil kalem rapuh komitmen karakternyadrinking buddies kualitas bagus ukur drama mikro budget teknik sutradara minimalis swanberg tangkap momen manis plot poles visual intim sinematografer beasts of the southern wild ben richardson scoring pop indie lembut kris swanson'),
(11, 28, 'sepertinya saya tidak terlalu berlebihan menobatkan drive sebagai salah satu yang terbaik tahun ini nicolas winding refn sudah membuat film aksi cerdas artistik brutal dan juga begitu emosional dengan gayanya sendiri yang tidak biasa dan menyegarkan di tengah hamparan mainstream hollywood yang selama ini menawarkan sesuatu yang itu-itu saja dan bukan hanya itu refn juga telah melahirkan sosok anti hero baru dalam diri ryan gosling sebagai seorang supir jagoan yang tidak hanya keren tapi juga tidak pernah tanggung-tanggung dalam menjalankan aksinya', 'menobatkan drive salah terbaik nicolas winding refn film aksi cerdas artistik brutal emosional gayanya menyegarkan hamparan mainstream hollywood menawarkan itu-itu refn melahirkan sosok anti hero ryan gosling supir jagoan keren tanggung-tanggung menjalankan aksinya', 'nobat drive salah baik nicolas winding refn film aksi cerdas artistik brutal emosional gaya segar hampar mainstream hollywood tawar itu refn lahir sosok anti hero ryan gosling supir jago keren tanggung jalan aksi'),
(12, 29, 'easy a jelas dengan mudah menjadikan dirinya sebagai salah satu teen flick terbaik tahun ini kisahnya yang sederhana namun berhasil dikemas menarik dengan dialog-dialog cerdas dan humor-humor menggelitik belum lagi didukung dengan penampilan fantastis dari emma stone menjadikan film ini sebagai sebuah film wajib ditonton bagi siapa saja yang mencari drama komedi remaja berkualitas', 'easy a mudah menjadikan salah teen flick terbaik kisahnya sederhana berhasil dikemas menarik dialog-dialog cerdas humor-humor menggelitik didukung penampilan fantastis emma stone menjadikan film film wajib ditonton mencari drama komedi remaja berkualitas', 'easy a mudah jadi salah teen flick baik kisah sederhana hasil kemas tarik dialog cerdas humor gelitik dukung tampil fantastis emma stone jadi film film wajib tonton cari drama komedi remaja kualitas'),
(13, 30, 'elephant bukan hanya sekedar crime drama biasa berkat sentuhan dingin seorang gus van sant film produksi hbo ini berhasil menyajikan sebuah pengalaman menonton drama yang berbeda dan unik sebuah drama yang mampu meninggalkan kesan bagi setiap penontonnya khususnya bagi pecinta drama dengan alur yang lambat', 'elephant sekedar crime drama berkat sentuhan dingin gus van sant film produksi hbo berhasil menyajikan pengalaman menonton drama berbeda unik drama meninggalkan kesan penontonnya pecinta drama alur lambat', 'elephant sekedar crime drama berkat sentuh dingin gus van sant film produksi hbo hasil saji alam tonton drama beda unik drama tinggal kesan tonton cinta drama alur lambat'),
(14, 31, 'sebagai sebuah aksi fiksi ilmiah kamu masih akan mendapatkan semua keasyikan ala blomkamp yang pernah kamu dapatkan dalam district dalam bungkusan visual dan efek canggih garapan industrial light and magic yang masih terasa manusiawi sama ketika weta menggarap district dulu termasuk senjata-senjata keren nan dashyat serta gear canggih yang dipakai karakter damon dan copley ', 'aksi fiksi ilmiah keasyikan ala blomkamp dapatkan district bungkusan visual efek canggih garapan industrial light and magic manusiawi weta menggarap district senjata-senjata keren nan dashyat serta gear canggih dipakai karakter damon copley ', 'aksi fiksi ilmiah asyik ala blomkamp dapat district bungkus visual efek canggih garap industrial light and magic manusiawi weta garap district senjata keren nan dashyat serta gear canggih pakai karakter damon copley '),
(15, 32, 'meskipun terkesan rumit dan penuh simbolisme macam karya-karya david lynch sebenarnya enemy tidak sampai seabsurd itu ya memang mungkin kamu akan dipaksa untuk menontonnya lebih dari satu kali dalam usaha menemukan maksud dari semua momen surealisnya tetapi kamu akan menyadari bahwa villeneuve dan penulis naskah javier gullon sebenarnya sudah sangat berbaik hati untuk memberikan jawaban dari pertanyaan-pertanyaan yang mengganggumu ini seperti sebuah jigsaw puzzle kuning besar berdurasi satu jam setengah di mana setiap kepingannya menunggu untuk ditemukan guna membentuk wajahnya secara keseluruhan dan keping-keping itu sebenarnya sudah terhampar di setiap adegan di setiap dialog yang semuanya secara cerdas berhasil diolah villeneuve menjadi sebuah sajian thriller kompleks sekaligus cerdas', 'terkesan rumit penuh simbolisme karya-karya david lynch enemy seabsurd ya dipaksa menontonnya kali usaha menemukan maksud momen surealisnya menyadari villeneuve penulis naskah javier gullon berbaik hati pertanyaan-pertanyaan mengganggumu jigsaw puzzle kuning berdurasi jam kepingannya menunggu ditemukan membentuk wajahnya keping-keping terhampar adegan dialog cerdas berhasil diolah villeneuve sajian thriller kompleks cerdas', 'kesan rumit penuh simbolisme karya david lynch enemy absurd ya paksa tonton kali usaha temu maksud momen surealis sadar villeneuve tulis naskah javier gullon baik hati pertanyaan ganggu jigsaw puzzle kuning durasi jam keping tunggu temu bentuk wajah keping hampar adegan dialog cerdas hasil diolah villeneuve saji thriller kompleks cerdas'),
(16, 33, 'melalui enter the void gaspar noe kembali sukses menyajikan sebuah pengalaman sinematik yang luar biasa tidak hanya indah namun juga bisa dibilang gila menghipnotis bahkan memabukkan dalam arti sebenarnya terutama bagi para penonton yang gampang mual pendek kata enter the void adalah sebuah masterpiece yang tidak mudah dilupakan dari seorang gaspar noe', 'enter the void gaspar noe sukses menyajikan pengalaman sinematik indah dibilang gila menghipnotis memabukkan arti penonton gampang mual pendek enter the void masterpiece mudah dilupakan gaspar noe', 'enter the void gaspar noe sukses saji alam sinematik indah bilang gila hipnotis mabuk arti tonton gampang mual pendek enter the void masterpiece mudah lupa gaspar noe'),
(17, 34, 'daya tarik dari film ini adalah bagaimana mencari celah untuk kabur permainan adu pintar dan kucing-kucingan dengan para penjaga dan sipir penjara dan itu semua disajikan dengan editing menghibur nan cepat sejak menit pertama ketika penontonnya diperlihatkan bagaimana karakter breslin melakukan pertunjukan sulapnya', 'daya tarik film mencari celah kabur permainan adu pintar kucing-kucingan penjaga sipir penjara disajikan editing menghibur nan cepat menit penontonnya karakter breslin pertunjukan sulapnya', 'daya tarik film cari celah kabur main adu pintar kucing jaga sipir penjara saji editing hibur nan cepat menit tonton karakter breslin tunjuk sulap'),
(18, 35, 'polesan plot familiar yang mengerikan dan mendebarkan visual cantik dan teknis realistis serta akting kuat para pemainnya adalah elemen-elemen yang kamu temukan dalam menit europa report dan hebatnya ini bukan space thriller besar macam franchise alien namun kadar aroma eerie dan teror luar angkasa yang kamu dapatkan nyaris sama', 'polesan plot familiar mengerikan mendebarkan visual cantik teknis realistis serta akting kuat pemainnya elemen-elemen temukan menit europa report hebatnya space thriller franchise alien kadar aroma eerie teror angkasa dapatkan', 'poles plot familiar erik debar visual cantik teknis realistis serta akting kuat main elemen temu menit europa report hebat space thriller franchise alien kadar aroma eerie teror angkasa dapat'),
(19, 36, 'alvarez membuang banyak porsi komedi hitamnya yang menjadi salah satu tanda pengenal versi klasiknya menggantikannya dengan tone yang jauh lebih gelap suram dan serius menambah lebih banyak kesadisan frontal nan brutal dan hujan darah yang memerahkan segalanya dalam bungkusan scoring roque banos yang menyayat dan kamu tahu kelancangan yang dilakukan alvarez rupanya berbuah manis menjadikan setiap momen gore yang konon digarap dengan sedikit cgi itu sukses menyiksa habis-habisan penontonnya yang berjiwa lemah', 'alvarez membuang porsi komedi hitamnya salah tanda pengenal versi klasiknya menggantikannya tone gelap suram serius menambah kesadisan frontal nan brutal hujan darah memerahkan bungkusan scoring roque banos menyayat kelancangan alvarez berbuah manis menjadikan momen gore konon digarap cgi sukses menyiksa habis-habisan penontonnya berjiwa lemah', 'alvarez buang porsi komedi hitam salah tanda nal versi klasik ganti tone gelap suram serius tambah sadis frontal nan brutal hujan darah merah bungkus scoring roque banos sayat lancang alvarez buah manis jadi momen gore konon garap cgi sukses siksa habis tonton jiwa lemah'),
(20, 37, 'tidak ada yang terlalu abstrak di sini tidak ada lapisan cerita rumit semua motif dan pesannya sudah terpampang jelas di depan hidungmu namun meski kurang kuat di narasinya saya menyukai bagaimana garland mempresentasikan idenya itu dihadirkan dalam visual sederhana namun terasa intim layaknya drama-drama indie yang indah setiap percakapan segi tiga antara gleeson dan issac mengundang rasa ketertarikan tersendiri ketika keduanya terlibat dalam bahasan moral etika serta keputusan yang diambil sementara interaksi gleeson dan vikander seharusnya bisa jauh lebih baik lagi mengingat keduanya punya peranan penting untuk membawa konfliknya terlebih melihat vikander bermain dengan sangat baik sebagai ava yang oh ya jangan lupakan juga penampilan sonoya mizuno yang meskipun nyaris tak berbicara namun kehadirannya mampu mencuri perhatian sebagai asisten pribadi nathan yang misterius bagian terbaik ex machina tentu saja adalah klimaksnya meski sudah bisa diprediksi ke mana ia akan berakhir namun horor di ujungnya sedikit banyak berhasil meninggalkan sedikit kesan haunting di benak penontonnya', 'abstrak lapisan cerita rumit motif pesannya terpampang hidungmu kuat narasinya menyukai garland mempresentasikan idenya dihadirkan visual sederhana intim layaknya drama-drama indie indah percakapan segi gleeson issac mengundang ketertarikan tersendiri terlibat bahasan moral etika serta keputusan diambil interaksi gleeson vikander peranan membawa konfliknya vikander bermain ava oh ya lupakan penampilan sonoya mizuno berbicara kehadirannya mencuri perhatian asisten pribadi nathan misterius terbaik ex machina klimaksnya diprediksi horor ujungnya berhasil meninggalkan kesan haunting benak penontonnya', 'abstrak lapis cerita rumit motif pesan pampang hidung kuat narasi suka garland mempresentasikan ide hadir visual sederhana intim layak drama indie indah cakap segi gleeson issac undang ketertarikan sendiri libat bahas moral etika serta putus ambil interaksi gleeson vikander peran bawa konflik vikander main ava oh ya lupa tampil sonoya mizuno bicara hadir curi perhati asisten pribadi nathan misterius baik ex machina klimaks prediksi horor ujung hasil tinggal kesan haunting benak tonton'),
(21, 38, 'seperti film-film indie kebanyakan exam juga tidak menampilkan bintang-bintang top namun bukan berarti para pemainnya tidak bermain baik justru dengan nama-nama yang kurang terkenal ini suasana tegang berhasil dihasilkan dengan baik apalagi mengetahui bahwa mereka semua bermain sama baiknya dengan porsi yang cukup berimbangso mencari sebuah thriller cerdas dengan konsep orisinal dan penuh dengan kejadian-kejadian tidak terduga didalamnya ya exam jelas adalah pilihan yang paling tepat untuk anda para maniak thriller berkualitas', 'film-film indie kebanyakan exam menampilkan bintang-bintang top pemainnya bermain nama-nama terkenal suasana tegang berhasil dihasilkan bermain baiknya porsi berimbangso mencari thriller cerdas konsep orisinal penuh kejadian-kejadian terduga didalamnya ya exam pilihan maniak thriller berkualitas', 'film indie banyak exam tampil bintang top main main nama kenal suasana tegang hasil hasil main baik porsi berimbangso cari thriller cerdas konsep orisinal penuh kejadian duga dalam ya exam pilih maniak thriller kualitas'),
(22, 39, 'jujur saya belum pernah melihat adegan sederhana seperti momen ketika menunggu seorang bocah perempuan nairobi berjualan roti bisa disajikan dengan begitu mendebarkan sekaligus emosional atau bagaimana ketika para petinggi-petinggi saling adu argumen tentang prosedur pelaksanaan operasi yang tak jarang membuat kita tertawa getir sementara jajaran cast-nya juga bermain gemilang dalam menggerakkan naskah dan penyutradaraannya kita tahu kualitas aktris senior macam helen mirren yang sekali lagi tampil mengesankan membawakan peran kolonel katherine powell yang tegas penuh wibawa namun di saat bersamaan juga sama tidak berdayanya ketika dihadapkan pada sebuah situasi yang sulit sementara mendiang aktor alan rickman juga tampil sama hebatnya sebagai petinggi militer inggris frank benson di salah satu film terakhirnya ', 'jujur adegan sederhana momen menunggu bocah perempuan nairobi berjualan roti disajikan mendebarkan emosional petinggi-petinggi adu argumen prosedur pelaksanaan operasi jarang tertawa getir jajaran cast-nya bermain gemilang menggerakkan naskah penyutradaraannya kualitas aktris senior helen mirren tampil mengesankan membawakan peran kolonel katherine powell penuh wibawa bersamaan berdayanya dihadapkan situasi sulit mendiang aktor alan rickman tampil hebatnya petinggi militer inggris frank benson salah film terakhirnya ', 'jujur adegan sederhana momen tunggu bocah perempuan nairobi jual roti saji debar emosional petinggi adu argumen prosedur laksana operasi jarang tertawa getir jajar cast nya main gemilang gerak naskah sutradara kualitas aktris senior helen mirren tampil kesan bawa peran kolonel katherine powell penuh wibawa sama daya hadap situasi sulit mendiang aktor alan rickman tampil hebat petinggi militer inggris frank benson salah film akhir '),
(23, 40, 'ini ketiga kalinya watts dan penn berkolaborasi setelah sebelumnya grams dan the assassination of richard nixon seperti biasa keduanya mampu membawakan perannya dengan baik meskipun bukan penampilan terbaik mereka namun sudah lebih dari cukup untuk membuat film berdurasi menit ini menjadi lebih hidup dan menarik', 'ketiga kalinya watts penn berkolaborasi grams the assassination of richard nixon membawakan perannya penampilan terbaik film berdurasi menit hidup menarik', 'tiga kali watts penn kolaborasi grams the assassination of richard nixon bawa peran tampil baik film durasi menit hidup tarik'),
(24, 41, 'fast furious semakin mengukuhkan bahwa franchise satu ini memang masih bertaji dan tidak bisa diremehkan sebagai sebuah sajian aksi hebat nan menghibur bahkan saya berani mengatakan ia menjadi semakin baik di setiap episodenya dan untuk sejauh ini instalemen kelimanya ini sudah menjadi yang terbaik termasuk dalam segi naskah yang semakin dewasa ensemble cast hebat hingga rentetan aksi dahsyatnya yang sulit untuk dilupakan benar-benar sebuah paket hiburan lengkap dan melihat apa yang terjadi setelah end credit saya berharap lin bisa kembali mengejutkan saya kembali di sekuel selanjutnya', 'fast furious mengukuhkan franchise bertaji diremehkan sajian aksi hebat nan menghibur berani episodenya instalemen kelimanya terbaik segi naskah dewasa ensemble cast hebat rentetan aksi dahsyatnya sulit dilupakan benar-benar paket hiburan lengkap end credit berharap lin mengejutkan sekuel', 'fast furious kukuh franchise taji remeh saji aksi hebat nan hibur berani episode instalemen lima baik segi naskah dewasa ensemble cast hebat rentet aksi dahsyat sulit lupa benar paket hibur lengkap end credit harap lin kejut sekuel'),
(25, 42, 'feast diawali dengan pembukaan yang menarik ketika gulager memperkenalkan setiap karakternya dengan gaya komikal lengkap dengan tulisan-tulisan nama pekerjaan dan ekspektasi hidup mereka yang tentu saja diisi dengan konyol dan yang menjadi bagian paling menarik di sini adalah kejutan ya feast bukan tipikal film yang taat pada pakem slasher kasual di mana biasanya yang paling cantik sok pintar atau paling bodoh mati terlabih dahulu tidak disini gulanger akan memberikan banyak kejutan anda akan dibuat tidak mudah untuk menebak siapa-siapa yang akan santapan para monster berikutnya', 'feast diawali pembukaan menarik gulager memperkenalkan karakternya gaya komikal lengkap tulisan-tulisan nama pekerjaan ekspektasi hidup diisi konyol menarik kejutan ya feast tipikal film taat pakem slasher kasual cantik sok pintar bodoh mati terlabih gulanger kejutan mudah menebak siapa-siapa santapan monster', 'feast awal buka tarik gulager kenal karakter gaya komikal lengkap tulisan nama kerja ekspektasi hidup isi konyol tarik kejut ya feast tipikal film taat pakem slasher kasual cantik sok pintar bodoh mati terlabih gulanger kejut mudah tebak siapa santap monster'),
(26, 43, 'ya pada akhirnya kesentimentalan field of dreams akan menyentuh anda tidak hanya faktor kehadiran lapangan baseball itu dengan segala keajaiban di dalamnya penampilan kevin costner yang sederhana dan membumi atau selipan road trip menarik tentang pencarian manusia-manusia yang mencintai baseball namun juga bagaimana usaha untuk memenuhi segala impian masa kecilmu yang mungkin belum kesampaian field of dream seperti ingin memberitahu kepada kita bahwa keajaiban itu ada', 'ya kesentimentalan field of dreams menyentuh faktor kehadiran lapangan baseball keajaiban dalamnya penampilan kevin costner sederhana membumi selipan road trip menarik pencarian manusia-manusia mencintai baseball usaha memenuhi impian kecilmu field of dream memberitahu keajaiban', 'ya sentimental field of dreams sentuh faktor hadir lapang baseball ajaib dalam tampil kevin costner sederhana bumi selip road trip tarik cari manusia cinta baseball usaha penuh impi kecil field of dream memberitahu ajaib'),
