(83, 100, 'ya ini adalah sebuah film emosional dan menyentuh yang digarap dengan teknis sinematik yang cantik serta dukungan akting luar biasa dari aktor kaliber oscar javier bardem', 'ya film emosional menyentuh digarap teknis sinematik cantik serta dukungan akting aktor kaliber oscar javier bardem', 'ya film emosional sentuh garap teknis sinematik cantik serta dukung akting aktor kaliber oscar javier bardem'),
(84, 101, 'tentu saja sebagai sebuah film gangster black mass akan dipenuhi dengan banyak unsur kekerasan frontal yang mampu semakin menebalkan kesan gelap dari kisah salah satu buronan yang paling dicari di amerika ini sementara di bagian teknis cooper dan sinematografer masanobu takayanagi juga berhasil menangkap suasana sendu dari sudut-sudut kota boston era dan dengan detail bagaimana selubung suram itu kemudian mampu menguatkan penceritaannya sekaligus di saat bersamaan karakternya termasuk scoring mencekam dari junkie xl yang membuat setiap gesekan yang terjadi bisa begitu terasa menegangkan', 'film gangster black mass dipenuhi unsur kekerasan frontal menebalkan kesan gelap kisah salah buronan dicari amerika teknis cooper sinematografer masanobu takayanagi berhasil menangkap suasana sendu sudut-sudut kota boston era detail selubung suram menguatkan penceritaannya bersamaan karakternya scoring mencekam junkie xl gesekan menegangkan', 'film gangster black mass penuh unsur kerasan frontal tebal kesan gelap kisah salah buron cari amerika teknis cooper sinematografer masanobu takayanagi hasil tangkap suasana sendu sudut kota boston era detail selubung suram kuat cerita sama karakter scoring cekam junkie xl gesek tegang'),
(85, 102, 'black swan bisa saya bilang adalah salah satu karya terjeniusnya mungkin yang terbaik setelah requiem for a dream hampir semua aspek baik teknis maupun non teknis sukses digarap dengan sempurna oleh sutradara tahun ini menyajikan sebuah pengalaman dan sensasi sinematik unik yang tidak terlupakan mengerikan dan menakutkan namun juga emosional di saat bersamaan plus akting fantastis dari natalie portman menjadikan segalanya terasa luar biasa', 'black swan bilang salah karya terjeniusnya terbaik requiem for a dream aspek teknis non teknis sukses digarap sempurna sutradara menyajikan pengalaman sensasi sinematik unik terlupakan mengerikan menakutkan emosional bersamaan plus akting fantastis natalie portman menjadikan', 'black swan bilang salah karya jenius baik requiem for a dream aspek teknis non teknis sukses garap sempurna sutradara saji alam sensasi sinematik unik lupa erik takut emosional sama plus akting fantastis natalie portman jadi'),
(86, 103, 'saya selalu menyukai bagaimana woody allen menghadirkan film-filmnya dengan caranya sendiri yang tidak biasa apalagi kali ini ia mencoba bermain-main sesuatu yang baru ketika menelusuri efek besar dari sebuah kebangkrutan yang berdampak pada kondisi mental karakternya allen menyajikan sebuah drama depresi yang dibungkus dengan sentuhan komedi khasnya yang hadir dalam dialog-dialog cerdas termasuk bagaimana allen seperti biasa menghadirkan visual cantik dari kota-kota yang menjadi latarnya dalam kasus ini ada san fransisco dalam nuansa musik jazz kental membuat blue jasmine terasa riang di balik temanya yang sebenarnya gelap itu', 'menyukai woody allen menghadirkan film-filmnya kali mencoba bermain-main menelusuri efek kebangkrutan berdampak kondisi mental karakternya allen menyajikan drama depresi dibungkus sentuhan komedi khasnya hadir dialog-dialog cerdas allen menghadirkan visual cantik kota-kota latarnya san fransisco nuansa musik jazz kental blue jasmine riang temanya gelap', 'suka woody allen hadir film kali coba main telusur efek bangkrut dampak kondisi mental karakter allen saji drama depresi bungkus sentuh komedi khas hadir dialog cerdas allen hadir visual cantik kota latar san fransisco nuansa musik jazz kental blue jasmine riang tema gelap'),
