(169, 186, 'menariknya dalam perjalanannya matchstick men tidak melulu bercerita soal teknik tipu menipu saja dengan segala selipan komedi satir di dalamnya ada dua bagian lain yang kemudian sukses menyertainya pertama adalah karakter roy wellar sendiri dengan segala krisis kejiwaan yang diidapnya yang sukses dibawakan dengan sangat baik oleh nicholas cage karakternya punya porsi yang sama besarnya antara kecerdasan seorang penipu handal kerapuhan seorang neurotik dan sosok ayah yang belajar untuk mencintai putri tahun yang baru saja dikenalnya', 'menariknya perjalanannya matchstick men melulu bercerita teknik tipu menipu selipan komedi satir dalamnya sukses menyertainya karakter roy wellar krisis kejiwaan diidapnya sukses dibawakan nicholas cage karakternya porsi besarnya kecerdasan penipu handal kerapuhan neurotik sosok ayah belajar mencintai putri dikenalnya', 'tarik jalan matchstick men melulu cerita teknik tipu tipu selip komedi satir dalam sukses serta karakter roy wellar krisis jiwa idap sukses bawa nicholas cage karakter porsi besar cerdas tipu handal rapuh neurotik sosok ayah ajar cinta putri kenal'),
