(174, 191, 'saya senang bagaimana proses menuju akhir yang paling istimewa adalah bagaimana nichols menghormati kecerdasan penontonnya dengan memilih melakukan pendekatan emosional ketimbang naratif yang bertele-tele dan sok pintar termasuk bagaimana ia memanfaatkan pesona jajaran para pemainnya yang turut bermain apik untuk menggerakkan ceritanya mungkin pada akhirnya midnight special tidak menawarkan sebuah twist yang sampai terlalu menonjok tetapi tidak bisa dimungkiri itu adalah sebuah akhir yang cukup emosional', 'senang proses istimewa nichols menghormati kecerdasan penontonnya memilih pendekatan emosional ketimbang naratif bertele-tele sok pintar memanfaatkan pesona jajaran pemainnya bermain apik menggerakkan ceritanya midnight special menawarkan twist menonjok dimungkiri emosional', 'senang proses istimewa nichols hormat cerdas tonton pilih dekat emosional ketimbang naratif tele sok pintar manfaat pesona jajar main main apik gerak cerita midnight special tawar twist tonjok mungkir emosional'),
