(228, 245, 'tentu saja united menjadi personal buat para penggemarnya seperti yang sudah saya tulis di atas karena ia mampu menginspirasi serta mengajak penontonnya untuk melihat bagaimana salah satu tim sepak bola paling hebat di jagat raya ini bangkit dari keterpurukan menjadi seperti yang kita lihat saat ini', 'united personal penggemarnya tulis menginspirasi serta mengajak penontonnya salah tim sepak bola hebat jagat raya bangkit keterpurukan lihat', 'united personal gemar tulis inspirasi serta ajak tonton salah tim sepak bola hebat jagat raya bangkit keterpurukan lihat'),
(229, 246, 'untuk ukuran sebuah horor domestik tentang arwah yang mengganggu under the shadow punya caranya sendiri untuk menakut-nakuti penontonnya penampakan dan kejutan datang tak terduga dalam presisi yang tepat tanpa harus diekspos secara berlebihan kadar seramnya juga dibangun oleh atmosfer tak nyaman yang dibarengi dengan kemampuan pemainnya yang memesona hasilnya under the shadow menakutkan dengan caranya sendiri yang terbilang efektif dan pintar', 'ukuran horor domestik arwah mengganggu under the shadow menakut-nakuti penontonnya penampakan kejutan terduga presisi diekspos kadar seramnya dibangun atmosfer nyaman dibarengi kemampuan pemainnya memesona hasilnya under the shadow menakutkan terbilang efektif pintar', 'ukur horor domestik arwah ganggu under the shadow takut nakuti tonton tampak kejut duga presisi ekspos kadar seram bangun atmosfer nyaman bareng mampu main pesona hasil under the shadow takut bilang efektif pintar'),
(230, 247, 'studi karakter menjadi kunci utama bagaimana tyrannosaur mampu tampil menggigit peter mullan seperti biasa aktor veteran ini memang piawai membawakan karakter pria keras bermasalah karakter joseph itu menarik dan kompleks bak bensin oktan tinggi yang mudah terbakar ketika ada sedikit percikan api saja yang menyentuhnya', 'studi karakter kunci utama tyrannosaur tampil menggigit peter mullan aktor veteran piawai membawakan karakter pria keras bermasalah karakter joseph menarik kompleks bak bensin oktan mudah terbakar percikan api menyentuhnya', 'studi karakter kunci utama tyrannosaur tampil gigit peter mullan aktor veteran piawai bawa karakter pria keras masa karakter joseph tarik kompleks bak bensin oktan mudah bakar percik api sentuh'),
(231, 248, 'jika premis tentang pilihan moral saja belum cukup maka dardenne membuatnya menjadi lebih pelik lagi ketika penontonnya juga dihadapkan pada tokoh sarah yang dimainkan cemerlang oleh cotillard tidak peduli seberapa seringnya sarah mengatakan ia dapat mengerti setiap penolakan toh kita langsung dapat melihat raut kekecewaan dari wajah meyakinkan cotillard yang setia ditangkap melalui pergerakan kamera genggam sederhana bersama take-take panjang khas dardenne ', 'premis pilihan moral dardenne membuatnya pelik penontonnya dihadapkan tokoh sarah dimainkan cemerlang cotillard peduli sarah mengerti penolakan langsung raut kekecewaan wajah cotillard setia ditangkap pergerakan kamera genggam sederhana take-take khas dardenne ', 'premis pilih moral dardenne buat pelik tonton hadap tokoh sarah main cemerlang cotillard peduli sarah erti tolak langsung raut kecewa wajah cotillard setia tangkap gera kamera genggam sederhana take khas dardenne '),
