(328, 345, 'tidak terlalu banyak romcom komedi remaja era milenium yang mampu meninggalkan kesan mendalam yang setelah beberapa lama filmnya dirilis masih mampu kamu ingat jika kemudian ada orang yang menanyakan hei apa sih romcom remaja yang bagus jawabannya mungkin tidak jauh-jauh dari mean girls dari mark water dengan dukungan ensemble cast perempuan yang luar biasa atau mungkin juga pesona luar biasa emma stone yang mempu membuat easy a susah untuk dilupakan dan saya senang bisa menemukan dan memasukkan the duff ke dalam salah satu romcom remaja terbaik yang pernah dibuat di era twitter saat ini', 'romcom komedi remaja era milenium meninggalkan kesan mendalam filmnya dirilis orang hei sih romcom remaja bagus jawabannya jauh-jauh mean girls mark water dukungan ensemble cast perempuan pesona emma stone mempu easy a susah dilupakan senang menemukan memasukkan the duff salah romcom remaja terbaik era twitter', 'romcom komedi remaja era milenium tinggal kesan dalam film rilis orang hei sih romcom remaja bagus jawab jauh mean girls mark water dukung ensemble cast perempuan pesona emma stone mempu easy a susah lupa senang temu masuk the duff salah romcom remaja baik era twitter'),
