(352, 369, 'the intern punya casting hebat kombinasi apik tua-muda yang diwakilkan de niro-hathaway menjadi daya tarik terbesar the intern secara keseluruhan the intern adalah jenis film ringan yang sangat enak dinikmati', 'the intern casting hebat kombinasi apik tua-muda diwakilkan de niro-hathaway daya tarik terbesar the intern the intern jenis film ringan enak dinikmati', 'the intern casting hebat kombinasi apik tua muda wakil de niro hathaway daya tarik besar the intern the intern jenis film ringan enak nikmat'),
(353, 370, 'mungkin the intouchables bukan drama teraplegic terbaik yang pernah saya tonton tapi saya suka setiap kehangatannya setiap keceriaan dan segala tawa serta chemistry solid yang dihadirkan olivier nakache dan ric toledano beserta duo cluzet-sly ya ini adalah tontonan menyenangkan sebuah feel-good movie tentang persahabatan tentang perbedaan yang menguatkan dan juga menginspirasi', 'the intouchables drama teraplegic terbaik tonton suka kehangatannya keceriaan tawa serta chemistry solid dihadirkan olivier nakache ric toledano beserta duo cluzet-sly ya tontonan menyenangkan feel-good movie persahabatan perbedaan menguatkan menginspirasi', 'the intouchables drama teraplegic baik tonton suka hangat ceria tawa serta chemistry solid hadir olivier nakache ric toledano serta duo cluzet sly ya tonton senang feel good movie sahabat beda kuat inspirasi'),
(354, 371, 'premis yang diangkat dalam the joneses termasuk sangat fresh dan orisinal film ini adalah sebuah drama komedi satir dengan sedikit unsur romance di dalamnya secara keseluruhan borte bisa dibilang berhasil menyajikan sebuah tontonan drama ringan yang cukup berbobot', 'premis diangkat the joneses fresh orisinal film drama komedi satir unsur romance dalamnya borte dibilang berhasil menyajikan tontonan drama ringan berbobot', 'premis angkat the joneses fresh orisinal film drama komedi satir unsur romance dalam borte bilang hasil saji tonton drama ringan bobot'),
(355, 372, 'narasinya sederhana dan bersahabat tanpa substansi macam-macam humornya lucu dan enak dinikmati semua umur petualangannya seru dan mendebarkan sisi emosionalnya juga cukup mengena namun jika ada satu hal yang paling menonjol dari the jungle book selain visualnya yang ciamik itu adalah jajaran pengisi suaranya bukan hanya karena diisi oleh nama-nama besar saja namun bagaimana mereka memberi jiwa pada karakter-karakternya dengan sangat baik', 'narasinya sederhana bersahabat substansi macam-macam humornya lucu enak dinikmati umur petualangannya seru mendebarkan sisi emosionalnya mengena menonjol the jungle book visualnya ciamik jajaran pengisi suaranya diisi nama-nama jiwa karakter-karakternya', 'narasi sederhana sahabat substansi macam humor lucu enak nikmat umur tualang seru debar sisi emosional kena tonjol the jungle book visual ciamik jajar isi suara isi nama jiwa karakter'),
(356, 373, 'tampaknya tidak terlalu susah untuk menempatkan the kids are all right sebagai salah satu drama terbaik tahun ini sebuah kisah keluarga yang berbeda dan sangat menarik yang berhasil disajikan dengan ringan oleh lisa cholodenko apalagi the kids are all right juga didukung oleh jajaran aktris dan aktor kelas atas yang bermain dengan sangat fantastis disini', 'susah menempatkan the kids are all right salah drama terbaik kisah keluarga berbeda menarik berhasil disajikan ringan lisa cholodenko the kids are all right didukung jajaran aktris aktor kelas bermain fantastis', 'susah tempat the kids are all right salah drama baik kisah keluarga beda tarik hasil saji ringan lisa cholodenko the kids are all right dukung jajar aktris aktor kelas main fantastis'),
(357, 374, 'tidak hanya tangguh membuat para cast mudanya tampil brilian vogt-roberts juga lihai membungkus kisah pendewasaan indie ini dengan teknis yang penuh dengan kepercayaan diri tinggi terlebih untuk sutradara first timer sepertinya ada banyak gambar-gambar apik menyegarkan yang menguasai menit durasinya', 'tangguh cast mudanya tampil brilian vogt-roberts lihai membungkus kisah pendewasaan indie teknis penuh kepercayaan sutradara first timer gambar-gambar apik menyegarkan menguasai menit durasinya', 'tangguh cast muda tampil brilian vogt roberts lihai bungkus kisah dewasa indie teknis penuh percaya sutradara first timer gambar apik segar kuasa menit durasi'),
(358, 375, 'dibuka dengan meyakinkan berkembang dengan dinamis dan diakhiri dengan sangat emosional itulah the kings speech sebuah historical drama luar biasa yang diisi oleh orang-orang luar biasa sebuah film inspirasional dari seorang pemimpin hebat dalam usaha mencari kepercayaan dirinya', 'dibuka berkembang dinamis emosional the kings speech historical drama diisi orang-orang film inspirasional pemimpin hebat usaha mencari kepercayaan', 'buka kembang dinamis emosional the kings speech historical drama isi orang film inspirasional pimpin hebat usaha cari percaya'),
(359, 376, 'dukungan naskah yang kuat presentasi yang bagus akting prima dari para pemainnya serta ending yang mengejutkan sudah lebih dari cukup bagi saya untuk dapat menyukai film ini', 'dukungan naskah kuat presentasi bagus akting prima pemainnya serta ending mengejutkan menyukai film', 'dukung naskah kuat presentasi bagus akting prima main serta ending kejut suka film'),
(360, 377, 'mark osborne mempresentasikan the little prince versinya dengan cukup baik mungkin tidak sampai kelewat istimewa mengingat kualitas animasi khususnya pada bagian cerita di dunia nyatanya terasa sedikit kurang menarik meski sebenarnya buat penonton yang lebih dewasa hal itu mungkin tidak terlalu menjadi masalah karena bisa ditutupi dengan kekuatan tema dan penceritaannya yang bagus', 'mark osborne mempresentasikan the little prince versinya kelewat istimewa kualitas animasi cerita dunia menarik penonton dewasa ditutupi kekuatan tema penceritaannya bagus', 'mark osborne mempresentasikan the little prince versi lewat istimewa kualitas animasi cerita dunia tarik tonton dewasa tutup kuat tema cerita bagus'),
(361, 378, 'ada elemen komedi hitam bekerja di dalamnya membuat kita tersenyum getir ketika melihat lanthimos sebuah satir tentang tragedi komitmen dari sebuah cinta yang tersembunyi dalam keabsurdan premis fiksi ilmiahnya ada situasi kompleks di bawah permukaannya', 'elemen komedi hitam dalamnya tersenyum getir lanthimos satir tragedi komitmen cinta tersembunyi keabsurdan premis fiksi ilmiahnya situasi kompleks permukaannya', 'elemen komedi hitam dalam senyum getir lanthimos satir tragedi komitmen cinta sembunyi absurd premis fiksi ilmiah situasi kompleks muka'),
(362, 379, 'begitu sederhana namun begitu membekas the lunchbox diisi oleh dua karakter utamanya yang kuat', 'sederhana membekas the lunchbox diisi karakter utamanya kuat', 'sederhana bekas the lunchbox isi karakter utama kuat'),
(363, 380, 'saya selalu percaya kekuatan utama sebuah film itu berada di pundak narasinya dan the man from earth membuktikan itu dengan sumber daya terbatas ia mampu memberikan sebuah suguhan drama fiksi ilmiah yang berbeda menghipnotis dan membuatmu tercengang sebuah premis konyol yang mampu dieksekusi dengan sangat baik dengan balutan dialog-dialog cerdas', 'percaya kekuatan utama film pundak narasinya the man from earth membuktikan sumber daya terbatas suguhan drama fiksi ilmiah berbeda menghipnotis membuatmu tercengang premis konyol dieksekusi balutan dialog-dialog cerdas', 'percaya kuat utama film pundak narasi the man from earth bukti sumber daya batas suguh drama fiksi ilmiah beda hipnotis buat cengang premis konyol eksekusi balut dialog cerdas'),
(364, 381, 'dengan durasi sepanjang ini butuh sesuatu untuk membuat penontonnya betah berlama-lama di bangkunya dan scott tahu benar bagaimana menjaga pace the martian dengan baik hampir tidak ada momen membosankan di dalamnya setiap adegan diisi dengan efektif dan jauh dari kesan lambat belum lagi ditambah elemen humor yang memberi variasi santai di tone seriusnya', 'durasi butuh penontonnya betah berlama-lama bangkunya scott menjaga pace the martian momen membosankan dalamnya adegan diisi efektif kesan lambat ditambah elemen humor variasi santai tone seriusnya', 'durasi butuh tonton betah lama bangku scott jaga pace the martian momen bosan dalam adegan isi efektif kesan lambat tambah elemen humor variasi santai tone serius'),
(365, 382, 'kombinasi west-statham rupanya sanggup membuat the mechanic tampil lebih baik yang dari saya perkirakan sebelumnya tidak istimewa memang namun setidaknya tidak sampai terjebak dalam sajian action murahan kelas dua the mechanic bisa dibilang cukup berkelas saya sendiri sangat menikmati bagaimana west mengemas tiap menitnya dalam dalam balutan visual menarik tempo cepat dan jauh dari bertele-tele', 'kombinasi west-statham sanggup the mechanic tampil perkirakan istimewa terjebak sajian action murahan kelas the mechanic dibilang berkelas menikmati west mengemas menitnya balutan visual menarik tempo cepat bertele-tele', 'kombinasi west statham sanggup the mechanic tampil kira istimewa jebak saji action murah kelas the mechanic bilang kelas nikmat west mas menit balut visual tarik tempo cepat tele'),
(366, 383, 'salah satu yang terbaik di genrenya setelah a dirty carnival butuh waktu tahun untuk mendapatkan sebuah film gangster ala negeri ginseng memuaskan yang tidak hanya menjual kekerasan dan segala tetek bengek dunia gelap mafia namun juga sebuah plot cerdas yang kuat dan menegangkan tentang sisi mana yang kamu pilih dengan bumbu aksi berdarah-darah di sepanjang dua jam lebih plus dukungan para pemainnya yang bermain solid', 'salah terbaik genrenya a dirty carnival butuh film gangster ala negeri ginseng memuaskan menjual kekerasan tetek bengek dunia gelap mafia plot cerdas kuat menegangkan sisi pilih bumbu aksi berdarah-darah jam plus dukungan pemainnya bermain solid', 'salah baik genre a dirty carnival butuh film gangster ala negeri ginseng muas jual kerasan tetek bengek dunia gelap mafia plot cerdas kuat tegang sisi pilih bumbu aksi darah jam plus dukung main main solid'),
(367, 384, 'dibungkus dengan semangat kesederhanaan seperti film-film farhadi lainnya yang juga mencerminkan sebuah realisme kental nyaris tanpa manipulasi scoring dan dramatisasi berlebihan dalam perjalanannya kita akan banyak mendapati kejutan hebat yang sedikit demi sedikit membentuk wajah utuh the past', 'dibungkus semangat kesederhanaan film-film farhadi mencerminkan realisme kental manipulasi scoring dramatisasi perjalanannya mendapati kejutan hebat membentuk wajah utuh the past', 'bungkus semangat sederhana film farhadi cermin realisme kental manipulasi scoring dramatisasi jalan dapat kejut hebat bentuk wajah utuh the past'),
(368, 385, 'gareth evans jelas sudah mengerjakan pekerjaannya dengan sangat baik termasuk bagaimana ia memaksimalkan kemampuan dua pemainnya ya the raid mungkin sudah menjadi film aksi indonesia terbaik yang pernah ada bahkan dunia pun mengakuinya', 'gareth evans pekerjaannya memaksimalkan kemampuan pemainnya ya the raid film aksi indonesia terbaik dunia mengakuinya', 'gareth evans kerja maksimal mampu main ya the raid film aksi indonesia baik dunia aku'),
(369, 386, 'the reef bisa jadi salah satu thriller tentang serangan hiu terbaik yang pernah dibuat setelah jaws sedikit membosankan di awal andrew traucki kemudian seakan-akan tidak mau membuang waktunya lagi dengan langsung memacu tensinya memberikan penontonnya momen-momen penuh kengerian dan ketegangan yang efektif merangsang rasa takut kita tanpa harus terlihat berlebihan', 'the reef salah thriller serangan hiu terbaik jaws membosankan andrew traucki seakan-akan membuang langsung memacu tensinya penontonnya momen-momen penuh kengerian ketegangan efektif merangsang takut', 'the reef salah thriller serang hiu baik jaws bosan andrew traucki akan buang langsung pacu tensi tonton momen penuh ngeri tegang efektif rangsang takut'),
(370, 387, 'hempasan debu dan gersangnya iran ditampilkan dengan sempurna hampir tidak ada musik yang saya dengar muncul di film ini dan juga banyaknya aktor dan aktris yang ada di film ini inilah yang membuat film ini begitu dalam saya sama sekali tidak melihat sang aktor berakting di sini yang ada hanyalah benar-benar seorang amiro apalagi film ini mempunyai ending dramatis yang bikin perasaan campur aduk sekaligus indah', 'hempasan debu gersangnya iran ditampilkan sempurna musik dengar muncul film banyaknya aktor aktris film film sang aktor berakting benar-benar amiro film ending dramatis bikin perasaan campur aduk indah', 'hempas debu gersang iran tampil sempurna musik dengar muncul film banyak aktor aktris film film sang aktor akting benar amiro film ending dramatis bikin asa campur aduk indah'),
(371, 388, 'the sea of trees seakan membawa kita pada kisah haru biru perjuangan keduanya untuk tetap bertahan hidup dengan kondisi hutan yang terlihat berbahaya di malam hari karena banyaknya jurang terjal yang tersembunyi dari pandangan hingga hujan yang menerpa tak dinyana makin ke ujung alur cerita malah dibawa ke arah drama melankolis dengan penutup manis yang tidak disangka-sangka', 'the sea of trees seakan membawa kisah haru biru perjuangan bertahan hidup kondisi hutan berbahaya malam banyaknya jurang terjal tersembunyi pandangan hujan menerpa dinyana ujung alur cerita dibawa arah drama melankolis penutup manis disangka-sangka', 'the sea of trees akan bawa kisah haru biru juang tahan hidup kondisi hutan bahaya malam banyak jurang terjal sembunyi pandang hujan terpa nyana ujung alur cerita bawa arah drama melankolis tutup manis sangka'),
(372, 389, 'kemampuan collet-serra menghadirkan set piece dengan segala teknis yang luar biasa lihat saja pengambilan gambarnya dan sound editing yang keren termasuk juga penggunaan cgi yang tepat guna ini kemudian menjadikan the shallows menjadi lebih istimewa tentu saja juga tidak lepas dari akting solo hebat blake lively yang sukses berpadu padan sempurna menghasilkan tensi ketegangan baik di atas maupun di dalam air yang luar biasa tinggi dan yang pasti juga sangat efektif mengguncang adrenalin penontonnya', 'kemampuan collet-serra menghadirkan set piece teknis lihat pengambilan gambarnya sound editing keren penggunaan cgi menjadikan the shallows istimewa lepas akting solo hebat blake lively sukses berpadu padan sempurna menghasilkan tensi ketegangan air efektif mengguncang adrenalin penontonnya', 'mampu collet serra hadir set piece teknis lihat ambil gambar sound editing keren guna cgi jadi the shallows istimewa lepas akting solo hebat blake lively sukses padu padan sempurna hasil tensi tegang air efektif guncang adrenalin tonton'),
(373, 390, 'tidak heran jika banyak penonton yang memasukkan the shining dalam list film horror klasik favorit mereka karena horror psikologis kolaborasi kubrick-king ini memang yang terbaik di genrenya bahkan sampai sekarang the shining adalah salah satu obat manjur yang dapat membuat penontonnya bermimpi buruk setelah menontonnya', 'heran penonton memasukkan the shining list film horror klasik favorit horror psikologis kolaborasi kubrick-king terbaik genrenya the shining salah obat manjur penontonnya bermimpi buruk menontonnya', 'heran tonton masuk the shining list film horror klasik favorit horror psikologis kolaborasi kubrick king baik genre the shining salah obat manjur tonton mimpi buruk tonton'),
(374, 391, 'meskipun tidak menawarkan nada gelap seperti confessions atau kebanyakan thriller-thriller tentang kasus pembunuhan lain the snow white murder case masih bisa tetap tampil solid dengan pesonanya uniknya sendiri dukungan naskah gubahannya yang berakar plot misteri pembunuhan digarap sangat rapi kreatif berbaur sempurna dengan penyutradaraan lambat namun memikat ala nakamura yang tidak pernah lupa membawa ciri khasnya', 'menawarkan nada gelap confessions kebanyakan thriller-thriller pembunuhan the snow white murder case tampil solid pesonanya uniknya dukungan naskah gubahannya berakar plot misteri pembunuhan digarap rapi kreatif berbaur sempurna penyutradaraan lambat memikat ala nakamura lupa membawa ciri khasnya', 'tawar nada gelap confessions banyak thriller bunuh the snow white murder case tampil solid pesona unik dukung naskah gubah akar plot misteri bunuh garap rapi kreatif baur sempurna sutradara lambat mikat ala nakamura lupa bawa ciri khas'),
(375, 392, 'cerita berjalan dengan rapi tanpa ada paksaan dengan tempo yang pas namun tidak membosankan fincher bukan hanya menyajikan cerita tapi juga mengajak kita untuk berpikir dan menganalisis apa dan mengapa kepada setiap karakter yang muncul di film ini selain itu film ini juga dipenuhi dialog slapstick tajam dan cerdas', 'cerita berjalan rapi paksaan tempo pas membosankan fincher menyajikan cerita mengajak berpikir menganalisis karakter muncul film film dipenuhi dialog slapstick tajam cerdas', 'cerita jalan rapi paksa tempo pas bosan fincher saji cerita ajak pikir analisis karakter muncul film film penuh dialog slapstick tajam cerdas'),
(376, 393, 'kunci keberhasilan the spectacular now adalah bagaimana ponsoldt tidak membuatnya menjadi sebuah teen drama yang lebay sebaliknya secara natural menjadikan semuanya membumi termasuk setiap konfliknya the spectacular now itu seperti karakter aimee polos tanpa makeup namun tetap cantik dilihat di sepanjang film termasuk adegan seksnya yang lugu sutter keely yang dimainkan cemerlang oleh jebolan rabbit hole miles teller adalah pusat segalanya', 'kunci keberhasilan the spectacular now ponsoldt membuatnya teen drama lebay natural menjadikan membumi konfliknya the spectacular now karakter aimee polos makeup cantik film adegan seksnya lugu sutter keely dimainkan cemerlang jebolan rabbit hole miles teller pusat', 'kunci keberhasilan the spectacular now ponsoldt buat teen drama lebay natural jadi bumi konflik the spectacular now karakter aimee polos makeup cantik film adegan seks lugu sutter keely main cemerlang jebol rabbit hole miles teller pusat'),
(377, 394, 'ada sebuah keseimbangan yang berhasil dihadirkan sophon sakdapisit di sini penceritaannya yang sederhana coba ditampilkan dengan cara tidak biasa ketika plotnya melompat-lompat dari masa lalu ke masa sekarang lalu kembali lagi ke masa lalu yang berpotensi membingungkan sementara kualitas horornya juga masih mampu dijaga dengan baik', 'keseimbangan berhasil dihadirkan sophon sakdapisit penceritaannya sederhana coba ditampilkan plotnya melompat-lompat berpotensi membingungkan kualitas horornya dijaga', 'keseimbangan hasil hadir sophon sakdapisit cerita sederhana coba tampil plot lompat potensi bingung kualitas horor jaga'),
(378, 395, 'thriller berbau aksi terorisme mungkin bukan barang baru untuk dipamerkan tetapi dengan melakukan pendekatan berbeda siapa sangka kombinasi usang itu bisa menjadi sangat menggigit coba lihat apa yang dilakukan kim byung woo ketika ia berhasil memanfaatkan minimnya lokasi untuk menghasilkan teror maksimal', 'thriller berbau aksi terorisme barang dipamerkan pendekatan berbeda sangka kombinasi usang menggigit coba lihat kim byung woo berhasil memanfaatkan minimnya lokasi menghasilkan teror maksimal', 'thriller bau aksi terorisme barang pamer dekat beda sangka kombinasi usang gigit coba lihat kim byung woo hasil manfaat minim lokasi hasil teror maksimal'),
(379, 396, 'the theory of everything itu punya tampilan secantik judulnya visual gloomy dari sinematografer veteran benot delhomme berbalut scoring magical dari nada-nada elegan dan melankolis garapan komposer islandia johann johannsson menghasilkan kombinasi momen-momen sentimentil romantis yang mendukung penceritaan james marsh di paruh pertamanya yang diisi banyak cinta', 'the theory of everything tampilan secantik judulnya visual gloomy sinematografer veteran benot delhomme berbalut scoring magical nada-nada elegan melankolis garapan komposer islandia johann johannsson menghasilkan kombinasi momen-momen sentimentil romantis mendukung penceritaan james marsh paruh pertamanya diisi cinta', 'the theory of everything tampil cantik judul visual gloomy sinematografer veteran benot delhomme balut scoring magical nada elegan melankolis garap komposer islandia johann johannsson hasil kombinasi momen sentimentil romantis dukung cerita james marsh paruh pertama isi cinta'),
(380, 397, 'affleck memang terbukti sukses menyutradarai film berdurasi jam lebih ini dengan sangat baik namun tidak sebagai aktor karena ada jeremy renner disini yang berhasil menjadi scene stealer sebagai seorang badass yang mampu menyuguhkan akting kuat di sepanjang film', 'affleck terbukti sukses menyutradarai film berdurasi jam aktor jeremy renner berhasil scene stealer badass menyuguhkan akting kuat film', 'affleck bukti sukses sutradara film durasi jam aktor jeremy renner hasil scene stealer badass suguh akting kuat film'),
(381, 398, 'tidak terlalu berlebihan jika saya kemudian menyebut the tree of life adalah mahakarya agung sebuah puisi bergerak perjalanan spiritual dari seorang pujangga hebat bernama terrence malick yang dibalut dengan teknis sinematik nyaris sempurna', 'menyebut the tree of life mahakarya agung puisi bergerak perjalanan spiritual pujangga hebat bernama terrence malick dibalut teknis sinematik sempurna', 'sebut the tree of life mahakarya agung puisi gerak jalan spiritual pujangga hebat nama terrence malick balut teknis sinematik sempurna'),
(382, 399, 'karya andre ovredal satu ini layak diberi acungan dua jempol bukan hanya karena sukses menghadirkan premis yang orisinal dan menyegarkan namun juga bagaimana ovredal mengemasnya dengan apik serealistis mungkin dan sangat menghibur', 'karya andre ovredal layak acungan jempol sukses menghadirkan premis orisinal menyegarkan ovredal mengemasnya apik serealistis menghibur', 'karya andre ovredal layak acung jempol sukses hadir premis orisinal segar ovredal mas apik realistis hibur'),
(383, 400, 'saya harus mengakui bagaimana usaha keras para sineas dan para pemainnya dalam menyajikan the tunnel ini serealistis mungkin ya mereka sudah melakukannya dengan cukup baik termasuk menyelipkan beberapa sesi wawancara dari para pelakunya yang terlibat langsung guna memperkuat kesan real film berdurasi menit ini', 'mengakui usaha keras sineas pemainnya menyajikan the tunnel serealistis ya melakukannya menyelipkan sesi wawancara pelakunya terlibat langsung memperkuat kesan real film berdurasi menit', 'aku usaha keras sineas main saji the tunnel realistis ya laku selip sesi wawancara laku libat langsung kuat kesan real film durasi menit'),
(384, 401, 'dengan menampilkan sajian multi genre the voices jelas adalah film yang penuh resiko buat sutradara manapun tidak mudah menggabungkan hal-hal serius dalam sebuah thriller psikologis seperti masalah kejiwaan dan pembunuhan dengan elemen-elemen romansa komedi dan melodrama itu seperti perpaduan busana yang tak cocok namun tetap menggoda', 'menampilkan sajian multi genre the voices film penuh resiko sutradara manapun mudah menggabungkan hal-hal serius thriller psikologis kejiwaan pembunuhan elemen-elemen romansa komedi melodrama perpaduan busana cocok menggoda', 'tampil saji multi genre the voices film penuh resiko sutradara mana mudah gabung hal serius thriller psikologis jiwa bunuh elemen romansa komedi melodrama padu busana cocok goda'),
(385, 402, 'ada perekrutan anggota perencanaan matang dan tentu saja eksekusi yang semuanya berhasil disajikan dengan cara yang menarik dan menghibur tetapi momen puncak the walk ada pada menit menjelang akhir momen ketika petit berada di atas kawat baja berada di puncak dunia katanya ya itu adalah momen luar biasa mungkin salah satu yang terbaik tahun ini', 'perekrutan anggota perencanaan matang eksekusi berhasil disajikan menarik menghibur momen puncak the walk menit menjelang momen petit kawat baja puncak dunia ya momen salah terbaik', 'rekrut anggota rencana matang eksekusi hasil saji tarik hibur momen puncak the walk menit jelang momen petit kawat baja puncak dunia ya momen salah baik');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(386, 403, 'selain visual vegetasi cantik ia juga dihiasi oleh banyak metafora dan momen emosional depresif yang terjadi dalam suasana intens dan kelam performa solo gedeck yang solid menguasai keseluruhan panggung juga menjadi alasan kenapa the wall bisa tampil memesona melihat karakternya tumbuh beradaptasi berinteraksi dengan hewan peliharaannya yang berakting sama bagusnya itu adalah pengalaman paling mengesankan menonton the wall selain menikmati indahnya visual puitis yang disuguhkan', 'visual vegetasi cantik dihiasi metafora momen emosional depresif suasana intens kelam performa solo gedeck solid menguasai panggung alasan the wall tampil memesona karakternya tumbuh beradaptasi berinteraksi hewan peliharaannya berakting bagusnya pengalaman mengesankan menonton the wall menikmati indahnya visual puitis disuguhkan', 'visual vegetasi cantik hias metafora momen emosional depresif suasana intens kelam performa solo gedeck solid kuasa panggung alas the wall tampil pesona karakter tumbuh adaptasi interaksi hewan pelihara akting bagus alam kesan tonton the wall nikmat indah visual puitis suguh'),
(387, 404, 'tidak ada momen yang terlewat frontal sebaliknya ribeiro dengan lembut memperlakukan narasi dan karakternya selembut dan sehangat orangtua leonardo memperlakukan putra semata wayangnya itu', 'momen terlewat frontal ribeiro lembut memperlakukan narasi karakternya selembut sehangat orangtua leonardo memperlakukan putra wayangnya', 'momen lewat frontal ribeiro lembut laku narasi karakter lembut hangat orangtua leonardo laku putra wayang'),
(388, 405, 'kekuatan the witch adalah bagaimana eggers mampu membangun dunianya dengan sangat-sangat kuat sejak menit-menit pertama ia bergulir pemilihan palet warna kelabu mendominasi visualnya dikombinasikan dengan scoring garapan mark korven yang menyayat menghasilkan aroma suram pekat', 'kekuatan the witch eggers membangun dunianya sangat-sangat kuat menit-menit bergulir pemilihan palet warna kelabu mendominasi visualnya dikombinasikan scoring garapan mark korven menyayat menghasilkan aroma suram pekat', 'kuat the witch eggers bangun dunia sangat kuat menit gulir pilih palet warna kelabu dominasi visual kombinasi scoring garap mark korven sayat hasil aroma suram pekat'),
(389, 406, 'the wolf of wall street menunjukkan kehandalan scorsese dalam mengeksekusi sebuah premis sederhana dengan teknis sinematis tingkat tinggi yang eksplosif dan over dramatis ya itu sudah jelas dan bersama naskah gubahan terence winter broadwalk empire scorsese tahu benar bagaimana menghadirkan sebuah biopik bagus namun secara bersamaan ia juga sukses mengeksploitasi sub teks tentang hedonisme total', 'the wolf of wall street kehandalan scorsese mengeksekusi premis sederhana teknis sinematis tingkat eksplosif over dramatis ya naskah gubahan terence winter broadwalk empire scorsese menghadirkan biopik bagus bersamaan sukses mengeksploitasi sub teks hedonisme total', 'the wolf of wall street kehandalan scorsese eksekusi premis sederhana teknis sinematis tingkat eksplosif over dramatis ya naskah gubah terence winter broadwalk empire scorsese hadir biopik bagus sama sukses eksploitasi sub teks hedonisme total'),
(390, 407, 'sebagai bagian penutup dari sebuah trilogi the worlds end jelas diharapkan menjadi sebuah closure hebat untuk dua film sebelumnya dan ia memang berhasil menjadi sebuah akhir yang bagus meskipun kualitasnya sedikit masih berada di bawah shaun of the dead yang punya tema serupa', 'penutup trilogi the worlds end diharapkan closure hebat film berhasil bagus kualitasnya shaun of the dead tema', 'tutup trilogi the worlds end harap closure hebat film hasil bagus kualitas shaun of the dead tema'),
(391, 408, 'saya tidak bisa memaafkan apa yang terjadi di menit akhir ya itu seperti sebuah lawakan besar dan konyol sekonyol ketika masih menggunakan karakter banci untuk mengeksploitasi beberapa momen komedinya', 'memaafkan menit ya lawakan konyol sekonyol karakter banci mengeksploitasi momen komedinya', 'maaf menit ya lawa konyol konyol karakter banci eksploitasi momen komedi'),
(392, 409, 'apa yang tersaji di sini menjadi membosankan tidak hanya di plot yang minim kejutan namun juga kadar komedi yang bisa dibilang tidak segila dan sesegar seri pertamanya', 'tersaji membosankan plot minim kejutan kadar komedi dibilang segila sesegar seri pertamanya', 'saji bosan plot minim kejut kadar komedi bilang gila segar seri pertama'),
(393, 410, 'sayang jika kamu mengharapkan itu maka bersiaplah akan kecewa ya memang ada proses bagaimana salah satu pemimpin persia paling disegani itu terlahir kembali dari api dendam tetapi ya hanya sebatas perkenalan basa-basi biasa tanpa kedalaman dan porsinya sama seperti yang terjadi di film pendahulunya', 'sayang mengharapkan bersiaplah kecewa ya proses salah pemimpin persia disegani terlahir api dendam ya sebatas perkenalan basa-basi kedalaman porsinya film pendahulunya', 'sayang harap siap kecewa ya proses salah pimpin sia segani lahir api dendam ya batas kenal basa-basi dalam porsi film dahulu'),
(394, 411, 'saya juga merasa ketegangan dan kesan claustrophobic kurang terjaga setelah menonton kedua kalinya beberapa adegan juga terasa agak terlalu panjang dan beberapa lainnya terlalu repetitif', 'ketegangan kesan claustrophobic terjaga menonton kalinya adegan repetitif', 'tegang kesan claustrophobic jaga tonton kali adegan repetitif'),
(395, 412, 'ini benar-benar terlihat medioker tampak jelas seperti hasil pekerjaan seorang sutradara first timer yang hanya mencoba bermain aman dengan dukungan naskah yang sama lemahnya termasuk plotnya yang berjalan terseok-seok dan melelahkan apalagi ketika mereka mencoba memasukkan elemen romansa di dalamnya yang lagi-lagi tidak berhasil meninggalkan kesan', 'benar-benar medioker hasil pekerjaan sutradara first timer mencoba bermain aman dukungan naskah lemahnya plotnya berjalan terseok-seok melelahkan mencoba memasukkan elemen romansa dalamnya lagi-lagi berhasil meninggalkan kesan', 'benar medioker hasil kerja sutradara first timer coba main aman dukung naskah lemah plot jalan seok lelah coba masuk elemen romansa dalam lagi hasil tinggal kesan'),
(396, 413, 'a good day to die hard tampak benar-benar seperti sekuel sejati die hard tetapi kamu hanya menemukan bagian terbaiknya muncul dan menghilang terlalu cepat digantikan dengan aksi-aksi membosankan dan naskah yang menggelikan', 'a good day to die hard benar-benar sekuel sejati die hard menemukan terbaiknya muncul menghilang cepat digantikan aksi-aksi membosankan naskah menggelikan', 'a good day to die hard benar sekuel sejati die hard temu baik muncul hilang cepat ganti aksi bosan naskah geli'),
(397, 414, 'julian gilbey memutuskan untuk membanting kemudi ceritanya dengan memasukkan dua penculik sebagai lawan mereka meninggalkan lanskap pegunungan dan suasana pendakian dan mengubahnya menjadi sebuah slasher medioker yang mudah diprediksi ke mana arahnya lengkap dengan segala permainan kucing-tikusnya', 'julian gilbey memutuskan membanting kemudi ceritanya memasukkan penculik lawan meninggalkan lanskap pegunungan suasana pendakian mengubahnya slasher medioker mudah diprediksi arahnya lengkap permainan kucing-tikusnya', 'juli gilbey putus banting kemudi cerita masuk culik lawan tinggal lanskap gunung suasana daki ubah slasher medioker mudah prediksi arah lengkap main kucing tikus'),
(398, 415, 'plot klise dan membosankan untuk ukuran film horor terlebih bagi anda yang sudah menyaksikan versi aslinya minimnya jam terbang sutradara samuel bayer yang biasanya hanya menggarap video klip musik ini dan yang paling parah adalah hilangnya sosok englund semakin menambah dosa platinum dunes semoga saja suatu saat michael bay bertobat untuk tidak lagi menghancurkan horror-horror klasik', 'plot klise membosankan ukuran film horor menyaksikan versi aslinya minimnya jam terbang sutradara samuel bayer menggarap video klip musik parah hilangnya sosok englund menambah dosa platinum dunes semoga michael bay bertobat menghancurkan horror-horror klasik', 'plot klise bosan ukur film horor saksi versi asli minim jam terbang sutradara samuel bayer garap video klip musik parah hilang sosok englund tambah dosa platinum dunes moga michael bay tobat hancur horror klasik'),
(399, 416, 'bukan tanpa kekurangan adore dihiasi banyak dialog-dialog chessy beberapa momen emosinalnya terasa terlalu diberat-beratkan dan ketika ia seharusnya bisa berhenti disatu titik fontaine malah memilih untuk melanjutkan lagi lebih lama untuk memperpanjang dan memperjelas sesuatu yang sebenarnya tidak terlalu perlu', 'kekurangan adore dihiasi dialog-dialog chessy momen emosinalnya diberat-beratkan berhenti disatu titik fontaine memilih melanjutkan memperpanjang memperjelas', 'kurang adore hias dialog chessy momen emosinalnya berat henti satu titik fontaine pilih lanjut panjang jelas'),
(400, 417, 'semuanya terasa percuma ketika shyamalan tampak tidak terlalu percaya diri untuk membawanya ke mana yang terjadi kemudian after earth malah terjebak antara drama tanpa emosi dan fiksi ilmiah yang kurang garam', 'shyamalan percaya membawanya after earth terjebak drama emosi fiksi ilmiah garam', 'shyamalan percaya bawa after earth jebak drama emosi fiksi ilmiah garam'),
(401, 418, 'overall premis yang sangat menarik namun sayang tidak dibarengi dengan kekonsistenan cerita sehingga membuat after life harus menderita di paruh akhir cerita menjadi kendur dan kurang greget', 'overall premis menarik sayang dibarengi kekonsistenan cerita after life menderita paruh cerita kendur greget', 'overall premis tarik sayang bareng konsisten cerita after life derita paruh cerita kendur greget'),
(402, 419, 'sulit memang untuk dibuat tak kecewa dengan hasil akhir allied apalagi melihat lemahnya naskah hingga plotnya yang kadang-kadang terasa begitu artifisial', 'sulit kecewa hasil allied lemahnya naskah plotnya kadang-kadang artifisial', 'sulit kecewa hasil allied lemah naskah plot kadang artifisial'),
(403, 420, 'harus diakui secara teknis altitude tampil mengecewakan tidak jauh berbeda dari yang ditampilkan kebanyakan film-film kelas dua lainnya lemah hampir di semua bagiannya', 'diakui teknis altitude tampil mengecewakan berbeda ditampilkan kebanyakan film-film kelas lemah bagiannya', 'aku teknis altitude tampil kecewa beda tampil banyak film kelas lemah bagi'),
(404, 421, 'and soon the darkness malah terjebak dalam sebuah thriller kosong tanpa jiwa bisa dibilang seperti menyaksikan sebuah sajian thriller kelas b murahan lengkap dengan karakter-karakter bodoh plot dangkal dan akting yang buruk', 'and soon the darkness terjebak thriller kosong jiwa dibilang menyaksikan sajian thriller kelas b murahan lengkap karakter-karakter bodoh plot dangkal akting buruk', 'and soon the darkness jebak thriller kosong jiwa bilang saksi saji thriller kelas b murah lengkap karakter bodoh plot dangkal akting buruk'),
(405, 422, 'dosa besar annabelle sebenarnya ada pada kualitas naskah garapan gary dauberman yang ngaco oh ya saya belum menyebut bagaimana akhirnya percayalah ending annabelle adalah salah satu ending paling konyol dalam sejarah perhororan dunia', 'dosa annabelle kualitas naskah garapan gary dauberman ngaco oh ya menyebut percayalah ending annabelle salah ending konyol sejarah perhororan dunia', 'dosa annabelle kualitas naskah garap gary dauberman ngaco oh ya sebut percaya ending annabelle salah ending konyol sejarah horor dunia'),
(406, 423, 'seperti kebanyakan thriller medioker lainnya atm punya cerita yang kelewat corny serta tidak luput dari rentetan kebodohan demi kebodohan termasuk tipikal karakter pembunuh tanpa motif yang sok misterius dengan jaket tebal ala pembunuh dalam slasher urban legend', 'kebanyakan thriller medioker atm cerita kelewat corny serta luput rentetan kebodohan kebodohan tipikal karakter pembunuh motif sok misterius jaket tebal ala pembunuh slasher urban legend', 'banyak thriller medioker atm cerita lewat corny serta luput rentet bodoh bodoh tipikal karakter bunuh motif sok misterius jaket tebal ala bunuh slasher urban legend'),
(407, 424, 'tidak semua terlihat keren beberapa terkesan bodoh dan memaksa namun overall buat adegan aksinya attack on titan tidak mengecewakan tetapi sayang di luar itu drama antar manusianya terkesan memble tidak ada pengembangan karakter tidak ada konflik berarti di antara mereka dan kemudian memaksakan elemen cinta segitiga yang tanggung malah membuatnya semakin kacau dan membosankan', 'keren terkesan bodoh memaksa overall adegan aksinya attack on titan mengecewakan sayang drama manusianya terkesan memble pengembangan karakter konflik memaksakan elemen cinta segitiga tanggung membuatnya kacau membosankan', 'keren kesan bodoh paksa overall adegan aksi attack on titan kecewa sayang drama manusia kesan memble pengembangan karakter konflik paksa elemen cinta segitiga tanggung buat kacau bosan'),
(408, 425, 'sungguh saya tidak pernah bisa mengetahui apa yang ingin disajikan di sini selain sebuah premis menarik dengan cerita kosong super dangkal rentetan pertunjukan kebodohan demi kebodohan dan wajah menyebalkan diaz yang mendominasi di sepanjang menit', 'sungguh disajikan premis menarik cerita kosong super dangkal rentetan pertunjukan kebodohan kebodohan wajah menyebalkan diaz mendominasi menit', 'sungguh saji premis tarik cerita kosong super dangkal rentet tunjuk bodoh bodoh wajah sebal diaz dominasi menit'),
(409, 426, 'tidak ada yang salah memang mendaur ulang premis basi tetapi ini seperti membuang percuma potensinya belum lagi saya menyebut beberapa plot hole mencolok yang cukup mengganggu', 'salah mendaur ulang premis basi membuang potensinya menyebut plot hole mencolok mengganggu', 'salah daur ulang premis basi buang potensi sebut plot hole colok ganggu'),
(410, 427, 'sepertinya ody terkesan terlalu serakah tidak masalah jika kemudian hasilnya bisa bagus nah ini malah sebaliknya lambat berantakan terlalu gelap sok misterius dengan plot hole sebesar gajah di dalamnya', 'ody terkesan serakah hasilnya bagus lambat berantakan gelap sok misterius plot hole gajah dalamnya', 'ody kesan serakah hasil bagus lambat beranta gelap sok misterius plot hole gajah dalam'),
(411, 428, 'sayang apa yang terjadi kemudian rupanya juga tidak berakhir sesuai ekspektasi kebanyakan orang karena faktanya battle los angeles juga bukanlah sebuah film yang kelewat istimewa tidak sedikit penonton dan kritikus-kritikus dunia yang terhormat mencapnya sebagai sebuah film buruk', 'sayang sesuai ekspektasi kebanyakan orang faktanya battle los angeles film kelewat istimewa penonton kritikus-kritikus dunia terhormat mencapnya film buruk', 'sayang sesuai ekspektasi banyak orang fakta battle los angeles film lewat istimewa tonton kritikus dunia hormat cap film buruk'),
(412, 429, 'berg bisa jadi telah berhasil melakukan apa yang bisa dicapai bay termasuk untuk bagian yang terburuknya macam kualitas naskah yang menyedihkan rentetan plot hole karakter-karakternya yang dangkal rangkaian momen super berisik yang sayangnya membosankan', 'berg berhasil dicapai bay terburuknya kualitas naskah menyedihkan rentetan plot hole karakter-karakternya dangkal rangkaian momen super berisik sayangnya membosankan', 'berg hasil capai bay buruk kualitas naskah sedih rentet plot hole karakter dangkal rangkai momen super berisik sayang bosan'),
(413, 430, 'karakter georges duroy semestinya punya kedalaman dan kompleks tapi yang ada pattinson malah menjadikannya seperti gigolo bodoh murahan di sepanjang film salahkan juga naskah yang ditulis rachel bennette seperti yang sudah saya bilang bel ami punya potensi yang kemudian dirusak dengan kualitas cerita dan dialog-dialog dangkalnya yang membosankan', 'karakter georges duroy semestinya kedalaman kompleks pattinson menjadikannya gigolo bodoh murahan film salahkan naskah ditulis rachel bennette bilang bel ami potensi dirusak kualitas cerita dialog-dialog dangkalnya membosankan', 'karakter georges duroy mesti dalam kompleks pattinson jadi gigolo bodoh murah film salah naskah tulis rachel bennette bilang bel ami potensi rusak kualitas cerita dialog dangkal bosan'),
(414, 431, 'meski priesnanda dwisatria selaku penulis naskah berupaya untuk memodifikasi sana-sini lembaran novel agnes agar tidak sampai berakhir menjadi melodrama yang terlalu dangkal namun memang susah untuk bisa mengangkatnya lebih tinggi lagi', 'priesnanda dwisatria penulis naskah berupaya memodifikasi sana-sini lembaran novel agnes melodrama dangkal susah mengangkatnya', 'priesnanda dwisatria tulis naskah upaya modifikasi sana sini lembar novel agnes melodrama dangkal susah angkat'),
(415, 432, 'mengecewakan tentu saja big eyes terasa mengecewakan untuk film kelas burton apalagi burton sebenarnya punya modal cerita bagus ketika menyorot komentar sosial tentang posisi perempuan di dekade masalahnya big eyes seperti nyaris tidak punya keistimewaan lain', 'mengecewakan big eyes mengecewakan film kelas burton burton modal cerita bagus menyorot komentar sosial posisi perempuan dekade big eyes keistimewaan', 'kecewa big eyes kecewa film kelas burton burton modal cerita bagus sorot komentar sosial posisi perempuan dekade big eyes istimewa'),
(416, 433, 'alwyn yang tergolong hijau di hollywood seakan kewalahan dan terlihat amatir saat harus beradu akting dengan nama-nama yang lebih berpengalaman adegan-adegan spiritual yang menyertakan diesel juga sekan mentah dan tak relevan dengan plot utamanya begitu pula saat plot dialihkan pada acara pertandingan football imitasi semuanya terlihat tidak penting membosankan dan dituturkan dengan bertele-tele', 'alwyn tergolong hijau hollywood seakan kewalahan amatir beradu akting nama-nama berpengalaman adegan-adegan spiritual menyertakan diesel sekan mentah relevan plot utamanya plot dialihkan acara pertandingan football imitasi membosankan bertele-tele', 'alwyn golong hijau hollywood akan kewalahan amatir adu akting nama berpengalaman adegan spiritual serta diesel sekan mentah relevan plot utama plot alih acara tanding football imitasi bosan tele'),
(417, 434, 'tidak hanya gagal di naskah blackhat malah bisa dibilang nyaris kacau di semua elemennya belum lagi saya menyebut pengembangan karakternya yang nyaris nol memang mann masih menampilkan semua ciri khasnya seperti pengunaan beberapa sudut kamera dinamis yang ditambah dengan editing cepat tetapi semuanya terlihat sudah mulai usang dan tidak bertenaga bahkan di beberapa adegan aksinya terkesan seperti merupakan versi medioker dari apa yang pernah dilakukannya di film-filmnya sebelumnya ', 'gagal naskah blackhat dibilang kacau elemennya menyebut pengembangan karakternya nol mann menampilkan ciri khasnya pengunaan sudut kamera dinamis ditambah editing cepat usang bertenaga adegan aksinya terkesan versi medioker dilakukannya film-filmnya ', 'gagal naskah blackhat bilang kacau elemen sebut kembang karakter nol mann tampil ciri khas pengunaan sudut kamera dinamis tambah editing cepat usang tenaga adegan aksi kesan versi medioker laku film '),
(418, 435, 'banyak olok-olokan slapstik yang sebenarnya tidak terlalu lucu pesan-pesan kacau dan maksa tentang bagaimana menjadi orangtua dengan terlebih dahulu mengejek kelakuan anak-anak mereka romansa yang tidak terlalu terasa romantisnya untuk ukuran romcom sebelum menutupnya dengan momen-momen cheesy dengan ending klise ', 'olok-olokan slapstik lucu pesan-pesan kacau maksa orangtua mengejek kelakuan anak-anak romansa romantisnya ukuran romcom menutupnya momen-momen cheesy ending klise ', 'olok slapstik lucu pesan kacau maksa orangtua ejek laku anak romansa romantis ukur romcom tutup momen cheesy ending klise '),
(419, 436, 'kondisi psikologis soo-ah yang merasa bersalah atas kecelakaan yang membuat adiknya terbunuh tidak memberikan pengaruh terlalu besar terhadap jalan ceritanya yang ada malah membuatnya terlihat sedikit cengeng terlebih untuk ukuran sebuah crime thriller belum lagi diperparah paruh keduanya yang mengalami penurunan kualitas dari satu jam pertama yang cerdas berubah menjadi sebuah thriller slasher corny yang tertebak tanpa sebuah penyelesaian yang bagus membuat blind menjadi kurang greget di satu jam terakhirnya', 'kondisi psikologis soo-ah bersalah kecelakaan adiknya terbunuh pengaruh jalan ceritanya membuatnya cengeng ukuran crime thriller diperparah paruh mengalami penurunan kualitas jam cerdas berubah thriller slasher corny tertebak penyelesaian bagus blind greget jam terakhirnya', 'kondisi psikologis soo ah bersalah celaka adik bunuh pengaruh jalan cerita buat cengeng ukur crime thriller parah paruh alami turun kualitas jam cerdas ubah thriller slasher corny tebak selesai bagus blind greget jam akhir'),
(420, 437, 'cerita yang disajikan masih terkesan dangkal dan predictable khususnya pada bagian ending don cheadle juga sebenarnya juga bermain cukup baik sayang cerita miliknya terbilang biasa-biasa saja terlalu banyak percakapan yang bertele-tele yang mungkin saja membuat penontonnya bosan richard gere dan kisahnya mungkin yang bisa dibilang paling buruk', 'cerita disajikan terkesan dangkal predictable ending don cheadle bermain sayang cerita miliknya terbilang biasa-biasa percakapan bertele-tele penontonnya bosan richard gere kisahnya dibilang buruk', 'cerita saji kesan dangkal predictable ending don cheadle main sayang cerita milik bilang biasa cakap tele tonton bosan richard gere kisah bilang buruk'),
(421, 438, 'bullet to the head adalah bagaimana untuk kesekian kalinya sly berada di film yang salah kharisma besarnya jelas membantunya untuk menjadi daya tarik terbesar buat penontonnya untuk berbondong-bondong melihat sang rambo kembali lagi terbang solo di layar lebar tetapi tanpa bantuan teman-temannya stallone terlihat begitu kepayahan dengan naskah yang lemah dan alur yang membosankan', 'bullet to the head kesekian kalinya sly film salah kharisma besarnya membantunya daya tarik terbesar penontonnya berbondong-bondong sang rambo terbang solo layar lebar bantuan teman-temannya stallone kepayahan naskah lemah alur membosankan', 'bullet to the head sekian kali sly film salah kharisma besar bantu daya tarik besar tonton bondong sang rambo terbang solo layar lebar bantu teman stallone payah naskah lemah alur bosan'),
(422, 439, 'sayang memang ketidak becusan brooks menjaga konsistensi yang sudah dibangun harus dirusak dengan banyaknya momen-momen tidak masuk akal yang terlalu dipaksakan andai saja burning bright dipegang oleh sutradara lain yang lebih kompeten tentu saja hasilnya bisa jauh lebih baik dari sekarang tidak hanya menjadi sebuah thriller yang hanya meninggalkan premis menariknya semata', 'sayang ketidak becusan brooks menjaga konsistensi dibangun dirusak banyaknya momen-momen masuk akal dipaksakan andai burning bright dipegang sutradara kompeten hasilnya thriller meninggalkan premis menariknya', 'sayang tidak becus brooks jaga konsistensi bangun rusak banyak momen masuk akal paksa andai burning bright pegang sutradara kompeten hasil thriller tinggal premis tarik'),
(423, 440, 'yang cukup mengganggu adalah bagaimana ketidak konsistenan yang dilakukan sattler di akhir-akhir film itu seperti sebuah blunder yang bisa saja merusak apa yang sudah dibuatnya dengan baik sejak awal ya sayang memang sattler harus sedikit mencederai debutnya dengan bermain curang untuk menguatkan pesan tetang kemanusiaannya meskipun sebenarnya juga tidak sampai benar-benar menghancurkannya', 'mengganggu ketidak konsistenan sattler akhir-akhir film blunder merusak ya sayang sattler mencederai debutnya bermain curang menguatkan pesan tetang kemanusiaannya benar-benar menghancurkannya', 'ganggu tidak konsisten sattler akhir film blunder rusak ya sayang sattler cedera debut main curang kuat pesan tetang manusia benar hancur'),
(424, 441, 'entah kenapa engler dan etter pada kenyataannya tidak mampu menjaga ritme ceritanya dengan baik membuat penontonnya terjebak dalam kebosanan dengan alurnya yang bertele-tele dan terkesan dipanjang-panjangkan serta membuang percuma sisi teknis yang sudah dikemas dengan sangat baik pada akhirnya cargo menjadi tidak lebih dari sebuah thriller medioker yang dengan mudah dilupakan oleh penontonnya', 'engler etter kenyataannya menjaga ritme ceritanya penontonnya terjebak kebosanan alurnya bertele-tele terkesan dipanjang-panjangkan serta membuang sisi teknis dikemas cargo thriller medioker mudah dilupakan penontonnya', 'engler etter nyata jaga ritme cerita tonton jebak bosan alur tele kesan panjang serta buang sisi teknis kemas cargo thriller medioker mudah lupa tonton'),
(425, 442, 'kali ini para penggemar animasi pixar harus menyaksikan pertama kalinya film pixar mendapat tomat busuk pertama di website rottentomatoes wow bayangkan orang dewasa penggemar pixar berbondong bondong ke bioskop tanpa membawa anaknya berharap cerita menyentuh dan penuh adegan emosional namun ternyata film ini memang diperuntukkan untuk anak-anak benar-benar di luar dugaan tapi inilah yang terjadi', 'kali penggemar animasi pixar menyaksikan kalinya film pixar tomat busuk website rottentomatoes wow bayangkan orang dewasa penggemar pixar berbondong bondong bioskop membawa anaknya berharap cerita menyentuh penuh adegan emosional film diperuntukkan anak-anak benar-benar dugaan', 'kali gemar animasi pixar saksi kali film pixar tomat busuk website rottentomatoes wow bayang orang dewasa gemar pixar bondong bondong bioskop bawa anak harap cerita sentuh penuh adegan emosional film untuk anak benar duga'),
(426, 443, 'chappie memang punya konsep usang yang telah dimodifikasi sana-sini namun masalah terbesar chappie bukan karena premis familiernya yang sudah bolak-balik di pakai atau template blomkamp yang itu-itu saja namun ada pada kualitas naskahnya itu sendiri yang ditulis blomkamp bersama terri tatchell memanjangkan narasinya dari sebuah film pendek menjadi feature film itu jelas penuh resiko salah salah akan merusak dan sayangnya ini yang terjadi pada chappie entah mungkin karena saya yang terlalu sok kritis tetapi melihat bagaimana narasi olahan blomkamp buaf film panjang tetra vaal itu terkesan sangat compang-camping dan kacau ', 'chappie konsep usang dimodifikasi sana-sini terbesar chappie premis familiernya bolak-balik pakai template blomkamp itu-itu kualitas naskahnya ditulis blomkamp terri tatchell memanjangkan narasinya film pendek feature film penuh resiko salah salah merusak sayangnya chappie sok kritis narasi olahan blomkamp buaf film tetra vaal terkesan compang-camping kacau ', 'chappie konsep usang modifikasi sana sini besar chappie premis familier bolak-balik pakai template blomkamp itu kualitas naskah tulis blomkamp terri tatchell panjang narasi film pendek feature film penuh resiko salah salah rusak sayang chappie sok kritis narasi olah blomkamp buaf film tetra vaal kesan compang-camping kacau '),
(427, 444, 'apa yang ditampilkan chloe selama menit ini rupanya juga tidak jauh berbeda dari formula-formula erotic thriller lawas bedanya cerita yang ditampilkan dalam chloe ini terlalu lemah predictable dan terkesan flat bahkan jauh sebelum klimaks akhir muncul penonton pun sudah dapat mengetahui apa yang akan terjadi nanti ', 'ditampilkan chloe menit berbeda formula-formula erotic thriller lawas bedanya cerita ditampilkan chloe lemah predictable terkesan flat klimaks muncul penonton ', 'tampil chloe menit beda formula erotic thriller lawas beda cerita tampil chloe lemah predictable kesan flat klimaks muncul tonton '),
(428, 445, 'pada akhirnya your highness tidak lebih dari komedi dangkal tidak terlalu jauh dengan komedi-komedi lain yang judulnya berakhiran movie ia terlihat jorok kotor dan menjijikkan di saat bersamaan yah cukup mengejutkan mengetahui film ini dibuat oleh sutradara yang pernah menghasilkan drama sekelas all the real girls dan snow angels ya sungguh mengecewakan', 'your highness komedi dangkal komedi-komedi judulnya berakhiran movie jorok kotor menjijikkan bersamaan yah mengejutkan film sutradara menghasilkan drama sekelas all the real girls snow angels ya sungguh mengecewakan', 'your highness komedi dangkal komedi judul akhir movie jorok kotor jijik sama yah kejut film sutradara hasil drama kelas all the real girls snow angels ya sungguh kecewa'),
(429, 446, 'harus diakui untuk kualitas naskahnya ia masih sama buruknya dengan pendahulunya tapi toh sekali lagi hanya orang-orang bodoh yang kemudian ribut mempermasalahkan segala tetek bengek plot dan kedalaman ceritanya yang jelas-jelas memang sengaja di nomor sekiankan', 'diakui kualitas naskahnya buruknya pendahulunya orang-orang bodoh ribut mempermasalahkan tetek bengek plot kedalaman ceritanya jelas-jelas sengaja nomor sekiankan', 'aku kualitas naskah buruk dahulu orang bodoh ribut masalah tetek bengek plot dalam cerita jelas sengaja nomor sekian'),
(430, 447, 'untuk sebuah film yang mengandung kata wild di dalamnya wild card tidak sampai seliar itu malah bisa dibilang ia adalah salah satu film aksi statham yang jinak dengan sekuens action yang meskipun cukup bad-ass tetapi bisa dihitung jari sebelah tangan dan untuk film yang mengandun kata card di dalamnya wild card walaupun gagal menyajikan dunia judi yang mendalam setidaknya saya masih menikmati bagaimana seorang jason statham bermain black jack dengan gayanya yang keren', 'film mengandung wild dalamnya wild card seliar dibilang salah film aksi statham jinak sekuens action bad-ass dihitung jari sebelah tangan film mengandun card dalamnya wild card gagal menyajikan dunia judi mendalam menikmati jason statham bermain black jack gayanya keren', 'film kandung wild dalam wild card liar bilang salah film aksi statham jinak sekuens action bad-ass hitung jari sebelah tang film mengandun card dalam wild card gagal saji dunia judi dalam nikmat jason statham main black jack gaya keren'),
(431, 448, 'kliseadalah kata yang paling pas untuk mengambarkan rom-com satu ini entah kenapa  dari  film-film bergenre komedi romantis yang diproduksi hollywood akhir-akhir ini jarang sekali ada yang menampilkan sesuatu yang baru selalu dan tidak pernah bosan-bosannya terjebak dalam formula yang itu lagi-itu lagi walaupun film-film tersebut nampak terlihat berbeda diawalnya namun toh ujung-ujungnya selalu berakhir sama happy ending ala hollywood yang predictable hal yang sama juga dapat kita temui pada when in rome drama komedi romantis hasil garapan sutradara sekaligus penulis mark steven johnson yang juga pernah menggarap ghost rider bersama nicholas cage meskipun memasukan sedikit elemen-elemen magic dan setting indah kota roma yang ternyata hanya ditampilkan  dari keseluruhan film toh tidak terlalu banyak dapat menolong film ini untuk jatuh dalam jurang ke klise-an seperti belum cukup dialog-dialognya yang jayus dan beberapa lelucon slapstik nan garing seakan-akan melengkapai derita film ini bahkan duet kristen bell-josh duhamel sama sekali tidak terasa chemsitry-nya sebagai dua pasangan yang saling jatuh cinta dan puncaknya tarian-tarian aneh di penghujung film semakin terasa sangat pas menutup salah satu kisah komedi romantis terburuk tahun  ini', 'kliseadalah pas mengambarkan rom-com   film-film bergenre komedi romantis diproduksi hollywood akhir-akhir jarang menampilkan bosan-bosannya terjebak formula lagi-itu film-film nampak berbeda diawalnya ujung-ujungnya happy ending ala hollywood predictable temui when in rome drama komedi romantis hasil garapan sutradara penulis mark steven johnson menggarap ghost rider nicholas cage memasukan elemen-elemen magic setting indah kota roma ditampilkan  film menolong film jatuh jurang klise-an dialog-dialognya jayus lelucon slapstik nan garing seakan-akan melengkapai derita film duet kristen bell-josh duhamel chemsitry-nya pasangan jatuh cinta puncaknya tarian-tarian aneh penghujung film pas menutup salah kisah komedi romantis terburuk ', 'kliseadalah pas ambar rom-com   film-film genre komedi romantis produksi hollywood akhir-akhir jarang tampil bosan-bosannya jebak formula lagi-itu film-film nampak beda awal ujung-ujungnya happy ending ala hollywood predictable temu when in rome drama komedi romantis hasil garap sutradara penulis mark steven johnson garap ghost rider nicholas cage masuk elemen-elemen magic setting indah kota roma tampil  film tolong film jatuh jurang klise-an dialog-dialognya jayus lelucon slapstik nan garing seakan-akan melengkapai derita film duet kristen bell-josh duhamel chemsitry-nya pasang jatuh cinta puncak tarian-tarian aneh hujung film pas tutup salah kisah komedi romantis buruk '),
(432, 449, 'yang menjadi masalah dari tema friendzone-nya what if sebenarnya sama saja dengan film-film berpremis sama adalah bagaimana kedua karakter utamanya menyiksa diri mereka sendiri dengan menyangkal perasaan cinta masing-masing yang sebenarnya sudah tumbuh sejak hari pertama mereka bertemu di satu sisi wallace yang galau jelas tidak ingin kehilangan chantry dengan merusak hubungan chantry dan ben karena ia pun punya pengalaman pahit yang sama ketika kekasihnya berselingkuh sementara chantry pun tidak ingin menjadi pihak yang disalahkan karena keputusannya untuk meyukai wallace lebih dari sekedar teman jadi di sisa durasinya penonton akan diajak menyaksikan tarik ulur hubungan wallace-chantry yang diwakili dengan banyak momen-momen manis termasuk dintaranya insiden kamar ganti pakaian sampai bermalam tanpa busana di pinggir pantai sayang setiap kemanisan itu terasa hambar bukan karena hanya plotnya yang mendadak klise namun juga karena chemistry lemah dari radcliffe dan kazan', 'tema friendzone-nya what if film-film berpremis karakter utamanya menyiksa menyangkal perasaan cinta tumbuh bertemu sisi wallace galau kehilangan chantry merusak hubungan chantry ben pengalaman pahit kekasihnya berselingkuh chantry disalahkan keputusannya meyukai wallace sekedar teman sisa durasinya penonton diajak menyaksikan tarik ulur hubungan wallace-chantry diwakili momen-momen manis dintaranya insiden kamar ganti pakaian bermalam busana pinggir pantai sayang kemanisan hambar plotnya mendadak klise chemistry lemah radcliffe kazan', 'tema friendzone-nya what if film-film premis karakter utama siksa sangkal asa cinta tumbuh bertemu sisi wallace galau hilang chantry rusak hubung chantry ben alam pahit kasih selingkuh chantry salah putus meyukai wallace sekedar teman sisa durasi penonton ajak saksi tarik ulur hubung wallace-chantry wakil momen-momen manis dintaranya insiden kamar ganti pakai malam busana pinggir pantai sayang manis hambar plot dadak klise chemistry lemah radcliffe kazan'),
(433, 450, 'cerita yang terlalu umum dan sederhana plot jelas tertebak sejak di sepertiga awal film disaat kwon hyeong-jin sudah menghadirkan penyakit mematikan buat karakter go-eun sisanya kita akan diajak melihat rangkaian adegan dramatis nan corny bagaimana go-eun melakukan penebusan dosanya untuk membahagiakan so-ra semaksimal mungkin dengan memberikan apapun yang diinginkan putrinya itu', 'cerita sederhana plot tertebak sepertiga film disaat kwon hyeong-jin menghadirkan penyakit mematikan karakter go-eun sisanya diajak rangkaian adegan dramatis nan corny go-eun penebusan dosanya membahagiakan so-ra semaksimal apapun putrinya', 'cerita sederhana plot tebak sepertiga film saat kwon hyeong-jin hadir sakit mati karakter go-eun sisa ajak rangkai adegan dramatis nan corny go-eun penebusan dosa bahagia so-ra maksimal apa putri'),
(434, 451, 'terlalu banyak konflik disini yang ingin diangkat tanpa diimbangi dengan pengolahan yang baik ini sebuah film dengan latar belakang great depression tapi herannya penonton sama sekali tidak melihat ekspresi tertekan dari para penonton sirkus atau bagaiman kondisi kesulitan masyarkat pada saat itu ini adalah sebuah kisah cinta segi tiga segi empat jika anda mau memasukan rosie si gajah tua pintar didalamnya yang terlalu datar sedatar chemistry yang dibangun pattinson dan witherspoon yang juga menjadi salah satu titik terlemah film berbiaya  juta ini ini juga film tentang bagaimana manusia memperlakukan hewan dengan kejam seperti yang dilakukan august dalam memberlakukan rosie yang tidak patuh kepadanya ya banyak problematika disini yang ingin dituangkan sekaligus masalahnya tidak diselesaikan dengan cara elegan dan teralalu terkesan menggampangkan plus minim momen emosioal menjadikan kisah water for elephants kurang berbobot dan harus menderita cukup banyak di bagian penting satu ini', 'konflik diangkat diimbangi pengolahan film latar great depression herannya penonton ekspresi tertekan penonton sirkus bagaiman kondisi kesulitan masyarkat kisah cinta segi segi memasukan rosie si gajah tua pintar didalamnya datar sedatar chemistry dibangun pattinson witherspoon salah titik terlemah film berbiaya  juta film manusia memperlakukan hewan kejam august memberlakukan rosie patuh ya problematika dituangkan diselesaikan elegan teralalu terkesan menggampangkan plus minim momen emosioal menjadikan kisah water for elephants berbobot menderita', 'konflik angkat imbang olah film latar great depression heran penonton ekspresi tekan penonton sirkus bagaiman kondisi sulit masyarkat kisah cinta segi segi masuk rosie si gajah tua pintar dalam datar datar chemistry bangun pattinson witherspoon salah titik lemah film biaya  juta film manusia laku hewan kejam august memberlakukan rosie patuh ya problematika tuang selesai elegan teralalu kesan gampang plus minim momen emosioal jadi kisah water for elephants bobot derita'),
(435, 452, 'apa yang disajikan duncan jones mungkin tidak istimewa secara premis penonton awam hanya menganggap ini hanya sekedar sajian fantasi konvensional yang mengekor kebesaran franchise milik peter jackson itu meski mungkin mereka akan terhibur dengan aksi dan kekuatan visual efeknya yang betul-betul dimaksimalkan hingga menghasilkan gambar-gambar yang begitu cantik dengan segala tetek bengek efek cgi-nya yang keren tetapi sekali lagi dari mata awam warcfrat the beginning hanya menjadi sekedar film hiburan tanpa kesan apa-apa', 'disajikan duncan jones istimewa premis penonton awam menganggap sekedar sajian fantasi konvensional mengekor kebesaran franchise milik peter jackson terhibur aksi kekuatan visual efeknya betul-betul dimaksimalkan menghasilkan gambar-gambar cantik tetek bengek efek cgi-nya keren mata awam warcfrat the beginning sekedar film hiburan kesan apa-apa', 'saji duncan jones istimewa premis penonton awam anggap sekedar saji fantasi konvensional ekor besaran franchise milik ter jackson hibur aksi kuat visual efek betul-betul maksimal hasil gambar-gambar cantik tetek bengek efek cgi-nya keren mata awam warcfrat the beginning sekedar film hibur kesan apa-apa'),
(436, 453, 'masalah victor frankenstein ada pada penyutradaraan dan naskah yang tidak konsisten jujur  menit pertamanya ia mampu menghadirkan sajian menarik melalui perkenalan karakternya dengan cepat dan efektif bersama set london yang kotor dan suram yang seakan-akan menegaskan aroma gotik dari novelnya namun dalam perjalanannya daya tarik mulai luntur seiring ketidakmampuan mcguigan menjaga ritmenya narasinya sendiri juga terkesan terburu-buru untuk mencapai tujuan utama membuat mayat hidup melupakan bentukan jalinan karakter yang sebenarnya bisa dieksplorasi lebih jauh lagi ujung-ujungnya tidak jauh dari action hingar bingar yang membuang potensinya menjadi drama horor yang kompleks dan menarik sementara beberapa sub-plot tidak penting seperti kisah percintaan igor dan gadis akrobat lorelei jessica brown findlay serta penyelidikan yang dilakukan detektif roderick turpin andrew scott sebenarnya bisa saja dienyahkan dengan mudah tanpa mengganggu plot utamanya', 'victor frankenstein penyutradaraan naskah konsisten jujur  menit pertamanya menghadirkan sajian menarik perkenalan karakternya cepat efektif set london kotor suram seakan-akan aroma gotik novelnya perjalanannya daya tarik luntur seiring ketidakmampuan mcguigan menjaga ritmenya narasinya terkesan terburu-buru mencapai tujuan utama mayat hidup melupakan bentukan jalinan karakter dieksplorasi ujung-ujungnya action hingar bingar membuang potensinya drama horor kompleks menarik sub-plot kisah percintaan igor gadis akrobat lorelei jessica brown findlay serta penyelidikan detektif roderick turpin andrew scott dienyahkan mudah mengganggu plot utamanya', 'victor frankenstein sutradara naskah konsisten jujur  menit pertama hadir saji tarik kenal karakternya cepat efektif set london kotor suram seakan-akan aroma gotik novel jalan daya tarik luntur iring ketidakmampuan mcguigan jaga ritme narasi kesan terburu-buru capai tuju utama mayat hidup lupa bentuk jalin karakter eksplorasi ujung-ujungnya action hingar bingar buang potensi drama horor kompleks tarik sub-plot kisah cinta igor gadis akrobat lorelei jessica brown findlay serta selidik detektif roderick turpin andrew scott enyah mudah ganggu plot utama'),
(437, 454, 'ika kamu penonton baru tidak usah protes jika veronica mars tidak sesuai ekspektasimu akan sebuah neo-noir mystery seperti kata wikipedia yang menghadirkan sajian misteri solid dan suspense tingkat tinggi bisa dibilang thomas lebih memfokuskan semuanya pada momen reuni dan nostalgianya ketimbang repot-repot harus memikirkan sebuah narasi misteri yang kuat toh versi televisinya sebenarnya juga lebih banyak berkutat pada urusan remaja dan komedi dari dialog-dialognya penuh humor cerdas tidak pernah punya kasus atau misteri yang benar-benar kuat hasilnya memang terlihat murahan dan terlalu tv series sentris untuk ukuran film yang dibuat untuk layar lebar tetapi sepertinya memang itu tujuannya sebuah penghormatan buat versi televisinya dan tentu saja penghormatan buat para fans fanatiknya', 'ika penonton protes veronica mars sesuai ekspektasimu neo-noir mystery wikipedia menghadirkan sajian misteri solid suspense tingkat dibilang thomas memfokuskan momen reuni nostalgianya ketimbang repot-repot memikirkan narasi misteri kuat versi televisinya berkutat urusan remaja komedi dialog-dialognya penuh humor cerdas misteri benar-benar kuat hasilnya murahan tv series sentris ukuran film layar lebar tujuannya penghormatan versi televisinya penghormatan fans fanatiknya', 'ika penonton protes veronica mars suai ekspektasimu neo-noir mystery wikipedia hadir saji misteri solid suspense tingkat bilang thomas fokus momen reuni nostalgia timbang repot-repot memikirkan narasi misteri kuat versi televisi kutat urus remaja komedi dialog-dialognya penuh humor cerdas misteri benar-benar kuat hasil murah tv series sentris ukur film layar lebar tuju hormat versi televisi hormat fans fanatik'),
(438, 455, 'meskipun kadar thrill-nya berhasil dijaga dengan baik dengan menawarkan banyak adegan-adegan cepat  namun pada akhirnya vehicle  terjangkit dengan banyak plot hole menganggu dialog-dialog cheesy plot yang familiar dan klimaks yang tanggung di mana sedikit banyak sudah melukai keasikan menonton belum lagi saya menyebut karakter menyebalkan yang dibawakan walker', 'kadar thrill-nya berhasil dijaga menawarkan adegan-adegan cepat  vehicle  terjangkit plot hole menganggu dialog-dialog cheesy plot familiar klimaks tanggung melukai keasikan menonton menyebut karakter menyebalkan dibawakan walker', 'kadar thrill-nya hasil jaga menawarkan adegan-adegan cepat  vehicle  jangkit plot hole menganggu dialog-dialog cheesy plot familiar klimaks tanggung luka asi tonton sebut karakter sebal bawak walker'),
(439, 456, 'bukan berarti tidak ada sesuatu yang baru di sini ada hanya saja bukan sesuatu yang sampai bisa membuat blood wars menjadi seri yang lebih istimewa ketimbang pendahulunya tidak dengan kehadiran tobias menzies sebagai komandan baru para lycan atau lara pulver sebagai semira yang licik termasuk kejutan di ujung cerita yang tampak sekali terkesan terlalu dipaksakan tanpa memberi penjelasan yang cukup', 'blood wars seri istimewa ketimbang pendahulunya kehadiran tobias menzies komandan lycan lara pulver semira licik kejutan ujung cerita terkesan dipaksakan penjelasan', 'blood wars seri istimewa timbang dahulu hadir tobias menzies komandan lycan lara pulver semira licik kejut ujung cerita kesan paksa jelas'),
(440, 457, 'soal bagaimana kualitas naskahnya sebetulnya tidak usah dipikirkan terlalu jauh toh franhcise underworld memang tidak pernah menghadirkan sebuah jalinan kisah yang luar biasa tidak juga naskah awekening yang bahkan sampai dikeroyok  orang ini malah kalau mau jujur ini menjadi seri underworld dengan cerita yang paling buruk dan terlihat terlalu memaksa untuk membuatnya tetap berlanjut ke seri-seri selanjutnya', 'kualitas naskahnya dipikirkan franhcise underworld menghadirkan jalinan kisah naskah awekening dikeroyok  orang jujur seri underworld cerita buruk memaksa membuatnya berlanjut seri-seri', 'kualitas naskah pikir franhcise underworld hadir jalin kisah naskah awekening keroyok  orang jujur seri underworld cerita buruk memaksa buat lanjut seri-seri'),
(441, 458, 'pakemnya sendiri memang tidak menawarkan sesuatu yang baru formulanya masih berada di wilayah horor generik yang terlalu mengandalkan teror audio-visual basi dan kaget-kagetan usang plus beberapa adegan yang terlihat konyol dan bodoh lihat saja rentetan adegan seramnnya yang seperti masih tidak percaya diri ketika harus selalu ditemani dengan scoring horor jrang-jreng berlebihan yang hasilnya membuat saya malah terdengar menganggu', 'pakemnya menawarkan formulanya wilayah horor generik mengandalkan teror audio-visual basi kaget-kagetan usang plus adegan konyol bodoh lihat rentetan adegan seramnnya percaya ditemani scoring horor jrang-jreng hasilnya terdengar menganggu', 'pakem menawarkan formula wilayah horor generik andal teror audio-visual basi kaget-kagetan usang plus adegan konyol bodoh lihat rentet adegan seramnnya percaya teman scoring horor jrang-jreng hasil dengar menganggu'),
(442, 459, 'smith memilih untuk menghabiskan banyak durasinya melalukan flash back yang melibatkan sahabat sekaligus rekan kerjanya teddy craft dan kekasih cantiknya ally gnesis rodrguez masalahnya itu bukan kilas balik yang penting kebanyakan hanya diisi percakapan tidak penting dari tiga karakternya yang sebenarnya dengan mudah dipersingkat lalu transformasi habis-habisan wallce menjadi mrtusk tidak didukung konstum dan make-up meyakinkan sehingga imbasnya tusk terkesan menjadi horor bodoh yang murahan', 'smith memilih menghabiskan durasinya melalukan flash back melibatkan sahabat rekan kerjanya teddy craft kekasih cantiknya ally gnesis rodrguez kilas kebanyakan diisi percakapan karakternya mudah dipersingkat transformasi habis-habisan wallce mrtusk didukung konstum make-up imbasnya tusk terkesan horor bodoh murahan', 'smith memilih habis durasi lalu flash back libat sahabat rekan kerja teddy craft kasih cantik ally gnesis rodrguez kilas banyak isi cakap karakternya mudah singkat transformasi habis-habisan wallce mrtusk dukung konstum make-up imbas tusk kesan horor bodoh murah'),
(443, 460, 'untuk film yang dibintangi oleh duet maut kelas a trespass juga mengecewakan khususnya untuk nicolas cage sorry pak anda sungguh sangat annoying dan cerewet disini bahkan saya berharap para perampok itu seharusnya membunuh karakter anda secepat mungkin sedangkan nicole kidman sendiri sebenarnya juga tidak terlalu bersinar ia tetap cantik seperti biasa dan untuk artis sehebat dirinya akting terburuk pun masih tetap enak untuk dilihat', 'film dibintangi duet maut kelas a trespass mengecewakan nicolas cage sorry sungguh annoying cerewet berharap perampok membunuh karakter secepat nicole kidman bersinar cantik artis sehebat akting terburuk enak', 'film bintang duet maut kelas a trespass kecewa nicolas cage sorry sungguh annoying cerewet harap rampok bunuh karakter cepat nicole kidman sinar cantik artis hebat akting buruk enak'),
(444, 461, 'meskipun masih menggunakan formula yang sama dari film-film sebelumnya michael bay pandai dalam mempertunjukan orkhestra ledakan demi ledakan di filmnya durasi  menit tidak membuat film ini kehilangan alur meskipun masih mubazir dengan adegan buang-buang waktu seperti saat sam witwicky sedang mencari pekerjaan dan juga penampilan perdana model victoria secret rossie huntington dengan maksud menggantikan megan fox tapi saya rasa tidak membawa pengaruh apa -apa di sini saya pun masih lebih memilih megan fox penampilan aktor kelas atas macam john malkovich pun juga tidak banyak membantu dan yang paling menggangu adalah peran ken jeong yang lebih menghancurkan suasana ketimbang komedinya meskipun tampil secuil saja di sini yahh pada akhirnya mungkin film ini adalah akhir dari franchise transformers dan mungkin saja film ini akan mudah dilupakan penontonnya', 'formula film-film michael bay pandai mempertunjukan orkhestra ledakan ledakan filmnya durasi  menit film kehilangan alur mubazir adegan buang-buang sam witwicky mencari pekerjaan penampilan perdana model victoria secret rossie huntington maksud menggantikan megan fox membawa pengaruh -apa memilih megan fox penampilan aktor kelas john malkovich membantu menggangu peran ken jeong menghancurkan suasana ketimbang komedinya tampil secuil yahh film franchise transformers film mudah dilupakan penontonnya', 'formula film-film michael bay pandai tunjuk orkhestra ledak ledak film durasi  menit film hilang alur mubazir adegan buang-buang sam witwicky cari kerja penampilan perdana model victoria secret rossie huntington maksud ganti megan fox bawa pengaruh -apa memilih megan fox penampilan aktor kelas john malkovich bantu menggangu peran ken jeong hancur suasana timbang komedi tampil cuil yahh film franchise transformers film mudah lupa penontonnya');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(445, 462, 'dengan durasi  menit age of extinction menjadi terasa sangat lama paling lama dibandingkan seri-seri pendahulunya subplot percintaanya digantikan dengan hubungan ayah-anak tidak memberi sesuatu yang benar-benar berarti di naskahnya yang masih digarap ehren kruger kualitasnya masih sama dangkalnya masih sama membosankannya dengan segudang plot hole mengganggu dan tidak lupa selalu ada komedi di sela-sela peperangan para roboat yang untung saja kali ini tidak sampai senorak dark of the moon yang seperti ingin menjadi film komedi ketimbang aksi', 'durasi  menit age of extinction dibandingkan seri-seri pendahulunya subplot percintaanya digantikan hubungan ayah-anak benar-benar naskahnya digarap ehren kruger kualitasnya dangkalnya membosankannya segudang plot hole mengganggu lupa komedi sela-sela peperangan roboat untung kali senorak dark of the moon film komedi ketimbang aksi', 'durasi  menit age of extinction banding seri-seri dahulu subplot percintaanya ganti hubung ayah-anak benar-benar naskah garap ehren kruger kualitas dangkal bosan gudang plot hole ganggu lupa komedi sela-sela perang roboat untung kali norak dark of the moon film komedi timbang aksi'),
(446, 463, 'tetapi debutan tetaplah debutan dan meskipun transcendence terasa solid di konsep dan visualnya ia masih punya banyak kekurangan mendasar selain menyia-nyiakan beberapa cast-nya macam morgan freeman dan cillian murphy yang jelas terlihat adalah bentukan plotnya yang berjalan lambat terutama pada pembukaan sampai - menit selanjutnya yap itu sedikit membosankan dan minim emosi belum lagi premisnya yang sedikit berat ', 'debutan tetaplah debutan transcendence solid konsep visualnya kekurangan mendasar menyia-nyiakan cast-nya morgan freeman cillian murphy bentukan plotnya berjalan lambat pembukaan - menit yap membosankan minim emosi premisnya berat ', 'debut tetap debut transcendence solid konsep visual kurang dasar menyia-nyiakan cast-nya morgan freeman cillian murphy bentuk plot jalan lambat buka - menit yap bosan minim emosi premis berat '),
(447, 464, 'tentu saja yang namanya komedi pasti banyak rentetan kejadian konyol tak terduga begitu juga tower heist sayang menginjak  akhir terlalu banyak adegan-adegan serba maksa seperti terlalu diatur untuk menjadi lucu termasuk lubang besar di sana sini yang mungkin membuat penontonnya mengerutkan dahi yah tapi sekali lagi karena ini komedi anda harus memaklumi kalau ia berlaku bodoh sengaja ataupun tidak', 'namanya komedi rentetan kejadian konyol terduga tower heist sayang menginjak  adegan-adegan serba maksa diatur lucu lubang penontonnya mengerutkan dahi yah komedi memaklumi berlaku bodoh sengaja', 'nama komedi rentet jadi konyol duga tower heist sayang injak  adegan-adegan serba maksa atur lucu lubang penontonnya kerut dahi yah komedi maklum berlaku bodoh sengaja'),
(448, 465, 'jujur saja penyajian yang dihadirkan oleh james nunn dan ronnie thompson terasa kurang matang masih banyak sebenarnya potensi-potensi untuk membuatnya menjadi jauh lebih baik dan lebih cerdas lagi hasilnya apa yang terjadi mungkin tidak akan membekas terlalu lama di ingatanmu setelah beberapa hari kamu menontonnya', 'jujur penyajian dihadirkan james nunn ronnie thompson matang potensi-potensi membuatnya cerdas hasilnya membekas ingatanmu menontonnya', 'jujur saji hadir james nunn ronnie thompson matang potensi-potensi buat cerdas hasil bekas ingat tonton'),
(449, 466, 'brad bird seperti tidak mampu mengolah ide besar yang dimilikinya menjadi sebuah penceritaan yang mulus meskipun sebenarnya ia sudah punya dasar cerita yang kuat dengan banyak potensi-potensi yang bagus terkadang ia begitu mudah dimengerti namun terkadang ia terasa susah dicerna apalagi buat penonton muda yang tidak memahami konsepnya beruntung garapan teknisnya yang luar biasa memanjakan mata mampu sedikit banyak menambal kekurangan di penceritaannya yang setengah matang itu bird memang dikenal piawai menghadirkan sekuens aksi yang memukau tidak terkecuali di sini didukung dengan cgi mahal bird bersama timnya berhasil menciptakan tomorrowland dunianya sendiri jauh lebih besar dari wahana permainannya sendiri pace-nya yang sedikit tidak konsisten mungkin membuat beberapa bagiannya terkesan terseok-seok dan membosankan', 'brad bird mengolah ide dimilikinya penceritaan mulus dasar cerita kuat potensi-potensi bagus terkadang mudah dimengerti terkadang susah dicerna penonton muda memahami konsepnya beruntung garapan teknisnya memanjakan mata menambal kekurangan penceritaannya matang bird dikenal piawai menghadirkan sekuens aksi memukau terkecuali didukung cgi mahal bird timnya berhasil menciptakan tomorrowland dunianya wahana permainannya pace-nya konsisten bagiannya terkesan terseok-seok membosankan', 'brad bird o ide milik cerita mulus dasar cerita kuat potensi-potensi bagus kadang mudah dimengerti kadang susah cerna penonton muda memahami konsep untung garap teknis manja mata tambal kurang cerita matang bird kenal piawai hadir sekuens aksi memukau kecuali dukung cgi mahal bird tim hasil cipta tomorrowland dunia wahana main pace-nya konsisten bagi kesan terseok-seok bosan'),
(450, 467, 'tidak ada plot yang kuat narasinya tampak mengambang di dalam akuarium yang indah bersama ikan-ikan yang hampa membuatnya seperti video klip indah yang panjang dengan mood dan momen yang lebih intim nan personal ya mungkin saja kali ini malick terlalu cepat merilis karyanya mungkin butuh  tahun lagi untuk membuat to the wonder lebih sempurna', 'plot kuat narasinya mengambang akuarium indah ikan-ikan hampa membuatnya video klip indah mood momen intim nan personal ya kali malick cepat merilis karyanya butuh  to the wonder sempurna', 'plot kuat narasi ambang akuarium indah ikan-ikan hampa buat video klip indah mood momen intim nan personal ya kali malick cepat rilis karya butuh  to the wonder sempurna'),
(451, 468, 'ini memang mainan sutaradara joseph mcginty nichol atau biasa yang dikenal dengan mcg ya this means war seperti charlies angels versi macho semua tentang komedi berbalut spionase cepat ala mcg yang tidak terlalu serius tapi bedanya kali ini ia mencoba memasukan bumbu romansa dan bromance di dalamnya membiarkan bane dan kapten kirk saling bunuh untuk memperebutkan si blonde witherspoon yang sudah terlihat terlalu tua untuk bermain di genre ini hasilnya tidak terlalu buruk seperti kebanyakan romcom this means war ringan dan cukup menghibur walaupun pada kenyataannya ia sama bodohnya dengan lainnya tidak peduli ada nama simon kinberg yang pernah menghasilkan naskah sherlock holmes  lalu', 'mainan sutaradara joseph mcginty nichol dikenal mcg ya this means war charlies angels versi macho komedi berbalut spionase cepat ala mcg serius bedanya kali mencoba memasukan bumbu romansa bromance dalamnya membiarkan bane kapten kirk bunuh memperebutkan si blonde witherspoon tua bermain genre hasilnya buruk kebanyakan romcom this means war ringan menghibur kenyataannya bodohnya peduli nama simon kinberg menghasilkan naskah sherlock holmes ', 'main sutaradara joseph mcginty nichol kenal mcg ya this means war charlies angels versi macho komedi balut spionase cepat ala mcg serius beda kali coba masuk bumbu romansa bromance dalam biar bane kapten kirk bunuh rebut si blonde witherspoon tua main genre hasil buruk banyak romcom this means war ringan hibur nyata bodoh peduli nama simon kinberg hasil naskah sherlock holmes '),
(452, 469, 'pada akhirnya the woman in black tidak lebih dari sekedar horor rumah hantu konvensional yang tugas utamanya hanya satu menakut-nakuti penontonnya sesering dengan trik-trik oldschool nya yang mungkin sudah sering kita lihat di puluhan film sejenis macam benda-benda bergerak sendiri kelebatan bayangan penampakan hantu wanita padahal jika mau watkins dan goldman bisa saja memberi ruang lebih banyak untuk perkembangan karakter radcliffe toh cerita susan hill sebenarnya sangat mendukung untuk memberikan penontonnya dengan kisah masa lalu karakter arthur kipps yang kelam atau menelusuri sedikit lebih jauh sejarah eel marsh house dan hantu bergaun hitam itu', 'the woman in black sekedar horor rumah hantu konvensional tugas utamanya menakut-nakuti penontonnya sesering trik-trik oldschool nya lihat puluhan film sejenis benda-benda bergerak kelebatan bayangan penampakan hantu wanita watkins goldman ruang perkembangan karakter radcliffe cerita susan hill mendukung penontonnya kisah karakter arthur kipps kelam menelusuri sejarah eel marsh house hantu bergaun hitam', 'the woman in black sekedar horor rumah hantu konvensional tugas utama menakut-nakuti penontonnya sering trik-trik oldschool nya lihat puluh film jenis benda-benda gerak kelebat bayang penampakan hantu wanita watkins goldman ruang kembang karakter radcliffe cerita sus hill dukung penontonnya kisah karakter arthur kipps kelam telusur sejarah eel marsh house hantu gaun hitam'),
(453, 470, 'dan dengan banyaknya pesawat terbang yang meliuk-liuk lincah di udara dengan setting langit biru jepang era showa berbalut scoring megah garapan komposer veteran langganan ghibli joe hisaishi sedikit banyak mengingatkan saya pada porco rosso yang luar biasa itu hanya saja tidak ada cerita seru tentang pilot babi yang dikutuk di sini digantikan dengan sesuatu yang lebih membosankan cerita tentang hidup ambisi cita-cita dan romansa jiro horikoshi yang lambat dan datar', 'banyaknya pesawat terbang meliuk-liuk lincah udara setting langit biru jepang era showa berbalut scoring megah garapan komposer veteran langganan ghibli joe hisaishi porco rosso cerita seru pilot babi dikutuk digantikan membosankan cerita hidup ambisi cita-cita romansa jiro horikoshi lambat datar', 'banyak pesawat terbang meliuk-liuk lincah udara setting langit biru jepang era showa balut scoring megah garap komposer veteran langgan ghibli joe hisaishi porco rosso cerita seru pilot babi kutuk ganti bosan cerita hidup ambisi cita-cita romansa jiro horikoshi lambat datar'),
(454, 471, 'pada akhirnya the whistleblower hanya menjadi sebuah thriller politik medioker yang akan dengan mudah terlupakan dikarenakan kondracki gagal untuk memanfaatkan sebaik mungkin modal besar kisah nyata yang diberikan kepadanya menjadikan film yang seharunya bisa menarik ini menjadi sedatar permukaan meja makan yah untung saja masih ada wajah cantik rachel weisz diantara muka-muka kasar pemain prianya dan beberapa fakta mengejutkan tentang pbb dengan segala kedok perdamaian yang sering mereka agung-agungkan selama ini', 'the whistleblower thriller politik medioker mudah terlupakan kondracki gagal memanfaatkan modal kisah nyata menjadikan film seharunya menarik sedatar permukaan meja makan yah untung wajah cantik rachel weisz muka-muka kasar pemain prianya fakta mengejutkan pbb kedok perdamaian agung-agungkan', 'the whistleblower thriller politik medioker mudah lupa kondracki gagal manfaat modal kisah nyata jadi film haru tarik datar muka meja makan yah untung wajah cantik rachel weisz muka-muka kasar main pria fakta kejut pbb kedok damai agung-agungkan'),
(455, 472, 'paruh pertamanya mungkin tidak sampai terlalu buruk uthaug menghabiskan waktunya untuk memperkenalkan tokoh utamanya termasuk keluarga dan pekerjaan membosankannya sebagai geologis pemantau longsor yang terakhir terjadi setengah abad lalu dari sini juga uthaug memberi banyak informasi tentang deretan pegunungan indah namun rapuh kerneset beserta kondisinya yang sampai harus ditusuk besi-besi besar untuk menahan patahannya agar tidak sampai terjatuh ke fjord ya kita tahu apa yang terjadi selanjutnya ketika tidak ada yang mendengar periangatan sang jagoan utama boom longsor pun terjadi dan hanya ada waktu  menit buat ia menyelamatkan diri keluarga dan orang-orang sekitar sebelum air bah datang dan menghancurkan segala yang dilewatinya cgi tsunaminya sendiri tidak buruk meski sajian yang ditunggu-tunggu itu hanya berlangsung cepat dan sebentar sayang setelah konflik semua menjadi tidak lebih baik tensinya menurun drastis plotnya menjadi sangat klise kita tahu persis apa yang akan terjadi dan kenyataannya memang benar-benar sesuai perkiraan', 'paruh pertamanya buruk uthaug menghabiskan memperkenalkan tokoh utamanya keluarga pekerjaan membosankannya geologis pemantau longsor abad uthaug informasi deretan pegunungan indah rapuh kerneset beserta kondisinya ditusuk besi-besi menahan patahannya terjatuh fjord ya mendengar periangatan sang jagoan utama boom longsor  menit menyelamatkan keluarga orang-orang air bah menghancurkan dilewatinya cgi tsunaminya buruk sajian ditunggu-tunggu cepat sebentar sayang konflik tensinya menurun drastis plotnya klise persis kenyataannya benar-benar sesuai perkiraan', 'paruh pertama buruk uthaug habis kenal tokoh utama keluarga kerja bosan geologis pemantau longsor abad uthaug informasi deret gunung indah rapuh kerneset beserta kondisi tusuk besi-besi nah patah jatuh fjord ya dengar periangatan sang jago utama boom longsor  menit selamat keluarga orang-orang air bah hancur lewat cgi tsunami buruk saji ditunggu-tunggu cepat bentar sayang konflik tensi turun drastis plot klise persis nyata benar-benar suai kira'),
(456, 473, 'yah lupakan saja memang soal bagaimana kisahnya yang sebenarnya memiliki premis menarik untuk sebuah film action bisa di garap selemah ini sngmoo lee tampaknya terlalu rakus menghidangkan terlalu banyak menu konflik tanpa mampu menghabiskan semuanya dengan bersih disamping itu juga terlalu banyak karakter menarik yang berpotensi untuk dikembangkan lebih jauh yang pada akhirnya malah terbuang percuma begitu saja tidak lebih menjadi karakter penghibur mengihisi kisah percintaan yang dan lynne yang membosankan apalagi kisah roman picisan tersebut nyaris mendominasi keseluruhan film bedurasi  menit ini', 'yah lupakan kisahnya memiliki premis menarik film action garap selemah sngmoo lee rakus menghidangkan menu konflik menghabiskan bersih disamping karakter menarik berpotensi dikembangkan terbuang karakter penghibur mengihisi kisah percintaan lynne membosankan kisah roman picisan mendominasi film bedurasi  menit', 'yah lupa kisah milik premis tarik film action garap lemah sngmoo lee rakus hidang menu konflik habis bersih samping karakter tarik potensi kembang buang karakter hibur mengihisi kisah cinta lynne bosan kisah roman picis dominasi film bedurasi  menit'),
(457, 474, 'kalau mau jujur momen-momen horor yang ditawarkan the visit tidak sampai taraf sangat menakutkan berbeda dengan karya-karya horor mungkin kombinasi antara seram sakaligus konyol ya susah untuk tidak bergidik terbelalak sekaligus tertawa kecil melihat apa yang disaksikan becca dan tyler melalui lensa kamera mereka ya shyamalan tahu benar bagaimana cara bersenang-senang tanpa harus menghilangkan ensensi misterinya yang selalu menempel di setiap momen yang melibatkan keanehan yang ditunjukan oleh nana dan pop-pop panggilan buat kakek nenek jamison ini mungkin juga yang membuat the visit menjadi terasa spesial dibanding film-film shyamalan lain yang lebih terkesan serius', 'jujur momen-momen horor ditawarkan the visit taraf menakutkan berbeda karya-karya horor kombinasi seram sakaligus konyol ya susah bergidik terbelalak tertawa disaksikan becca tyler lensa kamera ya shyamalan bersenang-senang menghilangkan ensensi misterinya menempel momen melibatkan keanehan ditunjukan nana pop-pop panggilan kakek nenek jamison the visit spesial dibanding film-film shyamalan terkesan serius', 'jujur momen-momen horor ditawarkan the visit taraf takut beda karya-karya horor kombinasi seram sakaligus konyol ya susah gidik belalak tawa saksi becca tyler lensa kamera ya shyamalan bersenang-senang hilang ensensi misteri tempel momen libat aneh tunjuk nana pop-pop panggil kakek nenek jamison the visit spesial banding film-film shyamalan kesan serius'),
(458, 475, 'ya sebenarnya masih ada momen-momen creepy di dalamnya tetapi jumlahnya tak banyak bahkan levelnya bisa dibilang hanya sekedar untuk menakut-nakuti anak ingusan misterinya tidak diperlakukan dengan baik tidak ada permulaan yang jelas tiba-tiba saja booom semua terjadi memang ada sedikit penjelasan yang menyangkut latar belakang tokoh angela yang kemudian dihubungkan dengan tema bilbical tetapi tetap saja prosesnya tidak jelas', 'ya momen-momen creepy dalamnya levelnya dibilang sekedar menakut-nakuti anak ingusan misterinya diperlakukan permulaan booom penjelasan latar tokoh angela dihubungkan tema bilbical prosesnya', 'ya momen-momen creepy dalam level bilang sekedar menakut-nakuti anak ingus misteri laku mula booom jelas latar tokoh angela hubung tema bilbical proses'),
(459, 476, 'eclipse adalah seri twilight yang paling membosankan bahkan dari new moon yang dianggap paling buruk sekalipun adegan-adegan penawar kantuk seperti aksi peperangan antara para vampire dan warewolf muncul terlalu lama dan ternyata juga tidak sehebat yang digembar gemborkan sebelumnya bahkan adegan tersebut hanya berlangsung sebentar memang eclipse bukanlah film aksi naif sekali jika kita mengarapkan banyak adegan-adegan pemicu adrenalin disini namun memang harus diakui selama kurang lebih dua jam penonton akan disugguhi dialog-dialog mononton dan tidak berbobot yang keluar diantara  karakter utamanya entah apa memang seperti itu juga dialog-dialog yang terdapat dalam novelnya', 'eclipse seri twilight membosankan new moon dianggap buruk adegan-adegan penawar kantuk aksi peperangan vampire warewolf muncul sehebat digembar gemborkan adegan sebentar eclipse film aksi naif mengarapkan adegan-adegan pemicu adrenalin diakui jam penonton disugguhi dialog-dialog mononton berbobot  karakter utamanya dialog-dialog novelnya', 'eclipse seri twilight bosan new moon anggap buruk adegan-adegan penawar kantuk aksi perang vampire warewolf muncul hebat digembar gembor adegan bentar eclipse film aksi naif karap adegan-adegan pemicu adrenalin aku jam penonton disugguhi dialog-dialog mononton bobot  karakter utama dialog-dialog novel'),
(460, 477, 'the tower tampaknya memang didesain sedemikian rupa dengan tujuan murni untuk hiburan tanpa harus melibatkan cerita yang kompleks jadi kamu hanya melihat bagaimana para manusianya berusaha bertahan hidup dikurang lebih dua jam durasinya sementara dukungan efek mahal dengan segela tetek bengek ketegangan dan aksi-aksi penyelamatan heroik yang mungkin terasa berlebihan kemudian memegang kendali sepenuhnya dan tentu saja tidak lupa bumbu melodrama khas korea kemudian diselipkan di dalamnya untuk memberikan sebuah luapan emosi ditengah kerusakan besar sayang hal itu tidak terlalu bekerja dengan baik', 'the tower didesain rupa tujuan murni hiburan melibatkan cerita kompleks manusianya berusaha bertahan hidup dikurang jam durasinya dukungan efek mahal segela tetek bengek ketegangan aksi-aksi penyelamatan heroik memegang kendali sepenuhnya lupa bumbu melodrama khas korea diselipkan dalamnya luapan emosi ditengah kerusakan sayang', 'the tower desain rupa tuju murni hibur libat cerita kompleks manusia usaha tahan hidup kurang jam durasi dukung efek mahal gela tetek bengek tegang aksi-aksi selamat heroik memegang kendali penuh lupa bumbu melodrama khas korea selip dalam luap emosi tengah rusak sayang'),
(461, 478, 'naskah buruk performa mengecewakan dari kedua pemainnya tidak ada nya adegan yang benar-benar seru dan menegangkan membuat the tourist seakan-akan menjadi sebuah action-thriller yang serba nanggung jika ada satu-satunya yang bisa dinikmati di sepanjang kurang lebih satu jam setengah ini mungkin adalah pemandangan venesia ya kota cinta nan indah yang terletak di bagian utara italia ini memang sukses diekspos habis-habisan oleh donnersmarck dengan dibantu oleh sinematografer john seale prince of persia the sands of time harry potter and the sorcerers stone sisanya yah seperti yang sudah saya katakan tanggung', 'naskah buruk performa mengecewakan pemainnya nya adegan benar-benar seru menegangkan the tourist seakan-akan action-thriller serba nanggung satu-satunya dinikmati jam pemandangan venesia ya kota cinta nan indah terletak utara italia sukses diekspos habis-habisan donnersmarck dibantu sinematografer john seale prince of persia the sands of time harry potter and the sorcerers stone sisanya yah tanggung', 'naskah buruk performa kecewa main nya adegan benar-benar seru tegang the tourist seakan-akan action-thriller serba nanggung satu-satunya nikmat jam pemandangan venesia ya kota cinta nan indah letak utara italia sukses ekspos habis-habisan donnersmarck bantu sinematografer john seale prince of sia the sands of time harry potter and the sorcerers stone sisa yah tanggung'),
(462, 479, 'super spy balas dendam aksi kejar-kejaran di atap-atap rumah dan pertarungan tangan kosong yang seru ya susah untuk tidak merasakan efek de javu dengan franchise jason bourne bahkan ia juga punya tone gelap dan banyak shaky cam ala paul greengrass dengan editing cepat dam scoring mendebarkan yang sayangnya terasa lebih berantakan dan memusingkan plotnya sendiri sebenarnya tidak terlalu solid bahkan dibandingkan dengan koleganya the berlin file yang mengusung tema sama the suspect terlihat terlalu dangkal terlalu lama dan bertele-tele sepanjang  menit dan berakhir sedikit cengeng dibalik segala konspirasi politik kemachoan dan konflik balas dendamnya', 'super spy balas dendam aksi kejar-kejaran atap-atap rumah pertarungan tangan kosong seru ya susah merasakan efek de javu franchise jason bourne tone gelap shaky cam ala paul greengrass editing cepat dam scoring mendebarkan sayangnya berantakan memusingkan plotnya solid dibandingkan koleganya the berlin file mengusung tema the suspect dangkal bertele-tele  menit cengeng dibalik konspirasi politik kemachoan konflik balas dendamnya', 'super spy balas dendam aksi kejar-kejaran atap-atap rumah tarung tang kosong seru ya susah rasa efek de javu franchise jason bourne tone gelap shaky cam ala paul greengrass editing cepat dam scoring debar sayang berantak memusingkan plot solid banding kolega the berlin file usung tema the suspect dangkal bertele-tele  menit cengeng balik konspirasi politik kemachoan konflik balas dendam'),
(463, 480, 'ujur saja pendekatan yang dilakukan film ini secara tidak langsung merusak film ini secara keseluruhan karena siapa sebenarnya sosok david harris sudah diperlihatkan dengan gamblang dari menit-menit awal sehingga kesan misteriusnya sudah berkurang selanjutnya bisa dibilang cerita film yang didistribusikan oleh screen gems ini sangat klise dan mudah sekali ditebak bahkan untuk endingnya sekalipun', 'ujur pendekatan film langsung merusak film sosok david harris gamblang menit-menit kesan misteriusnya berkurang dibilang cerita film didistribusikan screen gems klise mudah ditebak endingnya', 'ujur dekat film langsung rusak film sosok david harris gamblang menit-menit kesan misterius kurang bilang cerita film distribusi screen gems klise mudah tebak endingnya'),
(464, 481, 'the sorcerers apprentice sendiri sebenarnya tidak berbeda jauh dengan tipe-tipe film-film summer blockbuster bruckheimer lainnya penuh dengan segala kemewahan efek cgi yang memanjakan mata adegan-adegan cepat yang dihiasi dengan aksi-aksi spektakuler dan mengandalkan nama besar bintang-bintangnya yang pada kenyataanya hanya berakting pas-pasan sayang lagi-lagi seperti sudah menjadi penyakit film-film popcorn kebanyakan the sorcerers apprentice pun tidak lepas dari kelemahan mendasar ya plot yang terlalu sederhana dan klise layaknya dongeng-dongeng klasik tiga babak buatan disney yang dapat kita tebak bagaimana cerita tersebut berakhir tanpa harus repot-repot berpikir keras ya the sorcerers apprentice tidak ada plot njelimet dan berlapis-lapis yang memusingkan disini', 'the sorcerers apprentice berbeda tipe-tipe film-film summer blockbuster bruckheimer penuh kemewahan efek cgi memanjakan mata adegan-adegan cepat dihiasi aksi-aksi spektakuler mengandalkan nama bintang-bintangnya kenyataanya berakting pas-pasan sayang lagi-lagi penyakit film-film popcorn kebanyakan the sorcerers apprentice lepas kelemahan mendasar ya plot sederhana klise layaknya dongeng-dongeng klasik babak buatan disney tebak cerita repot-repot berpikir keras ya the sorcerers apprentice plot njelimet berlapis-lapis memusingkan', 'the sorcerers apprentice beda tipe-tipe film-film summer blockbuster bruckheimer penuh mewah efek cgi manja mata adegan-adegan cepat hias aksi-aksi spektakuler andal nama bintang-bintangnya kenyataanya berakting pas-pasan sayang lagi-lagi sakit film-film popcorn banyak the sorcerers apprentice lepas lemah dasar ya plot sederhana klise layak dongeng-dongeng klasik babak buat disney tebak cerita repot-repot pikir keras ya the sorcerers apprentice plot njelimet berlapis-lapis memusingkan'),
(465, 482, 'satu-satunya yang bisa dibilang menarik dari the saint versi noyce ini adalah bagaimana karakter simon temple melakukan keahliannya mencuri tidak bagian itu sama sekali tidak menarik adegan laga terlalu biasa penyamaran yabagian di saat ia melakukan perubahan penampilan inilah yang membuat the saint menjadi sedikit tertolong apalagi tidak hanya sekali terhitung lebih dari  kali sepajang film ia menggunakan kemampuannya itu dan membuat saya cukup terhibur walaupun harus jujur saya sedikit terganggu juga dengan penampilan val kilmer yang sangat berlebihan alias overacting dalam membawakan perannya ya pendek kata the saint versi noyce ini terasa hanya menumpang ketenaran serial televisinya saja tanpa adanya kedalaman cerita bahkan untuk ukuran film aksi spionase film ini juga tidak menawarkan adegan aksi yang wah semuanya serba standar dan lurus-lurus saja kalau tidak mau dibilang buruk belum lagi aksi jual tampang val kilmer yang cukup mengganggu sepanjang  menit', 'satu-satunya dibilang menarik the saint versi noyce karakter simon temple keahliannya mencuri menarik adegan laga penyamaran yabagian perubahan penampilan the saint tertolong terhitung  kali sepajang film kemampuannya terhibur jujur terganggu penampilan val kilmer alias overacting membawakan perannya ya pendek the saint versi noyce menumpang ketenaran serial televisinya kedalaman cerita ukuran film aksi spionase film menawarkan adegan aksi serba standar lurus-lurus dibilang buruk aksi jual tampang val kilmer mengganggu  menit', 'satu-satunya bilang tarik the saint versi noyce karakter simon temple ahli curi tarik adegan laga samar yabagian ubah penampilan the saint tolong hitung  kali pajang film mampu hibur jujur ganggu penampilan val kilmer alias overacting bawak peran ya pendek the saint versi noyce tumpang tenar serial televisi dalam cerita ukur film aksi spionase film menawarkan adegan aksi serba standar lurus-lurus bilang buruk aksi jual tampang val kilmer ganggu  menit'),
(466, 483, 'the rite mungkin tidak lebih dari horror bertema exorcism biasa menghibur namun tidak istimewa bahkan cenderung membosankan buat anda yang kurang menggemari horror beralur lambat kecuali anda adalah fans berat dan sudah rindu dengan penampilan dingin dari seorang sir anthony hopkins karena mungkin hanya itu satu-satunya yang bisa dibilang menarik di sini', 'the rite horror bertema exorcism menghibur istimewa cenderung membosankan menggemari horror beralur lambat kecuali fans berat rindu penampilan dingin sir anthony hopkins satu-satunya dibilang menarik', 'the rite horror tema exorcism hibur istimewa cenderung bosan gemar horror alur lambat kecuali fans berat rindu penampilan dingin sir anthony hopkins satu-satunya bilang tarik'),
(467, 484, 'kehadiran hillary swank jelas menjadi segalanya disini mungkin saya sendiri tidak akan melirik film ini jika didalamnya hanya ada nama jeffrey dean morgan lee pace ataupun christopher lee meskipun tidak buruk namun sangat disayangkan swank harus membuang percuma talentanya dalam film sekelas ini menariknya swank seakan-akan membiarkan joniken dengan mudah mengeksploitasi keindahan tubuhnya dengan menghadirkan cukup banyak adegan-adegan tanpa busana artis peraih oscar dalam boys dont cry dan million dollar baby ini so mencari sesuatu yang menarik di the resident mungkin anda hanya menemukan nama hillary swank didalamnya karena jika nama besar itu dicabut maka sisanya hanya sebuah thriller medioker klise dari seorang sutradara video klip yang sudah bersusah payah agar debut film panjangnya ini dapat laku dipasaran', 'kehadiran hillary swank melirik film didalamnya nama jeffrey dean morgan lee pace christopher lee buruk disayangkan swank membuang talentanya film sekelas menariknya swank seakan-akan membiarkan joniken mudah mengeksploitasi keindahan tubuhnya menghadirkan adegan-adegan busana artis peraih oscar boys dont cry million dollar baby so mencari menarik the resident menemukan nama hillary swank didalamnya nama dicabut sisanya thriller medioker klise sutradara video klip bersusah payah debut film panjangnya laku dipasaran', 'hadir hillary swank lirik film dalam nama jeffrey de morgan lee pace christopher lee buruk sayang swank buang talenta film kelas tarik swank seakan-akan biar joniken mudah eksploitasi indah tubuh hadir adegan-adegan busana artis raih oscar boys dont cry million dollar baby so cari tarik the resident temu nama hillary swank dalam nama cabut sisa thriller medioker klise sutradara video klip susah payah debut film panjang laku pasar'),
(468, 485, 'pouge kembali ke pakem lama yang melibatkan sedikit sentuhan modern dari elemen mockumentary sentuhan klasik haunted house dan pengusiran setan dalam setting jadul berpanggung rumah lama dengan perabot-perabot antik termasuk meja bulat kecil berwarna coklat di mana para karakternya berpengangan tangan lancang menantang kekuatan tak terlihat yang tidak mereka percayai tetapi sayang semua kesenangan-kesenangan itu tidak dibarengi dengan kehadiran aura mencekam dan presentasi yang solid semuanya tampak datar tidak menakutkan dan bisa dibilang membosankan', 'pouge pakem melibatkan sentuhan modern elemen mockumentary sentuhan klasik haunted house pengusiran setan setting jadul berpanggung rumah perabot-perabot antik meja bulat berwarna coklat karakternya berpengangan tangan lancang menantang kekuatan percayai sayang kesenangan-kesenangan dibarengi kehadiran aura mencekam presentasi solid datar menakutkan dibilang membosankan', 'pouge pakem libat sentuh modern elemen mockumentary sentuh klasik haunted house usir setan setting jadul panggung rumah perabot-perabot antik meja bulat warna coklat karakternya pengang tang lancang tantang kuat percaya sayang kesenangan-kesenangan bareng hadir aura cekam presentasi solid datar takut bilang bosan'),
(469, 486, 'demonaco juga seperti mencoba memasukan banyak elemen sosial-politis dengan melibatkan konspirasi pemerintah dan gerakan bawah tanah anti-purge yang sangat disayangkan menguap tak berbekas seiiring dengan berjalannya waktu apa yang terjadi setelah  menit anarchy kembali mengulangi kesalahan yang sama yang pernah dibuat pendahulunya membuang percuma tema besarnya dan segala elemen pendukung yang seharusnya membuat sekuelnya ini menjadi lebih baik sayang apa yang terjadi di lapangan tidak lebih dari sebuah thriller aksi survival kosong kelas dua yang dihiasi dengan kebisingan tanpa arti dan pertempuran murahan dengan kadar gore yang disunat', 'demonaco mencoba memasukan elemen sosial-politis melibatkan konspirasi pemerintah gerakan tanah anti-purge disayangkan menguap berbekas seiiring berjalannya  menit anarchy mengulangi kesalahan pendahulunya membuang tema besarnya elemen pendukung sekuelnya sayang lapangan thriller aksi survival kosong kelas dihiasi kebisingan arti pertempuran murahan kadar gore disunat', 'demonaco coba masuk elemen sosial-politis libat konspirasi pemerintah gerak tanah anti-purge sayang uap bekas seiiring jalan  menit anarchy ulang salah dahulu buang tema besar elemen dukung sekuelnya sayang lapang thriller aksi survival kosong kelas hias bising arti tempur murah kadar gore sunat'),
(470, 487, 'sebuah konsep gila yang punya potensi menjadi besar dan dalam sayangnya pada akhirnya demonaco entah terlalu malas atau tidak tahu bagaimana mengembangkannya the purge kemudian hanya menjadi sajian home invasion thriller yang sering kamu lihat dengan segala aspek bertahan hidupnya yang juga familiar ya sayang memang di mana ide brilian hanya sebatas menjadi ide semata', 'konsep gila potensi sayangnya demonaco malas mengembangkannya the purge sajian home invasion thriller lihat aspek bertahan hidupnya familiar ya sayang ide brilian sebatas ide', 'konsep gila potensi sayang demonaco malas kembang the purge saji home invasion thriller lihat aspek tahan hidup familiar ya sayang ide brilian batas ide'),
(471, 488, 'sayang kualitas naskah yang ditulis alim sudio tidak sekokoh sisi teknisnya membuat ceritanya yang juga tidak lagi terlalu orisinil ini bergerak begitu lambat dan sedikit membosankan dengan rentetan misteri-misteri yang tidak mampu disembunyikan dengan aman bukan saya sok pintar tapi sungguh teka-teki yang disajikan oleh the perfect house gagal mempermainkan saya suka atau tidak ia memang begitu mudah ditebak bahkan sebelum pada akhirnya karakter julie menemukannya sendiri sama sekali tidak mampu mengusik rasa penasaran sisi psikologis yang ditonjolkan juga tidak maksimal karena saya hanya mendapati sediki adegan yang benar-benar bisa meneror mental di sini dan tentu saja imbas dari kekurangan-kekurangan di atas membuat ending the perfect house yang seharusnya bisa mengejutkan menjadi cacat dan terasa hambar anggap saja seperti menonton thriller untuk pemula', 'sayang kualitas naskah ditulis alim sudio sekokoh sisi teknisnya ceritanya orisinil bergerak lambat membosankan rentetan misteri-misteri disembunyikan aman sok pintar sungguh teka-teki disajikan the perfect house gagal mempermainkan suka mudah ditebak karakter julie menemukannya mengusik penasaran sisi psikologis ditonjolkan maksimal mendapati sediki adegan benar-benar meneror mental imbas kekurangan-kekurangan ending the perfect house mengejutkan cacat hambar anggap menonton thriller pemula', 'sayang kualitas naskah tulis alim sudio sekokoh sisi teknis cerita orisinil gerak lambat bosan rentet misteri-misteri sembunyi aman sok pintar sungguh teka-teki saji the perfect house gagal main suka mudah tebak karakter julie temu usik penasaran sisi psikologis tonjol maksimal dapat dik adegan benar-benar teror mental imbas kekurangan-kekurangan ending the perfect house kejut cacat hambar anggap tonton thriller mula'),
(472, 489, 'meskipun punya premis menarik naskah melissa stack sebenarnya tidak terlalu kuat dan seperti kebanyakan romcom lainnya ia akan memulainya dengan sesuatu yang cukup menyegarkan sampai kemudian berakhir cheesy termasuk penyutradaraan cassavetes junior yang juga tidak istimewa terutama ketika ia terlalu memaksakan memasukan beberapa gambar-gambar melankolis yang terasa tidak cocok', 'premis menarik naskah melissa stack kuat kebanyakan romcom memulainya menyegarkan cheesy penyutradaraan cassavetes junior istimewa memaksakan memasukan gambar-gambar melankolis cocok', 'premis tarik naskah melissa stack kuat banyak romcom mulai segar cheesy sutradara cassavetes junior istimewa memaksakan masuk gambar-gambar melankolis cocok'),
(473, 490, 'ini mungkin salah satu film yang perjalanannya lebih baik ketimbang endingnya ya endingnya buruk terlalu cepat absurd dan tidak memberikan banyak jawaban dari pertanyaan-pertanyaan yang ada seperti siapa sebenarnya wanita misterius itu apa hubungan adegan bunuh diri di awal film dengan buku itu sendiri dan beberapa lubang lain di ceritanya banyak kritikus yang menanggap the ninth gate sebagai salah satu kesalahan besar polanski', 'salah film perjalanannya ketimbang endingnya ya endingnya buruk cepat absurd pertanyaan-pertanyaan wanita misterius hubungan adegan bunuh film buku lubang ceritanya kritikus menanggap the ninth gate salah kesalahan polanski', 'salah film jalan timbang endingnya ya endingnya buruk cepat absurd pertanyaan-pertanyaan wanita misterius hubung adegan bunuh film buku lubang cerita kritikus tanggap the ninth gate salah salah polanski'),
(474, 491, 'seperti ingin menyertai kegagalan film ini nama kevin costner yang didapuk sebagai nilai jual dan daya tarik terbesar film yang juga merupakan adaptasi dari film pendek karya john connolly juga kembali gagal menampilkan peran terbaiknya tidak ada sesuatu yang spesial yang membuat penontonnya bakal mengingat penampilan oleh aktor berusia  tahun ini malah bisa dibilang penampilannya dalam the new daughter semakin menambah daftar panjang kegagalannya mengangkat daya jual sebuah film mungkin satunya yang menarik adalah penampilan ivana baquero bagi yang pernah menonton pans labyrinth sudah tentu tidak akan melupakan wajah manis aktris yang kini sudah beranjak remaja ini walaupun jika dibandingkan dalam pans labyrinth aktingnya disini terkesan biasa saja namun setidaknya senang bisa melihat aktris kelahiran barcelona  tahun lalu ini tumbuh menjadi gadis cantik overall premis usang ditambah dengan eksekusinya yang payah dan di tutup dengan ending buruk jelas membuat the new daughter bukanlah sajian horror yang dapat diharapkan dapat memuaskan para penggemarnya', 'menyertai kegagalan film nama kevin costner didapuk nilai jual daya tarik terbesar film adaptasi film pendek karya john connolly gagal menampilkan peran terbaiknya spesial penontonnya penampilan aktor berusia  dibilang penampilannya the new daughter menambah daftar kegagalannya mengangkat daya jual film satunya menarik penampilan ivana baquero menonton pans labyrinth melupakan wajah manis aktris beranjak remaja dibandingkan pans labyrinth aktingnya terkesan senang aktris kelahiran barcelona  tumbuh gadis cantik overall premis usang ditambah eksekusinya payah tutup ending buruk the new daughter sajian horror diharapkan memuaskan penggemarnya', 'serta gagal film nama kevin costner didapuk nilai jual daya tarik besar film adaptasi film pendek karya john connolly gagal tampil peran baik spesial penontonnya penampilan aktor usia  bilang penampilannya the new daughter tambah daftar gagal angkat daya jual film satu tarik penampilan ivana baquero tonton pans labyrinth lupa wajah manis aktris anjak remaja banding pans labyrinth aktingnya kesan senang aktris lahir barcelona  tumbuh gadis cantik overall premis usang tambah eksekusi payah tutup ending buruk the new daughter saji horror harap muas gemar'),
(475, 492, 'ama richard gare jelas di dapuk untuk menjadi daya pikat the mothman prophecies namun apa daya aktor yang memiliki cir khas berambut putih ini gagal memainkan perannya dengan maksimal yang ada gare malah terlihat seperti orang kebingungan yang tidak harus berbuat apa dengan sibuk belari kesana kemari bahkan artis sekaliber laura linney pun terlihat tidak memiliki peran signifikan dalam pengembangan ceritanya pada akhirnya the mothman prophecies menjadi sebuah thriller misteri yang hanya meninggalkan premis menariknya semata bahkan jika mau dibandingkan menonton salah satu episoden dari serial televisi x-files yang berdurasi kurang dari  jam sepertinya masih terasa lebih menarik daripada duduk selama  menit menonton sebuah film garing seperti ini', 'ama richard gare dapuk daya pikat the mothman prophecies daya aktor memiliki cir khas berambut putih gagal memainkan perannya maksimal gare orang kebingungan berbuat sibuk belari kesana kemari artis sekaliber laura linney memiliki peran signifikan pengembangan ceritanya the mothman prophecies thriller misteri meninggalkan premis menariknya dibandingkan menonton salah episoden serial televisi x-files berdurasi  jam menarik duduk  menit menonton film garing', 'ama richard gare dapuk daya pikat the mothman prophecies daya aktor milik cir khas rambut putih gagal main peran maksimal gare orang bingung buat sibuk belar sana kemari artis kaliber laura linney milik peran signifikan pengembangan cerita the mothman prophecies thriller misteri tinggal premis tarik banding tonton salah episoden serial televisi x-files durasi  jam tarik duduk  menit tonton film garing'),
(476, 493, 'sementara unsur romansanya dibentuk secara paksa dan kasar transisi untuk membangun rasa cinta terasa kelewat cepat hanya melalui acara makan ayam panggang dan bersenang-senang beberapa jam di taman bermain seakan-akan chow tidak terlalu memedulikan bagian ini meski sebenarnya sangat penting untuk membangun ikatan emosi bahkan kalau mau jujur porsi cinta secuil yang ada di kung fu hustle dengan gadis bisu penjual permen itu jauh lebih mengena dan terakhir soal cgi ya kita tahu chow senang bermain-main dengan efek komputer untuk mendukung narasi dan aksi-aksinya dan tentu saja berbicara soal kualitasnya sudah sepantasnya kita tidak membandingkannya dengan apa yang dilakukan hollywood itu terlalu jauh masalahnya kualitas cgi the mermaid itu buruk sangat buruk bahkan untuk sekedar dibandingkan dengan shaolin soccer atau kung fu hustle sekalipun', 'unsur romansanya dibentuk paksa kasar transisi membangun cinta kelewat cepat acara makan ayam panggang bersenang-senang jam taman bermain seakan-akan chow memedulikan membangun ikatan emosi jujur porsi cinta secuil kung fu hustle gadis bisu penjual permen mengena cgi ya chow senang bermain-main efek komputer mendukung narasi aksi-aksinya berbicara kualitasnya membandingkannya hollywood kualitas cgi the mermaid buruk buruk sekedar dibandingkan shaolin soccer kung fu hustle', 'unsur romansa bentuk paksa kasar transisi bangun cinta lewat cepat acara makan ayam panggang bersenang-senang jam taman main seakan-akan chow memedulikan bangun ikat emosi jujur porsi cinta cuil kung fu hustle gadis bisu jual permen kena cgi ya chow senang bermain-main efek komputer dukung narasi aksi-aksinya bicara kualitas banding hollywood kualitas cgi the mermaid buruk buruk sekedar banding shaolin soccer kung fu hustle'),
(477, 494, 'settingnya hanya berputar-putar di sebuah bungker militer besar sebagian besar dananya mungkin hanya untuk menampilkan cgi berbentuk teknologi komputer canggih dan tentu saja sang mesin cantik dalam wujud caity lotz yang dibangkitkan dari kematian untuk dijadikan tentara super yang berkilauan masalahnya adalah ketika ciptaan si dokter ternyata dlluar dugaan bisa berpikir dan memiliki emosi layaknya manusia yang berbuntut dan kompleksitas moral ya berbicara soal moral dan pilihan-pilihan sulit sepertinya hal-hal filosofis macam perkataan sang mesin yang dalam kepada mccarthy what makes my clever imitation of life any different from theirs apart from their flesh what makes them any different from me coba ditonjolkan caradog w james guna mengalihkan presentasi klasik fiksi ilmiah suramnya yang minim kemewahan masalahnya naskah besutan james bukan hanya terlalu klise dengan segala cerita tentang bagaimana robot yang ingin menjadi manusia namun juga ia tidak pernah benar-benar kuat membentuk segala urusan moral termasuk sentuhan dramanya yang juga gagal menciptakan emosi yang semestinya belum lagi beberapa subplot tentang industri militer dan pemberontakan para mesin yang coba dijejelkan ke dalamnya ternyata tidak terlalu berguna menopang plot utamanya', 'settingnya berputar-putar bungker militer dananya menampilkan cgi berbentuk teknologi komputer canggih sang mesin cantik wujud caity lotz dibangkitkan kematian dijadikan tentara super berkilauan ciptaan si dokter dlluar dugaan berpikir memiliki emosi layaknya manusia berbuntut kompleksitas moral ya berbicara moral pilihan-pilihan sulit hal-hal filosofis perkataan sang mesin mccarthy what makes my clever imitation of life any different from theirs apart from their flesh what makes them any different from me coba ditonjolkan caradog w james mengalihkan presentasi klasik fiksi ilmiah suramnya minim kemewahan naskah besutan james klise cerita robot manusia benar-benar kuat membentuk urusan moral sentuhan dramanya gagal menciptakan emosi semestinya subplot industri militer pemberontakan mesin coba dijejelkan dalamnya berguna menopang plot utamanya', 'settingnya berputar-putar bungker militer dana tampil cgi bentuk teknologi komputer canggih sang mesin cantik wujud caity lotz bangkit mati jadi tentara super kilau cipta si dokter dlluar duga pikir milik emosi layak manusia buntut kompleksitas moral ya bicara moral pilihan-pilihan sulit hal-hal filosofis kata sang mesin mccarthy what makes my clever imitation of life any different from theirs apart from their flesh what makes them any different from me coba tonjol caradog w james alih presentasi klasik fiksi ilmiah suram minim mewah naskah besut james klise cerita robot manusia benar-benar kuat bentuk urus moral sentuh drama gagal cipta emosi mesti subplot industri militer berontak mesin coba dijejelkan dalam guna topang plot utama'),
(478, 495, 'faktor minus terbesar adalah ketika the love of siam bergerak terlalu bertele-tele dan terasa lama sesuatu yang tidak baik untuk sebuah drama yang berdurasi dua jam setengah benar-benar perjuangan yang melelahkan ketika menontonya sebenarnya saya sangat menikmati  menit pertama sebuah opening scene panjang yang juga menghadirkan prolog masa lalu kedua karakter utama kita semua berjalan lancar di bagian ini pemicu romansa keduanya terbentuk dengan baik meskipun sedikit cheesy adegan perkelahian di toilet sekolah termasuk tragedi yang menimpa keluarga tong yang kemudian membuat miew dan tong kecil harus berpisah dalam waktu yang lama nah yang menjadi masalah ketika kemudian sakveerakul sepertinya kebingungan untuk bagaiman mengembangkan kisahnya lebih lanjut dan apa yang terjadi kemudian ia malah menambahkan sub plot lain yang parahnya kelewat opera sabun alias terlalu sinetron dan tidak penting seperti memanjangkan tragedi keluarga tong membuat ayahnya menjadi alkoholik kemudian sakit parah muncul karakter june gadis yang mirip  dengan kakak perempuan tong cinta segi banyak dari tetangga yang tergila-gila pada miew sampai tong dan donut kekasih normal nya lengkap dengan segala melodrama picisannya pertanyaanya tentu saja apakah kehadiran sub-plot tersebut mampu memperkuat plot utamanya jika tidak kenapa tidak dibuang saja biarkan the love of siam memfokuskan dirinya pada tema romansa gay-nya tanpa harus tercemari melodrama-melodrama tidak penting itu', 'faktor minus terbesar the love of siam bergerak bertele-tele drama berdurasi jam benar-benar perjuangan melelahkan menontonya menikmati  menit opening scene menghadirkan prolog karakter utama berjalan lancar pemicu romansa terbentuk cheesy adegan perkelahian toilet sekolah tragedi menimpa keluarga tong miew tong berpisah sakveerakul kebingungan bagaiman mengembangkan kisahnya sub plot parahnya kelewat opera sabun alias sinetron memanjangkan tragedi keluarga tong ayahnya alkoholik sakit parah muncul karakter june gadis  kakak perempuan tong cinta segi tetangga tergila-gila miew tong donut kekasih normal nya lengkap melodrama picisannya pertanyaanya kehadiran sub-plot memperkuat plot utamanya dibuang biarkan the love of siam memfokuskan tema romansa gay-nya tercemari melodrama-melodrama', 'faktor minus besar the love of siam gerak bertele-tele drama durasi jam benar-benar juang lelah menontonya nikmat  menit opening scene hadir prolog karakter utama jalan lancar pemicu romansa bentuk cheesy adegan kelahi toilet sekolah tragedi timpa keluarga tong miew tong pisah sakveerakul bingung bagaiman kembang kisah sub plot parah lewat opera sabun alias sinetron memanjangkan tragedi keluarga tong ayah alkoholik sakit parah muncul karakter june gadis  kakak perempuan tong cinta segi tetangga tergila-gila miew tong donut kasih normal nya lengkap melodrama picis pertanyaanya hadir sub-plot kuat plot utama buang biar the love of siam fokus tema romansa gay-nya cemar melodrama-melodrama'),
(479, 496, 'berisi adegan-adegan yang seperti langsung di robek dari komiknya sylvain white membuat adegan-adegan dalam the losers berlari sangat cepat bahkan saking cepatnya sampai membuat penontonnya tidak lagi sempat untuk memikirkan mana -mana adegan yang masuk akal dan mana yang tidak yang juga menarik adalah bagaimana white sukses meracik unsur-unsur humor dengan adegan-adegan serius sehingga hasilnya cukup efektif menghadirkan sebuah tontonan serius tapi santai kepada penontonnya jadi santai sajalah menikmati the losers tidak perlu pusing dengan plot-nya yang simple dan klise toh filmnya sendiri memang diperuntukan sebagai hiburan semata', 'berisi adegan-adegan langsung robek komiknya sylvain white adegan-adegan the losers berlari cepat saking cepatnya penontonnya memikirkan -mana adegan masuk akal menarik white sukses meracik unsur-unsur humor adegan-adegan serius hasilnya efektif menghadirkan tontonan serius santai penontonnya santai menikmati the losers pusing plot-nya simple klise filmnya diperuntukan hiburan', 'isi adegan-adegan langsung robek komik sylvain white adegan-adegan the losers lari cepat saking cepat penontonnya memikirkan -mana adegan masuk akal tarik white sukses racik unsur-unsur humor adegan-adegan serius hasil efektif hadir tonton serius santai penontonnya santai nikmat the losers pusing plot-nya simple klise film untuk hibur');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(480, 497, 'ya the lorax memang terlalu kekanak-kanakan setuju ia punya pesan yang bagus buat para generasi muda untuk menjaga kesinambungan alam mereka saya juga suka bagaimana illumination mac guff studio yang bermarkas di perancis itu membungkusnya dengan kualitas animasi cantik dan colorfull lengkap dengan karakter-karakternya yang lucu nan imut bahkan d-nya juga tidak buruk dan juga tidak ada yang salah bagaimana duet chris renaud  kyle balda menyajikannya dengan sedikit sentuhan musikal di dalamnya yang salah bisa jadi adalah naskah yang ditulis ken daurio dan cinco paul bukan masalah bagaimana mereka sudah memodifikasinya sana-sini membuat karakter the lorax yang semestinya menjadi tokoh sentral mendapat porsi lebih sedikit ketimbang tokoh ted tapi yang menjadi persoalan adalah plotnya yang terlalu lurus khususnya untuk penonton dewasa efeknya bisa membosankan terlebih ketika homor-humor di paruh pertamanya yang menghibur itu sudah tidak lagi terlalu lucu ketika menginjak pertengahan film hingga kemudian ia berakhir klise', 'ya the lorax kekanak-kanakan setuju pesan bagus generasi muda menjaga kesinambungan alam suka illumination mac guff studio bermarkas perancis membungkusnya kualitas animasi cantik colorfull lengkap karakter-karakternya lucu nan imut d-nya buruk salah duet chris renaud  kyle balda menyajikannya sentuhan musikal dalamnya salah naskah ditulis ken daurio cinco paul memodifikasinya sana-sini karakter the lorax semestinya tokoh sentral porsi ketimbang tokoh ted plotnya lurus penonton dewasa efeknya membosankan homor-humor paruh pertamanya menghibur lucu menginjak pertengahan film klise', 'ya the lorax kekanak-kanakan tuju pesan bagus generasi muda jaga sinambung alam suka illumination mac guff studio markas perancis bungkus kualitas animasi cantik colorfull lengkap karakter-karakternya lucu nan imut d-nya buruk salah duet chris renaud  kyle balda saji sentuh musikal dalam salah naskah tulis ken daurio cinco paul modifikasi sana-sini karakter the lorax mesti tokoh sentral porsi timbang tokoh ted plot lurus penonton dewasa efek bosan homor-humor paruh pertama hibur lucu injak tengah film klise'),
(481, 498, 'masalahnya dengan segala tetek bengek latar belakang historis dan fiksi the legend of tarzan sebenarnya punya modal konsep yang besar yang membuatnya bisa berbeda dari kebanyakan adaptasi lain namun sayang pada akhirnya tidak dibarengi dengan kekuatan bercerita yang mumpuni dan eksplorasi karakter yang dalam padahal di atas kertas ia punya dukungan cast mentereng sebut saja alexander skarsgrd margot robbie samuel l jackson christoph waltz sampai djimon hounsou tidak ada ikatan kuat antara tarzan dan jane meski harus diakui skarsgrd cukup tampil menyakinkan membawakan perannya sebagai penguasa rimba dengan segala permak fisik yg sangar dan trademark khas tarzan yang selama ini kita kenal termasuk bergelayutan di antara pohon-pohon berkomunikasi dengan hewan serta teriakan ikoniknya sementara robbie dan karakter-karakter lain seperti terbuang percuma oleh peran mereka karena naskah yang tidak pernah mampu membuat mereka berkembang dari sekedar karakter hore-hore semata', 'tetek bengek latar historis fiksi the legend of tarzan modal konsep membuatnya berbeda kebanyakan adaptasi sayang dibarengi kekuatan bercerita mumpuni eksplorasi karakter kertas dukungan cast mentereng alexander skarsgrd margot robbie samuel l jackson christoph waltz djimon hounsou ikatan kuat tarzan jane diakui skarsgrd tampil menyakinkan membawakan perannya penguasa rimba permak fisik yg sangar trademark khas tarzan kenal bergelayutan pohon-pohon berkomunikasi hewan serta teriakan ikoniknya robbie karakter-karakter terbuang peran naskah berkembang sekedar karakter hore-hore', 'tetek bengek latar historis fiksi the legend of tarzan modal konsep buat beda banyak adaptasi sayang bareng kuat cerita mumpuni eksplorasi karakter kertas dukung cast mentereng alexander skarsgrd margot robbie samuel l jackson christoph waltz djimon hounsou ikat kuat tarzan jane aku skarsgrd tampil menyakinkan bawak peran penguasa rimba permak fisik yg sangar trademark khas tarzan kenal gelayut pohon-pohon komunikasi hewan serta teriak ikoniknya robbie karakter-karakter buang peran naskah kembang sekedar karakter hore-hore'),
(482, 499, 'masalahnya sedikit momen seram tidak mampu menutupi kekacauan yang akan hadir selanjutnya seiring dengan semakin jauhnya durasinya berjalan the lazarus effect menjadi melempem ia tidak lagi sekuat premis awalnya cakupan yang luas menjadi sempit seperti setting-nya yang hanya berputar-putar di laboratorium ia lalu juga kehilangan pegangannya ketika gelb tampak tidak tahu apa yang ingin ditonjolkannya kita tahu akan ada manusia yang kemudian terpaksa dijadikan percobaan karena sebuah kesalahan ya kita tahu eksperimen itu kemudian menjadi mimpi buruk yang kita tidak tahu adalah kemudian elemen sci-fi horor dan psikologisnya bercampur aduk tak karuan alih-alih melebur menjadi kesatuan yang apik narasi the lazarus effect menjadi tidak fokus ia seperti sedang kebingungan untuk memilih satu tema utama agar kemudian bisa menutup segalanya dengan baik sialnya itu tidak terjadi dan berbicara soal ending-nya percayalah apa yang terjadi di ujungnya itu tidak lebih dari sebauh kekonyolan luar biasa seakan-akan melengkapi setiap bencana yang terjadi', 'momen seram menutupi kekacauan hadir seiring jauhnya durasinya berjalan the lazarus effect melempem sekuat premis cakupan luas sempit setting-nya berputar-putar laboratorium kehilangan pegangannya gelb ditonjolkannya manusia terpaksa dijadikan percobaan kesalahan ya eksperimen mimpi buruk elemen sci-fi horor psikologisnya bercampur aduk karuan alih-alih melebur kesatuan apik narasi the lazarus effect fokus kebingungan memilih tema utama menutup sialnya berbicara ending-nya percayalah ujungnya sebauh kekonyolan seakan-akan melengkapi bencana', 'momen seram tutup kacau hadir iring jauh durasi jalan the lazarus effect lempem kuat premis cakup luas sempit setting-nya berputar-putar laboratorium hilang pegang gelb tonjol manusia paksa jadi coba salah ya eksperimen mimpi buruk elemen sci-fi horor psikologis campur aduk karu alih-alih lebur satu apik narasi the lazarus effect fokus bingung memilih tema utama tutup sial bicara ending-nya percaya ujung sebauh konyol seakan-akan lengkap bencana'),
(483, 500, 'sementara narasi yang digarap trio cory goodman matt sazama dan burk sharpless memang jauh dari kata istimewa tidak ada kedalaman tidak ada pengembangan cerirta berarti termasuk karakter-karakternya yang terasa teralu datar dan tidak tergali dengan baik meski sebenarnya ada sedikit potensi yang sebenarnya bisa dikembangkan dalam karakter klauder dengan sejumput masa lalunya yang suram toh pada akhirnya film-film jenis ini kembali terjebak dalam pakem lama yang lebih menonjolkan otot dalam aksi pertarungan dan visual dalam cgi mahal seharga  juta dollar', 'narasi digarap trio cory goodman matt sazama burk sharpless istimewa kedalaman pengembangan cerirta karakter-karakternya teralu datar tergali potensi dikembangkan karakter klauder sejumput lalunya suram film-film jenis terjebak pakem menonjolkan otot aksi pertarungan visual cgi mahal seharga  juta dollar', 'narasi garap trio cory goodman matt sazama burk sharpless istimewa dalam pengembangan cerirta karakter-karakternya alu datar gali potensi kembang karakter klauder jumput lalu suram film-film jenis jebak pakem tonjol otot aksi tarung visual cgi mahal harga  juta dollar'),
(484, 501, 'setelah dear john yang tampil kurang greget dan banyak mendapatkan respon negatif dari para kritikus kali ini the last song pun nasibnya tidak jauh berbeda dari pendahulunya itu malah bisa dibilang film yang dibidani oleh sutradara wanita julie anne robinson ini adalah film adaptasi novel nicholas spark terburuk yang pernah dibuat plot tidak menarik datar dan membosankan konfilk-konflik yang kurang digali serta tempo yang terlalu cepat menjadi penyebab-penyebab kegalalan the last song namun peyebab terbesar adalah pemilihan seorang miley cyrus yang didapuk menjadi pemeran utama film ini ya film yang sudah banyak menderita karena kelemahan-kelemahan teknisnya ini harus diperburuk lagi dengan kehadiran pemeran hannah montana dengan aktingnya yang sangat buruk tidak hanya buruk cyrus sukses membuat penontonnya terganggu dengan suaranya aneh-nya dan juga ekspresinya yang sedatar plot film sepanjang  menit ini tidak ada chemistry yang kuat antara cyrus dan hemsworth juga menambah dafar panjang alasan-alasan untuk membuat film ini tidak layak tonton mungkin satu-satunya yang dapat menjadi hiburan adalah visual dan pemandangan-pemandangan pantai tybee island yang berhasil ditampilkan dengan indah selebihnya tidak ada yang istimewa so jika anda bukan salah satu penggemar berat miley cyrus lebih baik hindari saja film membosankan satu ini ya the last song benar-benar tampil sangat mengecewakan hampir di semua bagian salah satu yang terburuk di tahun  ini', 'dear john tampil greget respon negatif kritikus kali the last song nasibnya berbeda pendahulunya dibilang film dibidani sutradara wanita julie anne robinson film adaptasi novel nicholas spark terburuk plot menarik datar membosankan konfilk-konflik digali serta tempo cepat penyebab-penyebab kegalalan the last song peyebab terbesar pemilihan miley cyrus didapuk pemeran utama film ya film menderita kelemahan-kelemahan teknisnya diperburuk kehadiran pemeran hannah montana aktingnya buruk buruk cyrus sukses penontonnya terganggu suaranya aneh-nya ekspresinya sedatar plot film  menit chemistry kuat cyrus hemsworth menambah dafar alasan-alasan film layak tonton satu-satunya hiburan visual pemandangan-pemandangan pantai tybee island berhasil ditampilkan indah selebihnya istimewa so salah penggemar berat miley cyrus hindari film membosankan ya the last song benar-benar tampil mengecewakan salah terburuk ', 'dear john tampil greget respon negatif kritikus kali the last song nasib beda dahulu bilang film bidan sutradara wanita julie anne robinson film adaptasi novel nicholas spark buruk plot tarik datar bosan konfilk-konflik gali serta tempo cepat penyebab-penyebab kegalalan the last song peyebab besar pemilihan miley cyrus didapuk pemeran utama film ya film derita kelemahan-kelemahan teknis buruk hadir pemeran hannah montana aktingnya buruk buruk cyrus sukses penontonnya ganggu suara aneh-nya ekspresi datar plot film  menit chemistry kuat cyrus hemsworth tambah dafar alasan-alasan film layak tonton satu-satunya hibur visual pemandangan-pemandangan pantai tybee island hasil tampil indah lebih istimewa so salah gemar berat miley cyrus hindar film bosan ya the last song benar-benar tampil kecewa salah buruk '),
(485, 502, 'presentasinya buruk alurnya kelewat lambat di awal-awal dan beberapa repetisi terasa hambar ketimbang menakutkan ini lebih pantas kamu masukan dalam format yang lebih kecil macam ftv atau home video ketimbang film layar lebar tidak peduli ada nama sebesar eli roth di bangku produsernya untung saja selain akhir yang bagus ada akting ashley bell yang kuat dalam menerjemahkan kekompleksan karakter nell dengan segala kerapuhan kondisi mentalnya tetapi sekali lagi ini adalah sekuel maksa yang tidak seharusnya dibuat', 'presentasinya buruk alurnya kelewat lambat awal-awal repetisi hambar ketimbang menakutkan masukan format ftv home video ketimbang film layar lebar peduli nama eli roth bangku produsernya untung bagus akting ashley bell kuat menerjemahkan kekompleksan karakter nell kerapuhan kondisi mentalnya sekuel maksa', 'presentasi buruk alur lewat lambat awal-awal repetisi hambar timbang takut masuk format ftv home video timbang film layar lebar peduli nama eli roth bangku produser untung bagus akting ashley bell kuat terjemah kompleks karakter nell rapuh kondisi mental sekuel maksa'),
(486, 503, 'ya untuk ukuran sebuah horor the intruders jelas gagal melaksanakan tugasnya dengan baik selain naskahnya yang lemah penyutradaraan fresnadillo juga tidak maksimal dengan segala pace lambatnya yang terkesan terseok-seok repetitif dan membosankan termasuk yang paling parah adalah gagal menghadirkan aura menakutkan untuk memberikan teror kepada penontonnya mungkin hanya scoringnya yang bekerja dengan baik untuk mengingatkan kita bahwa ini memang film horor bukan drama tentang anak-anak yang bermasalah dengan tidurnya', 'ya ukuran horor the intruders gagal melaksanakan tugasnya naskahnya lemah penyutradaraan fresnadillo maksimal pace lambatnya terkesan terseok-seok repetitif membosankan parah gagal menghadirkan aura menakutkan teror penontonnya scoringnya film horor drama anak-anak bermasalah tidurnya', 'ya ukur horor the intruders gagal laksana tugas naskah lemah sutradara fresnadillo maksimal pace lambat kesan terseok-seok repetitif bosan parah gagal hadir aura takut teror penontonnya scoringnya film horor drama anak-anak masa tidur'),
(487, 504, 'ironisnya dengan rentetan misteri semenarik itu nakata bisa dibilang gagal membangun tensi suspense alias keteganganya belum lagi saya menyebut beberapa plot hole yang menganggu dari naskah satoshi suzuki yang diadaptasi dari novel milik honobu yonezawa ini meskipun banyak dihiasi dengan kematian mengerikan tapi incite mill tidak pernah mencapai titik didih semestinya untuk sebuah thriller psikologis bahkan bumbu krisis kepercayaan dan survival yang memiliki potensi bagus untuk bisa lebih dieksplorasi juga terasa sedikit hambar bisa jadi itu semua imbas dari banyaknya karakter yang dihadirkan menjadikan pendekatan personal ke masing-masing pesertanya tidak tergali maksimal parahnya lagi ketimbang memasang nama-nama yang kurang dikenal untuk setidaknya dapat menjaga kemurnian misterinya hingga akhir nakata malah memasang nama sebesar tatsuya fujiwara bintang battle royale dan death note untuk dijadikan salah satu konsestan bukan hanya itu fujiwara juga nyaris mendominasi semua scene yang secara tidak langsung sudah membocorkan bahwa karakternya akan bertahan hingga akhir nanti tidak peduli dalam keadaan hidup atau mati bukan suguhan thriller misteri psikologis yang solid apalagi untuk ukuran seorang hideo nakata tapi meskipun banyak didera kekurangan sana-sini setidaknya incite mill yang juga menjadi film peserta inafff  ini masih menarik untuk dijadikan pilihan tontonan apalagi buat anda yang mengandrungi kisah misteri ala agatha christie', 'ironisnya rentetan misteri semenarik nakata dibilang gagal membangun tensi suspense alias keteganganya menyebut plot hole menganggu naskah satoshi suzuki diadaptasi novel milik honobu yonezawa dihiasi kematian mengerikan incite mill mencapai titik didih semestinya thriller psikologis bumbu krisis kepercayaan survival memiliki potensi bagus dieksplorasi hambar imbas banyaknya karakter dihadirkan menjadikan pendekatan personal pesertanya tergali maksimal parahnya ketimbang memasang nama-nama dikenal menjaga kemurnian misterinya nakata memasang nama tatsuya fujiwara bintang battle royale death note dijadikan salah konsestan fujiwara mendominasi scene langsung membocorkan karakternya bertahan peduli hidup mati suguhan thriller misteri psikologis solid ukuran hideo nakata didera kekurangan sana-sini incite mill film peserta inafff  menarik dijadikan pilihan tontonan mengandrungi kisah misteri ala agatha christie', 'ironis rentet misteri semenarik nakata bilang gagal bangun tensi suspense alias keteganganya sebut plot hole menganggu naskah satoshi suzuki adaptasi novel milik honobu yonezawa hias mati erik incite mill capai titik didih mesti thriller psikologis bumbu krisis percaya survival milik potensi bagus eksplorasi hambar imbas banyak karakter hadir jadi dekat personal serta gali maksimal parah timbang memasang nama-nama kenal jaga murni misteri nakata memasang nama tatsuya fujiwara bintang battle royale death note jadi salah konsestan fujiwara dominasi scene langsung bocor karakternya tahan peduli hidup mati suguh thriller misteri psikologis solid ukur hideo nakata dera kurang sana-sini incite mill film serta inafff  tarik jadi pilih tonton mengandrungi kisah misteri ala agatha christie'),
(488, 505, 'kombinasi konsep dongeng modifikasi tanggung petualangan yang tidak terlalu greget romansa gombal dan penyutradaraan lembek dari seorang debutan macam cedric nicolas-troyan yang sebelumnya bertindak sebagai pengawas spesial efek di film pertamanya memang menjadi luka-luka besar buat the huntsman winters war ya ia bisa saja bertambah buruk jika tidak dibantu oleh pesona jajaran pemainnya yang tidak hanya bermodalkan nama-nama besar semata namun juga bermain cukup bagus hemsworth mungkin hanya mengulangi peran lamanya sebagai eric the hunstman yang charming dan tangguh ia ditemani oleh jessica chastain sebagai sara yang juga tampil oke meski karakternya tidak disokong oleh cerita yang kuat tetapi kalau mau jujur saya pribadi lebih terpesona dengan emily blunt sebagai freya si ratu es dengan karakterisasi dan background cerita yang lebih kompleks plus bonusnya dandanan dan pemilihan kostum yang sama kerennya sementara meski hanya tampil sebentar di awal dan akhir film charlize theron kembali mengulangi performa mengerikan seperti di film pertamanya sebagai ravenna yang kejam', 'kombinasi konsep dongeng modifikasi tanggung petualangan greget romansa gombal penyutradaraan lembek debutan cedric nicolas-troyan bertindak pengawas spesial efek film pertamanya luka-luka the huntsman winters war ya bertambah buruk dibantu pesona jajaran pemainnya bermodalkan nama-nama bermain bagus hemsworth mengulangi peran eric the hunstman charming tangguh ditemani jessica chastain sara tampil oke karakternya disokong cerita kuat jujur pribadi terpesona emily blunt freya si ratu es karakterisasi background cerita kompleks plus bonusnya dandanan pemilihan kostum kerennya tampil sebentar film charlize theron mengulangi performa mengerikan film pertamanya ravenna kejam', 'kombinasi konsep dongeng modifikasi tanggung tualang greget romansa gombal sutradara lembek debut cedric nicolas-troyan tindak awas spesial efek film pertama luka-luka the huntsman winters war ya tambah buruk bantu pesona jajar main modal nama-nama main bagus hemsworth ulang peran eric the hunstman charming tangguh teman jessica chastain sara tampil oke karakternya sokong cerita kuat jujur pribadi pesona emily blunt freya si ratu es karakterisasi background cerita kompleks plus bonus dandan pemilihan kostum keren tampil bentar film charlize theron ulang performa erik film pertama ravenna kejam'),
(489, 506, 'lemah di plot dan didukung dengan penyajiannya yang serba nanggung dan sangat predictable membuat the human centipede sudah kalah di bagian yang bisa dibilang cukup vital ini dan hal itu masih diperparah dengan minimnya adegan gore dan disturbing yang ternyata juga tidak ditampilkan secara eksplisit salah satunya adalah adegan operasi yang sebelumnya dikira bakal di shoot habis habisan dan berdarah darah ternyata hanya tampil sekilas dan jauh dari sadis atau menjijikkan ', 'lemah plot didukung penyajiannya serba nanggung predictable the human centipede kalah dibilang vital diperparah minimnya adegan gore disturbing ditampilkan eksplisit salah satunya adegan operasi shoot habis habisan berdarah darah tampil sekilas sadis menjijikkan ', 'lemah plot dukung saji serba nanggung predictable the human centipede kalah bilang vital parah minim adegan gore disturbing tampil eksplisit salah satu adegan operasi shoot habis habis darah darah tampil kilas sadis jijik '),
(490, 507, 'ini bisa dibilang adalah seri terburuk paling mengecewakan tidak hanya punya kualitas narasi palik jelek namun six memindahkan jalurnya dari hororthriller ke ranah dark comedy yang sedikit banyak sudah menghilangkan kesan seriusnya hasilnya final sequence seperti parade sirkus bodoh yang dipimpin oleh cast dan plot yang sama bodohnya tidak seperti di seri pertamanya dieter laser tidak lagi memancarkan aroma angker sebaliknya ia seperti badut reot berseragam yang kerap berteriak dan bersumpah serapah tidak jelas mengacungkan sejata kemana-mana membunuh sementara laurence r harvey pun tidak kalah buruknya memang tidak menampilkan akting kelas oscar namun melihat six sudah membuat pemampilannya begitu berbeda dengan karakternya di full sequence jelas mengecewakan ', 'dibilang seri terburuk mengecewakan kualitas narasi palik jelek six memindahkan jalurnya hororthriller ranah dark comedy menghilangkan kesan seriusnya hasilnya final sequence parade sirkus bodoh dipimpin cast plot bodohnya seri pertamanya dieter laser memancarkan aroma angker badut reot berseragam kerap berteriak bersumpah serapah mengacungkan sejata kemana-mana membunuh laurence r harvey kalah buruknya menampilkan akting kelas oscar six pemampilannya berbeda karakternya full sequence mengecewakan ', 'bilang seri buruk kecewa kualitas narasi palik jelek six memindahkan jalur hororthriller ranah dark comedy hilang kesan serius hasil final sequence parade sirkus bodoh pimpin cast plot bodoh seri pertama eter laser memancarkan aroma angker badut reot berseragam kerap teriak sumpah serapah acung sejata kemana-mana bunuh laurence r harvey kalah buruk tampil akting kelas oscar six pemampilannya beda karakternya full sequence kecewa '),
(491, 508, 'jika di seri pertamanya kita banyak menemukan hal-hal pendukung yang hilang seperti darah ataupun kotoran manusia di sini saya pastikan six akan memenuhi permintaan para penontonnya akan ada lebih banyak jeritan kesakitan ketika seorang tukang parkir psikopat yang sama sekali tidak memiliki pengalaman medis menusukan pisau dapur yang kotor di bokong para korbannya atau disaat ia merontokkan satu per satu gigi mereka dengan palu setelah sebelumnya pria pendiam satu ini membius mereka apa yang dilakukan martin lomax disini terangkai dalam gambar-gambar yang cukup frontal dan tidak bermoral nyaris tanpa sensor membuat penonton yang lemah hati bisa jadi akan dibuat sakit jantung dan mual', 'seri pertamanya menemukan hal-hal pendukung hilang darah kotoran manusia pastikan six memenuhi permintaan penontonnya jeritan kesakitan tukang parkir psikopat memiliki pengalaman medis menusukan pisau dapur kotor bokong korbannya disaat merontokkan gigi palu pria pendiam membius martin lomax terangkai gambar-gambar frontal bermoral sensor penonton lemah hati sakit jantung mual', 'seri pertama temu hal-hal dukung hilang darah kotor manusia pasti six memenuhi minta penontonnya jerit sakit tukang parkir psikopat milik alam medis tusuk pisau dapur kotor bokong korban saat rontok gigi palu pria diam bius martin lomax angka gambar-gambar frontal moral sensor penonton lemah hati sakit jantung mual'),
(492, 509, 'tetapi di balik segala sumber dayanya yang mewah dan pesan kepahlawanan yang luar biasa itu tidak sulit untuk mengatakan bahwa the himalayas adalah sebuah drama cengeng yang konyol kenapa konyol pikir saja secara logika sehat misi membawa pulang jenazah dari puncak everest yang mematikan bisa dibilang adalah sebuah tindakan bunuh diri yang bodoh dan tidak masuk akal coba saja kamu tanyakan kepada pendaki profesional paling hebat sekalipun saya berani bertaruh ia tidak akan berpikir dua kali untuk menolaknya', 'sumber dayanya mewah pesan kepahlawanan sulit the himalayas drama cengeng konyol konyol pikir logika sehat misi membawa pulang jenazah puncak everest mematikan dibilang tindakan bunuh bodoh masuk akal coba pendaki profesional hebat berani bertaruh berpikir kali menolaknya', 'sumber daya mewah pesan pahlawan sulit the himalayas drama cengeng konyol konyol pikir logika sehat misi bawa pulang jenazah puncak everest mati bilang tindak bunuh bodoh masuk akal coba pendak profesional hebat berani taruh pikir kali tolak'),
(493, 510, 'mungkin the hangover  lalu sudah membuat batasan begitu tinggi bagi phillips yang membuatnya kesulitan untuk melanjutkannya ke sekuel-sekuel selanjutnya yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya dan the hangover part iii yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus namun setidaknya ini masih lebih baik ketimbang part deux yang malas itu', 'the hangover  batasan phillips membuatnya kesulitan melanjutkannya sekuel-sekuel kepercayaan bencana seri the hangover part iii dipaksakan dilanjutkan penutup sekuel bagus ketimbang part deux malas', 'the hangover  batas phillips buat sulit lanjut sekuel-sekuel percaya bencana seri the hangover part iii paksa lanjut penutup sekuel bagus timbang part deux malas'),
(494, 511, 'eli roth memang belum pernah membuat horor-horor yang luar biasa bagus dalam hal bercerita dalam kasus the green inferno roth memulainya dengan banyak basa-basi tak perlu yang terlalu lama dipenuhi narasi dan karakterisasi cheesy tetapi jika kamu hanya ingin sekedar mencari hiburan sederhana dalam bentuk blood and gore dengan sedikit bumbu humor gelap yang efektif maka kamu sudah berada di tangan orang yang tepat ', 'eli roth horor-horor bagus bercerita the green inferno roth memulainya basa-basi dipenuhi narasi karakterisasi cheesy sekedar mencari hiburan sederhana bentuk blood and gore bumbu humor gelap efektif tangan orang ', 'eli roth horor-horor bagus cerita the green inferno roth mulai basa-basi penuh narasi karakterisasi cheesy sekedar cari hibur sederhana bentuk blood and gore bumbu humor gelap efektif tang orang '),
(495, 512, 'ya the giver jelas punya modal kuat dari novelnya tetapi michael mitnick dan robert b weide rupanya memilih untuk bermain aman dengan banyak memangkas segalanya menyederhanakan narasi kompleksnya membuang bagian-bagian penting untuk dijadikan tontonan yang benar-benar terasa seperti sebuah sajian young adult klise nan cheesy ala hollywood ketimbang fiksi ilmiah pintar yang dipenuhi dengan kedalaman metafora filosofi dan sindiran sosial ya sayang memang setelah seperempat durasi awal yang cukup menyakinkan lengkap dengan sebuah proses perubahan warna ala pleasentville the giver jatuh menjadi tontonan sci-fi remaja tumpul yang terlalu panjang dan membosankan oleh beberapa momen tak perlu yang seperti diulang-ulang lalu ada banyak casting bagus yang terasa mubazir karena minimnya porsi yang diberikan', 'ya the giver modal kuat novelnya michael mitnick robert b weide memilih bermain aman memangkas menyederhanakan narasi kompleksnya membuang bagian-bagian dijadikan tontonan benar-benar sajian young adult klise nan cheesy ala hollywood ketimbang fiksi ilmiah pintar dipenuhi kedalaman metafora filosofi sindiran sosial ya sayang seperempat durasi menyakinkan lengkap proses perubahan warna ala pleasentville the giver jatuh tontonan sci-fi remaja tumpul membosankan momen diulang-ulang casting bagus mubazir minimnya porsi', 'ya the giver modal kuat novel michael mitnick robert b weide memilih main aman mangkas sederhana narasi kompleks buang bagian-bagian jadi tonton benar-benar saji young adult klise nan cheesy ala hollywood timbang fiksi ilmiah pintar penuh dalam metafora filosofi sindir sosial ya sayang seperempat durasi menyakinkan lengkap proses ubah warna ala pleasentville the giver jatuh tonton sci-fi remaja tumpul bosan momen diulang-ulang casting bagus mubazir minim porsi'),
(496, 513, 'kesalahan pertama sebagai gelaran horor ia tidak terlalu menakutkan ya itu fatal karena tugas utama sebuah horor adalah memberimu teror mental melalui audio dan visualnya memang sinematografer mattias troelstrup sudah bekerja dengan baik menghadirkan visual suram dan misterius aokigahara yang sebenarnya disyut di taman nasional tara di serbia mengingat lokasi nyata aokigahara terlarang untuk umum masalahnya kurangnya informasi dan sentuhan budaya setempat perlahan membuat kita lupa bahwa ini adalah hutan aokigahara kita tidak lagi memedulikan hutan di mana karakater dormer berlari-lari tak jelas ke sana kemari kesan creepy yang sebenarnya sudah dihadirkan dengan baik di awal-awal ketika tokoh sara mulai memasuki aokigahara menguap pelan-pelan digantikan dengan parade jump scare yang lebih banyak miss ketimbang hit implentasi psikologis bisa dibilang gagal total dalam memberikan sebuah pengalaman horor yang kompleks hasilnya terlebih dengan ending yang terlalu mudah diprediksi the forest tidak lebih dari sebuah horor medioker yang berlindung di balik premis kisah nyatanya yang harus diakui jauh lebih mampu membuatmu bergidik', 'kesalahan gelaran horor menakutkan ya fatal tugas utama horor memberimu teror mental audio visualnya sinematografer mattias troelstrup menghadirkan visual suram misterius aokigahara disyut taman nasional tara serbia lokasi nyata aokigahara terlarang kurangnya informasi sentuhan budaya perlahan lupa hutan aokigahara memedulikan hutan karakater dormer berlari-lari kemari kesan creepy dihadirkan awal-awal tokoh sara memasuki aokigahara menguap pelan-pelan digantikan parade jump scare miss ketimbang hit implentasi psikologis dibilang gagal total pengalaman horor kompleks hasilnya ending mudah diprediksi the forest horor medioker berlindung premis kisah diakui membuatmu bergidik', 'salah gelar horor takut ya fatal tugas utama horor beri teror mental audio visual sinematografer mattias troelstrup hadir visual suram misterius aokigahara disyut taman nasional tara serbia lokasi nyata aokigahara larang kurang informasi sentuh budaya perlahan lupa hutan aokigahara memedulikan hutan karakater dormer berlari-lari kemari kesan creepy hadir awal-awal tokoh sara masuk aokigahara uap pelan-pelan ganti parade jump scare miss timbang hit implentasi psikologis bilang gagal total alam horor kompleks hasil ending mudah prediksi the forest horor medioker lindung premis kisah aku buat gidik'),
(497, 514, 'the flowers of war jelas bukan pencapaian terbaik seorang zhang yimou narasinya tidak sekuat temanya tidak ada emosi yang dalam kecuali anda adalah penonton oversensitif hanya ada gambar-gambar bagus dan adengan perang hebat di  menit pertamanya dan christian bale dengan akting pas-pasan jauh jika dibandingkan karya-karya hebat yimaou yang lain macam raise the red lantern hero atau to live yang luar biasa itu mengecewakan memang untuk ukuran yimaou tapi setidaknya saya masih bisa menikmatinya hingga akhir', 'the flowers of war pencapaian terbaik zhang yimou narasinya sekuat temanya emosi kecuali penonton oversensitif gambar-gambar bagus adengan perang hebat  menit pertamanya christian bale akting pas-pasan dibandingkan karya-karya hebat yimaou raise the red lantern hero to live mengecewakan ukuran yimaou menikmatinya', 'the flowers of war capai baik zhang yimou narasi kuat tema emosi kecuali penonton oversensitif gambar-gambar bagus adengan perang hebat  menit pertama christian bale akting pas-pasan banding karya-karya hebat yimaou raise the red lantern hero to live kecewa ukur yimaou nikmat'),
(498, 515, 'berbeda dengan dua seri sebelumnya seri ketiganya ini mungkin akan sedikit mengecewakan karena beberapa hal pertama ia kembali mengulang formula plot yang sama semuanya persis seperti yang sudah pernah kamu lihat dimulai dengan opening heboh misi yang gagal dan ditutup dengan pembalasan yang setimpal lengkap dengan guyonan-guyonan one liner-nya kedua ia kembali menjadi terlalu serius dan lembek padahal seri ke-dua nya sempat berhasil tampil lepas menghamburkan komedi dan aksinya dengan porsi sama asiknya menjadi tontonan aksi yang super gila-gilaan ketiga dengan memilih untuk menurunkan ratingnya menjadi pg- segala kekerasannya disunat habis-habisan tidak ada lagi darah bermuncratan kepala pecah dan anggota tubuh yang terlepas ya ini seperti the expendebles versi disney', 'berbeda seri seri ketiganya mengecewakan mengulang formula plot persis lihat opening heboh misi gagal ditutup pembalasan setimpal lengkap guyonan-guyonan one liner-nya serius lembek seri ke-dua nya berhasil tampil lepas menghamburkan komedi aksinya porsi asiknya tontonan aksi super gila-gilaan ketiga memilih menurunkan ratingnya pg- kekerasannya disunat habis-habisan darah bermuncratan kepala pecah anggota tubuh terlepas ya the expendebles versi disney', 'beda seri seri tiga kecewa ulang formula plot persis lihat opening heboh misi gagal tutup balas timpal lengkap guyonan-guyonan one liner-nya serius lembek seri ke-dua nya hasil tampil lepas hambur komedi aksi porsi asiknya tonton aksi super gila-gilaan tiga memilih turun ratingnya pg- kerasan sunat habis-habisan darah muncrat kepala pecah anggota tubuh lepas ya the expendebles versi disney'),
(499, 516, 'untuk sebuah film yang berlebel romansa  the disappearance of eleanor rigby terasa begitu dingin di balik segala kehangatan sinematografinya tidak hanya kontennya namun bagaimana beson mempersentasikan narasinya juga begitu depresif plotnya seperti berjalan terseok-seok terasa begitu lama dan menjemukan terlebih beson memilih untuk membiarkan kedukaanya bertahan begitu panjang dan terkesan repetitif tanpa memberi solusi bagaimana karakter di dalamnya berusaha menyembuhkan diri mereka', 'film berlebel romansa  the disappearance of eleanor rigby dingin kehangatan sinematografinya kontennya beson mempersentasikan narasinya depresif plotnya berjalan terseok-seok menjemukan beson memilih membiarkan kedukaanya bertahan terkesan repetitif solusi karakter dalamnya berusaha menyembuhkan', 'film berlebel romansa  the disappearance of eleanor rigby dingin hangat sinematografi konten beson mempersentasikan narasi depresif plot jalan terseok-seok jemu beson memilih biar kedukaanya tahan kesan repetitif solusi karakter dalam usaha sembuh'),
(500, 517, 'para cast dimana semuanya perempuan juga tampil tidak mengecewakan mereka tidak hanya bermodalkan tampang cantik yang bisanya cuma teriak saja karakter mereka juga berkembang seiring berjalannya film sayang dibeberapa adegan banyak hal yang sepertinya dipaksakan dan sedikit tidak masuk akal para  mahluk  juga digambarkan terlalu sederhana kurang cukup menakutkan namun setidaknya kekurangan tersebut ditutup dengan ending yang menurut saya cukup keren walau sepertinya agak sedikit memaksa', 'cast dimana perempuan tampil mengecewakan bermodalkan tampang cantik bisanya teriak karakter berkembang seiring berjalannya film sayang dibeberapa adegan dipaksakan masuk akal  mahluk  digambarkan sederhana menakutkan kekurangan ditutup ending keren memaksa', 'cast mana perempuan tampil kecewa modal tampang cantik bisa teriak karakter kembang iring jalan film sayang beberapa adegan paksa masuk akal  mahluk  gambar sederhana takut kurang tutup ending keren memaksa'),
(501, 518, 'memang skalanya dinaikan menjadi lebih besar dalam artian ada pabrik terbengkalai tempat si kolekter bersemayam sebagai setnya dan tentu saja masih ada jebakan-jebakan maut penuai nyawa yang muktakhir lihat adegan pembantaian di diskotik itu dan jujur lebih banyak darah dan tubuh tercabik tetapi kamu tidak akan menemukan lagi kadar suspense yang terjaga baik seperti pada film pertamanya yang terjadi di the collection adalah ia nampak terlalu berupaya seperti saw namun gagal ia kemudian juga menjadi terlalu action membuang banyak ketegangan dan keintiman personalnya termasuk terlalu berfokus pada jebakan-jebakan dan gore-nya ketimbang unsur survivor yang dihadirkan karakternya dan itu bisa menjadi sangat menghibur namun jelas ia juga sudah kehilangan banyak elemen horornya yang membuat tensinya jauh menurun ketimbang pendahulunya tidak seintens the collector yang sempit tetapi ini bukan sekuel yang buruk mengingat banyak hal yang coba ditingkatan dunstan di sini dari setting karakter dan bumbu gore yang semakin banyak sayang naskahnya tidak mengalami perkembangan berarti ketegangan berkurang drastis karena dunstan lebih banyak bermain pada area aksi ketimbang membangun pondasi horornya dengan kuat dan dari ending-nya sepertinya ini akan menjadi franchise horor baru', 'skalanya dinaikan artian pabrik terbengkalai si kolekter bersemayam setnya jebakan-jebakan maut penuai nyawa muktakhir lihat adegan pembantaian diskotik jujur darah tubuh tercabik menemukan kadar suspense terjaga film pertamanya the collection nampak berupaya saw gagal action membuang ketegangan keintiman personalnya berfokus jebakan-jebakan gore-nya ketimbang unsur survivor dihadirkan karakternya menghibur kehilangan elemen horornya tensinya menurun ketimbang pendahulunya seintens the collector sempit sekuel buruk coba ditingkatan dunstan setting karakter bumbu gore sayang naskahnya mengalami perkembangan ketegangan berkurang drastis dunstan bermain area aksi ketimbang membangun pondasi horornya kuat ending-nya franchise horor', 'skala naik arti pabrik bengkalai si kolekter semayam set jebakan-jebakan maut penuai nyawa muktakhir lihat adegan bantai diskotik jujur darah tubuh cabik temu kadar suspense jaga film pertama the collection nampak upaya saw gagal action buang tegang intim personal fokus jebakan-jebakan gore-nya timbang unsur survivor hadir karakternya hibur hilang elemen horor tensi turun timbang dahulu intens the collector sempit sekuel buruk coba tingkat dunstan setting karakter bumbu gore sayang naskah alami kembang tegang kurang drastis dunstan main area aksi timbang bangun pondasi horor kuat ending-nya franchise horor'),
(502, 519, 'trailernya menarik seperti menjanjikan tontonan spy thriller konspirasi tingkat tinggi yang seru ala trilogi bourne tapi fakta di lapangan berkata lain the cold light of day tidak lebih seperti sebuah b movie dengan bintang kelas satu dari seorang sutradara medioker mabrouk el mechri yang sebelumnya juga pernah membuat jcvd semi-biografi aktor laga lawas jean-claude van damme ya ini seperti parodi buruk dari bourne melihat si bakal manusia baja henry cavill berlari ke sana kemari di lorong-lorong kota madrid dan di kejar-kejar oleh pihak-pihak yang ingin membunhnya seharusnya bisa menjadi sajian pemacu adrenalin yang mendebarkan sayang el mechri tidak lihai menghadirkannya setiap momennya terasa sangat lembek dan datar tidak peduli seberapa keras scoring lucas vidal memacunya tidak peduli ada dua gaek bruce wills dan sigourney weaver di sini rangkaian plot hole dan naskahnya yang buruk juga menjadi salah satu faktor yang menghancurkannya', 'trailernya menarik menjanjikan tontonan spy thriller konspirasi tingkat seru ala trilogi bourne fakta lapangan the cold light of day b movie bintang kelas sutradara medioker mabrouk el mechri jcvd semi-biografi aktor laga lawas jean-claude van damme ya parodi buruk bourne si manusia baja henry cavill berlari kemari lorong-lorong kota madrid kejar-kejar pihak-pihak membunhnya sajian pemacu adrenalin mendebarkan sayang el mechri lihai menghadirkannya momennya lembek datar peduli keras scoring lucas vidal memacunya peduli gaek bruce wills sigourney weaver rangkaian plot hole naskahnya buruk salah faktor menghancurkannya', 'trailer tarik janji tonton spy thriller konspirasi tingkat seru ala trilogi bourne fakta lapang the cold light of day b movie bintang kelas sutradara medioker mabrouk el mechri jcvd semi-biografi aktor laga lawas jean-claude v damme ya parodi buruk bourne si manusia baja henry cavill lari kemari lorong-lorong kota madrid kejar-kejar pihak-pihak membunhnya saji pemacu adrenalin debar sayang el mechri lihai hadir momen lembek datar peduli keras scoring lucas vidal memacunya peduli gaek bruce wills sigourney weaver rangkai plot hole naskah buruk salah faktor hancur'),
(503, 520, 'semuanya berjalan lancar sampai kemudian klimaksnya menjadi terlalu familiar dan dipaksakan tanpa perlu menjadi jenius kita sudah tahu apa yang akan terjadi dan seberapa kerasnya usaha anderson untuk membuat endingnya terlihat berbeda toh itu tidak terlalu berhasil but still the call adalah tontonan crime thriller menyenangkan tidak terlalu berat namun juga tidak sampai menjadi terlalu bodoh helle berry bermain kuat sebagai operator  sementara breslin juga tidak buruk', 'berjalan lancar klimaksnya familiar dipaksakan jenius kerasnya usaha anderson endingnya berbeda berhasil but still the call tontonan crime thriller menyenangkan berat bodoh helle berry bermain kuat operator  breslin buruk', 'jalan lancar klimaks familiar paksa jenius keras usaha anderson endingnya beda hasil but still the call tonton crime thriller senang berat bodoh helle berry main kuat operator  breslin buruk'),
(504, 521, 'tidak ada masalah dengan kualitas akting para pemainnya hampir semuanya bermain bagus bahkan untuk peran yang terkecil sekalipun yang menjadi masalah adalah narasinya yang tidak terlalu kuat itu terlalu banyak bergantung dengan kisah-kisah di luar gedung putih mungkin saja cerita aslinya terlalu membosankan dan tidak menarik sampai-sampai lee daniels bersama strong harus banyak melakukan permak sana sini dengan mengandalkan banyak sisipan sejarah yang dipaksa untuk dimasukan dan dikait-kaitkan dengan karkater cecil dalam kasus ini melalui putrannya louis si pemberontak untuk membuat the butler lebih bisa bergerak ke mana-manan ketimbang terjebak dalam rutinitas seorang pelayan sayang itu membuat fokus filmnya menjadi terlalu melebar ke mana mana', 'kualitas akting pemainnya bermain bagus peran terkecil narasinya kuat bergantung kisah-kisah gedung putih cerita aslinya membosankan menarik lee daniels strong permak mengandalkan sisipan sejarah dipaksa dimasukan dikait-kaitkan karkater cecil putrannya louis si pemberontak the butler bergerak mana-manan ketimbang terjebak rutinitas pelayan sayang fokus filmnya melebar', 'kualitas akting main main bagus peran kecil narasi kuat gantung kisah-kisah gedung putih cerita asli bosan tarik lee daniels strong permak andal sisip sejarah paksa masuk dikait-kaitkan karkater cecil putrannya louis si berontak the butler gerak mana-manan timbang jebak rutinitas layan sayang fokus film lebar'),
(505, 522, 'dalam perjalanannya misteri yang tampak menjanjikan di awal film berangsur-angsur menguap dan kehilangan daya cengkeramannya jangan salah dari segi akting lauren cohan sendiri tampil baik sama ketika natalie dormer menjadi bintang di the forest namun sayang bell membuat karakternya menjadi terlihat bodoh dengan pemilihan dialog dan pengambilan keputusan yang konyol sementara pencarian petunjuk dan penemuan fakta-fakta dari masa lalu seperti menjadi terbuang percuma ketika twist yang dihadirkan bell malah berakhir antiklimaks', 'perjalanannya misteri menjanjikan film berangsur-angsur menguap kehilangan daya cengkeramannya salah segi akting lauren cohan tampil natalie dormer bintang the forest sayang bell karakternya bodoh pemilihan dialog pengambilan keputusan konyol pencarian petunjuk penemuan fakta-fakta terbuang twist dihadirkan bell antiklimaks', 'jalan misteri janji film berangsur-angsur uap hilang daya cengkeram salah segi akting lauren cohan tampil natalie dormer bintang the forest sayang bell karakternya bodoh pemilihan dialog ambil putus konyol cari tunjuk penemuan fakta-fakta buang twist hadir bell antiklimaks'),
(506, 523, 'menderita cukup hebat pada pembukannya dengan segala konflik motivasi dan sub plot yang cukup membuat penontonnya bertanya-tanya the berlin file mulai sedikit membaik ketika seung-wa kemudian mengurangi segala kerumitannya di pertengahan film menjadikannya jauh lebih sederhana bersama melodrama dan suspense khas korea selatan yang dibungkus dengan adegan-adegan aksi cepat dan berkelas mungkin susah untuk menyebutnya sebagai bourne-nya korea selatan tetapi setidaknya seung-wa sudah mencoba menghadirkan sesuatu yang berbeda meskipun yah tidak sesuai ekspektasi', 'menderita hebat pembukannya konflik motivasi sub plot penontonnya the berlin file membaik seung-wa mengurangi kerumitannya pertengahan film menjadikannya sederhana melodrama suspense khas korea selatan dibungkus adegan-adegan aksi cepat berkelas susah menyebutnya bourne-nya korea selatan seung-wa mencoba menghadirkan berbeda yah sesuai ekspektasi', 'derita hebat bukan konflik motivasi sub plot penontonnya the berlin file baik seung-wa urang kerumit tengah film jadi sederhana melodrama suspense khas korea selatan bungkus adegan-adegan aksi cepat las susah sebut bourne-nya korea selatan seung-wa coba hadir beda yah suai ekspektasi'),
(507, 524, 'seperti yang sudah dijelaskan sedikit diatas film ini memang hanya sebatas menjual premis dan dua nama besar pemainnya saja terlihat dari bagaimana ketidakmampuan ravich memperpanjang premis tersebut menjadi sebuah plot yang solid dan menarik alih-alih tampil kuat the astronauts wife malah tampil dengan segala kedangkalan cerita dan lubang-lubang besar disepanjang  menit yang membuat misteri-misteri yang dihadirkan menjadi terasa hambar belum lagi ending yang buruk dan klise semakin membuat film ini terasa seperti thriller murahan yang hanya mengumbar banyak adegan tidak perlu yang semata-mata hanya agar membuat film ini terlihat sebagai sebuah film thriller', 'diatas film sebatas menjual premis nama pemainnya ketidakmampuan ravich memperpanjang premis plot solid menarik alih-alih tampil kuat the astronauts wife tampil kedangkalan cerita lubang-lubang disepanjang  menit misteri-misteri dihadirkan hambar ending buruk klise film thriller murahan mengumbar adegan film film thriller', 'atas film batas jual premis nama main ketidakmampuan ravich panjang premis plot solid tarik alih-alih tampil kuat the astronauts wife tampil dangkal cerita lubang-lubang disepanjang  menit misteri-misteri hadir hambar ending buruk klise film thriller murah umbar adegan film film thriller'),
(508, 525, 'the accused punya modal yang bagus untuk menjadikan dirinya sebuah drama pengadilan yang solid apalagi ia punya jodie foster yang tampil baik sayang kenyataannya tidak penyutradaraan dan naskah yang terlalu datar dan klise membuatnya tidak mampu meninggalkan kesan satu-satunya yang mungkin akan anda ingat adalah adegan mengerikan yang terjadi di atas mesin pinball itu', 'the accused modal bagus menjadikan drama pengadilan solid jodie foster tampil sayang kenyataannya penyutradaraan naskah datar klise membuatnya meninggalkan kesan satu-satunya adegan mengerikan mesin pinball', 'the accused modal bagus jadi drama adil solid jodie foster tampil sayang nyata sutradara naskah datar klise buat tinggal kesan satu-satunya adegan erik mesin pinball'),
(509, 526, 'tetapi kegembiraan itu tidak berlangsung lama dengan cepat setelah paruh pertama berakhir the th wave memasuki bagian paling buruknya tercebur dalam kubangan drama remaja dengan segala romantika picisan yang kelewat familiar tidak hanya terasa generik namun sangat payah bagaimana cassie sampai jatuh hati dengan evan walker alex roe penyelamat hidupnya yang misterius juga tidak pernah melewati sebuah proses yang wajar terjadi begitu cepat hanya dengan sedikit obrolan dengan mudah benci berubah menjadi cinta segampang membalikan telapak tangan', 'kegembiraan cepat paruh the th wave memasuki buruknya tercebur kubangan drama remaja romantika picisan kelewat familiar generik payah cassie jatuh hati evan walker alex roe penyelamat hidupnya misterius melewati proses wajar cepat obrolan mudah benci berubah cinta segampang membalikan telapak tangan', 'gembira cepat paruh the th wave masuk buruk cebur kubang drama remaja romantika picis lewat familiar generik payah cassie jatuh hati evan walker alex roe selamat hidup misterius lewat proses wajar cepat obrol mudah benci ubah cinta gampang balik telapak tang'),
(510, 527, 'seperti dua sisi koin begitu banyak twist bisa jadi menyenangkan namun di sisi lain juga bisa menjadi bumerang ketika ternyata focus menjadi teralalu asik memusatkan segalanya pada elemen kejutannya terlalu banyak tipu sana tipu sini sehingga penontonnya mungkin tidak tahu lagi bagaimana harus mempercayai jalan ceritanya yang bisa dipastikan selalu ada rekayasa baru selalu ada desain bohong lagi yang ironisnya terasa repetitif dan menjadi mudah tertebak langkah demi langkahnya ujung-ujungnya focus menjadi tidak sefokus judulnya tidak mengerti tujuannya tidak mengerti apa yang sebenarnya ingin dicapai karena terlalu sibuk mempertontonkan trik-triknya muktakhirnya dari awal sampai akhir sementara kadar romansa dan komedinya sendiri tidak pernah benar-benar disentuh dengan baik meskipun harus diakui pesona besar smith dan robbie masih mampu memberikan penampilan dan chemistry mereka dengan cukup intim', 'sisi koin twist menyenangkan sisi bumerang focus teralalu asik memusatkan elemen kejutannya tipu tipu penontonnya mempercayai jalan ceritanya rekayasa desain bohong ironisnya repetitif mudah tertebak langkah langkahnya ujung-ujungnya focus sefokus judulnya mengerti tujuannya mengerti dicapai sibuk mempertontonkan trik-triknya muktakhirnya kadar romansa komedinya benar-benar disentuh diakui pesona smith robbie penampilan chemistry intim', 'sisi koin twist senang sisi bumerang focus teralalu asik memusatkan elemen kejut tipu tipu penontonnya percaya jalan cerita rekayasa desain bohong ironis repetitif mudah tebak langkah langkah ujung-ujungnya focus fokus judul erti tuju erti capai sibuk tonton trik-triknya muktakhirnya kadar romansa komedi benar-benar sentuh aku pesona smith robbie penampilan chemistry intim'),
(511, 528, 'mungkin teknis mokumentarinya kacau dan naskahnya juga sama berantakannya dengan presentasi ala dokumenternya yang terlalu memusingkan tetapi pada dasarnya frankensteins army memang dimaksudkan sebagai tontonan yang ringan ia tidak pernah terlalu serius namun masih sanggup memberikanmu sebuah keasikan horor found footage indie orisnil dengan sekarung potongan tubuh galonan darah segar dan sajian utamanya monster-monster keren mematikan', 'teknis mokumentarinya kacau naskahnya berantakannya presentasi ala dokumenternya memusingkan dasarnya frankensteins army tontonan ringan serius sanggup memberikanmu keasikan horor found footage indie orisnil sekarung potongan tubuh galonan darah segar sajian utamanya monster-monster keren mematikan', 'teknis mokumentarinya kacau naskah berantak presentasi ala dokumenter memusingkan dasar frankensteins army tonton ringan serius sanggup berik asi horor found footage indie orisnil karung potong tubuh galon darah segar saji utama monster-monster keren mati');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(512, 529, 'ketimbang menanganinya sendiri besson mendapuk olivier megaton sutradara yang sebelumnya pernah bekerja sama dengannya dalam transporter  untuk membidani filmnya satu ini sementara ia duduk di bangku produser dan penulis naskah sayangnya ini bukan salah satu yang terbaik dari soerang luc besson skrip lemah penuh lubang sana-sani subplot romansanya yang konyol karakterisasi yang seharusnya bisa berekmbang lebih baik peran-peran yang mubazir dan penyutradaraan yang payah dari megaton membuat colombiana babak belur bak sajian action kelas dua bahkan from paris with love yang konon dikatakan sebagai salah satu film terburuk besson saja masih jauh lebih meyenangkan dari pada menikmati  menit colombiana jadi meskipun ia terlihat bergerak begitu cepat dan banyak mengobral rangkaian momen aksinya dari menit awal bergulir colombiana sebenarnya termasuk film yang membosankan', 'ketimbang menanganinya besson mendapuk olivier megaton sutradara dengannya transporter  membidani filmnya duduk bangku produser penulis naskah sayangnya salah terbaik soerang luc besson skrip lemah penuh lubang sana-sani subplot romansanya konyol karakterisasi berekmbang peran-peran mubazir penyutradaraan payah megaton colombiana babak belur bak sajian action kelas from paris with love konon salah film terburuk besson meyenangkan menikmati  menit colombiana bergerak cepat mengobral rangkaian momen aksinya menit bergulir colombiana film membosankan', 'timbang menanganinya besson mendapuk olivier megaton sutradara dengan transporter  bidan film duduk bangku produser penulis naskah sayang salah baik soerang luc besson skrip lemah penuh lubang sana-sani subplot romansa konyol karakterisasi berekmbang peran-peran mubazir sutradara payah megaton colombiana babak belur bak saji action kelas from paris with love konon salah film buruk besson meyenangkan nikmat  menit colombiana gerak cepat obral rangkai momen aksi menit gulir colombiana film bosan'),
(513, 530, 'cerita standar kengerian yang minim darah dan kesadisan yang kelewat sedikit dan karakter yang tidak dipoles dengan baik serta penyajian ala kadarnya crush tampak seperti sinetron thriller yang tumpul dan membosankan usaha untuk membuatnya menjadi berbeda dengan memunculkan twist di klimaksnya juga gagal ya ini seperti tontonan thriller buat anak-anak bahkan posternya saja sudah membocorkan semuanya', 'cerita standar kengerian minim darah kesadisan kelewat karakter dipoles serta penyajian ala kadarnya crush sinetron thriller tumpul membosankan usaha membuatnya berbeda memunculkan twist klimaksnya gagal ya tontonan thriller anak-anak posternya membocorkan', 'cerita standar ngeri minim darah sadis lewat karakter poles serta saji ala kadar crush sinetron thriller tumpul bosan usaha buat beda muncul twist klimaks gagal ya tonton thriller anak-anak poster bocor'),
(514, 531, 'mungkin tidak terlalu kuat di sektor naskahnya tetapi pengaruh eropa yang tenang plus sedikit suspense dan drama yang dibawa oplev untuk membungkus setiap momennya membuat dead man down mampu tampil menghayutkan yang sayangnya harus dirusak oleh endingnya yang terlalu hollywood ya klimaks di penghujungnya menjadikan dead man down seperti dua film yang berbeda begitu tenang dan terlihat solid di hampir keselurhan tetapi penutupnya seperti membuang segala hal-hal yang bagus itu ke tempat sampah dan menghacurkan dirinya sendiri', 'kuat sektor naskahnya pengaruh eropa tenang plus suspense drama dibawa oplev membungkus momennya dead man down tampil menghayutkan sayangnya dirusak endingnya hollywood ya klimaks penghujungnya menjadikan dead man down film berbeda tenang solid keselurhan penutupnya membuang hal-hal bagus sampah menghacurkan', 'kuat sektor naskah pengaruh eropa tenang plus suspense drama bawa oplev bungkus momen dead man down tampil menghayutkan sayang rusak endingnya hollywood ya klimaks hujung jadi dead man down film beda tenang solid keselurhan penutupnya buang hal-hal bagus sampah menghacurkan'),
(515, 532, 'tentu saja tidak ada situs seperti death tube di dunia nyata dan saya bersyukur karena itu tidak pernah bisa membayangkan jika ada orang sesakit itu yang tega membunuh manusia lain bahkan sampai kemudian mempertontonkan tindakan biadabnya itu secara live lewat internet nah berbekal premis nyeleneh seperti itu yang juga sedikit banyak mengingatkan saya pada thriller medioker lain yang dibintangi diane lane untraceable atau seperti saw dengan segalan permainan maut ala jigsaw kemudian death tube lahir dibawah arahan yohei fukuda sutrdara yang sebelumnya pernah menelurkan grotesque sayangnya death tube sepertinya hanya meninggalkan konsep yang ambius tanpa dibarengi eksekusi yang mumpuni menjadikannya sebuah horror-thriller yang membosankan tanpa tahu mau dibawa kemana tujuan akhir film ini padahal kalau mau jujur ia memiliki potensi untuk dapat berkembang lebih jauh', 'situs death tube dunia nyata bersyukur membayangkan orang sesakit tega membunuh manusia mempertontonkan tindakan biadabnya live internet berbekal premis nyeleneh thriller medioker dibintangi diane lane untraceable saw segalan permainan maut ala jigsaw death tube lahir dibawah arahan yohei fukuda sutrdara menelurkan grotesque sayangnya death tube meninggalkan konsep ambius dibarengi eksekusi mumpuni menjadikannya horror-thriller membosankan dibawa kemana tujuan film jujur memiliki potensi berkembang', 'situs death tube dunia nyata syukur bayang orang sakit tega bunuh manusia tonton tindak biadab live internet bekal premis nyeleneh thriller medioker bintang diane lane untraceable saw galan main maut ala jigsaw death tube lahir bawah arah yohei fukuda sutrdara telur grotesque sayang death tube tinggal konsep ambius bareng eksekusi mumpuni jadi horror-thriller bosan bawa mana tuju film jujur milik potensi kembang'),
(516, 533, 'di tempat lain derrickson juga memberi karakter eric bana konflik pribadi seperti skeptisme stereotip dan pergolakan antara pekerjaan atau keluarga sementara di tempat lain ada aktor dgar ramrez tampil menjadi pastur gaul yang membantu penyelidikan ralph sarchie secara spiritual sayang ketika dengan begitu banyak pertanyaan dari misteri yang sepertinya akan menjadi besar di klimaks kita akhirnya tidak mendapatkan jawaban sepatasnya apa yang dilakukan derrickson adalah sebuah antiklimaks terlepas dari sekuens exorcism medebarkan di ujungnya ia seperti memilih bermain aman dan terkesan malas memberi sentuhan akhir berupa penjelasan setimpal yang semestinya bisa membuat deliver us from evil tidak berakhir menjadi horor medioker yang begitu saja berlalu tanpa kesan apa-apa', 'derrickson karakter eric bana konflik pribadi skeptisme stereotip pergolakan pekerjaan keluarga aktor dgar ramrez tampil pastur gaul membantu penyelidikan ralph sarchie spiritual sayang misteri klimaks sepatasnya derrickson antiklimaks terlepas sekuens exorcism medebarkan ujungnya memilih bermain aman terkesan malas sentuhan penjelasan setimpal semestinya deliver us from evil horor medioker kesan apa-apa', 'derrickson karakter eric bana konflik pribadi skeptisme stereotip pergola kerja keluarga aktor dgar ramrez tampil pastur gaul bantu selidik ralph sarchie spiritual sayang misteri klimaks sepatasnya derrickson antiklimaks lepas sekuens exorcism debar ujung memilih main aman kesan malas sentuh jelas timpal mesti deliver us from evil horor medioker kesan apa-apa'),
(517, 534, 'ya mengawinkan peristiwa nyata misterius dengan sebuah dokumenter palsu bisa jadi sebuah tontonan menarik tetapi devils pass mungkin akan membuat penonton yang bosan dengan mocku horor akan eneg tidak ada yang baru di sini semua masih sama seperti yang sudah-sudah dari dominasi sudut pandang orang pertama bersama banyak penggunaan kamera gengam dialog-dialog kasual serta tempo pelan membosankan dengan segala basa-basinya sebelum akhirnya meledak di ujungnya kombinasi realisme found footage setting yang meyakinkan dan kandungan misterinya yang berujung narasi kompleks dan twist membuat devils pass milik harlin sebenarnya tidak terlalu buruk andai saja ia tahu bagaimana menghindari beberapa kesalahan macam yang paling fatal ketidak konsistenan pengunaan kameranya yang terkadang terasa janggal untuk ukuran film dengan tampilan dokumenter belum lagi penyakit lama dari horor jenis ini yang seperti terlalu memaksakan kameranya untuk harus terus merekam segalanya apapun yang terjadi seakan-akan membuat keselamatan kamera lebih penting dari nyawa mereka sendiri terasa aneh dan menganggu memang', 'ya mengawinkan peristiwa nyata misterius dokumenter palsu tontonan menarik devils pass penonton bosan mocku horor eneg sudah-sudah dominasi sudut pandang orang penggunaan kamera gengam dialog-dialog kasual serta tempo pelan membosankan basa-basinya meledak ujungnya kombinasi realisme found footage setting kandungan misterinya berujung narasi kompleks twist devils pass milik harlin buruk andai menghindari kesalahan fatal ketidak konsistenan pengunaan kameranya terkadang janggal ukuran film tampilan dokumenter penyakit horor jenis memaksakan kameranya merekam apapun seakan-akan keselamatan kamera nyawa aneh menganggu', 'ya awin peristiwa nyata misterius dokumenter palsu tonton tarik devils pass penonton bosan mocku horor eneg sudah-sudah dominasi sudut pandang orang guna kamera gengam dialog-dialog kasual serta tempo pelan bosan basa-basinya ledak ujung kombinasi realisme found footage setting kandung misteri ujung narasi kompleks twist devils pass milik harlin buruk andai hindar salah fatal tidak konsisten pengunaan kamera kadang janggal ukur film tampil dokumenter sakit horor jenis memaksakan kamera rekam apa seakan-akan selamat kamera nyawa aneh menganggu'),
(518, 535, 'ni mungkin yang terburuk dari sheridan tapi hasilnya bisa jadi akan berbeda andai saja pihak morgan creek tidak pernah turut campur tangan dalam urusan naskahnya ya konon terjadi perselisihan antara sheridan dan morgan creek selaku studio produksi yang berujung dengan tidak pernah digunakannya naskah sheridan yang dirasa tidak komersil itu ironisnya perubahan yang dilakukan sepihak tersebut ternyata juga tidak membuahkan hasil berarti selain filmnya sendiri banyak dicerca di sana sini termasuk oleh sheridan craig dan weisz sendiri yang sampai-sampai tidak mau mempromosikannya hasilnya box-ofiice nya pun anjlok menjadikannya salah satu horor-thriller paling mengecewakan tahun ini', 'ni terburuk sheridan hasilnya berbeda andai morgan creek campur tangan urusan naskahnya ya konon perselisihan sheridan morgan creek studio produksi berujung digunakannya naskah sheridan dirasa komersil ironisnya perubahan membuahkan hasil filmnya dicerca sheridan craig weisz mempromosikannya hasilnya box-ofiice nya anjlok menjadikannya salah horor-thriller mengecewakan', 'ni buruk sheridan hasil beda andai morgan creek campur tang urus naskah ya konon selisih sheridan morgan creek studio produksi ujung guna naskah sheridan rasa komersil ironis ubah buah hasil film cerca sheridan craig weisz promosi hasil box-ofiice nya anjlok jadi salah horor-thriller kecewa'),
(519, 536, 'drive angry sepertinya berusaha keras untuk menjadi sebuah film aksi tanpa otak gila-gilaan yang sayangnya tidak berjalan dengan baik patrick lussier seakan-akan tidak rela jika filmnya terlihat terlalu murahan namun disisi lain ia juga tidak ingin menjadikannya terlalu serius nah kegalauan inilah yang malah membuat drive angry menjadi sebuah film aksi banci yang terkesan masih malu-malu menunjukan kegilaannya', 'drive angry berusaha keras film aksi otak gila-gilaan sayangnya berjalan patrick lussier seakan-akan rela filmnya murahan disisi menjadikannya serius kegalauan drive angry film aksi banci terkesan malu-malu menunjukan kegilaannya', 'drive angry usaha keras film aksi otak gila-gilaan sayang jalan patrick lussier seakan-akan rela film murah sisi jadi serius galau drive angry film aksi banci kesan malu-malu tunjuk gila'),
(520, 537, 'masih di tangan todd philips sutradara yang selalu membuat film komedi ber rating r ini tidak menawarkan sesuatu yang wah buat saya masih setype dengan film-film komedi road trip pada umumnya meskipun di bintangi robert downey dan zach galifianakis tetap saja film ini tidak terlalu berpengaruh apa  apa bagi saya di karenakan naskah nya yang melempem selain itu kesalahan todd philips adalah improvisasinya menghancurkan segalanya kalau di perhatikan ia lupa mau di kemanakan dua aktor ini padahal chemistri dua orang yang berlawanan arah seharusnya menjadi daya tarik yang bagus di suatu adegan robert downey kembali reuni dengan jamie foxx the soloist meskipun cuman tampil sebentar di sini namun sekali lagi yang saya sayangkan kehadiran jamie fox sama sekali tak berpengaruh apa apa bagi film ini', 'tangan todd philips sutradara film komedi ber rating r menawarkan setype film-film komedi road trip bintangi robert downey zach galifianakis film berpengaruh  karenakan naskah nya melempem kesalahan todd philips improvisasinya menghancurkan perhatikan lupa kemanakan aktor chemistri orang berlawanan arah daya tarik bagus adegan robert downey reuni jamie foxx the soloist cuman tampil sebentar sayangkan kehadiran jamie fox berpengaruh film', 'tang todd philips sutradara film komedi ber rating r menawarkan setype film-film komedi road trip bintang robert downey zach galifianakis film pengaruh  karena naskah nya lempem salah todd philips improvisasi hancur hati lupa manakan aktor chemistri orang lawan arah daya tarik bagus adegan robert downey reuni jamie foxx the soloist cuman tampil bentar sayang hadir jamie fox pengaruh film'),
(521, 538, 'walaupun dalam segi penceritaanya masih terdapat banyak lubang di sana sini setidaknya chan punya pesan yang ingin diangkat tidak melulu menghadirkan horor yang berisi kesadisan dan kegilaan semata sentilan kecil di dalamnya tentang fenomena sosial yang sering kali terjadi dalam masyarakat cina daratan dan obsesi manusia dalam usahanya untuk mencari kecantikan abadi termasuk dengan cara yang paling menjijikan sekalipun ya mungkin saja anda tidak akan berani makan pangsit dulu dalam beberapa waktu terlebih ketika mendengar suara tulang-tulang kecil yang hancur di saat nyonya li menguyahnya dengan begitu lahap', 'segi penceritaanya lubang chan pesan diangkat melulu menghadirkan horor berisi kesadisan kegilaan sentilan dalamnya fenomena sosial kali masyarakat cina daratan obsesi manusia usahanya mencari kecantikan abadi menjijikan ya berani makan pangsit mendengar suara tulang-tulang hancur nyonya li menguyahnya lahap', 'segi penceritaanya lubang chan pesan angkat melulu hadir horor isi sadis gila sentil dalam fenomena sosial kali masyarakat cina darat obsesi manusia usaha cari cantik abadi jijik ya berani makan pangsit dengar suara tulang-tulang hancur nyonya l menguyahnya lahap'),
(522, 539, 'kuat di teknis tidak diikuti dengan penceritaan yang mengesankan mencoba membuat everest untuk tampil humble dan juga sebisa mungkin setia dengan sumber aslinya sedikit banyak sudah memaksa kormkur untuk mengurangi kadar dramatisasinya bukan berati naskah everest sampai menjadi buruk dan tak layak tonton kamu mungkin bisa menyebutnya sebagai sajian dokudrama yang lebih memfokuskan pada kronologis peristiwa masalahnya hal ini terkadang akan menjadi terasa lama dan membosankan setidaknya itu yang saya rasakan di paruh awal film yang terlalu banyak menghabiskan waktu untuk memperkenalkan karakter-karakter utamanya', 'kuat teknis diikuti penceritaan mengesankan mencoba everest tampil humble sebisa setia sumber aslinya memaksa kormkur mengurangi kadar dramatisasinya berati naskah everest buruk layak tonton menyebutnya sajian dokudrama memfokuskan kronologis peristiwa terkadang membosankan rasakan paruh film menghabiskan memperkenalkan karakter-karakter utamanya', 'kuat teknis ikut cerita kesan coba everest tampil humble bisa setia sumber asli memaksa kormkur urang kadar dramatisasi berat naskah everest buruk layak tonton sebut saji dokudrama fokus kronologis peristiwa kadang bosan rasa paruh film habis kenal karakter-karakter utama'),
(523, 540, 'untuk ukuran film reliji exodus tergolong terlalu bermain aman tidak ada upanya maksimal mengiring rasa emosi dan spiritual penontonnya apa yang tersaji di sepanjang dua jam setengah exodus terasa seperti film sejarah membosankan dengan sedikit adegan spektakuler yang tidak sebanding dengan kesabaran para penonton yang tersiksa menunggunya termasuk adegan penting yang berada di ujung film tidak hanya membuang banyak waktu untuk sesuatu yang kurang penting exodus bisa jadi adalah salah satu film yang memubazirkan jajaran cast-nya christian bale tidak tampil di performa terbaiknya meskipun ia juga tidak buruk memerankan salah satu karakter ikonis di ranah agama scott membagi porsi bale  dengan edgerton yang didapuk sebagai ramesses ii sang antagonis edegerton tampil bagus sayang narasinya yang lemah membuat karakternya menjadi tidak bisa berkembang sementara nama-nama besar lain macam sigourney weaver dan ben kingsley harus rela menjadi figuran tak penting', 'ukuran film reliji exodus tergolong bermain aman upanya maksimal mengiring emosi spiritual penontonnya tersaji jam exodus film sejarah membosankan adegan spektakuler sebanding kesabaran penonton tersiksa menunggunya adegan ujung film membuang exodus salah film memubazirkan jajaran cast-nya christian bale tampil performa terbaiknya buruk memerankan salah karakter ikonis ranah agama scott membagi porsi bale  edgerton didapuk ramesses ii sang antagonis edegerton tampil bagus sayang narasinya lemah karakternya berkembang nama-nama sigourney weaver ben kingsley rela figuran', 'ukur film reliji exodus golong main aman upa maksimal iring emosi spiritual penontonnya saji jam exodus film sejarah bosan adegan spektakuler banding sabar penonton siksa tunggu adegan ujung film buang exodus salah film mubazir jajar cast-nya christian bale tampil performa baik buruk memerankan salah karakter ikonis ranah agama scott bagi porsi bale  edgerton didapuk ramesses i sang antagonis edegerton tampil bagus sayang narasi lemah karakternya kembang nama-nama sigourney weaver ben kingsley rela figuran'),
(524, 541, 'emang untuk ukuran film superhero  juta dollar bukan budget yang kelewat besar tetapi jika ia mampu mengubah  juta menjadi tontonan sekelas chronicle secara logika dengan dukungan dana yang mencapai lima kali lipat trank seharusnya bisa melakukan sesuatu yang jauh lebih baik dan lebih besar tetapi seperti yang bisa kamu lihat fantastic four miliknya punya ruang lingkup yang sesempit narasinya tidak ada set besar semua pemandangan yang terlihat hanya melibatkan gudang besar dan banyak layar hijau untuk menampilkan scene planet zero yang gersang gelap dan sepi bahkan yang lebih mengecewakan dari cerita yang buruk adalah kualitas aksi yang medioker tanpa greget tensi dan emosi sungguh sangat disayangkan franchise sebesar fantastic four harus dimulai lagi dengan start yang buruk', 'emang ukuran film superhero  juta dollar budget kelewat mengubah  juta tontonan sekelas chronicle logika dukungan dana mencapai kali lipat trank lihat fantastic four miliknya ruang lingkup sesempit narasinya set pemandangan melibatkan gudang layar hijau menampilkan scene planet zero gersang gelap sepi mengecewakan cerita buruk kualitas aksi medioker greget tensi emosi sungguh disayangkan franchise fantastic four start buruk', 'emang ukur film superhero  juta dollar budget lewat ubah  juta tonton kelas chronicle logika dukung dana capai kali lipat trank lihat fantastic four milik ruang lingkup sempit narasi set pemandangan libat gudang layar hijau tampil scene planet zero gersang gelap sepi kecewa cerita buruk kualitas aksi medioker greget tensi emosi sungguh sayang franchise fantastic four start buruk'),
(525, 542, 'ya harus diakui beberapa momen masih berhasil menghadirkan sebuah atmosfer kelam mencekam setiap koridor gelap dari bagunan asrama masih memberikan efek tidak nyaman namun untuk ukuran j-horor fatal frame masih berada di wilayah aman buat penonton penakut tidak sampai terlalu mengerikan malah bisa dibilang ia membosankan karena alurnya bergerak terlalu pelan sementara narasinya sendiri sebenarnya tidak terlalu buruk di mulai dengan menawarkan misteri tentang kutukan aneh yang mengkibatkan para siswi mendadak menghilang pasca mencium foto salah satu primandona asrama plot fatal frame meskipun lemah namun ia masih mampu menghadirkan rasa penasaran penontonnya untuk mengetahui tentang apa yang sebenarnya terjadi termasuk dengan kejutan di akhir film', 'ya diakui momen berhasil menghadirkan atmosfer kelam mencekam koridor gelap bagunan asrama efek nyaman ukuran j-horor fatal frame wilayah aman penonton penakut mengerikan dibilang membosankan alurnya bergerak pelan narasinya buruk menawarkan misteri kutukan aneh mengkibatkan siswi mendadak menghilang pasca mencium foto salah primandona asrama plot fatal frame lemah menghadirkan penasaran penontonnya kejutan film', 'ya aku momen hasil hadir atmosfer kelam cekam koridor gelap bagunan asrama efek nyaman ukur j-horor fatal frame wilayah aman penonton penakut erik bilang bosan alur gerak pelan narasi buruk menawarkan misteri kutuk aneh mengkibatkan siswi dadak hilang pasca cium foto salah primandona asrama plot fatal frame lemah hadir penasaran penontonnya kejut film'),
(526, 543, 'ini mungkin film gangster dengan cerita dan karakterisasi terlemah yang pernah saya tonton tetapi jika kamu adalah salah satu audiens yang tidak pernah peduli soal hal-hal penting itu maka gangster squad akan memuaskanmu dengan parade aksi seru nan brutal sedikit komedi lengkap dengan segala aroma gangster ala amerika klasik yang kuat dipresentasinya plus ensemble cast yang sudah sedikit banyak memberikan pesona terbesar untuk film yang sebenarnya tidak istimewa ini', 'film gangster cerita karakterisasi terlemah tonton salah audiens peduli hal-hal gangster squad memuaskanmu parade aksi seru nan brutal komedi lengkap aroma gangster ala amerika klasik kuat dipresentasinya plus ensemble cast pesona terbesar film istimewa', 'film gangster cerita karakterisasi lemah tonton salah audiens peduli hal-hal gangster squad muas parade aksi seru nan brutal komedi lengkap aroma gangster ala amerika klasik kuat presentasi plus ensemble cast pesona besar film istimewa'),
(527, 544, 'pertama untuk ukuran horor dengan tema klasik rumah hantu ia tidak menakutkan tidak ada sesuatu yang benar-benar sampai membuat bergidik di sini kecual mungkin ketika melihat sosok bin bocah yatim-piatu yang diperankan dengan baik aktor cilik hyung-suk kedua yun-ho sudah kerap menipu penontonnya dengan cara yang sama sekali tidak elegan lihat saja ketika ia terlalu banyak melibatkan adegan mengerikan yang ternyata hanya jelmaan mimpi dari tokoh-tokoh didalamnya benar-benar sebuah cara yang bodoh dan ketiga yang paling fatal adalah kualitas naskahnya ceritanya begitu lemah dan dipaksakan terlalu banyak lubang-lubang besar di sana-sini yang sangat menggangu tentu saja saya tidak akan menjabarkannya disini untuk menghindari spoiler tapi sungguh rangkaian plot hole yang bertebaran di sepanjang kurang lebih  menit bahkan endingnya pun sangat tertebak dan menggelikan sebuah penantian yang berakhir antiklimaks ya itulah yang terjadi ketika saya berharap terlalu banyak pada horor korea satu ini bukan hanya tidak istimewa tapi ghastly juga begitu banyak didera borok-borok besar pada skripnya yang sangat menggangu kenikmatan menonton yah untung saja masih beberapa yang terlihat mengerikan disini selain potongan-potongan kaki palsu yang terlihat sangat meyakinkan itu karakter bocah setan yang sadis ada hyomin salah satu personil t-ara yang setidaknya memberi sedikit kesegaran di  menit yang kering', 'ukuran horor tema klasik rumah hantu menakutkan benar-benar bergidik kecual sosok bin bocah yatim-piatu diperankan aktor cilik hyung-suk yun-ho kerap menipu penontonnya elegan lihat melibatkan adegan mengerikan jelmaan mimpi tokoh-tokoh didalamnya benar-benar bodoh ketiga fatal kualitas naskahnya ceritanya lemah dipaksakan lubang-lubang sana-sini menggangu menjabarkannya menghindari spoiler sungguh rangkaian plot hole bertebaran  menit endingnya tertebak menggelikan penantian antiklimaks ya berharap horor korea istimewa ghastly didera borok-borok skripnya menggangu kenikmatan menonton yah untung mengerikan potongan-potongan kaki palsu karakter bocah setan sadis hyomin salah personil t-ara kesegaran  menit kering', 'ukur horor tema klasik rumah hantu takut benar-benar gidik cual sosok bin bocah yatim-piatu peran aktor cilik hyung-suk yun-ho kerap tipu penontonnya elegan lihat libat adegan erik jelma mimpi tokoh-tokoh dalam benar-benar bodoh tiga fatal kualitas naskah cerita lemah paksa lubang-lubang sana-sini menggangu menjabarkannya hindar spoiler sungguh rangkai plot hole tebar  menit endingnya tebak geli nanti antiklimaks ya harap horor korea istimewa ghastly dera borok-borok skrip menggangu nikmat tonton yah untung erik potongan-potongan kaki palsu karakter bocah setan sadis hyomin salah personil t-ara segar  menit kering'),
(528, 545, 'masalahnya adalah motif karakter cusack tidak seidealis dan tidak sepintar yang kita kira tidak seperti karakter yang dimainkan kiefer sutherland di phone booth ketika ia mengancam colin farell yang bermulut besar mungkin dari awal kita akan mengira bahwa ia seorang fans fanantik yang kecewa dengan pertunjukan terakhir selznick tetapi pada akhirnya kita tahu bahwa tujuannya sangat sederhana dan sangat cheesy dan itu sedikit banyak sudah merusak segalanya belum lagi mengetahui bahwa sang villain ternyata terlihat bodoh dan tidak pernah konsisten dengan ancamannya lalu klimaksnya di atas panggung itu bisa dibilang konyol', 'motif karakter cusack seidealis sepintar karakter dimainkan kiefer sutherland phone booth mengancam colin farell bermulut fans fanantik kecewa pertunjukan selznick tujuannya sederhana cheesy merusak sang villain bodoh konsisten ancamannya klimaksnya panggung dibilang konyol', 'motif karakter cusack idealis pintar karakter main kiefer sutherland phone booth ancam colin farell mulut fans fanantik kecewa tunjuk selznick tuju sederhana cheesy rusak sang villain bodoh konsisten ancam klimaks panggung bilang konyol'),
(529, 546, 'sebagai sebuah sugguhan superhero green lantern sebenarnya memiliki semua potensi untuk melebihi atau setidaknya menyaingi jagoan-jagoan marvel tahun ini sayang ia tidak pernah mencapai titik puncak kepuasan menonton sebuah sajian pahlawan super karena harus menderita oleh kualitas naskah yang buruk penggarapan yang pas-pasan cgi yang terlihat cantik namun terlalu berlebihan termask juga kehadiran ryan reinolds yang overatted sepertinya untuk saat ini dc comics lebih baik memfokuskan saja kepada reboot superman atau the dark knight rises yang mudah-mudahan bisa mengambalikan kejayaan mereka lagi', 'sugguhan superhero green lantern memiliki potensi melebihi menyaingi jagoan-jagoan marvel sayang mencapai titik puncak kepuasan menonton sajian pahlawan super menderita kualitas naskah buruk penggarapan pas-pasan cgi cantik termask kehadiran ryan reinolds overatted dc comics memfokuskan reboot superman the dark knight rises mudah-mudahan mengambalikan kejayaan', 'sugguhan superhero green lantern milik potensi lebih saing jagoan-jagoan marvel sayang capai titik puncak puas tonton saji pahlawan super derita kualitas naskah buruk garap pas-pasan cgi cantik termask hadir ryan reinolds overatted dc comics fokus reboot superman the dark knight rises mudah-mudahan mengambalikan jaya'),
(530, 547, 'perang irak memang bukanlah tema yang bersahabat untuk diangkat dalam sebuah film walaupun kuat secara kualitas cerita namun jelas tidak menjamin film tersebut akan sukses di pasaran contoh paling gampang adalah the hurt locker yang di puji habis-habisan oleh para kritikus bahkan sampai mendapat oscar sebagai film terbaik namun hasil box-office nya bisa dibilang biasa saja dan sepertinya kutukan itu kembali menerpa green zone walaupun sudah memasang duet maut greengrass-damon dan didukung oleh penulis naskah brian helgeland la confidential robin hood tampaknya untuk dapat balik modal saja sudah bagus memang kalau mau jujur walaupun cerita yang diangkat cukup menarik dan penuh dengan sindiran-sindiran dan intrik-intrik politik kental namun sepertinya masih terlalu berat untuk dinikmati sebagai sebuah film hiburan', 'perang irak tema bersahabat diangkat film kuat kualitas cerita menjamin film sukses pasaran contoh gampang the hurt locker puji habis-habisan kritikus oscar film terbaik hasil box-office nya dibilang kutukan menerpa green zone memasang duet maut greengrass-damon didukung penulis naskah brian helgeland la confidential robin hood modal bagus jujur cerita diangkat menarik penuh sindiran-sindiran intrik-intrik politik kental berat dinikmati film hiburan', 'perang irak tema sahabat angkat film kuat kualitas cerita jamin film sukses pasar contoh gampang the hurt locker puji habis-habisan kritikus oscar film baik hasil box-office nya bilang kutuk terpa green zone memasang duet maut greengrass-damon dukung penulis naskah brian helgeland la confidential robin hood modal bagus jujur cerita angkat tarik penuh sindiran-sindiran intrik-intrik politik kental berat nikmat film hibur'),
(531, 548, 'overall tampaknya daripada menghadirkan daur ulang sebuah dongeng klasik ke dalam versi modern gullivers travels malah lebih condong menjadi ajang jack black mempertontonkan segala kenarsisaan dan kegilaannya ya film ini memang hanya sekedar menghibur itupun kalau anda memang fans seorang jack black yang terbiasa dengan segala guyonannya yang nyeleh jika tidak lebih baik lewatkan saja film satu ini toh anda tidak akan rugi apa-apa', 'overall menghadirkan daur ulang dongeng klasik versi modern gullivers travels condong ajang jack black mempertontonkan kenarsisaan kegilaannya ya film sekedar menghibur itupun fans jack black terbiasa guyonannya nyeleh lewatkan film rugi apa-apa', 'overall hadir daur ulang dongeng klasik versi modern gullivers travels condong ajang jack black tonton kenarsisaan gila ya film sekedar hibur itu fans jack black biasa guyon nyeleh lewat film rugi apa-apa'),
(532, 549, 'dengan durasi kejam yang hampir menyentuh tiga jam tanpa kekuatan bercerita yang benar-benar bisa mengikat itu jelas adalah sebuah sikasaan tersendiri pesona teknis luar biasa dan dukungan ensemble cast-nya yang bermain gemilang hanya memberi rasa takjub instan yang perlahan memudar digerus durasi panjang nan memelahkan tidak ada momen yang benar-benar menghentak atau sampai emosional yang merengsek rasa patriotisme penontonnya bahkan konflik demi konfliknya pun terasa lempeng dan dipanjang-panjangkan termasuk penambahan karakter fiktif macam stella yang tidak terlalu penting meskipun kenyataanya chelsea islan bermain fantastis', 'durasi kejam menyentuh jam kekuatan bercerita benar-benar mengikat sikasaan tersendiri pesona teknis dukungan ensemble cast-nya bermain gemilang takjub instan perlahan memudar digerus durasi nan memelahkan momen benar-benar menghentak emosional merengsek patriotisme penontonnya konflik konfliknya lempeng dipanjang-panjangkan penambahan karakter fiktif stella kenyataanya chelsea islan bermain fantastis', 'durasi kejam sentuh jam kuat cerita benar-benar ikat sikasaan sendiri pesona teknis dukung ensemble cast-nya main gemilang takjub instan perlahan memudar gerus durasi nan memelahkan momen benar-benar menghentak emosional merengsek patriotisme penontonnya konflik konflik lempeng dipanjang-panjangkan penambahan karakter fiktif stella kenyataanya chelsea islan main fantastis'),
(533, 550, 'belum cukup dengan plot dan akting yang buruk bak tsunami yang dahsyat film ini masih akan menerjang penontonnya dengan luapan besar kesalahan alias bloopers yang kelewatan banget terlihat bukan hanya sekali dua kali namun hampir disetiap adegan yang melibatkan bencana dipastikan diwarnai dengan adegan bodoh tidak masuk akal dan sangat teramat dipaksakan maksud hati sih ingin menghadirkan sebuah ketegangan yang mencekam namun hasilnya malah konyol overall buruk adalah kata yang pas untuk menggambarkan keseluruhan film disaster korea selatan satu ini bahkan  yang notabene sudah terbilang mengecewakan terlihat jauh lebih baik dan masuk akal jika dibandingkan dengan film satu ini benar membuang buang waktu saja', 'plot akting buruk bak tsunami dahsyat film menerjang penontonnya luapan kesalahan alias bloopers kelewatan banget kali disetiap adegan melibatkan bencana diwarnai adegan bodoh masuk akal teramat dipaksakan maksud hati sih menghadirkan ketegangan mencekam hasilnya konyol overall buruk pas menggambarkan film disaster korea selatan  notabene terbilang mengecewakan masuk akal dibandingkan film membuang buang', 'plot akting buruk bak tsunami dahsyat film terjang penontonnya luap salah alias bloopers lewat banget kali disetiap adegan libat bencana warna adegan bodoh masuk akal amat paksa maksud hati sih hadir tegang cekam hasil konyol overall buruk pas gambar film disaster korea selatan  notabene bilang kecewa masuk akal banding film buang buang'),
(534, 551, 'overall walaupun masih bisa dibilang cukup halloween ii sukses menuai keuntungan secara komersil namun secara kualitas seri keduanya ini mengalami penurunan cukup besar terutama pada bagian cerita yang tidak sebaik predesornya terlepas dari kelemahannya tersebut ucapan terima kasih tetap layak diberikan oleh rob zombie yang mampu menghadirkan sosok baru sang legenda michael mayers menjadi lebih baik dari versi orisinilnya', 'overall dibilang halloween ii sukses menuai keuntungan komersil kualitas seri mengalami penurunan cerita predesornya terlepas kelemahannya ucapan terima kasih layak rob zombie menghadirkan sosok sang legenda michael mayers versi orisinilnya', 'overall bilang halloween i sukses tuai untung komersil kualitas seri alami penurunan cerita predesornya lepas lemah ucap terima kasih layak rob zombie hadir sosok sang legenda michael mayers versi orisinilnya'),
(535, 552, 'sementara apa yang kamu dapat dalam haunt bukan hanya sekedar sajian horor rumah angker dengan pakem basi yang kembali diulang tanpa modifikasi berarti namun juga sebuah kebingungan untuk menjabarkan narasi dan misterinya hasilnya haunt tidak lebih dari horor medioker dengan beberapa kebodohan keluarga yang menempati rumahnya tahu bahwa tempat itu bekas dari kejadian-kejadian mengerikan dan mereka seperti tidak pernah terpengaruh sama sekali cerita percintaan remaja maksa yang bertele-tele dan belum lagi gangguan plot hole', 'haunt sekedar sajian horor rumah angker pakem basi diulang modifikasi kebingungan menjabarkan narasi misterinya hasilnya haunt horor medioker kebodohan keluarga menempati rumahnya bekas kejadian-kejadian mengerikan terpengaruh cerita percintaan remaja maksa bertele-tele gangguan plot hole', 'haunt sekedar saji horor rumah angker pakem basi ulang modifikasi bingung menjabarkan narasi misteri hasil haunt horor medioker bodoh keluarga tempat rumah bekas kejadian-kejadian erik pengaruh cerita cinta remaja maksa bertele-tele ganggu plot hole'),
(536, 553, 'headshot menderita banyak di berbagai sisi cerita tentu saja salah satu yang paling mencolok narasi tentang balas dendam dari penjahat insaf dan pencarian identitas mungkin bukan konsep baru di ranah ini headshot sedikit banyak mengingatkan saya pada kill bill vol  milik tarantino namun klise bukan masalah utamanya adalah tidak adanya pengembangan yang cukup untuk membuat penontonnya bisa terlibat lebih dalam dengan konflik dan karakternya yang membuat naskah headshot terasa dangkal dan compang-camping padahal jujur saja meski terasa familiar premis ini sangat mungkin diolah lebih baik lagi guna menghasilkan tonjokan lebih emosional apalagi kemudian ia membawa embel-embel romansa di dalamnya dengan melibatkan relasi antara ishmael dan ailin yang sayang lagi-lagi juga tidak pernah bisa dikemas dengan sempurna', 'headshot menderita sisi cerita salah mencolok narasi balas dendam penjahat insaf pencarian identitas konsep ranah headshot kill bill vol  milik tarantino klise utamanya pengembangan penontonnya terlibat konflik karakternya naskah headshot dangkal compang-camping jujur familiar premis diolah menghasilkan tonjokan emosional membawa embel-embel romansa dalamnya melibatkan relasi ishmael ailin sayang lagi-lagi dikemas sempurna', 'headshot derita sisi cerita salah colok narasi balas dendam jahat insaf cari identitas konsep ranah headshot kill bill vol  milik tarantino klise utama pengembangan penontonnya libat konflik karakternya naskah headshot dangkal compang-camping jujur familiar premis o hasil tonjok emosional bawa embel-embel romansa dalam libat relasi ishmael ailin sayang lagi-lagi kemas sempurna'),
(537, 554, 'sayang ketimbang memilih untuk tampil sederhana dan to the point layaknya thriller home invasion kebanyakan huh jung berusaha membuat ceritanya menjadi lebih berbelit dengan memberikan karkater utamanya bermasalah dengan ocd- bukan trik diet ala pesulap lokal- dan masa lalu suram yang berusaha dilupakannya plus sebuah satir sosial kontras tentang si kaya dan si miskin nah sejak itu hide and seek mulai rusak ia terjebak dalam upayanya ingin mengalihkan perhatian penontonnya ke sesuatu yang lain sialnya semuanya terlalu dipaksakan dan kebodohan fatal huh jung membocorkan identitas pelaku terlalu dini -entah disengaja atau tidak- sudah merusak twistnya', 'sayang ketimbang memilih tampil sederhana to the point layaknya thriller home invasion kebanyakan huh jung berusaha ceritanya berbelit karkater utamanya bermasalah ocd- trik diet ala pesulap lokal- suram berusaha dilupakannya plus satir sosial kontras si kaya si miskin hide and seek rusak terjebak upayanya mengalihkan perhatian penontonnya sialnya dipaksakan kebodohan fatal huh jung membocorkan identitas pelaku -entah disengaja tidak- merusak twistnya', 'sayang timbang memilih tampil sederhana to the point layak thriller home invasion banyak huh jung usaha cerita belit karkater utama masa ocd- trik diet ala sulap lokal- suram usaha lupa plus satir sosial kontras si kaya si miskin hide and seek rusak jebak upaya alih hati penontonnya sial paksa bodoh fatal huh jung bocor identitas pelaku -entah sengaja tidak- rusak twistnya'),
(538, 555, 'mungkin yang sangat disayangkan adalah bagaimana aja menutup kisah ini alih-alih menghadirkan sebuah twist-shocking ending yang cerdas ala the sixth sense aja malah seakan-akan memaksa penontonnya tertipu dengan cara yang terbilang murahan saya sendiri tidak percaya sutradara sekelas aja bisa juga membuat ending seperti ini layaknya mencomot bagian penutup dari film lain dan menempelkannya disini apa yang tersaji di klimaks ini begitu penuh kontrdiksi dengan apa yang sudah dihadirkan sepanjang film sebuah plot hole besar yang seharusnya tidak perlu terjadi jika aja memilih untuk menyelesaikan film ini dengan cara yang lebih normal', 'disayangkan aja menutup kisah alih-alih menghadirkan twist-shocking ending cerdas ala the sixth sense aja seakan-akan memaksa penontonnya tertipu terbilang murahan percaya sutradara sekelas aja ending layaknya mencomot penutup film menempelkannya tersaji klimaks penuh kontrdiksi dihadirkan film plot hole aja memilih menyelesaikan film normal', 'sayang aja tutup kisah alih-alih hadir twist-shocking ending cerdas ala the sixth sense aja seakan-akan memaksa penontonnya tipu bilang murah percaya sutradara kelas aja ending layak comot penutup film tempel saji klimaks penuh kontrdiksi hadir film plot hole aja memilih selesai film normal'),
(539, 556, 'tetapi akan menjadi kasus berbeda jika kamu datang memosisikan dirimu sebagai penonton awam yang tidak membawa ekspektasi apa-apa ya hasilnya hitman agen  tidak terlalu buruk untuk sekelas sutradara iklan komersial basch sebenarnya cukup berhasil menghadirkan sebuah sensasi brainless action thriller yang seru dan enjoyable plot-nya mungkin sedikit berantakan lemah dan tidak konsisten beberapa elemen cerita akan terlihat tidak masuk akal dan menantang logika namun mengingat ini adalah cerita seorang agen super dari sebuah percobaan biologi rahasia yang mampu membuat jagoan kita lebih pintar lebih cepat dan lebih mematikan dari manusia normal maka hal-hal yang terasa berlebihan tersebut masih bisa dibilang cukup wajar ya ini adalah jenis film yang tidak perlu diambil pusing soal penceritaannya tentang kenapa dan mengapa yang ujung-ujungnya nanti malah membuatmu tambah pusing', 'berbeda memosisikan dirimu penonton awam membawa ekspektasi apa-apa ya hasilnya hitman agen  buruk sekelas sutradara iklan komersial basch berhasil menghadirkan sensasi brainless action thriller seru enjoyable plot-nya berantakan lemah konsisten elemen cerita masuk akal menantang logika cerita agen super percobaan biologi rahasia jagoan pintar cepat mematikan manusia normal hal-hal dibilang wajar ya jenis film diambil pusing penceritaannya ujung-ujungnya membuatmu pusing', 'beda memosisikan diri penonton awam bawa ekspektasi apa-apa ya hasil hitman agen  buruk kelas sutradara iklan komersial basch hasil hadir sensasi brainless action thriller seru enjoyable plot-nya berantak lemah konsisten elemen cerita masuk akal tantang logika cerita agen super coba biologi rahasia jago pintar cepat mati manusia normal hal-hal bilang wajar ya jenis film ambil pusing cerita ujung-ujungnya buat pusing'),
(540, 557, 'jadi kenapa dengan materi teknis semenjanjikan itu home malah tampil melempem pertama melihat deretan animasi-animasi besutan johnson tentu saja ada rasa pesimis akan keberhasilan home menjadi kartun yang bagus antz sinbad legend of the seven seas dan over the hedge jelas bukan termasuk dalam animasi panas dreamworks malah bisa dibilang secara kualitas mereka termasuk kelas medioker dibandingkan franchise besar dreamworks lain macam shrek kung-fu panda dan how to train your dragon dan apa yang terjadi di home semakin memperkuat posisi johnson sebagai sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal menghadirkan sesuatu yang spesial termasuk desian karakternya untuk bisa tinggal lama di ingatan penontonnya narasinya terlalu generik meskipun punya premis menarik yang meliputi petualangan intergalaksi namun materinya sendiri terasa terlalu dipanjang-panjangkan untuk ukuran film dengan durasi  menit home dengan mudah menjadi membosankan dalam perjalannya menuju akhir', 'materi teknis semenjanjikan home tampil melempem deretan animasi-animasi besutan johnson pesimis keberhasilan home kartun bagus antz sinbad legend of the seven seas over the hedge animasi panas dreamworks dibilang kualitas kelas medioker dibandingkan franchise dreamworks shrek kung-fu panda how to train your dragon home memperkuat posisi johnson sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal menghadirkan spesial desian karakternya tinggal ingatan penontonnya narasinya generik premis menarik meliputi petualangan intergalaksi materinya dipanjang-panjangkan ukuran film durasi  menit home mudah membosankan perjalannya', 'materi teknis semenjanjikan home tampil lempem deret animasi-animasi besut johnson pesimis hasil home kartun bagus antz sinbad legend of the seven as over the hedge animasi panas dreamworks bilang kualitas kelas medioker banding franchise dreamworks shrek kung-fu panda how to train your dragon home kuat posisi johnson sutradara animasi kelas dua-nya dreamworks johnson lagi-lagi gagal hadir spesial desian karakternya tinggal ingat penontonnya narasi generik premis tarik liput tualang intergalaksi materi dipanjang-panjangkan ukur film durasi  menit home mudah bosan jalan'),
(541, 558, 'harus diakui memang setengah jam pertama horsemen tampil sangat menjanjikan akan sebuah sajian thriller yang menarik atmosfer gelap dan mencekam serta misteri-misteri tentang peristiwa pembunuhan berantai misterius berhasil digarap dengan baik sehingga membuat penontonnya tentu berharap banyak untuk mendapatkan sebuah kejutan di satu jam kedepan namun apa yang terjadi adalah sebuah bencana cerita yang begitu menjanjikan di awal-awal film menjadi babak belur entah kenapa cerita menarik tersebut menjadi terlihat bodoh penuh dengan penjelasan yang tidak jelas dangkal dan terkesan dipaksakan belum lagi ending-nya yang sangat mengecewakan kesemuanya itu masih diperparah lagi dengan akting zhang ziyi yang luar biasa buruk alih-alih tampil mengesankan sebagai seorang wanita misterius aktris asal cina ini malah lebih terlihat seperti pelacur murahan yang sedang merayu pelanggannya dengan bahasa inggris-nya yang pas-pasan overall mencari sebuah crime-thriller yang pintar dan mencekam horseman jelas bukanlah sebuah pilihan yang bijak karena film ini dijamin akan menghabiskan percuma waktu anda dengan sajian yang jauh dari berkualitas', 'diakui jam horsemen tampil menjanjikan sajian thriller menarik atmosfer gelap mencekam serta misteri-misteri peristiwa pembunuhan berantai misterius berhasil digarap penontonnya berharap kejutan jam kedepan bencana cerita menjanjikan awal-awal film babak belur cerita menarik bodoh penuh penjelasan dangkal terkesan dipaksakan ending-nya mengecewakan kesemuanya diperparah akting zhang ziyi buruk alih-alih tampil mengesankan wanita misterius aktris cina pelacur murahan merayu pelanggannya bahasa inggris-nya pas-pasan overall mencari crime-thriller pintar mencekam horseman pilihan bijak film dijamin menghabiskan sajian berkualitas', 'aku jam horsemen tampil janji saji thriller tarik atmosfer gelap cekam serta misteri-misteri peristiwa bunuh beranta misterius hasil garap penontonnya harap kejut jam depan bencana cerita janji awal-awal film babak belur cerita tarik bodoh penuh jelas dangkal kesan paksa ending-nya kecewa semua parah akting zhang ziyi buruk alih-alih tampil kesan wanita misterius aktris cina lacur murah rayu langgan bahasa inggris-nya pas-pasan overall cari crime-thriller pintar cekam horseman pilih bijak film jamin habis saji kualitas'),
(542, 559, 'sayang selain adegan menguliti wajah otomatis tidak ada lagi hal mengerikan yang bisa ditawarkan spiegel ya menggunakan kecoa-kecoa madagaskar sebesar kepalan tangan anak kecil atau tembakan-tembakan anak panah besi untuk menyiksa korbannya jelas bukan cara yang kreatif untuk ukuran sebuah torture porn sekelas hostel parahanya lagi adegan-adegan tersebut terlihat begitu lembek begitu cupu jelas merusak apa yang sudah dibuat roth sebelumnya satu-satunya yang mungkin sukses disiksa disini mungkin hanya para penontonnya yang harus duduk menyaksikan segala jeritan-jeritan sumbang dan kebodohan demi kebodohan membuat durasi  menit terasa berjam-jam', 'sayang adegan menguliti wajah otomatis mengerikan ditawarkan spiegel ya kecoa-kecoa madagaskar kepalan tangan anak tembakan-tembakan anak panah besi menyiksa korbannya kreatif ukuran torture porn sekelas hostel parahanya adegan-adegan lembek cupu merusak roth satu-satunya sukses disiksa penontonnya duduk menyaksikan jeritan-jeritan sumbang kebodohan kebodohan durasi  menit berjam-jam', 'sayang adegan ulit wajah otomatis erik ditawarkan spiegel ya kecoa-kecoa madagaskar kepal tang anak tembakan-tembakan anak panah besi siksa korban kreatif ukur torture porn kelas hostel parahanya adegan-adegan lembek cupu rusak roth satu-satunya sukses siksa penontonnya duduk saksi jeritan-jeritan sumbang bodoh bodoh durasi  menit berjam-jam'),
(543, 560, 'ya tidak butuh lama untuk membuat penontonnya bisa membenci hates setelah opening yang menyakinkan narasi garapan david loucka dream house dan jonathan mostow surrogates ini perlahan namun pasti mulai terjun bebas ke jurang kehancuran dosis suspense-nya ompong misterinya tiga babaknya tidak pernah terasa kuat dan menggigit kamu dengan mudah melihat akhirnya jauh sebelum filmnya sendiri berakhir terutama ketika karakter ryan muncul dan membeberkan segalanya twist ending-nya sebenarnya bagus hanya saja proses menuju ke sana itu adalah sebuah kekacauan ditambah lagi selain penampilan apik j-law yang lovable karakter-karakter pendukung lainnya tidak pernah diberi porsi lebih dalam mereka tampak lebih seperti figuran tanpa arti ketimbang membantu menggerakan plotnya memang elizabeth sue mampu menjalin relasi ibu-anak dengan lawrence dengan cukup baik tetapi hanya itu saja subplot lainnya seperti diada-adakan untuk memperpanjang narasinya yang sebenarnya bisa saja diakhiri setengah jam lebih cepat', 'ya butuh penontonnya membenci hates opening menyakinkan narasi garapan david loucka dream house jonathan mostow surrogates perlahan terjun bebas jurang kehancuran dosis suspense-nya ompong misterinya babaknya kuat menggigit mudah filmnya karakter ryan muncul membeberkan twist ending-nya bagus proses kekacauan ditambah penampilan apik j-law lovable karakter-karakter pendukung porsi figuran arti ketimbang membantu menggerakan plotnya elizabeth sue menjalin relasi ibu-anak lawrence subplot diada-adakan memperpanjang narasinya jam cepat', 'ya butuh penontonnya benci hates opening menyakinkan narasi garap david loucka dream house jonathan mostow surrogates perlahan terjun bebas jurang hancur dosis suspense-nya ompong misteri babak kuat gigit mudah film karakter ryan muncul beber twist ending-nya bagus proses kacau tambah penampilan apik j-law lovable karakter-karakter dukung porsi figuran arti timbang bantu gerak plot elizabeth sue jalin relasi ibu-anak lawrence subplot diada-adakan panjang narasi jam cepat');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(544, 561, 'tetapi jujur saja i frankenstein itu lebih kacau dari franchise underworld dan blade yang buat saya sudah termasuk medioker bahkan parade pertarungan penuh cgi mewah antara pasukan gargoyle pimpinan miranda otto dan iblis yang dikomandani oleh sang pangeran kegelapan dalam wujud bill nighy itu akan menjadi cepat usang dan membosankan', 'jujur i frankenstein kacau franchise underworld blade medioker parade pertarungan penuh cgi mewah pasukan gargoyle pimpinan miranda otto iblis dikomandani sang pangeran kegelapan wujud bill nighy cepat usang membosankan', 'jujur i frankenstein kacau franchise underworld blade medioker parade tarung penuh cgi mewah pasuk gargoyle pimpin miranda otto iblis komandan sang pangeran gelap wujud bill nighy cepat usang bosan'),
(545, 562, 'memang cerita tentang arwah cantik penasaran dalam drama bukan sekali ini saja dipakai meskipun sedikit basi tetapi segmen penuh dengan aroma sedih dan kecemasan ini ini jelas jauh lebih menarik dan emosional ketimbang harus melihat banyak flashback membosankan tetang kehidupan bahagia mia pra tragedi yang diisi banyak momen cheesy dalam iring-iringan musik cantik  nyaris tanpa konflik berarti mungkin bukan sepenuhnya salah sutradara spesialis dokumenter r j cutler yang memulai debutnya di sini atau penulis naskahnya shauna cross mungkin saja memang novel gayle forman bukan live action material yang bisa dengan mudah dibuat versi filmnya dengan segala detil yang tak mungkin terangkut dalam  durasinya ', 'cerita arwah cantik penasaran drama dipakai basi segmen penuh aroma sedih kecemasan menarik emosional ketimbang flashback membosankan tetang kehidupan bahagia mia pra tragedi diisi momen cheesy iring-iringan musik cantik  konflik sepenuhnya salah sutradara spesialis dokumenter r j cutler debutnya penulis naskahnya shauna cross novel gayle forman live action material mudah versi filmnya detil terangkut  durasinya ', 'cerita arwah cantik penasaran drama pakai basi segmen penuh aroma sedih cemas tarik emosional timbang flashback bosan tetang hidup bahagia mia pra tragedi isi momen cheesy iring-iringan musik cantik  konflik penuh salah sutradara spesialis dokumenter r j cutler debut penulis naskah shauna cross novel gayle forman live action material mudah versi film detil angkut  durasi '),
(546, 563, 'ya film fantasi yang juga menjadi pembuka dalam ajang inafff kemarin ini memang gagal menghadirkan sebuah epik mitologi sendal dan pedang yang bagus dari segi kualitas cerita terlalu banyak modifikasi ekstrem di sana sini yang membuatnya malah terlihat konyol lihat saja bagaimana singh menurunkan derajat theseus dari manusia setengah dewa menjadi tukan batu yang terlahir dari seorang ibu tanpa ayah menggambarkan para titan yang alih-alih berukuran raksasa sesuai namanya mereka malah terlihat mengelikan termasuk juga para dewa-dewanya ya menjadi berbeda itu boleh-boleh saja tetapi bukan berati harus konyol tapi di sisi lain immortals punya daya tarik tersendiri selain visualnya yang luar biasa itu tingkat kesadisan yang cukup frontal membuatnya jelas bukan tontonan anak-anak seperti clash of the titans lihat saja ketika apollo menghabisi para anak buah hyperion sebuah kombinasi tidak wajar menggabungkan segala kecantikan dan kebrutalan penuh darah dan banyak kepala hancur menjadi kesatuan yang keren ya seperti  tapi tidak banyak editing berlebihan yang dilakukan oleh sighn di sini', 'ya film fantasi pembuka ajang inafff kemarin gagal menghadirkan epik mitologi sendal pedang bagus segi kualitas cerita modifikasi ekstrem membuatnya konyol lihat singh menurunkan derajat theseus manusia dewa tukan batu terlahir ayah menggambarkan titan alih-alih berukuran raksasa sesuai namanya mengelikan dewa-dewanya ya berbeda boleh-boleh berati konyol sisi immortals daya tarik tersendiri visualnya tingkat kesadisan frontal membuatnya tontonan anak-anak clash of the titans lihat apollo menghabisi anak buah hyperion kombinasi wajar menggabungkan kecantikan kebrutalan penuh darah kepala hancur kesatuan keren ya  editing sighn', 'ya film fantasi buka ajang inafff kemarin gagal hadir epik mitologi sendal pedang bagus segi kualitas cerita modifikasi ekstrem buat konyol lihat singh turun derajat theseus manusia dewa tuk batu lahir ayah gambar titan alih-alih ukur raksasa suai nama kelik dewa-dewanya ya beda boleh-boleh berat konyol sisi immortals daya tarik sendiri visual tingkat sadis frontal buat tonton anak-anak clash of the titans lihat apollo habis anak buah hyperion kombinasi wajar gabung cantik brutal penuh darah kepala hancur satu keren ya  editing sighn'),
(547, 564, 'ya di atas kertas imperium menjanjikan sajian thriller yang menarik tetapi narasinya yang tidak kuat membuatnya hanya terasa angker pada premis tidak dengan keseluruhan plotnya memang ada beberapa adegan yang terasa mendebarkan kebanyakan melibatkan nyaris terbongkarnya penyamaran nate foster tetapi secera keseluruhan imperium bisa dibilang adalah thriller yang masih bermain di wilayah aman tanpa benar-benar punya keberanian lebih untuk menelusuri konsep kontroversialnya dengan lebih terbuka terlebih dari interaksi antar karakternya yang terasa terlalu mudah dan memaksakan diri', 'ya kertas imperium menjanjikan sajian thriller menarik narasinya kuat membuatnya angker premis plotnya adegan mendebarkan kebanyakan melibatkan terbongkarnya penyamaran nate foster secera imperium dibilang thriller bermain wilayah aman benar-benar keberanian menelusuri konsep kontroversialnya terbuka interaksi karakternya mudah memaksakan', 'ya kertas imperium janji saji thriller tarik narasi kuat buat angker premis plot adegan debar banyak libat bongkar samar nate foster secera imperium bilang thriller main wilayah aman benar-benar berani telusur konsep kontroversial buka interaksi karakternya mudah memaksakan'),
(548, 565, 'dengan durasi yang menyentuh  jam howard sebenarnya punya cukup banyak waktu untuk mengolah relasi antar karakternya potensinya besar terutama ketika kita bisa melihat konsep rivalitas dan clash antara owen chase dan george pollard jr yang sedikit banyak mengingatkan saya pada niki lauda dan james hunt di rush dari situ sebenarnya howard bisa saja memperkuat naskah garapan charles leavitt blood diamond dan segala pergolakan emosi dengan modal perseteruan dua karakternya utamanya sayang nyatanya tidak demikian howard tampak lebih sibuk memperhatikan segala urusan teknis untuk bagaimana membuat in the heart of the sea secantik dan semegah mungkin namun tanpa jiwa dan emosi', 'durasi menyentuh  jam howard mengolah relasi karakternya potensinya konsep rivalitas clash owen chase george pollard jr niki lauda james hunt rush situ howard memperkuat naskah garapan charles leavitt blood diamond pergolakan emosi modal perseteruan karakternya utamanya sayang howard sibuk memperhatikan urusan teknis in the heart of the sea secantik semegah jiwa emosi', 'durasi sentuh  jam howard o relasi karakternya potensi konsep rivalitas clash owen chase george pollard jr nik lauda james hunt rush situ howard kuat naskah garap charles leavitt blood diamond pergola emosi modal seteru karakternya utama sayang howard sibuk hati urus teknis in the heart of the a cantik megah jiwa emosi'),
(549, 566, 'sungguh premis yang menjanjikan ketika pertama kali saya mendengarkan cerita film ini apalagi mengetahui kalau andrew niccol yang menyutradarai sekaligus menulis ceritanya saya langsung girang gattaca adalah salah satu film scifi favorit saya walaupun agak underrated selain gattaca andrew niccol juga menulis the terminal the truman show dan lord of war yang juga termasuk dalam daftar film-film yang saya sukai tetapi in time sayangnya menjadi film dengan ide yang sangat menarik tetapi eksekusi yang mengecewakan', 'sungguh premis menjanjikan kali mendengarkan cerita film andrew niccol menyutradarai menulis ceritanya langsung girang gattaca salah film scifi favorit underrated gattaca andrew niccol menulis the terminal the truman show lord of war daftar film-film sukai in time sayangnya film ide menarik eksekusi mengecewakan', 'sungguh premis janji kali dengar cerita film andrew niccol sutradara tulis cerita langsung girang gattaca salah film scifi favorit underrated gattaca andrew niccol tulis the terminal the truman show lord of war daftar film-film suka in time sayang film ide tarik eksekusi kecewa'),
(550, 567, 'jadi ketimbang lebih memusatkan segalanya pada pesona chupacabra itu sendiri orr malah seperti lebih asik bermain-main dengan karakter-karakternya masalahnya seperti chupacabra setiap tokohnya juga tidak mendapatkan perlakuan yang lebih baik mereka tidak jauh dari tipikal tokoh-tokoh sterotip dalam banyak sajian horor yang lebih cenderung bodoh terutama dalam mengambil keputusan tidak jarang mereka menganggap remeh larangan yang ada ya sepertinya dalam dunia horor peraturan larangan atau himbauan itu memang paling asik untuk dilanggar selanjutnya bisa ditebak sebuah penyesalan yang datang terlambat indigenous tidak hanya diisi oleh banyak karakter bodoh namun juga presentasinya yang seperti tidak mau kalah naskahnya sudah bisa diduga dangkal padahal kalau mau sedikit lebih rajin max roberts sang penulis bisa memberi lebih banyak', 'ketimbang memusatkan pesona chupacabra orr asik bermain-main karakter-karakternya chupacabra tokohnya perlakuan tipikal tokoh-tokoh sterotip sajian horor cenderung bodoh mengambil keputusan jarang menganggap remeh larangan ya dunia horor peraturan larangan himbauan asik dilanggar ditebak penyesalan terlambat indigenous diisi karakter bodoh presentasinya kalah naskahnya diduga dangkal rajin max roberts sang penulis', 'timbang memusatkan pesona chupacabra orr asik bermain-main karakter-karakternya chupacabra tokoh laku tipikal tokoh-tokoh sterotip saji horor cenderung bodoh ambil putus jarang anggap remeh larang ya dunia horor atur larang himbauan asik langgar tebak sesal lambat indigenous isi karakter bodoh presentasi kalah naskah duga dangkal rajin max roberts sang penulis'),
(551, 568, 'dari segi premis bisa dibilang kim sung-ho cukup berhasil mengusung benda sehari-hari sebagai medium penebar teror ya benda bernama cermin ternyata bisa menjadi sangat mengerikan di bawah arahan sung-ho apalagi didukung dengan atmosfer kelam dan sunyi ala horror-horror asia kebanyakan membuat film ini menjadi mencekam sayang hanya pada paruh pertamanya saja menginjak paruh kedua kesan mengerikan pun perlahan mulai kedodoran sampai akhirnya menginjak klimaks yang ternyata hanya terkesan begitu saja  walaupun harus diakui ending film ini sangat mengejutkan overall entah karena sudah menonton versi alexandre aja atau kenapa saya merasa into the mirror tampil tidak maksimal premis yang sebenarnya menarik harus terbuang begitu saja dikarenakan pengolahan cerita yang lemah untung saja alexandre aja mengetahui kekurangan ini dan mampu membuat mirrors versinya menjadi jauh lebih menarik', 'segi premis dibilang kim sung-ho berhasil mengusung benda sehari-hari medium penebar teror ya benda bernama cermin mengerikan arahan sung-ho didukung atmosfer kelam sunyi ala horror-horror asia kebanyakan film mencekam sayang paruh pertamanya menginjak paruh kesan mengerikan perlahan kedodoran menginjak klimaks terkesan  diakui ending film mengejutkan overall menonton versi alexandre aja into the mirror tampil maksimal premis menarik terbuang pengolahan cerita lemah untung alexandre aja kekurangan mirrors versinya menarik', 'segi premis bilang kim sung-ho hasil usung benda sehari-hari medium penebar teror ya benda nama cermin erik arah sung-ho dukung atmosfer kelam sunyi ala horror-horror asia banyak film cekam sayang paruh pertama injak paruh kesan erik perlahan dodor injak klimaks kesan  aku ending film kejut overall tonton versi alexandre aja into the mirror tampil maksimal premis tarik buang olah cerita lemah untung alexandre aja kurang mirrors versi tarik'),
(552, 569, 'dibandingkan twister into the strom memang menderita banyak di narasinya terlalu cheesy dan klise penulis naskah john swetnam memang seperti tidak terlalu ingin membuat ceritanya terlalu rumit toh ini adalah jenis film cenderung untuk dilihat ketimbang disimak jadi kamu akan menemukan pengenalan karakter yang kelewat standar dan pergerakan plot yang terlalu mudah dikenali singkatnya lupakan saja ceritanya setidaknya meskipun dangkal ia masih enak dinikmati tentu saja tidak lepas karena faktor lainnya', 'dibandingkan twister into the strom menderita narasinya cheesy klise penulis naskah john swetnam ceritanya rumit jenis film cenderung ketimbang disimak menemukan pengenalan karakter kelewat standar pergerakan plot mudah dikenali singkatnya lupakan ceritanya dangkal enak dinikmati lepas faktor', 'banding twister into the strom derita narasi cheesy klise penulis naskah john swetnam cerita rumit jenis film cenderung timbang simak temu pengenalan karakter lewat standar gerak plot mudah kenal singkat lupa cerita dangkal enak nikmat lepas faktor'),
(553, 570, 'ya jack and jill sudah menjadi pengalaman menonton komedi yang mengerikan selain harus menyaksikan karakter sandler berwujud wanita dengan wig payudara palsu lengkap dengan suara palsunya yang menganggu dan tingkah lakunya yang super bodoh nan menjijikan itu di selama satu jam setengah naskah yang dikeroyok sandler bersama tiga teman penulisnya juga terbilang sangat buruk sama buruknya dengan segala humor-humor serta dialog-dialog garing kurang ajar jorok dan kasar ala sandler yang kali ini sama sekali tidak berhasil membuat saya sulit untuk sekedar menyunggingkan senyum', 'ya jack and jill pengalaman menonton komedi mengerikan menyaksikan karakter sandler berwujud wanita wig payudara palsu lengkap suara palsunya menganggu tingkah lakunya super bodoh nan menjijikan jam naskah dikeroyok sandler teman penulisnya terbilang buruk buruknya humor-humor serta dialog-dialog garing ajar jorok kasar ala sandler kali berhasil sulit sekedar menyunggingkan senyum', 'ya jack and jill alam tonton komedi erik saksi karakter sandler wujud wanita wig payudara palsu lengkap suara palsu menganggu tingkah laku super bodoh nan jijik jam naskah keroyok sandler teman penulisnya bilang buruk buruk humor-humor serta dialog-dialog garing ajar jorok kasar ala sandler kali hasil sulit sekedar sungging senyum'),
(554, 571, 'sayang mcquarrie sepertinya tidak terlalu pintar mengeksekusi naskahnya menjadi sebuah kesatuan thirller yang solid seperti yang pernah dilakukannya pada valkyrie lalu intensitas keteganganya terasa labil ketika di satu titik ia berhasil mencapai puncak adegan kejar-kejaran mobil di titik selanjutnya ia seperti terjun bebas menjadi menjemukan dan terseok-seok dengan segala dialog-dialognya yang lemah dan itu sering terjadi berulang-ulang termasuk membuang percuma performa apik para peran pembantunya macam warner herzog yang tampil dingin sebagai the zec atau robert duvall sampai kemudian ia diakhiri dengan ending antiklimaks yang masih belum menjawab sepenuhnya siapa sebenarnya sosok jack reacher itu mungkin jika sukses akan dijelaskan dalam sekuel-sekuelnya saya kira ini bisa ditutup dengan pintar  ternyata saya salah jack reacher tidak lebih dari sebuah thriller kriminal yang berusaha keras untu terlihat cerdas dan seru sama baiknya sayang itu tidak terjadi di sini hanya terlihat bagus di  menit pertama selanjutnya kita hanya melihat mcquarrie lebih mengantungkan semuanya kepada pesona bintang seorang tom cruise', 'sayang mcquarrie pintar mengeksekusi naskahnya kesatuan thirller solid dilakukannya valkyrie intensitas keteganganya labil titik berhasil mencapai puncak adegan kejar-kejaran mobil titik terjun bebas menjemukan terseok-seok dialog-dialognya lemah berulang-ulang membuang performa apik peran pembantunya warner herzog tampil dingin the zec robert duvall ending antiklimaks sepenuhnya sosok jack reacher sukses sekuel-sekuelnya ditutup pintar  salah jack reacher thriller kriminal berusaha keras untu cerdas seru baiknya sayang bagus  menit mcquarrie mengantungkan pesona bintang tom cruise', 'sayang mcquarrie pintar eksekusi naskah satu thirller solid laku valkyrie intensitas keteganganya labil titik hasil capai puncak adegan kejar-kejaran mobil titik terjun bebas jemu terseok-seok dialog-dialognya lemah berulang-ulang buang performa apik peran bant