(555, 572, 'tentu saja mengecewakan untuk ukuran sutradara sekaliber bryan singer terlebih dengan budget sebesar itu dan banyak nama-nama aktor kelas satu di dalamnya jack the giant slayer harusnya bisa lebih dari sekedar sebuah dongeng fantasi daur ulang untuk kelas film keluarga dengan cgi pas-pasan tetapi sekali lagi saya masih sanggup menikmatinya yah setidaknya saya lebih suka yang satu ini ketimbang hansel  gratel witchs hunter ', 'mengecewakan ukuran sutradara sekaliber bryan singer budget nama-nama aktor kelas dalamnya jack the giant slayer sekedar dongeng fantasi daur ulang kelas film keluarga cgi pas-pasan sanggup menikmatinya yah suka ketimbang hansel  gratel witchs hunter ', 'kecewa ukur sutradara kaliber bryan singer budget nama-nama aktor kelas dalam jack the giant slayer sekedar dongeng fantasi daur ulang kelas film keluarga cgi pas-pasan sanggup nikmat yah suka timbang hansel  gratel witchs hunter '),
(556, 573, 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur dengan segala kegemerlapan acara waisak-nya mungkin hanya satu-satunya hal positif yang berhasil di garap conor sisanya java heat bak sebuah bencana berisik berbiaya besar yang gagal di semua sektornya termasuk membuang percuma premis dan sumber daya utamanya kecuali ada fans film aksi kelas b tanpa otak saya sarankan untuk menghindari java heat yang tidak ada panas-panasnya ini', 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur kegemerlapan acara waisak-nya satu-satunya positif berhasil garap conor sisanya java heat bak bencana berisik berbiaya gagal sektornya membuang premis sumber daya utamanya kecuali fans film aksi kelas b otak sarankan menghindari java heat panas-panasnya', 'eksploitasi besar-besaran kota jogjakarta plus candi borobudur gemerlap acara waisak-nya satu-satunya positif hasil garap conor sisa java heat bak bencana berisik biaya gagal sektor buang premis sumber daya utama kecuali fans film aksi kelas b otak saran hindar java heat panas-panasnya'),
(557, 574, 'mencampur elemen haunted house dan sihir-sihir voodoo lama dari selatan amerika jessabelle tidak pernah tampil semeyakinkan posternya sejak menit-menit awal bergulir tentu saja ada misteri yang butuh jawaban sejak kaset-kaset vhs tua itu mulai diputar oleh jessie yang malang tentu saja ada banyak pertanyaan tentang siapa itu dan mengapa ini yang sedikit banyak sudah memaksa penontonnya untuk duduk bersabar menanti akhir melewati serangkaian serangan lemah berupa jump scare murahan akting pas-pasan dari artis australia sarah snook aroma creepy yang tak pernah mencapai titik didih dan kualitas narasi lembek dan bisa dibilang jauh lebih dangkal ketimbang selokan depan rumahmu lengkap dengan banyak basa-basi tak perlu kecuali mungkin untuk memanjangkan durasinya', 'mencampur elemen haunted house sihir-sihir voodoo selatan amerika jessabelle tampil semeyakinkan posternya menit-menit bergulir misteri butuh kaset-kaset vhs tua diputar jessie malang memaksa penontonnya duduk bersabar melewati serangkaian serangan lemah jump scare murahan akting pas-pasan artis australia sarah snook aroma creepy mencapai titik didih kualitas narasi lembek dibilang dangkal ketimbang selokan rumahmu lengkap basa-basi kecuali memanjangkan durasinya', 'campur elemen haunted house sihir-sihir voodoo selatan amerika jessabelle tampil semeyakinkan poster menit-menit gulir misteri butuh kaset-kaset vhs tua putar jessie malang memaksa penontonnya duduk sabar lewat rangkai serang lemah jump scare murah akting pas-pasan artis australia sarah snook aroma creepy capai titik didih kualitas narasi lembek bilang dangkal timbang selokan rumah lengkap basa-basi kecuali memanjangkan durasi'),
(558, 575, 'seperti yang sudah saya singgung di atas tidak usah terlalu pusing memikirkan plot-nya yang memang berantakan jonah hex jelas tidak menawarkan sesuatu yang spesial pada ceritanya semuanya serba instan klise bahkan bisa dibilang jauh dibawah rata-rata film superhero yang paling standart sekalipun sebagai sutradara jimmy hayward yang sebelumnya cukup sukses menggarap horton hears a who rupanya tidak mampu mengadaptasi dengan baik kisah komik yang seharusnya memiliki potensi untuk menjadi sebuah film lebih baik dari ini membuang talenta sebaik josh brolin dan john malkovich -sorry not you megan cause you sucks like always- juga menjadi dosa terbesar hayward so andai saja tidak ada josh brolin dan malkovich di sini saya tidak mampu membayangkan bagaimana nasib kisah superhero western satu ini namun meskipun begitu dibalik segala keburukan-keburukannya jonah hex tetap adalah sebuah film ringan yang menghibur definitely a nice gulity pleasure antihero movie and i pretty much enjoyed it', 'singgung pusing memikirkan plot-nya berantakan jonah hex menawarkan spesial ceritanya serba instan klise dibilang dibawah rata-rata film superhero standart sutradara jimmy hayward sukses menggarap horton hears a who mengadaptasi kisah komik memiliki potensi film membuang talenta josh brolin john malkovich -sorry not you megan cause you sucks like always- dosa terbesar hayward so andai josh brolin malkovich membayangkan nasib kisah superhero western dibalik keburukan-keburukannya jonah hex film ringan menghibur definitely a nice gulity pleasure antihero movie and i pretty much enjoyed it', 'singgung pusing memikirkan plot-nya berantak jonah hex menawarkan spesial cerita serba instan klise bilang bawah rata-rata film superhero standart sutradara jimmy hayward sukses garap horton hears a who adaptasi kisah komik milik potensi film buang talenta josh brolin john malkovich -sorry not you megan cause you sucks like always- dosa besar hayward so andai josh brolin malkovich bayang nasib kisah superhero western balik keburukan-keburukannya jonah hex film ringan hibur definitely a nice gulity pleasure antihero movie and i pretty much enjoyed it'),
(559, 576, 'russell memang masih mempertahankan segala ciri khasnya dari momen-momen depresi yang dibungkus humor namun ia gagal menghadirkan sebuah proses yang masuk akal apalagi untuk ukuran drama berdasar kisah nyata transisi dari sebuah kegagalan menuju kesuksesan terasa digampangkan tanpa adanya sebuah penjelasan poof seperti sulap semua rintangan mendadak dengan cepat menghilang ketika joy menginginkannya proses transisi yang ajaib ini malah menghilangkan kesan realistisnya membuatnya menjadi semacam fantasi yang tentu saja terasa aneh', 'russell mempertahankan ciri khasnya momen-momen depresi dibungkus humor gagal menghadirkan proses masuk akal ukuran drama berdasar kisah nyata transisi kegagalan kesuksesan digampangkan penjelasan poof sulap rintangan mendadak cepat menghilang joy menginginkannya proses transisi ajaib menghilangkan kesan realistisnya membuatnya fantasi aneh', 'russell tahan ciri khas momen-momen depresi bungkus humor gagal hadir proses masuk akal ukur drama dasar kisah nyata transisi gagal sukses gampang jelas poof sulap rintang dadak cepat hilang joy ingin proses transisi ajaib hilang kesan realistis buat fantasi aneh'),
(560, 577, 'masalahnya tidak peduli seberapa dahsyat spesial efek dan hebohnya rentetan aksi yang tersaji pesona jupiter ascending dengan cepat menurun drastis entah karena terkesan repetitif atau tidak ada lagi yang bisa ditawarkan ketika para wachowskis ketika merka langsung mengobral cepat jualannya sejak awal tanpa menawarkan sesuatu yang lebih besar lagi dalam perjalannya ya tidak butuh waktu lama buat saya untuk segera merasakan kejenuhan wachowskis mengulangi lagi dan lagi sekuen yang sama dengan setting berbeda dengan suasan yang semakin berisik hal negatif ini kemudian diperparah dengan kualitas narasi yang sama membosankannya konsep yang ditawarkan memang terlihat besar dan ambisius bahkan lana sesumbar ada elemen spritual bekerja di dalamnya masalahnya entah saya tidak peka atau memang pesannya tidak berhasil tersampaikan dengan baik alih-alih menjadi versi baru the matrix dan cloud atlas jupiter ascending dengan cepat jatuh menjadi sajian sci-fi action garing dengan naskah kelas medioker saya tidak peduli dengan cerita terlebih karakter-karakternya yang annoying dan gagal meninggalkan kesan bahkan elemen yang seharusnya bisa memberikan hiburan lebih seperti aksi dan spesial efeknya juga dengan cepat meleleh menjadi semelahkan naskahnya hingga akhirnya satu-satunya yang saya tunggu adalah kedatangan end credit roll-nya', 'peduli dahsyat spesial efek hebohnya rentetan aksi tersaji pesona jupiter ascending cepat menurun drastis terkesan repetitif ditawarkan wachowskis merka langsung mengobral cepat jualannya menawarkan perjalannya ya butuh merasakan kejenuhan wachowskis mengulangi sekuen setting berbeda suasan berisik negatif diperparah kualitas narasi membosankannya konsep ditawarkan ambisius lana sesumbar elemen spritual dalamnya peka pesannya berhasil alih-alih versi the matrix cloud atlas jupiter ascending cepat jatuh sajian sci-fi action garing naskah kelas medioker peduli cerita karakter-karakternya annoying gagal meninggalkan kesan elemen hiburan aksi spesial efeknya cepat meleleh semelahkan naskahnya satu-satunya tunggu kedatangan end credit roll-nya', 'peduli dahsyat spesial efek heboh rentet aksi saji pesona jupiter ascending cepat turun drastis kesan repetitif ditawarkan wachowskis merka langsung obral cepat jual menawarkan jalan ya butuh rasa jenuh wachowskis ulang sekuen setting beda suasan berisik negatif parah kualitas narasi bosan konsep ditawarkan ambisius lana sumbar elemen spritual dalam peka pesan hasil alih-alih versi the matrix cloud atlas jupiter ascending cepat jatuh saji sci-fi action garing naskah kelas medioker peduli cerita karakter-karakternya annoying gagal tinggal kesan elemen hibur aksi spesial efek cepat leleh semelahkan naskah satu-satunya tunggu datang end credit roll-nya'),
(561, 578, 'lantas apa yang kemudian ditawarkan jurassic world ia bahkan hanya ditangani oleh sutradara sekaliber colin trevorrow yang terakhir menggarap sci-fi indie safety not guaranteed ya di dalamnya kita memang akan menemukan spesies baru dino yang lebih ganas lebih kuat lebih cerdas dan memiliki lebih banyak gigi dari t-rex bernama konyol indominus rex indominus rex pula lah yang kemudian menjadi alasan kenapa naskah dangkal jurassic world masih bisa berjalan ada petualangan mendebarkan khususnya di paruh ketiga dan momen puncaknya ketika karakter-karakter utamanya berusaha bertahan hidup dari serangan indominus rex yang mengerikan tentu saja semuanya itu dibungkus bersama adegan-adegan aksi dan kejar-kejaran seru nan mendebarkan dalam balutan cgi yang keren dan visual megah khas film musim panas yang mahal plus tambahan gimmick efek d yang sayang tidak bekerja terlalu maksimal sama tidak maksimalnya dengan pengembangan karakter yang terkesan apa adanya', 'lantas ditawarkan jurassic world ditangani sutradara sekaliber colin trevorrow menggarap sci-fi indie safety not guaranteed ya dalamnya menemukan spesies dino ganas kuat cerdas memiliki gigi t-rex bernama konyol indominus rex indominus rex alasan naskah dangkal jurassic world berjalan petualangan mendebarkan paruh ketiga momen puncaknya karakter-karakter utamanya berusaha bertahan hidup serangan indominus rex mengerikan dibungkus adegan-adegan aksi kejar-kejaran seru nan mendebarkan balutan cgi keren visual megah khas film musim panas mahal plus tambahan gimmick efek d sayang maksimal maksimalnya pengembangan karakter terkesan', 'lantas ditawarkan jurassic world ditangani sutradara kaliber colin trevorrow garap sci-fi indie safety not guaranteed ya dalam temu spesies dino ganas kuat cerdas milik gigi t-rex nama konyol indominus rex indominus rex alas naskah dangkal jurassic world jalan tualang debar paruh tiga momen puncak karakter-karakter utama usaha tahan hidup serang indominus rex erik bungkus adegan-adegan aksi kejar-kejaran seru nan debar balut cgi keren visual megah khas film musim panas mahal plus tambah gimmick efek d sayang maksimal maksimal pengembangan karakter kesan'),
(562, 579, 'naskahnya lemah dan cenderung terlalu lurus tidak peduli kemudian ia diberikan penghalang berupa seorang cantik bernama kimberly rider yang muncul ditengah-tengah dua hati yang sedang saling mengobati dan memperburuk keadaan toh ia tidak pernah menjadi terlalu rumit bahkan kita bisa mencium endingnya dari kejauhan tanpa harus menjadi anjing pelacak tapi sekali lagi bukan hanya itu masalahnya ekskusi yang dilakukan iqbal rais juga semakin memperparah segalanya alurnya lambat terlalu bertele-tele tidak peduli ketika ia bersama dop-nya berhasil menangkap gambar-gambar cantik kota jogja atau bagaimana andhika triyadi mampu membungkusnya dengan soundtrack-soundtrack romantis ini sama sekali tidak bekerja dengan baik itu saya belum menyebut dua karakter utamanya yang tidak punya cukup chemistry untuk membuatmu percaya bahwa ada banyak cinta di dalamnya lalu ada sub plot bodoh tentang adik fila yang sama sekali tidak penting kecuali untuk memperpanjang durasinya', 'naskahnya lemah cenderung lurus peduli penghalang cantik bernama kimberly rider muncul ditengah-tengah hati mengobati memperburuk rumit mencium endingnya kejauhan anjing pelacak ekskusi iqbal rais memperparah alurnya lambat bertele-tele peduli dop-nya berhasil menangkap gambar-gambar cantik kota jogja andhika triyadi membungkusnya soundtrack-soundtrack romantis menyebut karakter utamanya chemistry membuatmu percaya cinta dalamnya sub plot bodoh adik fila kecuali memperpanjang durasinya', 'naskah lemah cenderung lurus peduli halang cantik nama kimberly rider muncul ditengah-tengah hati obat buruk rumit cium endingnya jauh anjing lacak ekskusi iqbal rais parah alur lambat bertele-tele peduli dop-nya hasil tangkap gambar-gambar cantik kota jogja andhika triyadi bungkus soundtrack-soundtrack romantis sebut karakter utama chemistry buat percaya cinta dalam sub plot bodoh adik fila kecuali panjang durasi'),
(563, 580, 'meskipun dimulai dengan berantakan toh saya tetap harus melanjutkan film ini hingga habis karena sudah terlanjur penasaran dengan bagaimana nasib sang anak untung saja selanjutnya ternyata not so bad beberapa adegan tersaji cukup menarik dan menegangkan dengan tempo naik turun plus beberapa momen melodrama yang seharusnya mengaharukan namun tetap saja harus diakui adegan-adegan tersebut terkesan terlalu lebay atau berlebih-lebihan dalam penggarapannya sehingga cukup menganggu kenyamanan menonton', 'berantakan melanjutkan film habis terlanjur penasaran nasib sang anak untung not so bad adegan tersaji menarik menegangkan tempo turun plus momen melodrama mengaharukan diakui adegan-adegan terkesan lebay berlebih-lebihan penggarapannya menganggu kenyamanan menonton', 'berantak lanjut film habis lanjur penasaran nasib sang anak untung not so bad adegan saji tarik tegang tempo turun plus momen melodrama mengaharukan aku adegan-adegan kesan lebay berlebih-lebihan garap menganggu nyaman tonton'),
(564, 581, 'masih beranggapan saya berlebihan ya ini adalah jenis film yang menawarkan premis yang buruk dalam artian positif kotor dan cabul dengan banyak menampilkan gambar-gambar vulgar lalu kamu akan tahu kenapa film jenis ini dibatasi dengan rating nc- di as sana yang jelas membuatnya sulit untuk mendapatkan banyak penonton tetapi ini memang bukan film yang pantas untuk ditonton oleh banyak orang', 'beranggapan ya jenis film menawarkan premis buruk artian positif kotor cabul menampilkan gambar-gambar vulgar film jenis dibatasi rating nc- as membuatnya sulit penonton film ditonton orang', 'anggap ya jenis film tawar premis buruk arti positif kotor cabul tampil gambar vulgar film jenis batas rating nc- as buat sulit tonton film tonton orang'),
(565, 582, 'ketika drama keluarga dengan segala tetek bengek melodrama dan isu-isu sosialnya bisa tersaji lebih kuat dan menarik ladda land malah harus menderita pada sisi horornya malah membuat elemen yang seharunya mendapatkan porsi paling besar ini terkesan sebagai sebuah subplot tambahan yang buruk termasuk dengan hadirnya rentetan plot hole yang tidak pernah terungkap dan juga terkesan terlalu dipaksakan hanya untuk memenuhi tujuannya untuk menakut-nakuti penontonnya dengan cara murahan tanpa memberikan asas cerita yang kuat bukan berarti saya mengatakan sukdapisit gagal total dalam menghadirkan segala momen mencekam dan atmosfer creepynya di beberapa bagian ladda land masih mampu memberikan terapi kejut yang efektif sayang klimaksnya sedikit tertebak tetapi saya menyukai bagaimana kemudian sukdapisit memilih sentuhan drama ketimbang horor untuk menutup kisahnya', 'drama keluarga tetek bengek melodrama isu-isu sosialnya tersaji kuat menarik ladda land menderita sisi horornya elemen seharunya porsi terkesan subplot tambahan buruk hadirnya rentetan plot hole terungkap terkesan dipaksakan memenuhi tujuannya menakut-nakuti penontonnya murahan asas cerita kuat sukdapisit gagal total menghadirkan momen mencekam atmosfer creepynya ladda land terapi kejut efektif sayang klimaksnya tertebak menyukai sukdapisit memilih sentuhan drama ketimbang horor menutup kisahnya', 'drama keluarga tetek bengek melodrama isu-isu sosial saji kuat tarik ladda land derita sisi horor elemen haru porsi kesan subplot tambah buruk hadir rentet plot hole ungkap kesan paksa memenuhi tuju menakut-nakuti penontonnya murah asas cerita kuat sukdapisit gagal total hadir momen cekam atmosfer creepynya ladda land terapi kejut efektif sayang klimaks tebak suka sukdapisit memilih sentuh drama timbang horor tutup kisah'),
(566, 583, 'tidak ada yang terlalu istimewa dalam letters to juliet semuanya tersaji serba standart tidak sampai terlalu mengecewakan memang namun masih jauh juga untuk dikatakan sebagai sebuah film yang bagus tipikal drama romantis hollywood yang hanya mejual keindahan kulit luar ketimbang kedalaman ceritanya', 'istimewa letters to juliet tersaji serba standart mengecewakan film bagus tipikal drama romantis hollywood mejual keindahan kulit ketimbang kedalaman ceritanya', 'istimewa letters to juliet saji serba standart kecewa film bagus tipikal drama romantis hollywood jual indah kulit timbang dalam cerita'),
(567, 584, 'tidak peduli seberapa memesonanya penampilan cantik lily collins dengan alis tebalnya itu naskah towhidi dengan cepat dan pasti membuatnya menjadi tidak lebih dari karakter perempuan bodoh yang insecure haus akan cinta yang tak kunjung datang membuatnya seperti terlihat selalu putus asa dalam mengambil setiap keputusan yang kemudian di sesalinya tetapi penampilan collins bisa dibilang terlihat jauh lebih baik ketimbang ketika narasinya memperlakukan tokoh alex yang dibawakan jebolan the hunger games sam claflin alex adalah jenis manusia yang jauh lebih menyedihkan ketimbang rosie punya banyak kesempatan untuk mengakhiri konfliknya lebih cepat namun yang terjadi adalah sebuah kebodohan demi kebodohan yang membuatnya seperti tidak pantas menjadi pria yang ditunggu selama  tahun', 'peduli memesonanya penampilan cantik lily collins alis tebalnya naskah towhidi cepat membuatnya karakter perempuan bodoh insecure haus cinta kunjung membuatnya putus asa mengambil keputusan sesalinya penampilan collins dibilang ketimbang narasinya memperlakukan tokoh alex dibawakan jebolan the hunger games sam claflin alex jenis manusia menyedihkan ketimbang rosie kesempatan konfliknya cepat kebodohan kebodohan membuatnya pria ditunggu ', 'peduli memesonanya penampilan cantik lily collins alis tebalnya naskah towhidi cepat buat karakter perempuan bodoh insecure haus cinta kunjung buat putus asa ambil putus sesal penampilan collins bilang timbang narasi laku tokoh alex bawak jebol the hunger games sam claflin alex jenis manusia sedih timbang rosie sempat konflik cepat bodoh bodoh buat pria tunggu '),
(568, 585, 'man on a ledge thriller dengan premis menarik eksekusi yang tidak terlalu buruk dan deretan bintang-bintang besar sayang ia harus dirusak dengan kualitas naskah menyedihkan yah masih untung ia tidak berakhir membosankan dan sekali lagi mungkin anda harus menutup sebelah mata untuk benar-benar bisa merasakan segala kebodohannya yang menghibur itu', 'man on a ledge thriller premis menarik eksekusi buruk deretan bintang-bintang sayang dirusak kualitas naskah menyedihkan yah untung membosankan menutup sebelah mata benar-benar merasakan kebodohannya menghibur', 'man on a ledge thriller premis tarik eksekusi buruk deret bintang-bintang sayang rusak kualitas naskah sedih yah untung bosan tutup sebelah mata benar-benar rasa bodoh hibur'),
(569, 586, 'di luar dari kepiawaian clarke yang membawakan peran gadis kikuk manisnya me before you juga untungnya didukung chemistry yang lumayan sepadan dari duet clarke dan claflin keduanya cukup mampu menjaga laju filmnya yang beralur lemah dan kelewat enteng sebagai sajian komedi romantis me before you sudah memenuhi semua kriteria film mainstream sejenis dari dua pemeran utama yang berwajah sedap dipandang tempat-tempat berpanorama elok di mata hingga lantunan lagu-lagu yang sedap didengar kurangnya ada di naskah tulisan moyes sendiri yang berasa kelewat manis dan ringan bak gula kapas arumanis sebegitu manisnya hingga terkadang membuat enek isu sensitif euthanasia yang bisa digali dengan mendalam juga dijadikan sekedar tempelan belaka di penghujung plotnya di tangan sineas inggris thea sharrock me before you juga terkesan main aman tak berani bermain-main keluar dari zona aman stereotype komedi romantis kontemporer yang belakangan ini mulai terasa menjemukan', 'kepiawaian clarke membawakan peran gadis kikuk manisnya me before you untungnya didukung chemistry lumayan sepadan duet clarke claflin menjaga laju filmnya beralur lemah kelewat enteng sajian komedi romantis me before you memenuhi kriteria film mainstream sejenis pemeran utama berwajah sedap dipandang tempat-tempat berpanorama elok mata lantunan lagu-lagu sedap didengar kurangnya naskah tulisan moyes berasa kelewat manis ringan bak gula kapas arumanis manisnya terkadang enek isu sensitif euthanasia digali mendalam dijadikan sekedar tempelan belaka penghujung plotnya tangan sineas inggris thea sharrock me before you terkesan main aman berani bermain-main zona aman stereotype komedi romantis kontemporer menjemukan', 'piawai clarke bawak peran gadis kikuk manis me before you untung dukung chemistry lumayan padan duet clarke claflin jaga laju film alur lemah lewat enteng saji komedi romantis me before you memenuhi kriteria film mainstream jenis pemeran utama wajah sedap pandang tempat-tempat panorama elok mata lantun lagu-lagu sedap dengar kurang naskah tulis moyes asa lewat manis ringan bak gula kapas arumanis manis kadang enek isu sensitif euthanasia gali dalam jadi sekedar tempel belaka hujung plot tang sineas inggris thea sharrock me before you kesan main aman berani bermain-main zona aman stereotype komedi romantis kontemporer jemu'),
(570, 587, 'paruh pertama minions bisa dibilang cukup menarik melihat bagaimana coffin dan penulis naskah menciptakan origins kaum minion bagaimana melihat mereka bertahan hidup dari satu majikan ke majikan lain dalam sebuah rentang waktu sejarah yang sangat panjang dengan segala tingkah laku kocak yang sayangnya selalu berakhir buruk masalahnya kelucuan yang seharusnya bisa maksimal harus menjadi terasa hambar karena sebelumnya sudah bolak-balik dibocorkan oleh trailer-nya yang muncul dalam berbagai versi nyaris tidak menyisakan sesuatu yang benar-benar berbeda untuk bisa membuat penontonnya kemudian bisa sampai terpingkal sementara di paruh kedua ada lebih banyak momen aksi yang melibatkan set amerika dan inggris di era an akhir lengkap dengan segala pernak-pernik budaya dan sejarahnya plus elemen spionase klasik tetapi coffin seperti sudah kehabisan amunisi untuk menghadirkan lelucon baru buat para minion-nya hasilnya kelucuan yang dihadirkan minions perlahan namun pasti menjadi garing dan annoying setiap lelucon kemudian hanya sebatas menghasilkan sedikit senyum ketimbang tawa lepas sementara kemunculan karakter villain baru macam scarlet overkill pun tidak mampu memberikan banyak pengaruh besar buat pergerakan plot-nya mungkin salah suara sandra bullock yang tidak sejahat penampilannya atau mungkin juga salah penulis naskah brian lnych yang tidak mampu mengolah sebuah narasi yang kuat buat para minion bahkan suara-suara yang dihadirkan bintang-bintang besar macam michael keaton jon hamm steve coogan sampai geoffrey rush seperti tidak memberi pengaruh apa-apa selain hanya menjadi label jualan', 'paruh minions dibilang menarik coffin penulis naskah menciptakan origins kaum minion bertahan hidup majikan majikan rentang sejarah tingkah laku kocak sayangnya buruk kelucuan maksimal hambar bolak-balik dibocorkan trailer-nya muncul versi menyisakan benar-benar berbeda penontonnya terpingkal paruh momen aksi melibatkan set amerika inggris era an lengkap pernak-pernik budaya sejarahnya plus elemen spionase klasik coffin kehabisan amunisi menghadirkan lelucon minion-nya hasilnya kelucuan dihadirkan minions perlahan garing annoying lelucon sebatas menghasilkan senyum ketimbang tawa lepas kemunculan karakter villain scarlet overkill pengaruh pergerakan plot-nya salah suara sandra bullock sejahat penampilannya salah penulis naskah brian lnych mengolah narasi kuat minion suara-suara dihadirkan bintang-bintang michael keaton jon hamm steve coogan geoffrey rush pengaruh apa-apa label jualan', 'paruh minions bilang tarik coffin penulis naskah cipta origins kaum minion tahan hidup majikan majikan rentang sejarah tingkah laku kocak sayang buruk lucu maksimal hambar bolak-balik bocor trailer-nya muncul versi sisa benar-benar beda penontonnya pingkal paruh momen aksi libat set amerika inggris era an lengkap pernak-pernik budaya sejarah plus elemen spionase klasik coffin habis amunisi hadir lelucon minion-nya hasil lucu hadir minions perlahan garing annoying lelucon batas hasil senyum timbang tawa lepas muncul karakter villain scarlet overkill pengaruh gerak plot-nya salah suara sandra bullock jahat penampilannya salah penulis naskah brian lnych o narasi kuat minion suara-suara hadir bintang-bintang michael keaton jon hamm steve coogan geoffrey rush pengaruh apa-apa label jual'),
(571, 588, 'narasinya menjebak anda untuk ikut tersesat seperti halnya laura yang terombang ambing didalamnya dimulai sejak peristiwa di klub malam itu selanjutnya akan banyak kejutan tidak terduga yang membuat anda tetap terjaga menantikan apa yang kira-kira akan terjadi kemudian pada laura yang berada di tempat dan waktu yang salah sayang naranjo menghadirkan film yang mewakili meksiko dalam ajang oscar  ini sedikit bertele-tele dan terkesan repetitif pesannya sendiri juga tidak pernah mencapai sasaran kecuali satu hal meksiko itu memang keras bung tidak ada karakter yang benar-benar baik di sini bahkan polisi sampai jenderal sekalipun semuanya korup tapi selain itu kita benar-benar dibuat bingung apa yang sebenarnya ingin disampaikan naranjo tidak ada klimaks bahkan terdapat beberapa bagian yang nampak konyol dan tidak masuk akal ', 'narasinya menjebak tersesat halnya laura terombang ambing didalamnya peristiwa klub malam kejutan terduga terjaga menantikan laura salah sayang naranjo menghadirkan film mewakili meksiko ajang oscar  bertele-tele terkesan repetitif pesannya mencapai sasaran kecuali meksiko keras karakter benar-benar polisi jenderal korup benar-benar bingung naranjo klimaks nampak konyol masuk akal ', 'narasi jebak sesat hal laura terombang ambing dalam peristiwa klub malam kejut duga jaga nanti laura salah sayang naranjo hadir film wakil meksiko ajang oscar  bertele-tele kesan repetitif pesan capai sasar kecuali meksiko keras karakter benar-benar polisi jenderal korup benar-benar bingung naranjo klimaks nampak konyol masuk akal '),
(572, 589, 'memang di menit-menit awal money monster terasa menjanjikan ketika foster memilih untuk tidak menjadikannya the big short versi  yang cerewet berbicara soal uang dan ekonomi dan langsung tancap gas ke konflik utamanya lalu presentasi thriller ruang sempitnya juga tidak buruk perpindahan antara adegan di panggung dan di ruang kontrol digarap dengan baik di bagian ini foster cukup pintar memberikan momen intensnya meski buat saya efek tegangnya dengan cepat berlalu bersama penampilan tokoh-tokohnya yang kurang bersimpati serta transisi antara komedi dan dramanya yang kacau kecuali mungkin julia roberts yang bermain cukup oke sebagai director money monster meski ia selalu berada di belakang layar bagian terburuk money monster ada pada third act-nya itu bukan sebuah puncak yang bagus terkesan memaksakan diri dengan segala konklusi yang datang secara kebetulan dan bersamaan tetapi sekali lagi ini bukan tontonan yang buruk setidaknya saya menikmati apa yang ditawarkan foster di sini terlepas dari segala kekurangannya', 'menit-menit money monster menjanjikan foster memilih menjadikannya the big short versi  cerewet berbicara uang ekonomi langsung tancap gas konflik utamanya presentasi thriller ruang sempitnya buruk perpindahan adegan panggung ruang kontrol digarap foster pintar momen intensnya efek tegangnya cepat penampilan tokoh-tokohnya bersimpati serta transisi komedi dramanya kacau kecuali julia roberts bermain oke director money monster layar terburuk money monster third act-nya puncak bagus terkesan memaksakan konklusi bersamaan tontonan buruk menikmati ditawarkan foster terlepas kekurangannya', 'menit-menit money monster janji foster memilih jadi the big short versi  cerewet bicara uang ekonomi langsung tancap gas konflik utama presentasi thriller ruang sempit buruk pindah adegan panggung ruang kontrol garap foster pintar momen intens efek tegang cepat penampilan tokoh-tokohnya simpati serta transisi komedi drama kacau kecuali julia roberts main oke director money monster layar buruk money monster third act-nya puncak bagus kesan memaksakan konklusi sama tonton buruk nikmat ditawarkan foster lepas kurang'),
(573, 590, 'beberapa kekurangan lain seperti dialog yang tidak berkembang disaat memasuki pertengahan film dan lemahnya chemistry yang terjalin antara scoot mcnairy dan whitney able menjadi catatan tersendiri disini cukup mengejutkan memang mengingat keduanya sebenarnya juga adalah pasangan di dunia nyata namun kenyataannya mereka tidak mampu menghasilkan pendekatan satu sama lain dengan meyakinkan', 'kekurangan dialog berkembang disaat memasuki pertengahan film lemahnya chemistry terjalin scoot mcnairy whitney able catatan tersendiri mengejutkan pasangan dunia nyata kenyataannya menghasilkan pendekatan', 'kurang dialog kembang saat masuk tengah film lemah chemistry jalin scoot mcnairy whitney able catat sendiri kejut pasang dunia nyata nyata hasil dekat'),
(574, 591, 'jelas ini adalah film besar lihat konsepnya lihat budgetnya lihat distribusi masalnya lihat bagaimana para tim spesial efeknya berhasil melakukan pekerjaan rumah mereka dengan menciptakan gorilla cgi menggemaskan yang nyaris sempurna sebagai daya pikat terbesarnya lalu memberikannya baseball sebagai pertunjukan utama tetapi yang terjadi pada narasinya bisa dikatakan berbanding terbalik dengan segala teknis canggihnya entah terlalu sibuk memfokuskan semuanya untuk menciptakan sosok gorilla sebagus mungkin mereka bahkan membuat setiap helai bulu ling ling yang berjumlah  juta kim yong-hwa melupakan bahwa mr go juga memerlukan kualitas cerita yang bagus atau setidaknya tidak sampai sedangkal dan semudah ini', 'film lihat konsepnya lihat budgetnya lihat distribusi masalnya lihat tim spesial efeknya berhasil pekerjaan rumah menciptakan gorilla cgi menggemaskan sempurna daya pikat terbesarnya memberikannya baseball pertunjukan utama narasinya berbanding terbalik teknis canggihnya sibuk memfokuskan menciptakan sosok gorilla sebagus helai bulu ling ling  juta kim yong-hwa melupakan mr go kualitas cerita bagus sedangkal semudah', 'film lihat konsep lihat budgetnya lihat distribusi masalnya lihat tim spesial efek hasil kerja rumah cipta gorilla cgi gemas sempurna daya pikat besar berik baseball tunjuk utama narasi banding balik teknis canggih sibuk fokus cipta sosok gorilla bagus helai bulu ling ling  juta kim yong-hwa lupa mr go kualitas cerita bagus dangkal mudah');
INSERT INTO `sa_bagofwords` (`id_bagofwords`, `id_review`, `term_tokenized`, `term_filtered`, `term_stemmed`) VALUES
(575, 592, 'jujur saja mudah kok untuk menebak siapa yang menjadi pilihan lintang toh ini bukan film christopher nolan yang njelimet atau terrence malick yang absurd petunjuk-petunjuknya sudah tersebar jelas di sepanjang film dengan karakter lintang yang cenderung serius dan sedikit manja kandidat calon suami langsung mengerucut ke dua orang belum lagi twist menjelang akhir film semakin memperjelas siapa yang akhirnya bersanding di pelaminan bersamanya mungkin saya tidak terlalu memusingkan pertanyaan siapa itu mudah namun dengan potensi premis yang sebenarnya menjanjikan akan sebuah proses pengenalan karakter yang dalam ternyata disia-siakan oleh endri pelita memang ada pengenalan satu per satu karakternya namun itu masih dirasa terlalu minim dan hanya menyentuh permukaannya saja', 'jujur mudah menebak pilihan lintang film christopher nolan njelimet terrence malick absurd petunjuk-petunjuknya tersebar film karakter lintang cenderung serius manja kandidat calon suami langsung mengerucut orang twist menjelang film memperjelas bersanding pelaminan bersamanya memusingkan mudah potensi premis menjanjikan proses pengenalan karakter disia-siakan endri pelita pengenalan karakternya dirasa minim menyentuh permukaannya', 'jujur mudah tebak pilih lintang film christopher nol njelimet terrence malick absurd petunjuk-petunjuknya sebar film karakter lintang cenderung serius manja kandidat calon suami langsung kerucut orang twist jelang film jelas sanding lamin sama memusingkan mudah potensi premis janji proses pengenalan karakter disia-siakan endri pelita pengenalan karakternya rasa minim sentuh muka'),
(576, 593, 'ampir sepanjang  jam setengah tidak ada sesuatu yang istimewa yang ditawarkan disini semuanya terkesan plain membosankan belum lagi akting-akting bodoh yang ditampilkan para pemainnya membuat saya berharap film ini untuk secepat mungkin berakhir dan berharap secepat mungkin menyaksikan ending-nya yang mungkin saja akan membuat saya terbangun namun apa yang ditunggu ternyata jauh diluar dugaan jujur saja saya terkejut namun bukan dalam arti yang postif saya terkejut karena seumur hidup belum pernah saya menonton sebuah thriller dengan ending sebodoh ini bahkan hanya dengan membaca judulnya saja kita akan tahu bagaimana akhir film kelas b satu ini', 'ampir  jam istimewa ditawarkan terkesan plain membosankan akting-akting bodoh ditampilkan pemainnya berharap film secepat berharap secepat menyaksikan ending-nya terbangun ditunggu diluar dugaan jujur terkejut arti postif terkejut seumur hidup menonton thriller ending sebodoh membaca judulnya film kelas b', 'ampir  jam istimewa ditawarkan kesan plain bosan akting-akting bodoh tampil main harap film cepat harap cepat saksi ending-nya bangun tunggu luar duga jujur kejut arti postif kejut umur hidup tonton thriller ending bodoh baca judul film kelas b'),
(577, 594, 'sementara kemunculan tokoh hammond yang dimainkan pierce brosnan alih-alih menjadi daya tarik malah melemahkan tidak ada kejelasan karakter hammond siapa ia dan apa tugasnya hammond muncul seenaknya dengan kharisma khas brosnan selalu di saat dan momen yang terlalu pas membuat no escape kehilangan elemen realistisnya karakter hammond sama tidak jelas dengan latar belakang narasi utamanya yang sama sekali tidak pernah membahas mengapa dan kenapa situasi politik bisa memanas yang kita tahu para pemberontak tidak terima karena amerika menguasai sumber air dan mendirikan perusahaan di sana masalahnya apakah itu bisa menjadi motif kuat untuk memicu sebuah aksi pemberontakan meski set waktunya berlangsung cepat terhitung hanya satu malam tetapi melihat bagaimana pemerintah yang nyaris tidak bereaksi dan hanya muncul di awal konflik itu jelas menjadi sebuah plot hole yang mengganggu', 'kemunculan tokoh hammond dimainkan pierce brosnan alih-alih daya tarik melemahkan kejelasan karakter hammond tugasnya hammond muncul kharisma khas brosnan momen pas no escape kehilangan elemen realistisnya karakter hammond latar narasi utamanya membahas situasi politik memanas pemberontak terima amerika menguasai sumber air mendirikan perusahaan motif kuat memicu aksi pemberontakan set cepat terhitung malam pemerintah bereaksi muncul konflik plot hole mengganggu', 'muncul tokoh hammond main pierce brosnan alih-alih daya tarik lemah jelas karakter hammond tugas hammond muncul kharisma khas brosnan momen pas no escape hilang elemen realistis karakter hammond latar narasi utama bahas situasi politik memanas berontak terima amerika kuasa sumber air diri usaha motif kuat memicu aksi berontak set cepat hitung malam pemerintah reaksi muncul konflik plot hole ganggu'),
(578, 595, 'masalah utama nurse d bukan pada lemahnya naskah yang memang sangat-sangat cheesy atau efek d-nya yang norak soal itu sudah sangat bisa dimaklumi tetapi bagaimana ketidak konsistenan penyutradaraan aarniokoski di awal-awal ia seperti ingin membungkus nurse dengan kemasan grindhouse seksi dan erotis bersama segala unsur gotik-nya yang penyajiannya seakan-akan sengaja dibentuk dalam kemasan hororthriller murahan namun dalam perjalanannya semua itu menguap dan ironisnya menjadikan nurse benar-benar terasa murahan termasuk efek d-nya -ya saya tidak pernah menyukai ide hororthriller bercampur d', 'utama nurse d lemahnya naskah sangat-sangat cheesy efek d-nya norak dimaklumi ketidak konsistenan penyutradaraan aarniokoski awal-awal membungkus nurse kemasan grindhouse seksi erotis unsur gotik-nya penyajiannya seakan-akan sengaja dibentuk kemasan hororthriller murahan perjalanannya menguap ironisnya menjadikan nurse benar-benar murahan efek d-nya -ya menyukai ide hororthriller bercampur d', 'utama nurse d lemah naskah sangat-sangat cheesy efek d-nya norak maklum tidak konsisten sutradara aarniokoski awal-awal bungkus nurse kemas grindhouse seksi erotis unsur gotik-nya saji seakan-akan sengaja bentuk kemas hororthriller murah jalan uap ironis jadi nurse benar-benar murah efek d-nya -ya suka ide hororthriller campur d'),
(579, 596, 'ada hal-hal yang tidak konsisten dan dipaksakan dalam perjalannya menuju akhir yang membuat plotnya berlubang di beberapa bagian belum lagi karakter-karakter baru yang seperti selalu muncul silih berganti seperti ingin membuat penontonnya bingung untuk menebak siapa pelakunya tanpa adanya latar belakang yang jelas entah karena sommers tidak lihai mengubah narasi novelnya ke naskah film tanpa dukungan koontz fyi sommers menulis sendiri naskahnya setelah membaca novelnya karena tidak mendapatkan hak cipta dari dean koontz sebelum akhirnya diberikan pada juni  lalu  atau sederhana memang novelnya sendiri yang tidak kuat saya tidak terlalu percaya yang ini menjadikan odd thomas kedodoran di setengah jam terakhir plus twist ending yang memaksa', 'hal-hal konsisten dipaksakan perjalannya plotnya berlubang karakter-karakter muncul silih berganti penontonnya bingung menebak pelakunya latar sommers lihai mengubah narasi novelnya naskah film dukungan koontz fyi sommers menulis naskahnya membaca novelnya hak cipta dean koontz juni   sederhana novelnya kuat percaya menjadikan odd thomas kedodoran jam plus twist ending memaksa', 'hal-hal konsisten paksa jalan plot lubang karakter-karakter muncul silih ganti penontonnya bingung tebak laku latar sommers lihai ubah narasi novel naskah film dukung koontz fyi sommers tulis naskah baca novel hak cipta de koontz juni   sederhana novel kuat percaya jadi odd thomas dodor jam plus twist ending memaksa'),
(580, 597, 'tempo yang dibangun sudah pas tidak terlalu lambat dan tidak kelewat cepat namun entah kenapa masih terkesan dangkal dan kurang menyentuh mitos tentang celtic creature yang menjadi tema utama sepertinya hanya dijadikan pajangan disepanjang film pertanyaan tentang siapa sebenarnya ondine memang terjawab di akhir film namun sekali lagi tidak membuat film ini menjadi istimewa karenanya', 'tempo dibangun pas lambat kelewat cepat terkesan dangkal menyentuh mitos celtic creature tema utama dijadikan pajangan disepanjang film ondine terjawab film film istimewa', 'tempo bangun pas lambat lewat cepat kesan dangkal sentuh mitos celtic creature tema utama jadi pajang disepanjang film ondine jawab film film istimewa'),
(581, 598, 'bukan pilihan romcom yang tepat untuk menghabiskan malam valentine bersama pasanganmu terlalu medioker dan mudah dilupakan tanpa sebuah romantisme dan chemistry yang kuat untung saja masih ada italia dan wajah cantik tomei yang setidaknya mampu membuat saya atau mungkin penonton pria lainnya mampu bertahan menyaksikan only you sampai akhir', 'pilihan romcom menghabiskan malam valentine pasanganmu medioker mudah dilupakan romantisme chemistry kuat untung italia wajah cantik tomei penonton pria bertahan menyaksikan only you', 'pilih romcom habis malam valentine pasang medioker mudah lupa romantisme chemistry kuat untung italia wajah cantik tomei penonton pria tahan saksi only you'),
(582, 599, 'pasca opening-nya tensinya langsung melorot drastis meskipun tidak sampai mengerucutkan niatmu untuk melihat akhirnya lpez-gallego jelas harus banyak berterima kasih kepada sharlto copley yang menjadi alasan besar kenapa open grave masih layak ditonton selain misterinya dan tentu saja ending yang kamu tunggu-tunggu sebenarnya tidak perlu menunggu sampai habis untuk mencerna semuanya toh lpez-gallego terlalu baik untuk memberikan banyak petunjuk dan flashback tentang apa yang sebenarnya terjadi dan ketika akhir itu datang hasilnya tidak terlalu mengejutkan lagi sebuah akhir yang ternyata sangat familiar hanya saja seperti nasib para karakternya kita seperti dibuat tidak tahu apa-apa dari awal', 'pasca opening-nya tensinya langsung melorot drastis mengerucutkan niatmu lpez-gallego berterima kasih sharlto copley alasan open grave layak ditonton misterinya ending tunggu-tunggu menunggu habis mencerna lpez-gallego petunjuk flashback hasilnya mengejutkan familiar nasib karakternya apa-apa', 'pasca opening-nya tensi langsung lorot drastis kerucut niat lpez-gallego terima kasih sharlto copley alas open grave layak tonton misteri ending tunggu-tunggu tunggu habis cerna lpez-gallego tunjuk flashback hasil kejut familiar nasib karakternya apa-apa'),
(583, 600, 'jujur meskipun mengakui sebagai fans beratnya saya tidak pernah berharap banyak pada instalemen terbaru pa ini apalagi mengingat ini sebuah spin-off dan benar saja the marked ones mengecewakan termasuk buat penonton yang memuja franchise ini macam saya tidak ada hal baru di sini seperti berjalan di tempat yang sama semuanya sudah pernah kamu lihat parahnya the marked ones tersaji dengan kualitas keangkeran yang menurun jauh  bahkan dari seri ke-empatnya sekalipun yang digadang-gadang sebagai seri terburuk', 'jujur mengakui fans beratnya berharap instalemen terbaru pa spin-off the marked ones mengecewakan penonton memuja franchise berjalan lihat parahnya the marked ones tersaji kualitas keangkeran menurun  seri ke-empatnya digadang-gadang seri terburuk', 'jujur aku fans berat harap instalemen baru pa spin-off the marked ones kecewa penonton memuja franchise jalan lihat parah the marked ones saji kualitas angker turun  seri ke-empatnya digadang-gadang seri buruk'),
(584, 601, 'yang menjadi permasalahan bukan karena plotnya yang familiar namun untuk sebuah film yang katanya menjual erotic thriller passion jelas kurang unsur erotisnya ia terasa lebih berat ke arah misteri dan crime-nya yang sempit termasuk mengekslpoitasi pesona mcadams dan repace dengan akting kuat namun sayang karkater-karakter mereka seperti kurang punya movitasi dan datar ini terasa seperti salah satu episode serial televisi ketimbang sebuah sajian layar lebar tidak peduli seberapa banyaknya de palma menginjeksinya dengan serum hitchcockian dan segala ciri khas-nya teknik split-screen dutch angle shot-shot panjang passion terasa kecil belum lagi saya menyebut banyak kejutan-kejutan murahan macam sekuen mimpi yang berulang-ulang dan twist yang bisa dikatakan sedikit bodoh tetapi toh meskipun lebih banyak kekurangnnya ujung-ujungnya yang paling penting adalah bagaimana saya menikmati semuanya baik teknis sinematis jempolannya maupun plotnya yang lemah', 'permasalahan plotnya familiar film menjual erotic thriller passion unsur erotisnya berat arah misteri crime-nya sempit mengekslpoitasi pesona mcadams repace akting kuat sayang karkater-karakter movitasi datar salah episode serial televisi ketimbang sajian layar lebar peduli banyaknya de palma menginjeksinya serum hitchcockian ciri khas-nya teknik split-screen dutch angle shot-shot passion menyebut kejutan-kejutan murahan sekuen mimpi berulang-ulang twist bodoh kekurangnnya ujung-ujungnya menikmati teknis sinematis jempolannya plotnya lemah', 'masalah plot familiar film jual erotic thriller passion unsur erotis berat arah misteri crime-nya sempit mengekslpoitasi pesona mcadams repace akting kuat sayang karkater-karakter movitasi datar salah episode serial televisi timbang saji layar lebar peduli banyak de palma injeksi serum hitchcockian ciri khas-nya teknik split-screen dutch angle shot-shot passion sebut kejutan-kejutan murah sekuen mimpi berulang-ulang twist bodoh kekurangnnya ujung-ujungnya nikmat teknis sinematis jempol plot lemah'),
(585, 602, 'jujur saya menikmati setiap lagu-lagu modifikasi tidak pernah menyangka bahwa the sign legendarisnyaace of base bisa dimodif seperti itu yang dihadirkan di sini mereka sungguh terdengar keren dan itu jelas adalah bagian terbaiknya tetapi tetap saja sebagai sebuah film utuh ia tidak boleh hanya bergantung pada satu elemen saja sementara elemen lainnya tidak bekerja maksimal maka inilah pitch perfect sebuah drama komedi kompetisi dengan cerita tipis yang punya humor-humor garing romansa dangkal dan banyak karakter-karakter bodoh tetapi jika kamu mencari tontonan seringan kapas dan sedangkal selokan depan rumah dengan kualitas musikalitas yang bagus silahkan', 'jujur menikmati lagu-lagu modifikasi menyangka the sign legendarisnyaace of base dimodif dihadirkan sungguh terdengar keren terbaiknya film utuh bergantung elemen elemen maksimal pitch perfect drama komedi kompetisi cerita tipis humor-humor garing romansa dangkal karakter-karakter bodoh mencari tontonan seringan kapas sedangkal selokan rumah kualitas musikalitas bagus silahkan', 'jujur nikmat lagu-lagu modifikasi sangka the sign legendarisnyaace of base dimodif hadir sungguh dengar keren baik film utuh gantung elemen elemen maksimal pitch perfect drama komedi kompetisi cerita tipis humor-humor garing romansa dangkal karakter-karakter bodoh cari tonton sering kapas dangkal selokan rumah kualitas musikalitas bagus silah'),
(586, 603, 'jika film pertamanya menggantungkan dirinya pada pengenalan dan banyak hal-hal baru yang menarik pitch perfect  seperti terkesan malas untuk membuat plot-nya menjadi lebih greget memang ada kompetisi yang lebih besar dan kompetitor yang lebih ganas dalam wujud das sound machine yang kerap menghadirkan performa mengesankan dan masih ada perang lagu tetapi hampir separuhnya adalah pengulang demi pengulangan belum lagi hampir diisi oleh sub-plot tak penting misalnya kisah percintaan fat amy dengan mantan pemimpin the treblemakers bumper allen yang masih dimainkan adam devine atau kisah beca yang mencoba meraih karier sebagai musisi selepas lulus nanti sebenarnya bukan sampai tidak terlalu penting namun yang menjadi masalah adalah ia seperti tidak mempunyai tujuan tidak ada spirit dan antusiasme besar dari para bellas seperti yang pernah dihadirkan di seri pertamanya semua terkesan canggung termasuk beberapa guyonan garing yang masih mengandalkan rabel wilson dan beberapa anggota bellas macam lilly onakurama pendatang baru si anak hispanik flo dengan segala keanehan komedinya', 'film pertamanya menggantungkan pengenalan hal-hal menarik pitch perfect  terkesan malas plot-nya greget kompetisi kompetitor ganas wujud das sound machine kerap menghadirkan performa mengesankan perang lagu separuhnya pengulang pengulangan diisi sub-plot kisah percintaan fat amy mantan pemimpin the treblemakers bumper allen dimainkan adam devine kisah beca mencoba meraih karier musisi selepas lulus tujuan spirit antusiasme bellas dihadirkan seri pertamanya terkesan canggung guyonan garing mengandalkan rabel wilson anggota bellas lilly onakurama pendatang si anak hispanik flo keanehan komedinya', 'film pertama gantung pengenalan hal-hal tarik pitch perfect  kesan malas plot-nya greget kompetisi kompetitor ganas wujud das sound machine kerap hadir performa kesan perang lagu paruh ulang ulang isi sub-plot kisah cinta fat amy mantan pemimpin the treblemakers bumper allen main adam devine kisah beca coba raih karier musisi lepas lulus tuju spirit antusiasme bellas hadir seri pertama kesan canggung guyon garing andal rabel wilson anggota bellas lilly onakurama datang si anak hispanik flo aneh komedi'),
(587, 604, 'harus diakui narasinya setipis kertas dan pengembangan karkaternya nyaris nol termasuk di dalamnya romansa antara sam brenner dan lieutenant colonel violet van patten yang dimainkan michelle monaghan tetapi ini bukan jenis film yang mesti kamu anggap terlalu serius dari segi penceritaan apalagi karakter berbekal premis ajaib yang seperti persilangan antara independece day ghostbusters wreck it ralph dan futurama spesial efek mahal visual yang memanjakan mata dan guyonan khas sandler dengan kadar kekurang ajaran yang sedikit dikompres bersama spirit nostalgia dari era an yang tidak pernah ketinggalan di setiap filmnya plus momen-momen aksi seru mendebarkan ya pixels masih bisa lah kamu masukan ke dalam golongan film keluarga yang paling menghibur tahun ini', 'diakui narasinya setipis kertas pengembangan karkaternya nol dalamnya romansa sam brenner lieutenant colonel violet van patten dimainkan michelle monaghan jenis film mesti anggap serius segi penceritaan karakter berbekal premis ajaib persilangan independece day ghostbusters wreck it ralph futurama spesial efek mahal visual memanjakan mata guyonan khas sandler kadar kekurang ajaran dikompres spirit nostalgia era an ketinggalan filmnya plus momen-momen aksi seru mendebarkan ya pixels masukan golongan film keluarga menghibur', 'aku narasi tipis kertas pengembangan karkaternya nol dalam romansa sam brenner lieutenant colonel violet v patten main michelle monaghan jenis film mesti anggap serius segi cerita karakter bekal premis ajaib silang independece day ghostbusters wreck it ralph futurama spesial efek mahal visual manja mata guyon khas sandler kadar kurang ajar kompres spirit nostalgia era an tinggal film plus momen-momen aksi seru debar ya pixels masuk golong film keluarga hibur'),
(588, 605, 'ah sayang sekali scott steward tampaknya terlalu percaya dengan diri membuang sebagaian besar elemen-elemen penting dalam komiknya meninggalkan priest telanjang dengan segala kekurangan-kekurangannya baik dalam naskah maupun bagaimana menghadirkan momen-momen aksinya yang seharusnya bisa menjadi bagian paling menghibur disini yah untuk menghibur anda priest setidaknya sedikit lebih baik dari legion', 'ah sayang scott steward percaya membuang sebagaian elemen-elemen komiknya meninggalkan priest telanjang kekurangan-kekurangannya naskah menghadirkan momen-momen aksinya menghibur yah menghibur priest legion', 'ah sayang scott steward percaya buang bagai elemen-elemen komik tinggal priest telanjang kekurangan-kekurangannya naskah hadir momen-momen aksi hibur yah hibur priest legion'),
(589, 606, 'jujur saja untuk sebuah film yang diadaptasi dari novel secara keseluruhan terlepas dari twistnya cerita primal fear memiliki lubang yang cukup banyak walaupun itu terbatas hanya pada subplotnya saja namun cukup menganggu banyak hal yang ditinggalkan mengambang tanpa penjelasan begitu saja seakan akan subplot tersebut hanya digunakan untuk memperpanjang durasi film tanpa berpengaruh besar pada cerita utamanya', 'jujur film diadaptasi novel terlepas twistnya cerita primal fear memiliki lubang terbatas subplotnya menganggu ditinggalkan mengambang penjelasan seakan subplot memperpanjang durasi film berpengaruh cerita utamanya', 'jujur film adaptasi novel lepas twistnya cerita primal fear milik lubang batas subplotnya menganggu tinggal ambang jelas akan subplot panjang durasi film pengaruh cerita utama'),
(590, 607, 'dengan premis yang menantang dan teknis sinematik serumit dan semengagumkan itu itu pvc- seharusnya bisa tampil perkasa sayang pada akhirnya thriller satu ini tidak pernah berhasil membuat kita benar-benar merasakan sebuah sensai ketegangan yang seharusnya di sepanjang kurang lebih satu jam setengah durasinya ya jujur saja saya memang kagum dengan bagaimana stathoulopoulos mempresentasikannya tapi disaat bersamaan ia juga berhasil membuat saya cukup frustasi disaat menontonnya', 'premis menantang teknis sinematik serumit semengagumkan pvc- tampil perkasa sayang thriller berhasil benar-benar merasakan sensai ketegangan jam durasinya ya jujur kagum stathoulopoulos mempresentasikannya disaat bersamaan berhasil frustasi disaat menontonnya', 'premis tantang teknis sinematik rumit semengagumkan pvc- tampil perkasa sayang thriller hasil benar-benar rasa sensai tegang jam durasi ya jujur kagum stathoulopoulos presentasi saat sama hasil frustasi saat tonton'),
(591, 608, 'lalu datanglah bencana itu dipertengahan naskahnya menjadi amburadul entah apa yang terjadi ketika robert schwentke mencoba mencampurkan alam baka dan dunia manusia menjadi satu ya manusia dapat melihat apa yang dilakukan ripd meskipun senjata mereka terlihat seperti pisang dan yang lebih para dari cgi setengah matang untuk ukuran film berbiaya ratusan juta dan momen aksi yang mudah terlupakan adalah plot hole besar', 'datanglah bencana dipertengahan naskahnya amburadul robert schwentke mencoba mencampurkan alam baka dunia manusia ya manusia ripd senjata pisang cgi matang ukuran film berbiaya ratusan juta momen aksi mudah terlupakan plot hole', 'datang bencana tengah naskah amburadul robert schwentke coba campur alam baka dunia manusia ya manusia ripd senjata pisang cgi matang ukur film biaya ratus juta momen aksi mudah lupa plot hole'),
(592, 609, 'jujur saja horor satu ini termasuk salah satu mockumentary yang buruk pawan kripalani sebagai sutradara telah gagal mengeksekusi setiap momen didalamnya niatnya sih boleh saja besar ingin menampilkan ragini mms layaknya sebuah crossover antara paranormal activity dan the blair witch project dengan berusaha menampilkan tampilan indoor maupun outdoor se creepy mungkin sayang usahanya tidak berhasil semua yang disajikan disini terkesan terburu-buru asal-asalan dan terlihat murahan penampatan kamera-kamera cctv kelewat banyak dan tidak logis malah menambah kesan tidak realistis penampakan mahkluk halusnya beserta segala ganguan-ganguannya terlalu di obral habis-habisan sejak keduanya menginjak rumah itu sedari pertama kali parahanya lagi kripalani juga nyaris tidak mampu menghadirkan sesuatu yang menakutkan disini kecuali setting rumah itu sendiri', 'jujur horor salah mockumentary buruk pawan kripalani sutradara gagal mengeksekusi momen didalamnya niatnya sih menampilkan ragini mms layaknya crossover paranormal activity the blair witch project berusaha menampilkan tampilan indoor outdoor creepy sayang usahanya berhasil disajikan terkesan terburu-buru asal-asalan murahan penampatan kamera-kamera cctv kelewat logis menambah kesan realistis penampakan mahkluk halusnya beserta ganguan-ganguannya obral habis-habisan menginjak rumah sedari kali parahanya kripalani menghadirkan menakutkan kecuali setting rumah', 'jujur horor salah mockumentary buruk pawan kripalani sutradara gagal eksekusi momen dalam niat sih tampil ragini mms layak crossover paranormal activity the blair witch project usaha tampil tampil indoor outdoor creepy sayang usaha hasil saji kesan terburu-buru asal-asalan murah penampatan kamera-kamera cctv lewat logis tambah kesan realistis penampakan mahkluk halus beserta ganguan-ganguannya obral habis-habisan injak rumah dari kali parahanya kripalani hadir takut kecuali setting rumah'),
(593, 610, 'overall rec mungkin adalah salah satu dari sekian banyak sequel mengecewakan yang juga seharusnya tidak perlu dibuat karena film pertamanya sebenarnya sudah berhasil ditutup dengan sangat baik namun apa daya lagi-lagi faktor komersial untuk mengeruk untung lebih banyak dengan tidak diimbangi dengan kualitas yang memadai menjadi noda besar pada film ini mudah-mudahan saja nanti seri ke- nya bisa tampil lebih baik dari seri keduanya ini', 'overall rec salah sekian sequel mengecewakan film pertamanya berhasil ditutup daya lagi-lagi faktor komersial mengeruk untung diimbangi kualitas memadai noda film mudah-mudahan seri ke- nya tampil seri', 'overall rec salah kian sequel kecewa film pertama hasil tutup daya lagi-lagi faktor komersial keruk untung imbang kualitas memadai noda film mudah-mudahan seri ke- nya tampil seri'),
(594, 611, 'bagaimana dengan ceritanya seperti yang sudah dijelaskan sedikit diatas tema cerita seperti ini sudah sering diangkat dalam sebuah film oleh sineas-sineas dunia sehingga tidak ada sesuatu yang bisa diandalkan dalam ceritanya kalau tidak mau dibilang membosankan dan tidak fokus terhadap masalah yang ingin disampaikan mungkin satu-satunya yang menyelamatkan film ini sehingga masih layak ditonton hingga akhir adalah endingnya yang cukup powerfull ya akhir yang luar biasa untuk ukuran film yang tergolong biasa-biasa ini benar-benar membuat penontonnya bak tersengat listrik dan membangunkan mereka dari kebosanan yang melanda hampir kurang lebih  jam overall untuk sebuah film yang tidak isitmewa yang hanya mengandalkan seorang robert pattinson semata sebagai nilai jual terbesar remember me tampil terlalu lama dan membosankan tampaknya r-pratz masih harus giat belajar akting lebih banyak lagi jika tidak mau dibilang sebagai aktor yang hanya mengandalkan tampang semata', 'ceritanya diatas tema cerita diangkat film sineas-sineas dunia diandalkan ceritanya dibilang membosankan fokus satu-satunya menyelamatkan film layak ditonton endingnya powerfull ya ukuran film tergolong biasa-biasa benar-benar penontonnya bak tersengat listrik membangunkan kebosanan melanda  jam overall film isitmewa mengandalkan robert pattinson nilai jual terbesar remember me tampil membosankan r-pratz giat belajar akting dibilang aktor mengandalkan tampang', 'cerita atas tema cerita angkat film sineas-sineas dunia andal cerita bilang bosan fokus satu-satunya selamat film layak tonton endingnya powerfull ya ukur film golong biasa-biasa benar-benar penontonnya bak sengat listrik bangun bosan landa  jam overall film isitmewa andal robert pattinson nilai jual besar remember me tampil bosan r-pratz giat belajar akting bilang aktor andal tampang'),
(595, 612, 'jadi dengan menurunkan ekpektasi saya serendah-rendahnya saya membaranikan diri untuk duduk dan menonton kisah terbaru petualangan alice di negeri para zombie ini seperti yang sudah bisa ditebak memang tidak ada hal yang baru yang ditawarkan anderson dalam resident evil afterlife terutama dari segi cerita yang seakan-akan mengulang kembali formula yang sama dengan seri-seri sebelumnya yah seperti yang sudah saya bilang tadi saya sama sekali tidak terkejut dan sangat memaklumi kekonsistenan anderson dalam menggarap ceritan dan dialog-dialog yang sangat dangkal dan klise ini bahkan judul resident evil sendiri sepertinya sama sekali tidak mewakili kisah di versi game-nya jadi kita langsung saja membahas senjata utama film yang membuat film ini terasa istimewa yaitu pengunaan d fusion camera system', 'menurunkan ekpektasi serendah-rendahnya membaranikan duduk menonton kisah terbaru petualangan alice negeri zombie ditebak ditawarkan anderson resident evil afterlife segi cerita seakan-akan mengulang formula seri-seri yah bilang terkejut memaklumi kekonsistenan anderson menggarap ceritan dialog-dialog dangkal klise judul resident evil mewakili kisah versi game-nya langsung membahas senjata utama film film istimewa pengunaan d fusion camera system', 'turun ekpektasi serendah-rendahnya membaranikan duduk tonton kisah baru tualang alice neger zombie tebak ditawarkan anderson resident evil afterlife segi cerita seakan-akan ulang formula seri-seri yah bilang kejut maklum konsisten anderson garap ceritan dialog-dialog dangkal klise judul resident evil wakil kisah versi game-nya langsung bahas senjata utama film film istimewa pengunaan d fusion camera system'),
(596, 613, 'ya retreat membosankan dan terlalu lama bergerak naskahnya tidak sekuat idenya eksekusinya lemah hingga ia tidak pernah mampu mencapai potensi ketegangan yang semestinya bisa jauh lebih baik walaupun harus diakui juga tibbets sempat membuat saya mengalami keraguan sejenak tentang kebenaran kabar kiamat yang dihebuskan oleh karakter jack disini dan senang mengetahui endingnya mampu mengobati kekecewaan saya dengan sedikit twist yang cerdas tidak ada yang menonjol dari ketiga karakter utamanya cillian murphy nyaris bermain tanpa emosi dan pemilihan jamie bell adalah sebuah kesalahan bukan karena aktingnya buruk tapi ia terlalu lugu untuk kemudian didapuk sebagai tokoh antagonis disini', 'ya retreat membosankan bergerak naskahnya sekuat idenya eksekusinya lemah mencapai potensi ketegangan semestinya diakui tibbets mengalami keraguan kebenaran kabar kiamat dihebuskan karakter jack senang endingnya mengobati kekecewaan twist cerdas menonjol ketiga karakter utamanya cillian murphy bermain emosi pemilihan jamie bell kesalahan aktingnya buruk lugu didapuk tokoh antagonis', 'ya retreat bosan gerak naskah kuat ide eksekusi lemah capai potensi tegang mesti aku tibbets alami ragu benar kabar kiamat dihebuskan karakter jack senang endingnya obat kecewa twist cerdas tonjol tiga karakter utama cillian murphy main emosi pemilihan jamie bell salah aktingnya buruk lugu didapuk tokoh antagonis'),
(597, 614, 'kualitas narasinya mungkin bukan yang terbaik namun sudah cukup untuk menegaskan kembali franchise ini masih punya daya tarik dan ia tidak sebodoh seri keduanya riddick juga banyak dihiasi dengan dialog-dialog canggung tetapi kamu pastinya tidak menonton riddick untuk mencari dialog pintar bukan terlalu banyak karkater tanpa ada waktu memberikan mereka kedalaman tidak seperti pitch black yang membaginya sama rata di sini hanya riddick yang berkuasa penuh', 'kualitas narasinya terbaik franchise daya tarik sebodoh seri riddick dihiasi dialog-dialog canggung pastinya menonton riddick mencari dialog pintar karkater kedalaman pitch black membaginya riddick berkuasa penuh', 'kualitas narasi baik franchise daya tarik bodoh seri riddick hias dialog-dialog canggung pasti tonton riddick cari dialog pintar karkater dalam pitch black bagi riddick kuasa penuh'),
(598, 615, 'ada premis bagus dari novel bagus sutradara dan penulis naskah menjanjikan dan sebuah ensemble cast menarik tetapi bagi penonton awam ini hanya film terbaru dari arnie tidak lebih tidak kurang tetapi jangan terlalu banyak berharap ini akan diwarnai banyak ledakan dan keributan ala kebanyakan film schwarzeneggerya memang sabotage sendiri memang masih tidak jauh-jauh dari otot senjata berat dialog humor one liner dan sedikit aksi tetapi ayer ingin menjual misteri dan sisi psikologis karakternya ketimbang parade aksi hasilnya sabotage dengan kandungan misteri gelap dan kadar violence cukup vulgar terlihat seperti sebuah horor slasher beralut kemachoan yang sayang tidak mampu berjalan beriringan dengan sempurna', 'premis bagus novel bagus sutradara penulis naskah menjanjikan ensemble cast menarik penonton awam film terbaru arnie berharap diwarnai ledakan keributan ala kebanyakan film schwarzeneggerya sabotage jauh-jauh otot senjata berat dialog humor one liner aksi ayer menjual misteri sisi psikologis karakternya ketimbang parade aksi hasilnya sabotage kandungan misteri gelap kadar violence vulgar horor slasher beralut kemachoan sayang berjalan beriringan sempurna', 'premis bagus novel bagus sutradara penulis naskah janji ensemble cast tarik penonton awam film baru arnie harap warna ledak ribut ala banyak film schwarzeneggerya sabotage jauh-jauh otot senjata berat dialog humor one liner aksi ayer jual misteri sisi psikologis karakternya timbang parade aksi hasil sabotage kandung misteri gelap kadar violence vulgar horor slasher beralut kemachoan sayang jalan iring sempurna'),
(599, 616, 'tidak usahlah membahas plotnya yang tipis dan serba memaksakan diri kita tahu benar dari awal bahwa sadako vs kayako memang akan berakhir menggelikan ketimbang mengerikan bersama humor-humor yang datang dari celetukan-celetukan bodoh karakternya serta momen-momen kematian yang terkesan berlebihan alias over the top tetapi bukan berarti kamu tidak bisa menikmati setiap menit yang disajikan shiraishi di sini aspek horor khas negeri matahari terbit itu tetap dipertahankan sejak awal film dibuka masih ada aura creepy yang masih cukup sanggup menggoyang para penonton berhati lembek dengan segala penampakan-penampakan mengerikan yang muncul dari koridor-koridor gelap', 'usahlah membahas plotnya tipis serba memaksakan sadako vs kayako menggelikan ketimbang mengerikan humor-humor celetukan-celetukan bodoh karakternya serta momen-momen kematian terkesan alias over the top menikmati menit disajikan shiraishi aspek horor khas negeri matahari terbit dipertahankan film dibuka aura creepy sanggup menggoyang penonton berhati lembek penampakan-penampakan mengerikan muncul koridor-koridor gelap', 'usah bahas plot tipis serba memaksakan sadako vs kayako geli timbang erik humor-humor celetukan-celetukan bodoh karakternya serta momen-momen mati kesan alias over the top nikmat menit saji shiraishi aspek horor khas neger matahari terbit tahan film buka aura creepy sanggup goyang penonton hati lembek penampakan-penampakan erik muncul koridor-koridor gelap'),
(600, 617, 'polisi korup uang kotor gengster baku hantam peluru di mana mana dan kejar-kejaran dengan kualitas cerita apa adanya safe seperti kebanyakan film statham lainnya yang memang didesain cepat untuk sekedar menjadi suguhan murni hiburan buat penontonnya sayang tidak bekerja terlalu baik bahkan untuk sekedar menikmati porsi aksi tanpa otaknya yang tak pernah bisa mencapai kadar maksimunya', 'polisi korup uang kotor gengster baku hantam peluru kejar-kejaran kualitas cerita safe kebanyakan film statham didesain cepat sekedar suguhan murni hiburan penontonnya sayang sekedar menikmati porsi aksi otaknya mencapai kadar maksimunya', 'polisi korup uang kotor gengster baku hantam peluru kejar-kejaran kualitas cerita safe banyak film statham desain cepat sekedar suguh murni hibur penontonnya sayang sekedar nikmat porsi aksi otak capai kadar maksimunya'),
(603, 620, 'mengaku mengekor mengisap menguap mengolah mengoper mengikis mengatasi mengobati mengolok', 'mengaku mengekor mengisap menguap mengolah mengoper mengikis mengatasi mengobati mengolok', 'mengaku suka suka suka mengolah suka kikis atas obat suka');
