INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(18, 'Carol', 'POSITIF', 'DATA LATIH', 'Di permukaannya, naskah Carol garapan Phyllis Nagy mungkin tidak sampai serumit romansa provokatif sejenis. Tidak ada momen emosional, tidak ada pertentangan besar dari lingkungan. Ruang lingkupnya dipersempit pada tokoh Carol dan konflik internalnya, namun bagaimana cara Haynes memperlakukan kesederhanaan narasinya menjadi sajian yang intim dan personal. Nada-nada depresi dan dingin menghiasi 118 menit durasinya. Ada begitu banyak cinta, nafsu sekaligus rasa putus asa di udara yang dibungkus oleh visual cantik dan detail  desain produksi yang sempurna serta iringan scoring lembut Carter Burwell yang sanggup menghasilkan sisi sentimentil tersendiri, namun yang terpenting adalah bagaimana Haynes berhasil memaksimalkan daya pikat dua cast utamanya yang bermain gemilang guna memperkuat narasinya.'),
(19, 'Circles', 'POSITIF', 'DATA LATIH', 'Meski terdiri dari banyak cerita dan karakter, namun semuanya mendapatkan perlakuan dan jatah seimbang. Setiap tokohnya berjuang menyembuhkan luka dalam diri mereka dengan sebuah keberanian menghadapi ketakutan. setiap konflik berhasil menyedot perhatian sama besarnya. Dan bagaimana akhirnya seperti kembali lagi ke awal itu adalah menjadi bagian paling berkesan. Semuanya berhasil dibungkus Golubovic bersama dukungan sinematografi cantik, silent moment penuh renungan, kekuatan akting fantastis dan kandungan tema filosofis yang tergambar dalam kepedihan puitis dalam 112 menit durasinya.'),
(20, 'Chronicle', 'POSITIF', 'DATA LATIH', 'Ada banyak ledakan besar, mobil-mobil terbalik, dilema moral dan pertarungan hebat di klimaksnya yang kemudian berakhir dengan suara penuh kekaguman dari penonton dan tentu saja pertanyaan menarik seperti “Bagaimana mereka melakukannya?” Ya, biayanya ‘hanya’ 15 juta Dollar tapi Chronicle punya cita rasa, spesial efek dan magis seperti film-film blockbuster mahal yang dananya puluhan kali lipat, sekali lagi semua itu berkat ide brilian dan kemampuan luar biasa dua sineas mudanya yang mampu membuat manusia bisa terbang dengan serealistis itu. '),
(21, 'Compliance', 'POSITIF', 'DATA LATIH', 'Compliance sekali lagi membuktikan bahwa thriller kecil pun dapat memberikan sebuah efek teror yang besar dengan efektif. Saya sarankan untuk tidak mencari info terlalu banyak soal film ini karena ini adalah jenis thriller yang semakin sedikit kamu tahu tentangnya semakin bagus.'),
(22, 'Creed', 'POSITIF', 'DATA LATIH', 'Meski tampil dengan raut muka menyebalkan di sepanjang film, Michael B. Jordan sukses menjadi hero baru, berdampingan dengan mentornya Rocky tua yang ternyata mampu dimainkan dengan sangat baik oleh Stallone penuh kerut wajah tanpa harus melibatkan otot dan tinju.'),
(23, 'Dog Day Afternoon', 'POSITIF', 'DATA LATIH', 'Dog Day Afternoon sukses menyuguhkan dirinya sebagai salah satu crime thriller paling hebat sepanjang masa. Bukan hanya karena terinspirasi dari kisah nyata saja, namun juga bagaimana seorang Sidney Lumet menyajikannya dengan sangat luar biasa dengan adegan demi adegan di dalamnya, dan semuanya menjadi terasa semakin lengkap dengan dukungan akting kuat dari seorang Al Pacino.'),
(24, 'District 9', 'POSITIF', 'DATA LATIH', 'Sepertinya sudah cukup lama sebuah tidak ada sebuah fiksi ilmiah yang mampu tampil beda dan luar biasa, dan sepertinya District 9 mampu mengobati kerinduan para penontonnya akan hal tersebut, dengan keorisinalan cerita maupun penggarapannya membuat District 9 menjadi salah satu yang terbaik di genrenya, dan tidak usah heran jika di masa yang akan datang bakal ada film-film fiksi ilmiah lain yang meniru gaya yang ditampilkan oleh District 9.'),
(25, 'Don''t Breathe', 'POSITIF', 'DATA LATIH', 'Kudos buat Stephen Lang yang bermain sebagai the Blind Man dengan sangat fantastis, karakter si buta dengan segala ancamannya adalah pusat gravitasi buat Don’t Breathe, ia adalah mimpi buruk buat para maling dan penyusup yang nekat.'),
(26, 'Drag Me to Hell', 'POSITIF', 'DATA LATIH', 'Film ini secara di luar dugaan mampu menghibur saya lebih dari yang saya perkirakan sebelumnya. Sebuah horror modern dengan sentuhan klasik dari Sam Raimi yang berhasil membuat sebuah film horror yang berkelas. Dari opening scene saja saya sudah bakalan menduga kalau film ini bakalan memberikan suasana yang berbeda dari film-film horor kebanyakan. '),
(27, 'Drinking Buddies', 'POSITIF', 'DATA LATIH', 'Berbicara soal pemainnya, tidak seperti mumblecore pada umumnya, Swanberg melakukan seperti yang dilakukan koleganya, Duplass bersaudara; Mengisinya dengan nama-nama besar macam Oliva Wilde dan Anna Kendrick, tetapi bukan berarti kehadiran mereka hanya sekedar bahan jualan semata. Wilde yang mendominasi bersama Johnson yang karismatik tampil energik dan percaya diri sebagai Kate. Sementara Kendrick tampil kalem seperti biasa, memberikan sedikit kerapuhan akan komitmen kepada karakternya.\r\nDrinking Buddies punya kualitas bagus untuk ukuran drama mikro budget. Teknik penyutradaraan minimalis  Swanberg  mampu menangkap momen-momen manis di dalam maupun di luar plot yang lalu dipoles dengan visual intim dari sinematografer Beasts of the Southern Wild, Ben Richardson dan scoring pop indie lembut Kris Swanson.'),
(28, 'Drive', 'POSITIF', 'DATA LATIH', 'Sepertinya saya tidak terlalu berlebihan menobatkan Drive sebagai salah satu yang terbaik tahun ini. Nicolas Winding Refn sudah membuat film aksi cerdas, artistik, brutal dan juga begitu emosional dengan gayanya sendiri yang tidak biasa dan menyegarkan di tengah hamparan mainstream Hollywood yang selama ini menawarkan sesuatu yang itu-itu saja, dan bukan hanya itu, Refn juga telah melahirkan sosok anti hero baru dalam diri Ryan Gosling, sebagai seorang supir jagoan yang tidak hanya keren, tapi juga tidak pernah tanggung-tanggung dalam menjalankan aksinya.'),
(29, 'Easy A', 'POSITIF', 'DATA LATIH', 'Easy A jelas dengan mudah menjadikan dirinya sebagai salah satu teen flick terbaik tahun ini. Kisahnya yang sederhana namun berhasil dikemas menarik dengan dialog-dialog cerdas dan humor-humor menggelitik, belum lagi didukung dengan penampilan fantastis dari Emma Stone menjadikan film ini sebagai sebuah film wajib ditonton bagi siapa saja yang mencari drama komedi remaja berkualitas'),
(30, 'Elephant', 'POSITIF', 'DATA LATIH', 'Elephant bukan hanya sekedar crime drama biasa, berkat sentuhan dingin seorang Gus Van Sant, film produksi HBO ini berhasil menyajikan sebuah pengalaman menonton drama yang berbeda dan unik, sebuah drama yang mampu meninggalkan kesan bagi setiap penontonnya, khususnya bagi pecinta drama dengan alur yang lambat.'),
(31, 'Elysium', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah aksi fiksi ilmiah kamu masih akan mendapatkan semua keasyikan ala Blomkamp yang pernah kamu dapatkan dalam District 9 dalam bungkusan visual dan efek canggih garapan Industrial Light and Magic yang masih terasa ‘manusiawi’ sama ketika Weta menggarap District 9 dulu, termasuk senjata-senjata keren nan dashyat serta gear canggih yang dipakai karakter Damon dan Copley. '),
(32, 'Enemy', 'POSITIF', 'DATA LATIH', 'Meskipun terkesan rumit dan penuh simbolisme macam karya-karya David Lynch, sebenarnya Enemy tidak sampai seabsurd itu. Ya, memang mungkin kamu akan dipaksa untuk menontonnya lebih dari satu kali dalam usaha menemukan maksud dari semua momen surealisnya, tetapi kamu akan menyadari bahwa Villeneuve dan penulis naskah Javier Gullon sebenarnya sudah sangat berbaik hati untuk memberikan jawaban dari pertanyaan-pertanyaan yang mengganggumu. Ini seperti sebuah jigsaw puzzle kuning besar berdurasi satu jam setengah di mana setiap kepingannya menunggu untuk ditemukan guna membentuk wajahnya secara keseluruhan. Dan keping-keping itu sebenarnya sudah terhampar di setiap adegan, di setiap dialog yang semuanya secara cerdas berhasil diolah Villeneuve menjadi sebuah sajian thriller kompleks sekaligus cerdas.'),
(33, 'Enter the Void', 'POSITIF', 'DATA LATIH', 'Melalui Enter the Void, Gaspar Noe kembali sukses menyajikan sebuah pengalaman sinematik yang luar biasa, tidak hanya indah namun juga bisa dibilang gila, menghipnotis bahkan memabukkan dalam arti sebenarnya, terutama bagi para penonton yang gampang mual. Pendek kata, Enter the Void adalah sebuah masterpiece yang tidak mudah dilupakan dari seorang Gaspar Noe.'),
(34, 'Escape Plan', 'POSITIF', 'DATA LATIH', 'Daya tarik dari film ini adalah bagaimana mencari celah untuk kabur, permainan adu pintar dan kucing-kucingan dengan para penjaga dan sipir penjara dan itu semua disajikan dengan editing menghibur nan cepat sejak menit pertama ketika penontonnya diperlihatkan bagaimana karakter Breslin melakukan pertunjukan ‘sulapnya’.'),
(35, 'Europa Report', 'POSITIF', 'DATA LATIH', 'Polesan plot familiar yang mengerikan dan mendebarkan, visual cantik dan teknis realistis serta akting kuat para pemainnya adalah elemen-elemen yang kamu temukan dalam 90 menit Europa Report, dan hebatnya ini bukan space thriller besar macam franchise Alien namun kadar aroma eerie dan teror luar angkasa yang kamu dapatkan nyaris sama.'),
(36, 'Evil Dead', 'POSITIF', 'DATA LATIH', 'Alvarez membuang banyak porsi komedi hitamnya yang menjadi salah satu tanda pengenal versi klasiknya, menggantikannya dengan tone yang jauh lebih gelap, suram dan serius, menambah lebih banyak kesadisan frontal nan brutal dan hujan darah yang memerahkan segalanya dalam bungkusan scoring Roque Banos yang menyayat, dan kamu tahu, “kelancangan” yang dilakukan Alvarez rupanya berbuah manis, menjadikan setiap momen gore yang konon digarap dengan sedikit CGI itu sukses menyiksa habis-habisan penontonnya yang berjiwa lemah.'),
(37, 'Ex Machina', 'POSITIF', 'DATA LATIH', 'Tidak ada yang terlalu abstrak di sini, tidak ada lapisan cerita rumit, semua motif dan pesannya sudah terpampang jelas di depan hidungmu. Namun meski kurang kuat di narasinya saya menyukai bagaimana Garland mempresentasikan idenya itu. Dihadirkan dalam visual sederhana namun terasa intim layaknya drama-drama indie yang indah. Setiap percakapan segi tiga antara Gleeson dan Issac mengundang rasa ketertarikan tersendiri ketika keduanya terlibat dalam bahasan moral, etika serta keputusan yang diambil. Sementara interaksi Gleeson dan Vikander seharusnya bisa jauh lebih baik lagi, mengingat keduanya punya peranan penting untuk membawa konfliknya, terlebih melihat Vikander bermain dengan sangat baik sebagai Ava yang.. Oh ya, jangan lupakan juga penampilan Sonoya Mizuno yang meskipun nyaris tak berbicara, namun kehadirannya mampu mencuri perhatian sebagai asisten pribadi Nathan yang misterius. Bagian terbaik Ex Machina tentu saja adalah klimaksnya, meski sudah bisa diprediksi ke mana ia akan berakhir, namun horor di ujungnya sedikit banyak berhasil meninggalkan sedikit kesan haunting di benak penontonnya.'),
(38, 'Exam', 'POSITIF', 'DATA LATIH', 'Seperti film-film indie kebanyakan, Exam juga tidak menampilkan bintang-bintang top, namun bukan berarti para pemainnya tidak bermain baik, justru dengan nama-nama yang kurang terkenal ini suasana tegang berhasil dihasilkan dengan baik, apalagi mengetahui bahwa mereka semua bermain sama baiknya dengan porsi yang cukup berimbang.\r\nSo, mencari sebuah thriller cerdas dengan konsep orisinal dan penuh dengan kejadian-kejadian tidak terduga didalamnya? Ya, Exam jelas adalah pilihan yang paling tepat untuk anda para maniak thriller berkualitas.'),
(39, 'Eye In the Sky', 'POSITIF', 'DATA LATIH', 'Jujur, saya belum pernah melihat adegan  sederhana seperti momen ketika menunggu seorang bocah perempuan Nairobi  berjualan roti bisa disajikan dengan begitu mendebarkan sekaligus emosional atau bagaimana ketika para petinggi-petinggi saling adu argumen tentang prosedur pelaksanaan operasi yang tak jarang membuat kita tertawa getir. Sementara jajaran cast-nya juga bermain  gemilang dalam menggerakkan naskah dan penyutradaraannya. Kita tahu kualitas aktris senior macam Helen Mirren yang sekali lagi tampil mengesankan membawakan peran Kolonel Katherine Powell yang tegas, penuh wibawa namun di saat bersamaan juga sama tidak berdayanya ketika dihadapkan pada sebuah situasi yang sulit. Sementara mendiang aktor Alan Rickman juga tampil sama hebatnya sebagai petinggi militer Inggris Frank Benson di salah satu film terakhirnya. '),
(40, 'Fair Game', 'POSITIF', 'DATA LATIH', 'Ini ketiga kalinya Watts dan Penn berkolaborasi setelah sebelumnya, 21 Grams dan The Assassination of Richard Nixon. Seperti biasa keduanya mampu membawakan perannya dengan baik, meskipun bukan penampilan terbaik mereka, namun sudah lebih dari cukup untuk membuat film berdurasi 108 menit ini menjadi lebih hidup dan menarik.'),
(41, 'Fast & Furious 5', 'POSITIF', 'DATA LATIH', 'Fast & Furious 5 semakin mengukuhkan bahwa franchise satu ini memang masih bertaji dan tidak bisa diremehkan sebagai sebuah sajian aksi hebat nan menghibur, bahkan saya berani mengatakan ia menjadi semakin baik di setiap episodenya. Dan untuk sejauh ini instalemen kelimanya ini sudah menjadi yang terbaik termasuk dalam segi naskah yang semakin dewasa, ensemble cast hebat hingga rentetan aksi dahsyatnya yang sulit untuk dilupakan, benar-benar sebuah paket hiburan lengkap. Dan melihat apa yang terjadi setelah end credit, saya berharap Lin bisa kembali mengejutkan saya kembali di sekuel selanjutnya.'),
(42, 'Feast', 'POSITIF', 'DATA LATIH', 'Feast diawali dengan pembukaan yang menarik, ketika Gulager memperkenalkan setiap karakternya dengan gaya komikal, lengkap dengan tulisan-tulisan nama, pekerjaan dan ekspektasi hidup mereka yang tentu saja diisi dengan konyol. Dan yang menjadi bagian paling menarik di sini adalah kejutan. Ya, Feast bukan tipikal film yang taat pada pakem slasher kasual di mana biasanya yang paling cantik, sok pintar atau paling bodoh mati terlabih dahulu, tidak disini, Gulanger akan memberikan banyak kejutan, anda akan dibuat tidak mudah untuk menebak siapa-siapa yang akan santapan para monster berikutnya.'),
(43, 'Field of Dreams', 'POSITIF', 'DATA LATIH', 'Ya, pada akhirnya kesentimentalan Field of Dreams akan menyentuh anda, tidak hanya faktor kehadiran lapangan baseball  itu dengan segala keajaiban di dalamnya, penampilan Kevin Costner yang sederhana dan membumi atau selipan road trip menarik tentang pencarian manusia-manusia yang mencintai baseball namun juga bagaimana usaha untuk memenuhi segala impian masa kecilmu yang mungkin belum kesampaian. Field of Dream seperti ingin memberitahu kepada kita bahwa keajaiban itu ada.'),
(44, 'Finding Vivian Maier', 'POSITIF', 'DATA LATIH', 'Tentu saja saya tidak akan membocorkan hasil temuannya di sini, biar kamu menonton dan mengetahui siapa itu Vivian Maier, namun satu hal yang pasti ini adalah salah satu dokumenter paling kuat tahun lalu, dokumenter yang tidak hanya didedikasikan kepada sosok VIvian Maier yang penuh talenta dan kejutan, namun juga sebuah studi karakter menarik dan kompleks dari manusia hebat yang nyaris dilupakan dunia.'),
(45, 'Fists of Legend', 'POSITIF', 'DATA LATIH', 'Bagian terbaiknya mungkin ada di pertarungan tangan kosongnya dan penampilan apik Hwang Jung-min yang baru-baru ini juga tampil bagus di thriller gangster, New World. Meskipun tidak memiliki banyak variasi tetapi setiap duelnya digarap dengan editing dan visual yang baik dan terasa realistis ketika ada campur tangan koreografer Jung Doo-hong yang tahun ini juga menggarap aksi di The Berlin File. Klimaksnya mungkin tidak yang seperti kita harapkan tetapi bisa jadi itu adalah penutup yang pantas untuk menebalkan semua tema-temanya. Sementara di tempat lain, karakter-karakter utamanya dibuat cukup menarik.'),
(46, 'Footloose', 'POSITIF', 'DATA LATIH', 'Sama seperti pendahulunya, Footloose versi Craig Brewer ini masih tetap menjadi sebuah guilty pleasure yang menyenangkan dengan segala melodrama yang corny, termasuk tarian-tarian klasiknya yang abadi itu. Yang menarik adalah bagaimana Brewer berusaha tetap setia menghadirkan pernak pernik di dalamnya sebagai sebuah penghormatan besar untuk versi orisinalnya. Ya, Footloose mungkin akan disukai oleh penonton-penonton remajanya.'),
(47, 'Foxcatcher', 'POSITIF', 'DATA LATIH', 'Seperti judulnya yang secara harfiah berarti “perangkap rubah”, Miller sudah menyiapkan ‘jebakan’ untuk membuat penontonnya yang tidak siap terperosok ke dalam sebuah lubang berisi proses dari sebuah kisah nyata kelam yang berjalan lambat serta ditempeli oleh studi karakter yang kompleks. Dengan memposisikan kita seperti karakter lugu Mark Schultz yang tidak tahu apa-apa, tentu saja dengan asumsi kamu juga tidak pernah tahu kisah aslinya sebelumnya, Foxcatcher akan memberi kejutan-kejutan dalam perjalanannya, terutama ketika ia menutup kisahnya dengan sebuah momen ‘shocking’ yang menghentak.'),
(48, 'Frank', 'POSITIF', 'DATA LATIH', 'Tanpa bisa memamerkan wajahnya di nyaris 90% durasinya, dedikasi Michael Fassbender dalam memerankan Frank yang punya pesona unik sekaligus rapuh patut diacungi jempol. Tentu saja kita tidak pernah bisa melihat ekspresi wajahnya yang keras, kebanyakan emosinya diungkapkan secara verbal yang terkadang sering mengganggu karakter lainnya, tetapi gestur tubuh Fassbender sudah berbicara banyak, sangat banyak malah dalam usahanya menciptakan karakter salah satu karakter paling ikonis dalam perjalanan kariernya.'),
(49, 'Frankenweenie', 'POSITIF', 'DATA LATIH', 'Frankenweenie mungkin saja membuat mereka bermimpi buruk meskipun masih ada sisi menyentuh tentang persahabatan seorang anak dengan anjingnya di dalamnya. Tetapi jika kamu adalah penonton dewasa yang pernah merasakan kejayaan horor-horor jadul, atau setidaknya sedikit mengenalnya, maka kamu akan terpuaskan dengan apa yang sudah dilakukan Tim Burton kali ini. Ya, ini bukan sekedar parodi dari kisah klasik Frankenstein yang legendaris itu saja, ini seperti sebuah persembahan untuk semua horor-horor klasik.'),
(50, 'Friends With Benefits', 'POSITIF', 'DATA LATIH', 'Friends With Benefits, mungkin tidak sekuat dan secerdas Easy A sebagai sebuah komedi seks dewasa, tapi untuk ukuran romcom ringan, ia jelas lucu, enjoyable,  menghibur dan sekaligus satir disaat bersamaan dengan segala dukungan hebat dari chemistry yang dibangun Timberlake-Kunis plus kehadiran karakter-karakter pendukungnya yang menarik. Sepertinya seorang Will Gluck patut bernafas lega karena ia kembali berhasil menorehkan pekerjaan bagus di film ketiganya kali ini.'),
(51, 'Fright Night', 'POSITIF', 'DATA LATIH', 'Fright Night mungkin tidak sedalam Let The Right One In tapi saya percaya ia tidak akan dihina habis-habisan seperti saga Twilight oleh para vampir mania. Ya, untuk ukuran remake, Gillespie bisa dibilang sukses membawa horor klasik milik Holland itu ke ranah modern tanpa harus menghilangkan segala aspek-aspek vampir tradisionalnya, termasuk juga humor-humor gelapnya yang mampu berpadu padan dengan baik dengan horor mencekamnya dan ceritanya yang ringan.'),
(52, 'From Paris with Love', 'POSITIF', 'DATA LATIH', 'Selain adegan-adegan aksinya, From Paris with Love benar-benar tertolong dengan penampilan dynamic duo yang tampil kompak. Sepertinya semenjak True Lies yang kontroversial itu, sudah cukup lama tidak ada lagi film bertema aksi terorisme yang menyenangkan untuk ditonton, untung saja ada Luc Besson dengan From Paris with Love yang hadir memberikan sebuah sajian film aksi yang benar-benar menghibur'),
(53, 'Fruitvale Station', 'POSITIF', 'DATA LATIH', 'Penampilan cemerlang jebolan fiksi ilmiah Chronicle dan serial televisi Friday Night Lights, Michael B. Jordan turut menjadi alasan mengapa film yang diproduseri oleh Forest Whitaker ini tampil meyakinkan. Mungkin kita tidak mengenal siapa Oscar, tetapi apa yang dilakukan Jordan sedikit banyak sudah mendekatkan kita pada sosok pemuda 22 tahun itu termasuk bagaimana keseharian dan pribadinya. Tetapi tidak hanya Jordan yang bagus, ada Melonie Diaz yang memainkan kekasih Oscar, Sophina Mesa dan Octavia Spencer sebagai sang ibu yang tampil sama kuatnya, memberikan kehangatan sebuah keluarga dalam menemani hari-hari terakhir Oscar yang malang.'),
(54, 'Full Metal Jacket', 'POSITIF', 'DATA LATIH', 'Sebagai karya jenius Stanley Kubrick, Full Metal Jacket bukanlah film perang berskala besar, namun jarang ada film perang dengan kualitas seperti ini. Menurut saya dari film film perang Vietnam yang membanjiri Bioskop pada era ''70 hingga ''90 Full Metal Jacket merupakan film anti perang yang mengesankan, bahkan dengan segala kesalahannya film ini merupakan salah satu yang terbaik.'),
(55, 'Gattaca', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film kecil untuk ukuran sebuah fiksi ilmiah, Gattaca jelas menyimpan segudang potensi luar biasa yang berhasil diterjemahkan dengan sangat baik dan cantik oleh Andrew Niccol. Tidak hanya menjadi sebuah sajian fiksi ilmiah yang sarat dengan teknologi-teknologi canggihnya namun Gattaca juga sarat dengan pesan-pesan moral serta inspirasi yang kuat tentang perjuangan seorang manusia dalam mencapai cita-citanya.'),
(56, 'Girl, Interrupted', 'POSITIF', 'DATA LATIH', 'Dengan cerita terbilang cukup berat dan dalam ini, dibutuhkan sedikit kesabaran dan pemikiran lebih untuk menontonnya, namun bukan berarti Girl, Interrupted adalah film yang membosankan, malah sebaliknya film ini mampu memberikan sebuah tontonan yang menarik dengan segala konflik-konflik didalamnya, apalagi dengan dukungan akting yang luar biasa dari para aktrisnya.'),
(57, 'Gone Girl', 'POSITIF', 'DATA LATIH', 'Gone Girl tidak hanya menyajikan sebuah thriller kriminal paling solid dan paling rapi tahun ini, tetapi yang mengejutkan adalah bagaimana ia bisa membuat si blonde cantik Rosamund Pike keluar dari zona nyamannya, bertransformasi menjadi sesuatu yang sama sekali berbeda dari peran-perannya sebelumnya. Amy adalah karakter yang kompleks, sama kompleksnya dengan kebanyakan karakter dalam film-film Fincher. Untuk sebuah film tentang istri hilang, tokoh Pike malah bisa dibilang lebih mendominasi, tidak hanya dengan aktingnya yang patut diganjar setidaknya nominasi Oscar, namun juga porsi secara keseluruhan.'),
(58, '2046', 'POSITIF', 'DATA LATIH', 'Sudah selayaknya sebuah trilogi hebat ditutup pula dengan kisah yang hebat, dan 2046 pun berhasil menjadi akhir kisah manis dari trilogi “patah hati” yang berjarak 15 tahun ini. Melalui 2046 ini sekali lagi Wong Kar Wai membuktikan bahwa ia adalah sutradara luar biasa yang selalu berhasil menghasilkan karya-karya seninya yang indah, unik dan sangat berkesan bagi para penggemarnya.'),
(59, '10 Cloverfield Lane', 'POSITIF', 'DATA LATIH', 'Satu hal lain yang menonjol dalam 10 Cloverfield Lane selain kualitas narasi dan penyutradaraan yang ‘menyimpang’ adalah casting yang sempurna. Ia hanya punya tiga orang pemain utama, dan semua bermain fantastis. Kudos terutama patut diberikan kepada aktor senior John Goodman dalam salah satu penampilan terbaiknya. Berperan sebagai Howard sang penyelamat, Goodman bisa menghadirkan sebuah kompleksitas karakter yang menarik.'),
(60, '12 Angry Men', 'POSITIF', 'DATA LATIH', 'Dialog-dialog cerdas dan kekuatan akting prima dari para pemainnya yang memang menjadi ‘senjata’ andalan film yang diadaptasi dari drama televisi tahun 1954 berjudul sama ini. Hanya dengan mendengar percakapan yang keluar dari mulut para pemainnya saja kita sudah diajak seakan-akan terlibat langsung menjadi juri ke 13 dan juga ikut membayangkan kejadian-kejadian secara kronologis yang pada filmnya sendiri tidak pernah ditampilkan. Hasilnya adalah sebuah pengalaman menonton yang menyenangkan dimana banyak kejutan demi kejutan menarik bermunculan sepanjang 96 menit film berlangsung.'),
(61, '12 Years a Slave', 'POSITIF', 'DATA LATIH', 'Tidak hanya menawarkan perjalanan seorang budak yang menjadi bagian sejarah suram dengan segala momen kebrutalannya, McQueen juga tahu bagaimana menghadirkan sisi lain yang bermain dengan rasa ironi dan situasi dilematis hebat yang menghinggapi setiap karakter, termasuk karakter majikan kulit putih di mana seperti manusia, tidak semuanya digambarkan jahat, sayang mereka terjebak dalam situasi serba salah. Bahkan yang jahat pun tidak lepas dari beban moral ketika harus menyiksa budak yang diam-diam disukainya, dan segala kegalauan hebat itu berhasil dibawakan apik oleh para pemainnya.'),
(62, '13 Assassins', 'POSITIF', 'DATA LATIH', 'Dii tahun 2011 ini film 13 Assassin mempunyai adegan pertarungan paling epik yang pernah saya tonton, tensi pertarungannya benar-benar terjaga mengingatkan saya pada film jadul Samurai Seven karya master Akira Kurosawa hampir semua karakternya mempunyai chemistry yang sama, akan tetapi sayangnya skenario film ini tidak terlalu menonjol untuk ukuran film samurai, setelah selesai menonton saya sendiri merasa agak ada yang kurang di film ini. Sebagai seorang sutradara predikat Cult, Takashi Miike sudah berhasil mengembalikan jiwa film-film samurai yang telah lama hilang lewat 13 Assassins, sudah sepantasnya film ini masuk ke jajaran film samurai terbaik sepanjang masa.'),
(63, '2001: A Space Odyssey', 'POSITIF', 'DATA LATIH', '2001: A Space Odyssey adalah salah satu film terbaik yang pernah dibuat dalam sejarah manusia, sebuah film yang lebih tepat disebut maha karya seni, sebuah art cosmic dari seorang Stanley Kubrick, seorang sutradara dengan ide-ide jenius yang berhasil mengubah cara pandang kita menonton sebuah film.'),
(64, '3 Hari Untuk Selamanya', 'POSITIF', 'DATA LATIH', '3 Hari untuk Selamanya jelas merupakan salah satu film Indonesia  terbaik sepanjang masa versi saya dan melalui film  ini sekali lagi duet Mira Lesmana dan Riri Riza membuktikan bahwa mereka adalah film maker terbaik bangsa ini yang berani menghasilkan karya-karya fresh dan berkualitas tanpa harus terjebak dalam komersialisme belaka.'),
(65, '3 Nafas Likas', 'POSITIF', 'DATA LATIH', 'Di separuh awalnya, 3 Nafas Likas begitu terasa personal. Narasinya yang mengalir baik dalam balutan visual-visual cantik kamera Hani Pradigya membawa penonton ke masa kecil Likas, melihat kesederhanaan hidupnya, mengulik pribadinya yang cerdas sekaligus keras dalam halnya mencoba menembus batasan adat dan budaya patriarki Karo yang kental.'),
(66, '5 Centimeters Per Second', 'POSITIF', 'DATA LATIH', ' Dengan balutan animasi, pencahayaan super detail dan sinematografi yang super indah serta iringan musik penuh emosi dari Tenmon, kisah percintaan dua manusia yang terpisahkan oleh jarak dan waktu ini digambarkan secara realistis, tidak ada unsur-unsur fantasi ataupun petualangan-petualangan seru yang melibatkan monster-monster dan kisah-kisah kepahlawanan, semuanya digambarkan layaknya seperti kehidupan percintaan remaja Jepang dengan segala suka dukanya. '),
(67, '500 Days of Summer', 'POSITIF', 'DATA LATIH', 'Kredit plus juga pantas diberikan oleh kedua pemain utamanya. Baik Joseph Gordon Levitt maupun Zooey Deschanel tampaknya benar-benar sangat menikmati peran mereka disini sebagai pasangan TTM yang serasi. Menyenangkan memang melihat bagaimana kedua karakter ini berinteraksi satu sama lain apalagi dengan chemistry yang dibangun dengan sangat kuat. Walaupun bukan akting terbaik dari keduanya, namun tetap saja kedua aktor-aktris ini mampu memesona penontonnya. Aroma indie juga tampak pada soundrack yang keren dan emosional. Jangan terlalu percaya dengan narasi Richard McGonagle yang mengatakan bahwa 500 Days of Summer bukanlah sebuah kisah cinta, malahan bisa dibilang film ini adalah salah satu cerita cinta terbaik dan terkeren yang pernah dibuat oleh perfilman modern saat ini.'),
(68, '7 Days', 'POSITIF', 'DATA LATIH', 'Tidak ada soundtrack atau scoring sama sekali disini, sepertinya Daniel Grou sengaja ‘membungkus’ penontonnya dalam kesunyian dengan tujuan agar penontonnya lebih dapat merasakan bagaimana terasa realistisnya ketegangan dan atmosfer kelam nan dingin yang dibangun sepanjang 111 menit ini. Dan semuanya terasa lengkap ketika para pemerannya bermain dengan sangat baik,'),
(69, '9 Summers 10 Autumns', 'POSITIF', 'DATA LATIH', 'Simpel namun padat berisi dengan segala filosofi hidup tanpa harus terkesan berdakwah, membumi dengan segala kesederhanaan bertutur dalam balutan teknis solid dan juga sentimentil tanpa harus jatuh menjadi tontonan cengeng nan mendayu-dayu.'),
(70, 'A Copy of My Mind', 'POSITIF', 'DATA LATIH', 'Apa yang terjadi di A Copy of My Mind adalah murni sebuah observasi langsung kepada para karakternya. Seperti tidak ada jarak yang memisahkan antara setiap tokoh dengan penontonnya. Satu hal yang menonjol adalah teknisnya. Kamera dari Ical Tanjung seperti begitu setia, tidak hanya ‘menguntit’ Sara dan Alex dari belakang, namun bagaimana juga ia menangkap sisi lain kota metropolitan yang kumuh, sesak, bising dan suram dalam balutan visual yang ‘kasar’ dan ‘mentah’, termasuk di dalamnya departemen penata suara yang jempolan.'),
(71, 'A Girl at My Door', 'POSITIF', 'DATA LATIH', 'Plotnya sendiri berjalan lambat seperti kebanyakan drama arthouse, namun Jung juga membuatnya begitu memesona ketika ia mampu membungkusnya dengan kelembutan sekaligus aroma depresi yang begitu kuat bersama kekuatan akting Bae Doona dan Kim Sae-ron yang memikat, mampu menggerakkan naskahnya yang berisi pesan-pesan ambigu yang bernada provokatif.'),
(72, 'A Moment to Remember', 'POSITIF', 'DATA LATIH', 'Lee tahu bagaimana membuat sebuah drama romantis indah dengan balutan visualnya yang cantik plus dukungan musik latar klasik yang mendayu-dayu, apalagi alih-alih menggunakan kematian sebagai konflik utama pengaduk-aduk emosi, A Moment to Remember lebih memilih Alzheimer yang bisa secara perlahan namun pasti menyiksa penontonnya. Hati siapa yang tidak terenyuh melihat kondisi Kim Su Jin? Ya, pelan namun pasti ia mulai melupakan orang-orang yang dicintainya, khususnya Cheol Su, suaminya. Keberhasilan A Moment to Remember menyentuh penontonnya juga tidak lepas dari kekuatan chemistry yang dihasilkan Son Ye Jin dan Jung Woo Sung dalam membawakan karakter mereka masing-masing. Keduanya benar-benar pas dipasangkan satu sama lain.'),
(73, 'A Monster Calls', 'POSITIF', 'DATA LATIH', 'Relasi tak biasa antara sosok monster dan Conor tentu menjadi pusat gravitasi buat A Monster Calls. Melihat bagaimana kombinasi penyutradaraan lembut Bayona dan Patrick Ness yang ditunjuk untuk mengurus naskahnya mampu bersinergi dengan sempurna dalam usahanya mengeksplorasi sisi terdalam sang bocah dalam menghadapi problematikanya yang diwakili melalui dongeng-dongeng depresif yang diceritakan si monster pohon. Setiap cerita divisualisasikan oleh presentasi cantik animasi stop motion dengan sentuhan gaya cat air penuh imajinasi, setiap cerita punya pesan-pesan kuat yang merepresentasikan kehidupan Conor.'),
(74, 'A Separation', 'POSITIF', 'DATA LATIH', '\r\nDibuka dan diakhiri dengan luar biasa, itulah A Separation, sebuah drama tentang perpisahan dalam sebuah keluarga menengah Iran yang juga membahas arti lain dari nilai-nilai kejujuran yang mampu berjalan berdampingan dengan manisnya elemen-elemen agama, moralitas, sosial bahkan court room drama sekalipun tanpa harus berat sebelah, tanpa terlihat overdramatis, Ya, semuanya itu disajikan dengan naskah dan penyutradaraan brilian oleh Asghar Farhadi menjadikan A Separation masterpiece dari sutradara asal Iran itu dan salah satu yang terbaik tahun ini.'),
(75, 'A Stranger of Mine', 'POSITIF', 'DATA LATIH', 'A Stranger of Mine jelas akan terdengar asing, maklum saja film kecil satu ini memang jauh dari hingar-bingar dan promosi besar-besaran, lihat saja di situs sebesar IMdB pun, tidak banyak user yang mengulasnya, tapi jangan salah, anda mungkin akan sepakat dengan saya untuk mengatakan bahwa Kenji Uchida adalah seorang jenius.'),
(76, 'A Very Harold & Kumar 3D Christmas', 'POSITIF', 'DATA LATIH', 'Ini memang tipe film yang mengajak anda menanggalkan segala kewarasan anda sembari menertawakan segala kebodohan cerita dan tingkah laku karakternya, dan jika anda merasa adegan Harold dan Kumar berganja ria dengan George W. Bush sudah cukup sinting, maka bersiaplah karena A Very Harold & Kumar 3D Christmas akan memberikan anda lebih banyak lagi kehebohan. Dan seperti yang tertera pada judulnya, semua kegilaan itu terbungkus dalam balutan 3D yang tidak disangka mampu digarap dengan baik.\r\n'),
(77, 'Afflicted', 'POSITIF', 'DATA LATIH', 'Ya, “niat” adalah kunci mengapa Afflicted berhasil menjadi tontonan mocku horor yang asyik. Dengan hanya bekal dua kamera, budget mini dan kreativitas tingkat tinggi yang mencakup sinematografi cantik dan pergerakan kamera gila-gilaan, apa yang terjadi di sepanjang 85 menit durasinya seperti campuran keseruan dalam “Chronicle” dan ketegangan ala “An American Werewolf in London”.'),
(78, 'Aftershock', 'POSITIF', 'DATA LATIH', 'Memang ending film ini mudah ditebak, bahkan jauh sebelum film ini berakhir, namun bagaimana proses menuju akhir itu yang menjadi bagian terpenting, dan Aftershock bisa terbilang sukses menggambarkan perjalanan tersebut dengan cukup baik.'),
(79, 'Agora', 'POSITIF', 'DATA LATIH', 'Harus diakui plot yang dihadirkan masih terasa kurang dalam dan terkesan terburu-buru dalam penyajiannya, sepertinya Amenábar terlalu memfokuskan kisahnya kepada konflik-konflik agama saja tanpa terlalu banyak menggali kisah Hypatia. Untung saja kelemahan-kelemahan tersebut masih bisa ditutupi oleh bagaimana indahnya Amenábar manyajikan setting kota Alexandria dengan sinematografi yang apik dan detail-detail yang memukau dan juga tidak ketinggalan penampilan apik dari seorang Rachel Weisz dalam memerankan sosok Hypatia.'),
(80, 'Air Doll', 'POSITIF', 'DATA LATIH', 'Ini bukan cerita tentang boneka yang menjadi manusia, sosok Nazomi sebenarnya tetap adalah sebuah boneka karet kosong yang hanya berisi angin, namun yang menjadi menarik adalah bagaimana proses ia berinteraksi dengan lingkungannya yang tidak jarang membuat penonton tertawa dan juga sedih dengan segala tingkah lakunya, bahkan adegan klimaksnya pun cukup mengejutkan. Air Doll adalah sebuah film yang menarik dan indah tentang kesepian, kehampaan, dan bagaimana pentingnya kehadiran orang lain dalam kehidupan kita.'),
(81, 'All is Lost', 'POSITIF', 'DATA LATIH', 'Ada pesan kuat tentang seberapa besarnya daya tahan dan kesabaran manusia di tengah sebuah cobaan maha dahsyat, tetapi tidak hanya karakter Redford yang diuji, kesabaran penontonnya pun juga, karena seperti yang saya bilang barusan, ini bukan film yang mudah ditonton, tone kesepiannya bisa saja akan sangat menyiksa sebagian penontonnya karena di sepanjang kurang lebih 100 menit durasinya kita hanya bisa duduk diam, menjadi saksi bagaimana karakter Redford tanpa dialog bertindak tanduk.'),
(82, 'American Hustle', 'POSITIF', 'DATA LATIH', 'Lihat set, lihat kostum, lihat tata riasnya, O.Russell punya semua dukungan material teknis kelas Oscar di sini. Semuanya aroma ''70 itu berhasil melebur di bawah penyutradaraan enerjik O.Russell lengkap dengan segala editing cepat, tracking shot, soundtrack retro yang asyik dan tentu saja para pemainnya.\r\n'),
(83, 'American Sniper', 'NEGATIF', 'DATA LATIH', 'Eastwood begitu baik hati sampai memberikan karakter fiktif yang tidak kalah jagonya dalam menembak dari pihak lawan, spesial untuk membuat pertarungan antar sniper menjadi semakin seru meskipun ujung-ujungnya terasa dipaksakan. Sementara ‘pertempuran’ lain yang melibatkan batin dan mental serta keluarga harus diakui masih kurang dijelajahi Eastwood dengan sempurna. Kedua bagian ini seperti dua film berbeda yang tidak mampu menyatu dengan mulus. Jangan salahkan Bradley Cooper yang sudah tampil cukup baik ketika harus membagi perannya yang kompleks itu, salahkan Eastwood yang tidak memaksimalkan dramanya dengan baik termasuk studi karakter Kyle yang terasa sedikit jomplang di antara dua ‘dunia’ berbeda.'),
(84, 'Amour', 'POSITIF', 'DATA LATIH', 'Ada banyak sisi personal dan kehangatan dari seorang Hanake di dalamnya yang dituangkan buat istri tercintanya, mungkin ini adalah karya Hanake paling lembut dibandingkan yang lainnya meskipun ada sedikit ‘kekejaman’, rasa takut dan kecemasan di dalamnya tetapi kita tahu bahwa semuanya sekali lagi ditujukan untuk merayakan apa yang kamu sebut dengan “CINTA”.'),
(85, 'Amy', 'POSITIF', 'DATA LATIH', 'Pendekatan intim yang dilakukan Kapadia di dua pertiga filmnya menghasilkan ragam lecutan emosi buat penontonnya. Ada kegembiraan ketika melihat Amy senang, ketika melihatnya tampil membawakan lagu-lagunya, kemudian ada rasa getir, iba dan sedih, bahkan sedikit kecewa ketika melihatnya jatuh dan tidak belajar dari kesalahannya namun tentu saja tidak ada yang mengalahkan sensasi heartbreaking luar biasa ketika Kapadia menutupnya dengan momen puncak menggetarkan yang sama-sama kita ketahui akhirnya.'),
(86, 'Argo', 'POSITIF', 'DATA LATIH', 'Senang rasanya melihat bagaimana seorang aktor seperti Ben Affleck bisa berkembang sehebat ini sebagai seorang filmmaker. Dari thriller kecil yang mengesankan lalu lihatlah sekarang, Argo  bisa dibilang pencapaian terbaik Affleck sejauh ini. Sebuah thriller politik yang cerdas dan mendebarkan, sebuah tontonan berkelas dari ‘anak kemarin sore’, salah satu yang terbaik tahun ini'),
(87, 'Arlington Road', 'POSITIF', 'DATA LATIH', 'Naskah yang berani dari Ethan Kruger dan suspense yang terjaga rapi menjadi kekuatan terbesar Arlington Road selain penampilan menawan Jeff Bridges dan Tim Robbis. Ini adalah suguhan thriller apik nan menantang yang akan membuatmu tetap terjaga sampai akhir bersama rentetan misterinya yang mengasyikkan sampai kemudian ia menamparmu keras dengan penutup yang luar biasa.'),
(88, 'Athirah', 'POSITIF', 'DATA LATIH', 'Riri memilih untuk membuang segala embel-embel sentimentil, menggantikannya dengan pertunjukan gestur  yang minim dialog dalam iring-iringan musik lembut dari Endah & Rhesa yang menjadi kekuatan buat Athirah dalam  menghadirkan letupan emosi tersendiri, apalagi didukung dengan penampilan apik para pemainnya yang tampil total terutama Cut Mini. Sementara tak kalah hebatnya adalah presentasi teknis dan penyutradaraan Riri yang meliputi pergerakan kamera, sinematografi yang menangkap lanskap-lanskap cantik di Sulawesi Selatan.'),
(89, 'August Osage County', 'POSITIF', 'DATA LATIH', 'Dari Streep sampai Cumberbatch semua tampil cemerlang. Streep lagi-lagi tampil gemilang membawakan karakter penyakitan baik secara fisik maupun mental. Streep nyaris sempurna menguasai panggung dan semua momen dengan karakternya yang menyebalkan, karakter yang menyerang siapa saja sebagai imbas dari rasa depresi atas penyakitnya, termasuk putri-putrinya sendiri, tidak heran jika nantinya ia kembali dinominasikan lagi di ajang Oscar nanti. Sementara lawan mainnya ada Julia Roberts yang juga tampil bagus sebagai putri kesayangan yang berkarakter kuat.'),
(90, 'Baraka', 'POSITIF', 'DATA LATIH', 'Scoring musik yang dinamis dan menghanyutkan dari Michael Stearns yang setia mengiringi film sepanjang 96 menit. Walaupun secara teknis film ini tanpa cerita, melalui gambar-gambar yang ditampilkannya, Baraka mampu menyampaikan pesan non verbalnya secara efektif.'),
(91, 'Baran', 'POSITIF', 'DATA LATIH', 'Baran memang tidak terlalu menampilkan banyak dialog, malah karakter Baran sendiri sama sekali tidak memiliki dialog dari awal hingga akhir, dan hal tersebut yang membuat film ini menjadi terasa istimewa karena mampu secara langsung menyentuh emosi penontonnya hanya dengan melihat tingkah laku dan tatapan mata Lateef dan Baran. Perbedaan budaya yang menjadi ‘tembok’ tidak terlihat juga mampu dieksplorasi dengan baik oleh Majidi, pendewasaan dan pencarian jati diri seorang Lateef juga menjadi bagian paling menarik dalam film berdurasi 94 menit ini.'),
(92, 'Be with You', 'POSITIF', 'DATA LATIH', 'Sebuah drama cinta berbalut elemen fantasi menyentuh yang dijamin akan meninggalkan kesan mendalam di setiap hati penontonnya, apalagi Be with You ternyata mampu keluar dari formula klise drama-drama tearjerker Asia lainnya yang hanya menampilkan cerita dan konflik yang itu-itu saja.'),
(93, 'Beasts of the Southern Wild', 'POSITIF', 'DATA LATIH', 'Beast of The Southern Wild seperti sebuah dongeng distopia modern rumit yang punya orisinalitas, keceriaan, semangat hidup luar biasa dan akting-akting luar biasa di balik setting dan premis pasca kiamatnya yang suram dan kotor. Sebuah tontonan indie arthouse yang memberikan kita sebuah sentuhan emosional dengan cara sederhana yang tidak pernah kamu bayangkan sebelumnya.'),
(94, 'Before Midnight', 'POSITIF', 'DATA LATIH', 'Linklater tahu benar bagaimana memanfaatkan dua seri sebelumnya sebagai pondasi kuat dalam membentuk Midnight dan perjalanan karakternya hingga berada seperti yang kita lihat sekarang. Tetapi Linklater tentu saja tidak berdaya tanpa duo maut Hawk dan Delpy yang meskipun mulai menua dan gendut (khususnya Delpy) mereka tampak tidak pernah kehilangan keintiman dan spontanitas luar biasa yang sudah mereka bentuk di nyaris dua dekade ini.'),
(95, 'Behind the Candelabra', 'POSITIF', 'DATA LATIH', 'Meskipun kalau mau jujur sebenarnya narasinya juga tidak sampai terlalu istimewa, tetapi kekuatan sebenarnya bukan berada di naskahnya, namun bagaimana penampilan total dua bintang utamanya yang fantastis dan tentu saja bagaimana Soderbergh menghadirkan narasinya menjadi sebuah biopik intens yang menggambarkan gejolak asmara, seks dan ketenaran  serta sisi hitam dibalik setiap gemerlapnya candelabra'),
(96, 'Bernie', 'POSITIF', 'DATA LATIH', 'Bernie mungkin  tidak terlalu serius, namun di balik segala komedi-komedi hitamnya yang ‘aneh’ dan presentasinya yang unik ada pesan tentang sebuah dilema moral dan ambiguitas besar tentang arti sebuah kebaikan dan keadilan itu sendiri, semuanya tergantung dari sisi mana kita memandangnya dan Richard Linklater dengan sangat lihai menghadirkan itu semua dalam kemasan yang santai, menghibur dan juga berkelas. Ini jelas salah satu karya terbaik Linklater dan salah satu film Jack Black yang paling bagus.'),
(97, 'Beyond the Hills', 'POSITIF', 'DATA LATIH', 'Alurnya memang lambat, presentasinya sederhana, sunyi tanpa scoring mungkin berpotensi menjenuhkan buat sebagian penontonnya, namun imbas dari kesederhanaannya bertutur menjadikan semuanya terasa natural dan sukses menghadirkan emosi tanpa harus berdramatis ria. Ya, Beyond the Hills adalah sebuah drama kuat tentang cinta dan ketidak pedulian.'),
(98, 'Billy Elliot', 'POSITIF', 'DATA LATIH', 'Yang menarik lagi dari film ini adalah, meskipun premisnya sederhana, tapi selama film berlangsung, semua tertata rapi di setiap adegan, dan dialog yang tidak dipaksakan, Storytelling yang baik dan mudah dimengerti. Sutradara Stephen Daldry dengan sukses menghadirkan drama yang mudah dicintai dan berkesan bagi penontonnya.'),
(99, 'Birdman', 'POSITIF', 'DATA LATIH', 'Dengan pergerakan yang luar biasa, begitu dinamis meliputi zoom in, zoom out lembut plus teknis pencahayaan puitis lembut khas Lubezki setiap momen menjadi terasa begitu bermakna, setiap momen menjadi terasa spesial, lepas, bebas dan seperti melayang tak terbatas menembus tembok-tembok keras.'),
(100, 'Biutiful', 'POSITIF', 'DATA LATIH', 'Ya, ini adalah sebuah film emosional dan menyentuh yang digarap dengan teknis sinematik yang cantik serta dukungan akting luar biasa dari aktor kaliber Oscar, Javier Bardem.'),
(101, 'Black Mass', 'POSITIF', 'DATA LATIH', 'Tentu saja sebagai sebuah film gangster, Black Mass akan dipenuhi dengan banyak unsur kekerasan frontal yang mampu semakin menebalkan kesan gelap dari kisah salah satu buronan yang paling dicari di Amerika ini. Sementara di bagian teknis, Cooper dan sinematografer  Masanobu Takayanagi juga berhasil menangkap suasana sendu dari sudut-sudut kota Boston era ''70 dan ''80 dengan detail, bagaimana selubung suram itu kemudian mampu menguatkan penceritaannya sekaligus di saat bersamaan, karakternya, termasuk scoring mencekam dari Junkie Xl yang membuat setiap gesekan yang terjadi bisa begitu terasa menegangkan.\r\n'),
(102, 'Black Swan', 'POSITIF', 'DATA LATIH', 'Black Swan bisa saya bilang adalah salah satu karya terjeniusnya, mungkin yang terbaik setelah Requiem for a Dream. Hampir semua aspek baik teknis maupun non teknis sukses digarap dengan sempurna oleh sutradara 41 tahun ini, menyajikan sebuah pengalaman dan sensasi sinematik unik yang tidak terlupakan, mengerikan dan menakutkan namun juga emosional di saat bersamaan plus akting fantastis dari Natalie Portman menjadikan segalanya terasa luar biasa.'),
(103, 'Blue Jasmine', 'POSITIF', 'DATA LATIH', 'Saya selalu menyukai bagaimana Woody Allen menghadirkan film-filmnya dengan caranya sendiri yang tidak biasa, apalagi kali ini ia mencoba bermain-main sesuatu yang baru ketika menelusuri efek besar dari sebuah kebangkrutan yang berdampak pada kondisi mental karakternya. Allen menyajikan sebuah drama depresi yang dibungkus dengan sentuhan komedi khasnya yang hadir dalam dialog-dialog cerdas termasuk bagaimana Allen seperti biasa, menghadirkan visual cantik dari kota-kota yang menjadi latarnya, dalam kasus ini ada San Fransisco dalam nuansa musik Jazz kental membuat Blue Jasmine terasa riang di balik temanya yang sebenarnya gelap itu.'),
(104, 'Blue Valentine', 'POSITIF', 'DATA LATIH', 'Derek Cianfrance sudah memberikan saya sebuah tontonan drama percintaan yang tidak hanya menjual romantisme ‘gombal’ belaka, namun Derek juga ingin menunjukkan kepada penontonnya sebuah realita kehidupan yang membutuhkan lebih dari sekedar kata cinta untuk dapat mempertahankan sebuah komitmen. Indah namun juga depressing dan penuh kesedihan.'),
(105, 'Boogie Nights', 'POSITIF', 'DATA LATIH', 'Boogie Nights bisa dibilang adalah salah satu karya terbaik Paul Thomas Anderson, dengan teknik penyajiannya yang baik dan unik, Anderson sukses menghadirkan kisah manusia-manusia yang tidak bahagia dan depresi di balik gemerlap dan popularitas dunia porno.'),
(106, 'Boyhood', 'POSITIF', 'DATA LATIH', 'Linklater berhasil menghadirkan sebuah keintiman kuat yang nyata, sesuatu yang tidak kamu dapati di film manapun. Ini seperti melihat langsung proses character building dengan melibatkan aroma kental trilogi “Before” terutama dari feel dan pergerakan kameranya dan para pemain yang sama dari awal hingga akhir.'),
(107, 'Breath', 'POSITIF', 'DATA LATIH', 'Tentu saja kunci keberhasilan Breath menjadi sajian drama remaja depresif tidak hanya kepiawaian Laurent mengolah naskah bersama kekuatan penyutradaraannya yang menghasilkan keintiman luar biasa dari dua karakter utamanya yang dimainkan fantastis oleh dua cast mudanya. Nada-nada lembut visual dari Arnaud Potier, termasuk penggunaan teknik tracking shot bersama balutan scoring yang mampu menangkap kedekatan Charlie dan Sarah dengan sangat baik di paruh pertamanya dan terus secara konsisten sampai akhir.'),
(108, 'Broken', 'POSITIF', 'DATA LATIH', 'Lee Jeong Ho seperti ingin menjadikan Broken dekat dan membumi dengan keseharian penontonnya, merasakan kesedihan dan kemarahan sampai ketakutan dari setiap karakternya, dan harus diakui ia berhasil menuntaskan tugasnya dengan baik, membentuk sebuah emosi spontan imbas dari keputusan dari tokoh-tokohnya yang bermain ciamik (terutama Jung Jae Young). Jeong Ho membungkus setiap momen Broken dengan tone kelam dan dingin yang menegaskan sebuah rasa putus asa dan amarah mendalam.'),
(109, 'Cafe Society', 'POSITIF', 'DATA LATIH', 'Sutradara berkacamata Moscot Lemtosh ini selalu membuai penontonnya dengan dialog-dialog cerdas dan plot yang sederhana tapi mengena, tak peduli seburuk apapun filmnya, Allen tetaplah Allen yang jago menggulirkan kisah tentang hubungan manusia dan kerumitannya dengan gaya yang santai tapi mendalam. Dan Café Society bukanlah pengecualian. Masih menggelar kisah kesukaan Allen tentang cinta dan segala macam masalahnya, Café Society  berhasil tampil cantik di mata dengan sokongan teknis yang apik. Latar belakang dekade ''30 dengan keglamoran Hollywood berhasil disajikan tanpa cela oleh Allen di layar, pun begitu cerita dibawa ke Big Apple, tata artistiknya tetap memanjakan indera penglihatan kita.'),
(110, 'Captain America: The Winter Soldier', 'POSITIF', 'DATA LATIH', 'Duo Russo di luar dugaan tampil fantastis ketika harus mengemban tugas membawa Captain America: The Winter Soldier  agar tampil sama besarnya dengan film Marvel lain, atau paling tidak lebih baik ketimbang seri pertamanya, dan mereka melakukannya dengan sangat baik. Komposisi aksi, ketegangan, ledakan dan spesial efek berhasil ditampilkan berimbang dengan dramanya. Editing cepat dan taktis, duel-duel berkoreografi jempolan dan momen-momen penuh hingar bingar semuanya tampil solid.'),
(111, 'Captain Phillips', 'POSITIF', 'DATA LATIH', 'Puncaknya ada di ujung cerita ketika Hanks secara emosional mengeluarkan seluruh kemampuannya untuk mewakili perasaan sang Kapten selama proses penyanderaan, dan dengan penampilan sebaik itu, mungkin saja para juri Academy akan meliriknya kali ini, setidaknya peluang masuk nominasi sebagai pemeran utama terbaik terbuka lebar. Sementara lawan main Hanks tidak kalah hebatnya. Dan apa yang dilakukan Abdi adalah hal yang fantastis secara dengan meyakinkan ia sukses memberikan gambaran bagaimana tangguhnya para pembajak Somalia dan di sisi lain ada kenaifan dan kesedihan tak terlihat  dari setiap ucapan yang membuat penontonnya turut bersimpati dengan karakternya.'),
(112, 'Graduate', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah drama komedi romantis coming of age, The Graduate jelas adalah salah satu yang terbaik, bahkan hingga sekarang film ini banyak memberikan inspirasi kepada film-film romcom modern saat ini. Cerita tentang seorang pemuda lugu yang mencoba mencari jati diri dan cintanya ditampilkan dengan fantastis oleh seorang Dustin Hoffman.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(113, 'Gravity', 'POSITIF', 'DATA LATIH', 'Cuaron melakukan pendekatan serealistis mungkin termasuk melakukan penelitian yang dalam untuk menciptakan sebuah pengalaman luar angkasa yang logis, bahkan Gravity banyak dipuji karena berhasil menghadirkan premis dan prinsip-prinsip fisika yang realistis termasuk semua pergerakan tanpa bobotnya yang mendominasi 95% film. Untuk menghadirkan segalanya agar terlihat nyata, Cuarón bersama ahli visual efek, Tim Webber membuatnya seteliti dan sedetail mungkin di studio Framestore di London. Hasilnya bisa dilihat tanpa henti sejak adegan pembukaannya yang memesona sampai klimaksnya yang menggetarkan itu, apalagi kemudian efek-efek ciamik ini dikombinasikan dengan sentuhan sinematografi brilian dengan kamera yang seperti tidak bisa berhenti bergerak dari sinematografer handal langganan Cuaron dan Terrence Malick, Emmanuel Lubezki, scoring mendebarkan Steven Price, sound editing jempolan dan tentu saja, kepiawaian Cuarón dalam mengolah setiap momennya  yang semua campuran itu mampu menghasilkan efek jaw dropping yang pada akhirnya ditutup dengan ungkapan penuh ketakjuban.'),
(114, 'Groundhog Day', 'POSITIF', 'DATA LATIH', 'Groundhog Day adalah sebuah drama komedi dengan cerita unik dan ringan yang bisa membuat kita tertawa dan merenung saat menontonnya, bukan hanya sekedar drama komedi biasa, film ini juga memberikan inspirasi dan pesan moral yang cukup dalam bagi kita untuk menjadi manusia yang lebih baik.'),
(115, 'Guardians of the Galaxy', 'POSITIF', 'DATA LATIH', 'Di bagian aksinya, Guardias of The Galaxy tampil memukau. Meskipun sebelumnya hanya pernah membuat film superhero “gadungan” dalam Super, tetapi di sini Gunn sepertinya sudah fasih benar ketika ia menghadirkan setiap momennya dengan sangat berkelas dan tentu saja menghibur. Gunn  menyuntik narasinya dengan keseimbangan sempurna humor-humor segar dari setiap karakternya, musik-musik pop ''70-''80 asyik dari kaset dan walkman jadul kesayangan Peter Quill yang seperti tidak pernah gagal menggelitik dan tentu saja keseruan sebuah action supehero spektakuler berbiaya mahal bersama dukungan CGI dan 3D yang apik. Dari pertarungan berskala kecil di darat dan penjara sampai pertempuran pesawat-pesawat luar angkasanya, semua ditampilkan maksimal bersama sinematografi cantik. '),
(116, 'Guzaarish', 'POSITIF', 'DATA LATIH', 'Keberhasilan Guzaarish mengaduk-aduk emosi penontonnya selain karena kepiawaian Bhansali meracik kisahnya dengan dukungan teknis kelas atas,  juga jelas tidak terlepas dari performa gemilang Hrithik Roshan. Dibutuhkan akting prima untuk dapat membawakan karakter Ethan Mascarenhas yang lumpuh secara meyakinkan, dan Roshan melakukan pekerjaannya dengan sangat baik, membuat penonton bersimpati dan memaklumi keadaannya tanpa harus merasa kasihan terhadap kekurangannya. Kehadiran artis cantik yang  juga mantan Miss World, Aishwarya Rai sebagai perawat sekaligus love interest Ethan pun semakin mewarnai kisah indah ini.\r\n'),
(117, 'Hacksaw Ridge', 'POSITIF', 'DATA LATIH', 'Memasuki medan tempur Gibson terlihat habis-habisan mengeksploitasi segala hal yang ia suka. Kombinasi dramatisasi antara kebrutalan, kepahlawanan dan sisi religius mampu bersinergi dengan sempurna bersama kekuatan karakter unik seorang Desmond Doss. Kekacauan dalam adegan peperangan dihadirkan dengan sangat baik. Pertempuran digambarkan begitu masif dan cepat namun hebatnya kita tetap bisa mengikuti pergerakan karakter utamanya dengan baik. Setiap desingan peluru dan ledakan granat yang tersaji dalam balutan sinematografi ciamik Simon Duggan benar-benar memamerkan apa itu arti dari horor perang.'),
(118, 'Hanna', 'POSITIF', 'DATA LATIH', 'Hanna memang bukan suguhan biasa. Ini adalah kombinasi apik dari action thriller, revenge movie dan coming of age yang digarap dengan kualitas penyutradaraan hebat serta dukungan  teknis sinematografi jempolan dari Joe Wright dan tentunya sosok Hanna itu sendiri yang sukses dibawakan dengan sangat apik oleh Saoirse Ronan.'),
(119, 'Hari Untuk Amanda', 'POSITIF', 'DATA LATIH', 'Hari Untuk Amanda adalah sebuah oase kesegaran di tengah panas dan gersangnya padang pasir perfilman Indonesia, sebuah kisah cinta sederhana namun mampu meninggalkan kesan manis dan personal bagi setiap penontonnya. Tidak diragukan lagi jika Hari Untuk Amanda adalah salah satu drama romantis Indonesia terbaik yang pernah dibuat oleh sineas kita.'),
(120, 'Harry Potter and the Deathly Hallows: Part 1', 'POSITIF', 'DATA LATIH', 'The Deathly Hollows: part 1 sejauh ini adalah yang terbaik dari seluruh film Harry Potter yang ada. David Yates selaku sutradara sukses memanfaatkan momentum dibagi duanya kisah epik petualangan penyihir paling dicintai di dunia ini dengan menghadirkan separuh kisah seri terakhir ini dengan baik. Jelas sebuah ‘bekal’ yang kuat bagi para penontonnya untuk menghadapi grand finale yang akan hadir tahun depan.'),
(121, 'Heartless', 'POSITIF', 'DATA LATIH', 'Heartless sukses menghadirkan sebuah tema horror yang berbeda. Elemen-elemen misteri yang gelap, tragis dan mencekam berhasil berbaur dengan baik dan berimbang dengan elemen-elemen drama psikologis, keluarga, romantisme yang kuat dan penuh emosi. Heartless sekaligus menjadi ajang comeback yang manis bagi seorang Philip Ridley setelah 15 tahun hiatus dari dunia perfilman.'),
(122, 'Heat', 'POSITIF', 'DATA LATIH', 'Bagi pecinta heist movie, Heat jelas adalah salah satu yang terbaik dan juga sebuah film yang wajib dan patut ditonton. Selain karena kehadiran Al Pacino dan Robert De Niro yang bermain gemilang, kisahnya yang menarik dan adegan aksinya yang seru dan ‘gila ‘dijamin akan membuat penontonnya betah untuk berlama-lama duduk di depan televisi mereka.'),
(123, 'Hello Goodbye', 'POSITIF', 'DATA LATIH', 'Dimulai dengan sedikit canggung namun perlahan namun pasti Hello Goodbye mampu tampil lepas dengan segala pendekatan yang ‘masuk akal’, presentasi yang cantik, membuat segala hal tentang premisnya yang stereotip dan dialog-dialognya yang tidak pernah terlalu kuat itu mendadak bukan lagi menjadi masalah besar. Ya, saya suka Hello Goodbye, mengingatkan saya pada Before Sunrise/Sunset atau Lost in Translation yang berkesan itu. Ini sebuah romansa manis yang tidak pernah berlebihan dalam menyampaikan pesan cinta dan pencarian jati diri.'),
(124, 'Henry''s Crime', 'POSITIF', 'DATA LATIH', 'Henry’s Crime, kamu bisa menyebutnya sebagai sebuah drama komedi romantis yang santai. Tidak hanya bagaimana ia bergerak pelan sepanjang 108 menit, namun juga bagaimana setiap konfliknya tentang pencarian jati diri dibuat begitu sederhana namun tetap tidak menghilangkan usur hiburannya yang enjoyable, terlebih ‘trio Musketeer’ kita , Keanu Reeves, Vera Farmiga dan James Caan begitu solid dalam menghadirkan interaksi antara karakternya.'),
(125, 'Her', 'POSITIF', 'DATA LATIH', 'Her menjadi sebuah pengalaman berbeda menonton sebuah romansa dengan sentuhan fiksi ilmiah, sebuah film yang membawa sebuah romcom ke level berbeda, romcom yang bisa membuatmu jatuh cinta pada pandangan pertama, berlebihan? Ah, tidak juga, tunggu sampai kamu merasakan sendiri bagaimana Her akan langsung membiusmu sejak menit pertama, sejak karakter Theodore membacakan surat cintanya yang manis, ketika Jonze membungkus semuanya dengan (lagi-lagi) kualitas sinematografi dreamy Los Angeles masa depan dari Hoyte van Hoytema dan iringan scoring-scoring keren Arcade Fire di mana membuat tampilan Her layaknya seperti video klip cantik romantis berwarna lembut dengan durasi 125 menit.'),
(126, 'Hidden', 'POSITIF', 'DATA LATIH', 'Sementara tensinya juga berhasil terjaga dengan baik, Duffer tidak pernah berlama-lama dengan melodramanya, ketika tempo mulai mengendur ada ketegangan, dari kehilangan stok makanan, kebakaran sampai teror dari atas yang seperti mulai mencium jejak keberadaan keluarga Ray. Lalu dalam misi mengisi informasi yang hilang, beberapa rentetan flash back memberi sedikit banyak jawaban dari masa lalu tetapi lagi-lagi Duffer masih berhasil menjaga misterinya dengan baik setidaknya sampai klimaks datang menjemput dengan twist menghentak yang langsung mengubah wajah Hidden selamanya.'),
(127, 'Honeymoon', 'POSITIF', 'DATA LATIH', 'Tetapi sekali lagi bagian terbaiknya bukan hanya pada misterinya, namun juga pada ikatan dari dua tokoh utamanya yang dimainkan oleh dua bintang muda dari dua serial televisi populer, Harry Treadaway (Penny Dreadful) dan Rose “Ygritte” Leslie (Game of Thrones). baik sebelum atau setelah konflik terjadi. Ada sebuah pesan tentang cinta sejati yang coba turut diangkut Janik di samping segala teror mencekamnya yang datang dari luar kabin.'),
(128, 'Horrible Bosses', 'POSITIF', 'DATA LATIH', 'Selain trio Jason Bateman, Charlie Day, dan Jason Sudeikis yang sukses membawakan peran mereka sebagai para pekerja yang tidak dihargai oleh atasannya, para ‘evil boss’ tampaknya juga tidak mau ketinggalan untuk bersenang-senang, melengkapi salah satu ensemble cast terbaik yang pernah ada dalam sebuah komedi. Ada Kevin Spacey yang tampil paling hebat dan paling menyebalkan di sini mengisi sebagai si  ‘psikopat’ Dave Harken, atau Collin Ferrell yang penampilannya mengingatkan saya pada cameo Tom Cruise di Tropic Thunder, lengkap dengan perut buncitnya dan rambutnya yang licin, serta Jeniffer Aniston yang secara mengejutkan mampu tampil apik membawakan karakter dokter gigi cabul, dan last but not least, Jamie Foxx yang memerankan konsultan pembunuhan bernama Motherfucker Jones, ya, nama yang ‘unik’, seunik kisah di balik pemilihan namanya.'),
(129, 'Housebound', 'POSITIF', 'DATA LATIH', 'Sebagai sutradara yang masih ‘bau kencur’ macam Gerard Johnstone, Housebound adalah sajian sempurna. Sebuah horor mikro budget yang percaya diri dengan segala keunikannya, diisi oleh banyak kombinasi dan jebakan-jebakan penuh kejutan menyenangkan yang akan mengundang rasa penasaran, rasa takut sekaligus tawa lepas. Johnstone mencoba menciptakan sesuatu yang berbeda pada karakter utamanya, menjauhkan dari unsur-unsur stereotip seperti kebanyakan horor lainnya. Kylie yang dimainkan asyik oleh Morgana O’Reilly adalah karakter anti heroine yang kuat, cuek, pemarah, kurang ajar dan untuk ukuran tokoh utama perempuan dalam film horor, Kylie termasuk pemberani.'),
(130, 'How to Train Your Dragon', 'POSITIF', 'DATA LATIH', 'Berbekal cerita yang kuat yang diadaptasi bebas dari bukunya yang berjudul sama buah karya Cressida Cowell, duet sutradara sekaligus penulis Chris Sanders dan Dean DeBlois yang sebelumnya pernah sukses menghasilkan cerita animasi Disney, Lilo & Stitch berhasil menghadirkan sebuah kisah from zero to hero, persahabatan, kesetiaan, kepercayaan dan semangat juang pantang menyerah yang dibungkus dengan karakter-karakter dan animasi yang menarik, penuh warna dan sangat detail. Sanders dan DeBlois berhasil dengan konsisten menjaga irama film ini sampai akhir. Tanpa terlalu terburu-buru cerita mengalir dengan lembut dengan konflik-konflik yang tergali dengan baik. '),
(131, 'Hugo', 'POSITIF', 'DATA LATIH', 'Hugo adalah debut Scorsese dalam dunia 3D, dan untuk seorang sutradara veteran yang baru pertama kali menangani teknologi ini Scorsese sudah mampu menghadirkannya dengan sangat baik. Gambar-gambarnya terlihat luar biasa dan hebatnya, tidak terkesan terlalu berlebihan karena semuanya mampu menyatu dengan bagaimana sutradara berambut putih ini menanganinya, termasuk pergerakan kamera yang dinamis dan juga dukungan efek CGI yang menjadikan dunia Hugo begitu mempesona, sama mempesonanya ketika ia menampilkan bagaimana Melies dalam wujud Ben Kingsley yang luar biasa itu dan sang istri, Jeanne (Helen McCrory) membuat film-filmnya dengan penuh semangat dan keceriaan sebelum akhirnya mereka dilupakan.'),
(132, 'I Give It A Year', 'POSITIF', 'DATA LATIH', 'Kekuatan utama I Give it Year jelas ada pada komedinya. Didominasi oleh dialog-dialog yang porsi kelucuannya sama besar dengan kekotorannya terutama yang keluar dari mulut Minnie Driver yang tampil sebagai pencuri perhatian terbesar. Dari momen pernikahan, threesome, permainan tebak kata, sampai adegan frame foto elektronik, semuanya berhasil menghadirkan kelucuan yang memalukan. I Give it A Year jelas bukan role model yang pantas buat romcom impian, banyak yang memandangnya sinis karena dianggap vulgar dan pro perceraian alih-alih percaya dengan keajaiban cinta pandangan pertama. Tetapi di balik segala kekacauan gila-gilaan yang menyenangkan itu ada sisi manis dan romantisme yang tetap dipertahankan Mazer untuk menekankan bahwa ini masih berada di ranah film-film cinta.  Ada sebuah realita pahit yang biasanya berusaha dijauhi oleh koleganya ketika film ini berakhir dengan ceria. '),
(133, 'I Love You Phillip Morris', 'POSITIF', 'DATA LATIH', 'I Love You Phillip Morris mungkin adalah salah satu film dengan tema homoseksual yang sangat enjoyable dan menghibur untuk ditonton. Jika kebanyakan film-film yang mengangkat tema ‘tabu’ seperti ini tampil begitu serius dengan konflik-konflik yang cukup berat, namun tidak bagi film besutan duet sutradara Glenn Ficarra dan John Requa ini. Ya, I Love You Phillip Morris berhasil menggabungkan kisah nyata dari seorang penipu ulung bernama Steven Russell dengan unsur-unsur tipu-menipu ala Catch Me if You Can, romantisme cinta sejenis ala Brokeback Mountain dan gaya lelucon komikal ala Jim Carrey dengan manis yang membuat film bertema sensitif ini menjadi sebuah sajian yang unik dan sangat menghibur, terlebih lagi banyak sekali adegan-adegan mengejutkan, menipu sekaligus kocak yang membuat tawa penontonnya lepas di saat menyaksikan film berdurasi 98 menit ini.'),
(134, 'Ichi the Killer', 'POSITIF', 'DATA LATIH', 'Jika belum pernah bersentuhan dengan komiknya, Ichi The Killer sepintas mungkin terlihat seperti film gangster kebanyakan, namun bagaimana Miike menghadirkannya yang membuat segalanya menjadi berbeda. Tidak hanya disuguhkan dengan parade adegan-adegan disturbing seperti yang sudah saya singgung diatas, namun juga mengajak penontonnya dalam sebuah studi karakter dari tokoh-tokohnya yang unik, lengkap dengan segala konflik maupun gangguan kejiwaannya masing-masing plus sedikit bumbu black komedi dan iring-iringan soundtrack Japanese avant garde dari grup musik legendaris Jepang, Boredoms menjadikan Ichi the Killer sebuah pesta darah yang lengkap dan meriah.'),
(135, 'Il Mare', 'POSITIF', 'DATA LATIH', 'Selain kisahnya yang unik, seperti kebanyakan drama-drama Korea Selatan lainnya, penontonnya akan banyak disuguhkan adegan-adegan manis dengan visual yang indah. “Il Mare” dengan latar belakang pantai sunyi nan indah berhasil ditangkap dengan sangat baik, menimbulkan kesan romantis sekaligus misterius secara bersamaan. Kehadiran Jun Ji Hyun dan Lee Jung Jae sebagai pasangan beda waktu juga terbilang cukup baik, walaupun tidak istimewa setidaknya mereka sudah pas membawakan karakter masing-masing dengan segala konflik internalnya'),
(136, 'In America', 'POSITIF', 'DATA LATIH', 'Dengan dukungan para pemainnya yang bermain gemilang terutama pada kedua aktris ciliknya Sarah dan Emma Bolger yang di dunia nyata memang adalah kakak adik tampil sangat luar biasa sehingga menjadikan film ini menjadi jauh lebih menarik, termasuk juga akting dari Djimon Hounsou, aktor asal Perancis berkulit hitam ini ternyata juga bisa tampil meyakinkan sebagai seorang pria yang penuh dengan kasih sayang dibalik wajahnya yang sangar. Sebuah drama keluarga yang indah dan penuh makna yang akan menyentuh emosi setiap penontonnya dengan kisahnya yang luar biasa.'),
(137, 'Inception', 'POSITIF', 'DATA LATIH', 'Tidak diragukan lagi jika Inception adalah salah satu yang terbaik dari seorang Christopher Nolan, walaupun secara kualitas masih sedikit berada di bawah Memento maupun The Dark Night, namun apa yang disajikan oleh Nolan di sini lebih dari cukup untuk sekali lagi mengukuhkannya sebagai salah satu sutradara terbaik yang dimiliki oleh Hollywood dan juga membuat Inception menjadi salah satu film terbaik tahun ini.'),
(138, 'Incendies', 'POSITIF', 'DATA LATIH', 'Incendies adalah sebuah drama kuat yang tersaji luar biasa selama 2 jam lebih. Tidak peduli seberapa lambat ia berjalan karena hampir di setiap menitnya film yang banyak memperoleh penghargaan internasional ini mampu berbicara banyak dan juga memberikan efek kejut kepada penontonnya. Ini adalah sebuah kisah hebat, depresi dan tragis yang dikemas apik, kisah pilu bagaimana seorang ibu berusaha menyatukan kembali keluarganya meskipun harus dengan cara yang menyakitkan.'),
(139, 'Inglorious Basterds', 'POSITIF', 'DATA LATIH', 'Tidak mudah memang membuat sebuah film dengan tema sejarah di mana sejarah tersebut sudah dimodifikasi ulang sedemikian rupa sehingga menghasilkan sebuah tontonan yang berbeda, dan untuk dapat membuatnya sebagai sebuah tontonan berkualitas tentu saja dibutuhkan keberanian tersendiri dan juga sedikit “kegilaan” untuk menulis ulang sejarah sesuai dengan yang diinginkan, dan kemampuan itulah yang dimiliki oleh seorang Tarantino yang ternyata berhasil menghadirkan sebuah fantasi perang yang sangat luar biasa menghibur, penuh kejutan dan menegangkan hingga akhir, namun film ini juga bisa luar biasa membosankan bagi penonton yang tidak terbiasa dengan dialog-dialog panjang dan alur lambat yang hampir menghiasi film yang berdurasi 153 menit ini'),
(140, 'Inside', 'POSITIF', 'DATA LATIH', 'Inside bisa dibilang adalah salah satu horror slasher terbaik yang pernah dibuat Perancis. Dengan premisnya yang simpel dan latar minimalis, rangkaian adegan-adegan menegangkan plus bumbu blood and gore yang sangat kental, film ini akan memberikan efek maksimum kepada penontonnya.'),
(141, 'Inside Out', 'POSITIF', 'DATA LATIH', 'Lebih dalam, Inside Out punya pesan solid tentang proses perjalanan dari seorang anak menuju kedewasaan yang mungkin hanya dimengerti oleh penonton dengan rentang usia yang lebih besar lengkap dengan segala adegan-adegannya yang mampu menyentil emosi. Setiap kegalauan yang hadir, setiap rasa amarah dan kelabilan memang merupakan bagian tak terpisahkan dari sebuah proses, namun menjadi istimewa ketika Docter dan Del Carmen mampu membungkusnya dalam petualangan khas Pixar yang bisa dinikmati oleh siapa saja, dan itu yang paling penting.'),
(142, 'Instructions Not Included', 'POSITIF', 'DATA LATIH', 'Terlalu banyak kejutan di sini yang membuat plotnya seperti berbelok tajam setiap kali sebuah surprise baru menabraknya, seperti sejak Valentine beralih profesi menjadi stuntman dadakan yang sukses di Hollywood setelah melompat dari lantai 10 lalu kedatangan Julie yang mengubah aroma kental “Big Daddy” menjadi “Kramer Vs. Kramer”,  Dan ketika kamu seperti sudah mulai terbiasa ditampar bolak balik oleh twistnya yang penuh emosi dan tawa, sekali lagi sebuah kejutan paling besar datang tepat sebelum credit akhir, sebuah kejutan yang dipastikan akan membuatmu menyesal sudah meremehkannya sejak awal.'),
(143, 'Interstellar', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film yang banyak menyajikan pengalaman luar angkasa, Nolan membuatnya dengan spektakuler. Dibungkus dengan visual menakjubkan dari dapur spesial efek Double Negative bersama dukungan kamera IMAX yang dikendalikan sinematografer kawakan Hoyte van Hoytema. Setiap momen yang melibatkan petualangan di angkasa luar itu penuh kejutan tak terduga, begitu menegangkan, begitu misterius sekaligus begitu memesona dan emosional terutama ketika Cooper dan Amelia bersenggolan dengan fenomena spacetime continuum dan usaha mereka bertahan hidup demi kemanusiaan, cinta dan keluarga, dan saya masih belum menyebut pengaruh besar scoring dahsyat garapan sang maestro Hans Zimmer yang tidak pernah gagal memompa setiap emosi penontonnya. Klimaksnya seperti banyak terinspirasi dari rangkaian momen absurd nan indah opus fiksi ilmiah legendaris Stanley Kubrick, 2001: A Space Odyssey. Twist di ujungnya tidak hanya begitu mengejutkan namun juga terasa begitu sentimentil ketika Nolan membawa narasinya menjadi sebuah puzzle utuh yang menggetarkan.'),
(144, 'Invictus', 'POSITIF', 'DATA LATIH', 'Invictus merupakan contoh film yang sangat baik dalam membawa tema olahraga untuk alat mempersatukan bangsa. Clint Eastwood, orang tua yang masih dengan tekunnya masih bisa menyutradarai film- film drama bermutu beralur pelan, lagi-lagi Clint sukses  membawakan kisah nyata ini ke layar lebar, ketika adegan pertandingan terakhir yang bersejarah antara Afrika Selatan dan Selandia baru dengan suasana tahun 1995 dibuat sedetail mungkin oleh Clint, begitu banyak momen indah yang jangan sampai dilewatkan.'),
(145, 'Ironclad', 'POSITIF', 'DATA LATIH', 'Sebuah film perang tentu tidak lengkap jika tidak menghadirkan adegan-adegan baku hantam baik jarak jauh maupun dekat, dan untuk bagian satu ini saya harus mengacungkan jempol buat English yang sudah membuat pertarungan jaman medieval ini dengan sangat baik, terlebih untuk film dengan biaya produksi yang minim. ‘Brutal’ dan ‘realistis’ mungkin adalah dua kata yang tepat untuk menggambarkan bagaimana English menghadirkan adegan peperangan di sini. '),
(146, 'It Follows', 'POSITIF', 'DATA LATIH', 'Elemen supernaturalnya bekerja dengan sangat efektif, mampu mengusik imajinasimu hanya dengan melihat koridor atau pintu ruangan terbuka. Semua kengerian ini banyak dibantu dengan kekuatan teknis dan kerja kamera yang brilian menangkap setiap ketakutan, setiap rasa tidak nyaman dan ancaman yang bisa datang kapan saja tanpa peringatan.'),
(147, 'Jackass 3D', 'POSITIF', 'DATA LATIH', 'Jackass dengan mudah menjadi sebuah suguhan komedi yang dicintai sekaligus dibenci sama besarnya. Kecuali penggunaan kamera yang jauh lebih canggih, efek slow motion dan 3D yang dahsyat, Jackass 3D sesungguhnya tidak menawarkan sesuatu yang baru, tetap setia mengusung konsep pranks & stunts usangnya, namun hebatnya hingga seri ketiga ini suguhan usang tersebut masih terbukti efektif memberikan efek kejutan dan hiburan luar biasa bagi saya. Ya, jujur saja saya menikmati setiap menit penuh kegilaan dan kegembiraan menyimpang bersama kru Jackass.'),
(148, 'Jason Bourne', 'POSITIF', 'DATA LATIH', 'Narasinya memang tidak mampu berinovasi besar dan terasa seperti mengulang dari pakem seri pendahulunya, namun fokus utamanya adalah bagaimana meleburkan kisahnya bersama momen aksinya yang harus diakui masih terasa luar biasa mendebarkan ketika berada di tangan Greengrass. Trademark Greengrass dengan segala editing cepat dan penggunaan shaky cam kembali mendominasi setiap pergerakan Bourne ketika beradu pintar dengan para agen CIA. Setiap adegan kejar-kejaran digarap dengan sangat baik, setiap adu fisik dan senjata menghadirkan lecutan adrenalin tingkat tinggi bersama dentuman scoring familiar dari John Powell dan David Buckley.'),
(149, 'Joe', 'POSITIF', 'DATA LATIH', 'Kekuatannya ada pada character driven dan kekuatan akting  para pemainnya ketimbang plot adaptasi dari novel lama milik Larry Brown. Harus diakui juga, secara teknis Gordon Green bersama sinematografer langganannya, Tim Orr juga sudah bekerja dengan baik membungkus Joe dengan visual depressing atmosferis yang juga cantik dan mellow serta menambahkan sedikit humor pada dialog-dialognya dan juga sedikit kebrutalan guna mencegah menjadikannya terlalu sentimental.'),
(150, 'John WIck', 'POSITIF', 'DATA LATIH', 'David Leitch dan Chad Stahelski adalah dua orang yang paling bertanggung jawab mengapa John Wick bisa bergerak begitu leluasa, begitu asyik dan begitu stylish dalam menerjemahkan narasi usang yang sudah dimodifikasi sana-sini oleh Derek Kolstad, dan saya masih belum mengatakan ia juga begitu keras dan kotor memiliki tingkat kebrutalan dan koreografi aksi paling keren tahun ini yang mungkin hanya bisa dikalahkan oleh sekuel The Raid, Berandal.'),
(151, 'Joint Security Area', 'POSITIF', 'DATA LATIH', 'Joint Security Area bisa dibilang adalah salah satu thriller terbaik Korea Selatan, yang juga menjadi pintu gerbang bagi karir Park Chan Wook, yang seperti kita ketahui kemudian berhasil menghadirkan banyak karya-karya besar, salah satunya adalah Trilogi Vengeance yang fenomenal itu.'),
(152, 'Julie & Julia', 'POSITIF', 'DATA LATIH', 'Julie & Julia tampil cukup solid baik dari cerita maupun akting para aktrisnya, sehingga film yang mengangkat tema tentang kuliner ini mampu menjadi hiburan tersendiri buat para penontonnya, baik buat penggemar masak memasak atau tidak film ini akan membuat kita lapar dan secara tidak sadar meneteskan air liur kita.'),
(153, 'Justin Bieber: Never Say Never', 'POSITIF', 'DATA LATIH', 'Never Say Never jelas menghibur dan emosional tidak hanya buat para fans semata, namun juga buat saya, golongan penonton yang kurang mengenal siapa itu sosok Justin Bieber untuk ikut berdendang bersama menikmati kemegahan dan histeria suasana konser My World Tour yang spektakuler itu, dan di sisi lain Chu juga tidak ketinggalan untuk mengajak penontonnya untuk mengenal lebih dekat sosok pribadi sang mega bintang yang sudah berhasil menyihir dunia ini.'),
(154, 'Kagemusha', 'POSITIF', 'DATA LATIH', 'Kurosawa benar-benar tahu cara mengambil momen dan adegan di setiap scene, pemandangan-pemandangan yang menarik, tone warna yang cemerlang, Apalagi ini merupakan film Kurosawa berwarna pertama yang saya tonton, adegan alam mimpi Shingen palsu benar-benar memukau, tidak ada visual efek dan sebagainya, yang ada hanyalah permainan warna dan pengambilan gambar yang epik. '),
(155, 'Kahaani', 'POSITIF', 'DATA LATIH', 'Naskahnya memang menarik dan nyaris rapi dengan segala detailnya, tapi harus diakui ia masih memiliki beberapa plot hole yang terasa sedikit mengganggu keasyikannya. Untung saja Kahaani punya cast yang bagus untuk menambal kekurangannya itu termasuk bagaimana kemudian Ghosh berhasil menutup kisahnya dengan twist ending cerdas, ending yang sangat berkaitan dengan pemilihan karakter wanitanya yang tidak biasa itu. '),
(156, 'Kapan Kawin', 'POSITIF', 'DATA LATIH', 'Tidak mudah membuat sebuah komedi romantis yang masih terlihat menyegarkan di balik formula komersialnya. Selain karena kepiawaian Ody Harahap mempresentasikan racikan komedi dan romansanya dengan takaran pas, Kapan Kawin? juga banyak sekali terbantu oleh kinerja para pemainnya yang solid, malah bisa dibilang Kapan Kawin? bisa begitu memikat berkat digerakkan oleh jagoan-jagoan hebatnya, baik yang berada di posisi karakter utama maupun pendukung seperti Adi Kurdi dan Ivanka Suwandi sebagai orangtua Dinda yang kolot sekaligus kocak luar biasa.'),
(157, 'Kick-Ass', 'POSITIF', 'DATA LATIH', 'Layaknya keberanian yang ditampilkan oleh karakter Kick-Ass, Matthew Vaughn pun dengan berani menyajikan sebuah suguhan berbeda dalam genre superhero. Sebuah usaha yang ternyata tidak sia-sia dan berbuah manis, karena Kick-Ass benar-benar sukses tampil menghibur dengan segala keunikan dan kesegarannya.'),
(158, 'Kiki''s Delivery Service', 'POSITIF', 'DATA LATIH', 'Seperti kebanyakan animasi buatan Miyazaki lainnya, Kiki’s Delivery Service juga tidak lepas dari balutan animasi cantik, penuh warna-warni dengan detail yang luar biasa, apalagi mengingat ini adalah animasi 2D buatan 1989 di mana teknologi animasi belum secanggih sekarang, namun Studio Ghibli bersama Miyazaki sudah mampu membuat animasi klasik modern dengan kualitas tinggi. Kiki’s Delivery Service memang bukanlah animasi terbaik dari Miyazaki dan Studio Ghibli, namun tetap saja animasi satu ini mampu memberikan sebuah tontonan menghibur dan penuh dengan segala kebaikan yang menginspirasi serta dapat dinikmati oleh semua kalangan.'),
(159, 'Kidnapped', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah thriller indie, Kidnapped sama sekali tidak buruk.  Miguel Ángel Vivas sudah melakukan pekerjaannya dengan hebat untuk meramu kembali formula usang dalam kemasan yang berkelas, rumit sekaligus menyegarkan, memberikan penontonnya sebuah sensasi teror dan ketakutan yang berbeda dari kebanyakan film bertema sama.'),
(160, 'Killer Toon', 'POSITIF', 'DATA LATIH', 'Secara teknis Killer Toon sudah tampil meyakinkan sebagai sebuah horor. Sementara narasinya sendiri tidak sekuat penampilannya. Memang harus diakui ia punya kekuatan besar di temanya, kandungan misterinya pun sukses mengusik rasa penasaran.'),
(161, 'Kimi no Na Wa', 'POSITIF', 'DATA LATIH', 'Sebuah cerita cinta tentang keajaiban ruang dan waktu pun dimulai, ada rasa harap-harap cemas tentang apa yang terjadi selanjutnya yang kemudian ditutup dengan klimaks sentimentil dan ending kuat yang mengingatkan saya pada sensasi yang ada pada 5 Centimeters Per Second. Sensasi yang dijamin akan membuatmu menjadi baper maksimal.'),
(162, 'Kingsman: The Secret Service', 'POSITIF', 'DATA LATIH', 'Kingsman menjadi spesial tidak hanya karena ia menginjeksi tema aksi spionase yang notabene salah satu sub genre populer, namun yang penting adalah bagaimana Vaughn memperlakukannya layaknya anak kandungnya sendiri. Ya, Kingsman punya semua ciri khas Vaughn dari kekerasan tingkat tinggi yang melibatkan banyak darah dan kepala pecah sampai koreografi aksi memukau dengan segala efek slow motion cantik dan scoring asyik yang tepat sasaran, terutama pada klimaks spektakulernya, plus selipan komedi yang renyah.'),
(163, 'Kon Tiki', 'POSITIF', 'DATA LATIH', 'Duo Ronning-Sanberg tahu benar bagaimana menghasilkan gambar-gambar cantik bersama pergerakan kamera yang dinamis. Ya, mungkin spesial efeknya tidak secanggih Life of Pi, tetapi ada kesan natural yang terasa jauh lebih kental dan meyakinkan, lihat bagaimana para tim spesiel efeknya mampu membuat CGI hiu senyata itu.'),
(164, 'Kristy', 'POSITIF', 'DATA LATIH', 'Kristy punya kekuatan terbesar dari bagaimana Blackburn membentuk dengan kuat set piece horornya, menjadikan setiap momen slasher mampu lepas, keluar dan menghunjam dengan sangat efektif menggedor jantung penontonnya, menghadirkan sebuah pesona kuat tidak hanya melalui momen ketegangan akibat melihat karakternya dikejar-kejar para pemburu misterius sembari ‘bermain’ petak umpet dan adu cerdas, namun juga bagaimana suasana suram mencekam yang hadir secara konsisten sejak konflik dimulai.'),
(165, 'La Horde', 'POSITIF', 'DATA LATIH', 'Melalui La Horde, duet sutradara Benjamin Rocher & Yannick Dahan sukses menghadirkan sebuah survival action zombie movie di debut penyutradaraan mereka. Dan hasilnya di luar dugaan tampil cukup baik dan menghibur. Segala ciri khas film-film zombie klasik pun tidak lupa mereka tampilkan dalam film berdurasi 96 menit ini, bertaburannya adegan-adegan gore dan blood splatter, serta kejutan-kejutan ‘pelecut’ adrenalin yang sudah menanti dalam setiap kegelapan.'),
(166, 'La Strada', 'POSITIF', 'DATA LATIH', 'Film Besutan Federico Fellini yang satu ini menampilkan kisah cinta yang indah dan menghanyutkan, benar-benar menuangkan cinta di pita seluloidnya, meskipun film hitam putih ceritanya tidak hitam putih, ide yang di sampaikan cukup berkesan dan mengena, mudah diingat, menghibur, bijaksana, dan banyak hal lainnya. Film ini benar-benar mengungkapkan tentang kondisi manusia sebenarnya dalam kombinasi tak terduga dari emosi yang kadang-kadang membangkitkan.'),
(167, 'Lake Mungo', 'POSITIF', 'DATA LATIH', 'Lake Mungo bisa dibilang adalah salah satu contoh bagaimana horror mockumentary yang baik itu dibuat. Dengan sederhana namun efektif, film yang rencananya akan dibuat remake tahun 2011 nanti ini mampu memberikan sebuah pengalaman ‘berkesan’ yang akan menghantui pikiran setiap penontonnya.'),
(168, 'Lars and the Real Girl', 'POSITIF', 'DATA LATIH', 'Tidak seperti latarnya yang dingin, ini adalah film yang menghangatkan dan membuat kita nyaman dengan segala kebaikan di dalamnya, sebuah ‘heart warming’ drama kata orang di barat sana. Semua karakter tampak begitu menyenangkan dan begitu suportif, tidak ada karakter antagonis di sini kecuali mungkin Lars dan dirinya sendiri. Ryan Gosling sudah melakukan hal hebat untuk menghidupkan karakter Lars yang ‘sakit’ sekaligus karismatik secara bersamaan, sebuah pribadi yang kompleks dengan tragedi masa lalu yang menghantuinya'),
(169, 'Laura & Marsha', 'POSITIF', 'DATA LATIH', 'Ini adalah road movie menarik dengan kandungan estrogen yang kental (disutradarai, ditulis, dimainkan dan diproduseri oleh para wanita). Semua yang kamu butuhkan dari sebuah fim perjalanan ada di Laura & Marsha; Set cantik, karakterisasi kuat dan soundtrack yang bagus, yah, meskipun masih digarap dengan terburu-buru dan terasa kikuk di beberapa bagian, ini adalah tontonan yang enjoyable tentang sebuah perjalanan penuh makna yang menguji sampai di mana kekuatan sebuah persahabatan.'),
(170, 'Lean on Me', 'POSITIF', 'DATA LATIH', 'Selain ceritanya yang ringan, film produksi tahun 1989 ini juga banyak diselingi dengan quote menarik dan humor-humor lucu sehingga tidak jarang membuat penontonnya tertawa.'),
(171, 'Lego Movie', 'POSITIF', 'DATA LATIH', 'Jika kamu bukan penggemar Lego, mungkin membutuhkan sedikit waktu untuk terbiasa melihat tampilan visualnya yang unik, seperti kombinasi animasi stop motion dengan tampilan kotak-kotak kaku ala bata-bata cerah Lego.'),
(172, 'Leon: The Professional', 'POSITIF', 'DATA LATIH', 'Tidak terlalu berlebihan rasanya jika banyak orang yang memasukkan Leon ke dalam list film terfavorit mereka, karena film produksi Perancis bukan hanya tampil menghibur semata namun juga memberikan sebuah tontonan crime drama berkelas dan penuh emosi.'),
(173, 'Let Me In', 'POSITIF', 'DATA LATIH', 'Walaupun secara keseluruhan saya tetap lebih menyukai Let the Right One In, namun harus diakui Matt Reeves telah berhasil melalukan ‘pekerjaan rumahnya’ mentransfer elemen-elemen penting novel maupun film aslinya dengan sangat baik. Ya,  Let Me In ini adalah contoh sukses bagaimana harusnya sebuah film daur ulang itu dibuat. Jarang-jarang ada remake yang mampu berbicara banyak, sebanyak film aslinya'),
(174, 'Life of Pi', 'POSITIF', 'DATA LATIH', 'Secara fisik Life of Pi itu cantik, sangat cantik, bahkan sejak pertama kali dibuka ia sudah menebar pesonanya melalui gambar-gambar fauna yang terbalut dalam selimut 3D yang apik. Ya, efeknya bisa jadi salah satu yang terbaik di kelasnya tetapi kejutan masih terus berlanjut, kamu akan menemukan bahwa visualnya pun sangat indah, sinematografer Claudio Miranda sepertinya tahu benar kemauan Lee akan sebuah sajian penuh orgasme visual menggetarkan ketika ia dengan lihai menghasilkan variasi lanskap-lanskap laut fantastis yang merangsang mata dan hati kita.'),
(175, 'Like Crazy', 'POSITIF', 'DATA LATIH', 'Like Crazy, sebuah romansa pahit manis dengan rasa indie kental yang berbalut narasi sederhana tentang kekuatan cinta. Menjadi menarik dan emosional ketika Drake Doremus membungkusnya dengan segala kesederhanaan bercerita, pemilihan sudut-sudut kamera yang cantik termasuk memaksimalkan akting dua pemeran utamanya, khususnya Felicity Jones yang tampil luar biasa.'),
(176, 'Limitless', 'POSITIF', 'DATA LATIH', 'Limitless mungkin bukan yang terbaik di genrenya. Seorang Neil Burger  sepertinya juga butuh asupan NZT-48 untuk menjadikan filmnya ini jauh lebih sempurna. Tapi dengan premis menarik dan ditunjang dengan naskahnya yang cukup cerdas plus permainan apik dari seorang Bradley Cooper, tentu tidak sulit bagi Limetless untuk menjadi sebuah sajian crime thriller unik dan menghibur yang saya percaya dapat langsung disukai penontonnya.'),
(177, 'Locke', 'POSITIF', 'DATA LATIH', 'Setting, naskah dan karakternya memang terlihat begitu sederhana dan sempit, tetapi siapa sangka di bawah arahan solid Steven Knight, Locke bisa tampil memaksimalkan segala keterbatasannya. Memang dengan hanya didominasi seorang Tom Hardy di belakang kemudi BMW berkecepatan 100 km per jam dan timbunan percakapan telepon, Locke bukan thriller yang akan disukai kebanyakan penontonnya yang tidak sabar.'),
(178, 'Logorama', 'POSITIF', 'DATA LATIH', 'Menonton Logorama adalah sebuah sensasi 16 menit menyenangkan yang tak terlupakan. Konsep unik berhasil disajikan dengan balutan animasi cell shading penuh warna yang sangat enjoyable.'),
(179, 'Lone Survivor', 'POSITIF', 'DATA LATIH', 'Diisi oleh jajaran aktor besar, dari keempat karakter utamanya; Mark Walhberg, Taylor Kitsch, Ben Foster dan Emile Hirsch sampai sang komandan yang diperankan Eric Bana, semua bermain bagus dalam mengemban tugas mereka masing-masing.'),
(180, 'Lovelace', 'POSITIF', 'DATA LATIH', 'Saya menyukai bagaimana Epstein dan Friedman membungkus kisah Linda dalam balutan presentasi yang menarik. Tidak hanya menampilkan setting dekade ''70 yang akurat termasuk dandanan, busana retro kental dan behind the scene pembuatan Deep Throat bersama “cameo-cameo” bintang porno besar lainnya, termasuk kehadiran juragan Playboy, Hugh Hefner yang dibawakan oleh James Franco,  namun juga secara visual kita seperti menonton kembali film berusia 30 tahun dengan segala efek dan musiknya.'),
(181, 'Mad Max: Fury Road', 'POSITIF', 'DATA LATIH', 'Berbicara soal aksi, Fury Road punya semua yang kamu butuhkan di sebuah action movie kejar-kejaran. Cepat, menegangkan, seru dan indah. Ya, setiap aspek aksi di Fury Road digarap dengan teknis luar biasa. Untuk sebuah film yang berlatar padang gurun tandus, visual garapan John Seale tersaji begitu indah menangkap setiap lanskapnya,'),
(182, 'Malavita', 'POSITIF', 'DATA LATIH', 'Malavita alias The Family  adalah sajian mobster komedi yang menghibur dengan 20 menit klimaks yang menegangkan bersama jajaran cast solid, terutama Michelle Pfeiffer dan si cantik Dianna Agron.'),
(183, 'Mama', 'POSITIF', 'DATA LATIH', 'Mama menawarkan sebuah dongeng horor dengan premis dan narasi yang menarik, sukses untuk membuat kita penasaran hingga akhir. Elemen horornya bekerja dengan baik, latarnya menakutkan, auranya menyesakkan serta para cast bermain dengan..  ya, mungkin sedikit berlebihan di beberapa bagian, namun bagaimanapun Andres Muschietti bisa dikatakan sudah sukses memanjangkan film pendeknya dengan baik, efektif menunaikan tugasnya untuk memberikan penontonnya sebuah sensasi menonton horor yang menakutkan.'),
(184, 'Maniac', 'POSITIF', 'DATA LATIH', 'Tentu saja seperti kebanyakan remake, mau tidak mau, suka tidak suka kita akan membandingkannya dengan versi aslinya, dan untuk kasus Maniac, sekali lagi Aja membuktikan bahwa ia memang pantas dijuluki sang master horor remake di mana ia bersama koleganya, Khalfoun sudah membuat versi daur ulangnya ini menjadi lebih segar bersama sentuhan-sentuhan modern yang membuatnya memiliki ciri khas sendiri tanpa harus kehilangan DNA milik Bill Lustig.'),
(185, 'Marshland', 'POSITIF', 'DATA LATIH', 'Jika ada satu hal yang menonjol dari Marshland itu adalah kualitas visualnya. Ya, ia punya sinematografi jempolan di bawah arahan Álex Catalán. Setiap gambar berhasil memancarkan aura tenang sekaligus haunting dan eerie di saat bersamaan. Permainan lensa jarak jauh termasuk penggunaan format bird eye view bergerak pelan, menawarkan kecantikan realisme tersendiri di balik tragedi dari kota rawa-rawa terpencil itu.'),
(186, 'Matchstick Men', 'POSITIF', 'DATA LATIH', 'Menariknya, dalam perjalanannya Matchstick Men tidak melulu bercerita soal teknik tipu menipu saja dengan segala selipan komedi satir di dalamnya, ada dua bagian lain yang kemudian sukses menyertainya. Pertama adalah karakter Roy Wellar sendiri dengan segala krisis kejiwaan yang diidapnya yang sukses dibawakan dengan sangat baik oleh Nicholas Cage. Karakternya punya porsi yang sama besarnya antara kecerdasan seorang penipu handal, kerapuhan seorang neurotik dan sosok ayah yang belajar untuk mencintai putri 14 tahun yang baru saja dikenalnya.'),
(187, 'Me and Earl and the Dying Girl', 'POSITIF', 'DATA LATIH', 'Paruh pertamanya diisi dengan tone ceria lengkap dengan segala dialog-dialog blakblakan dan humor ‘ajaib’ yang seakan-akan tidak pernah memedulikan rasa sakit yang menjadi tema besarnya. Namun dalam perjalanannya ada elemen coming of age alias pendewasaan yang berperan besar di mana kemudian akan mengubah nadanya menjadi lebih serius.'),
(188, 'Melancholia', 'POSITIF', 'DATA LATIH', 'Inilah kiamat ala Lars von Trier, sebuah studi karakter kompleks yang dibawakan dengan hebat oleh Kristen Dunst dan pelajaran tentang keikhlasan menjelang kematian melalui metafora sebuah planet fiksi bernama Melancholia. Ya, von Trier bermain sedikit lembut dan lebih sopan di sini tanpa kehilangan sentuhannya bercerita dengan gambar-gambar puitis tentang kehancuran yang digarap mengesankan.'),
(189, 'Memento', 'POSITIF', 'DATA LATIH', 'Cerita berjalan mundur begitu unik, sangat jarang ada film seperti ini. Ini yang saya suka dari Memento karena butuh berpikir, butuh konsentrasi tinggi buat menontonnya, mungkin beberapa orang berpikir adegan bolak balik membuat plot film ini sangat tidak biasa namun sebenarnya adalah plotnya sederhana. Untuk itu bagi yang belum menonton scene demi scene harus anda cermati karena ending film ada di awal film dan fakta mengejutkan akan terselip di akhir film,  menjadikan film ini film murah namun berbobot. Salut buat Nolan brothers yang berhasil meraih penghargaan di mana-mana.'),
(190, 'Mencari Hilal', 'POSITIF', 'DATA LATIH', 'Tidak ada melodrama berlebih apalagi sampai menjurus  cengeng, namun momen-momen besar yang hadir mampu meletupkan emosi dengan caranya sendiri, belum lagi saya menyebut kepiawaian Satria Kurnianto dalam membalut narasinya dalam gambar-gambar yang sangat cantik sekaligus puitis yang kemudian dipasangkan serasi dengan scoring garapan Charlie Meliala hingga kemudian soundtrack milik Sabrang ‘Noe’ Panuluh menutup rangkaian perjalanan besar dua anak manusia dengan sangat menyentuh.'),
(191, 'Midnight Special', 'POSITIF', 'DATA LATIH', 'Saya senang bagaimana proses menuju akhir yang paling istimewa adalah bagaimana Nichols menghormati kecerdasan penontonnya dengan memilih  melakukan pendekatan emosional ketimbang naratif yang bertele-tele dan sok pintar, termasuk bagaimana ia memanfaatkan pesona jajaran para pemainnya yang turut bermain apik untuk menggerakkan ceritanya. Mungkin pada akhirnya Midnight Special tidak menawarkan sebuah twist yang sampai terlalu menonjok tetapi tidak bisa dimungkiri itu adalah sebuah akhir yang cukup emosional.'),
(192, 'Mindscape', 'POSITIF', 'DATA LATIH', 'Sampai tiga perempat filmnya, Dorado seperti sudah mengerjakan segalanya dengan rapi. Misterinya dijaga dengan baik, bersama tone mencekam, mencoba menghapus batasan alam mimpi dan alam nyata, termasuk dukungan performa yang bagus dari Mark Strong yang tampil lebih kalem dan tentu saja penampilan meyakinkan dari Taissa Farmiga yang tidak lain dan tidak bukan adalah adik dari aktris Vera Farmiga. Taissa sukses menghadirkan aura misterius pada karakternya, membuat pikiran penontonnya terpecah.'),
(193, 'Minggu Pagi di Victoria Park', 'POSITIF', 'DATA LATIH', 'Di bawah penyutradaraan  apik Lola Amaria plus dukungan naskah kuat dari Titin Watimena, MPdVP sukses menjelma menjadi sebuah suguhan menarik dan menyegarkan. Meskipun tema yang disuguhkan mungkin terlihat “berat” namun berkat olahan naskah yang cerdas membuat jalinan kisah MPdVP menjadi mudah dikunyah oleh para penontonnya.'),
(194, 'Mirrors', 'POSITIF', 'DATA LATIH', 'Memang untuk ukuran film horror secara keseluruhan Mirrors jelas bukan yang terbaik, masih banyak lubang kecil di sana sini, namun setidaknya bagi saya film sudah berhasil digarap cukup baik oleh Aja, bahkan lebih baik dari versi aslinya. Aja sekali lagi membuktikan bahwa ia memang ahlinya membuat horror remake.'),
(195, 'Misery', 'POSITIF', 'DATA LATIH', 'Keberhasilan Misery sebagai sebuah thriller mencekam tentu tidak lepas dari dua orang penting yang berjasa di baliknya. Selain Stephen King sebagai yang empunya cerita, tentu acungan jempol sangat layak diberikan kepada Kathy Bates yang performanya sangat luar biasa di sini. Berperan sebagai seorang wanita psikopat, Bates benar-benar memaksimalkan kemampuan beraktingnya dengan menghadirkan kengerian dalam sosok psikopat bernama Annie Wilkes.'),
(196, 'Miss Granny', 'POSITIF', 'DATA LATIH', 'Premisnya memang menarik, tetapi segala kegilaan itu tidak akan bekerja maksimal jika tidak didukung pemain yang sama gilanya. Ada Shim Eun Kyung yang imut menjadi Oh Doo Ri. Kelucuan demi kelucuan timbul dari gap generasi, kisah cinta segi banyak yang konyol dan kehangatan sebuah keluarga serta perjalanan karakternya mencari jati diri dalam kesempatan kedua yang semuanya difokuskan ke tingkah laku komikal Eun Kyung yang sangat jago memberikan sentuhan jompo cerewet ke dalam wujud 20 tahunnya.'),
(197, 'Moebius', 'POSITIF', 'DATA LATIH', 'Apa yang selalu saya suka dari film-film Kim Ki Duk adalah bagaimana ia menetralkan kegilaannya dalam sebuah konklusi spiritual dengan pesan mendalam, untuk kasus ini ada sub teks tentang karma dan sebab akibat dari apa yang kamu hasilkan melalui setiap perbuatanmu di dunia.'),
(198, 'Mommy', 'POSITIF', 'DATA LATIH', 'Dipresentasikan dengan gaya semi realis seperti kebanyakan film-film Dolan dan visual cantik dari sinematografer langganan Dolan, Andre Turpin sukses menciptakan pemandangan outdoor indah. Sementara lantunan-lantunan musik latar dari tembang-tembang pop tenar dari White Flag milik Dido. Colorblind milik Counting Crows, Oasis dengan Wonderwall sampai ditutup oleh nada depressing dari Born to Die milik Lana Del Rey sukses memberikan suntikan energi tersendiri di setiap sekuen dramatisnya, membuatnya seperti kompilasi video klip musik panjang yang emosional.'),
(199, 'Moneyball', 'POSITIF', 'DATA LATIH', 'Sudah lama tidak melihat film tentang baseball yang bagus, dan Moneyball menjawab kekosongan itu dengan menghadirkan sebuah biopik hebat dengan perpaduan naskah adaptasi cerdas dari kisah nyata penuh inspirasi tentang manusia-manusia yang ingin keluar dari pakem konvensional dan mengubah cara pandang terhadap baseball itu sendiri dengan cara-cara mereka yang tidak biasa.'),
(200, 'Moon', 'POSITIF', 'DATA LATIH', 'Wow! Mungkin itulah ekspresi saya setelah menonton film ini, sebuah ekspresi yang mungkin hanya terjadi jika melihat atau mengalami sesuatu yang memesona atau sesuatu yang di luar dugaan kita. Yup ekspresi itulah yang dirasakan saya setelah menonton Moon, sebuah thriller fiksi ilmiah yang disutradarai oleh Duncan Jones ini tampil di atas ekspektasi. Berbeda dengan kebanyakan film fiksi ilmiah lainnya, Moon tidak bergantung pada kehadiran alien misterius, pesawat-pesawat luar angkasa yang dilengkapi dengan senjata canggih atau pertempuran-pertempuran kolosal, namun Moon menawarkan sesuatu yang lebih mendasar yang merupakan inti dari semua film yaitu ceritanya yang kuat.'),
(201, 'Morning Glory', 'POSITIF', 'DATA LATIH', 'Jadi ingin mencari tontonan drama komedi ringan namun tetap memiliki cerita berbobot dan masih menghibur? Morning Glory bisa jadi pilihan tepat untuk mengisi waktu santai anda. Tidak hanya mampu memberikan sajian yang enjoyable, di sisi lain Morning Glory juga memberikan anda sedikit pengetahuan tentang bagaimana suka duka di balik layar sebuah acara televisi.'),
(202, 'Mother and Child', 'POSITIF', 'DATA LATIH', 'Mother and Child mungkin bukanlah sebuah drama yang dengan mudah dinikmati begitu saja oleh semua orang, namun jelas juga bukan sebuah drama rumit yang sulit untuk dicerna. Yang dibutuhkan hanya kesabaran dan bagaimana kemampuan kita untuk dapat merasakan kisah yang disajikan dan kedalaman setiap karakter-karakternya, dan niscaya seperti saya, anda akan dapat juga merasakan bagaimana hebatnya film ini memengaruhi emosi para penontonnya dengan cara yang cerdas.'),
(203, 'Mother''s Day', 'POSITIF', 'DATA LATIH', 'Mother’s Day bisa jadi salah satu contoh langka di mana versi daur ulang bisa tampil lebih bagus dari versi orisinalnya. Tidak hanya sukses membuat penontonnya menahan napas dengan momen-momen penuh darah, kesadisan dan ketegangan semata, namun di sisi lain Bousman juga memberikan perhatian lebih dalam usahanya menghidupkan karakter-karakternya plus dalam mengkonversi naskah ceritanya.'),
(204, 'Mud', 'POSITIF', 'DATA LATIH', 'Ya, Mud memesona, tidak hanya narasi sederhana dan elemen menarik coming of age dari sudut pandang remaja 14 tahun namun secara visual ia juga memikat dengan gambar-gambar cantiknya di bawah arahan sinematografer langganan Nichols, Adam Stone dan juga akting menawan dari Matthew McConaughey dan aktor kecilnya.'),
(205, 'Mulholland Dr.', 'POSITIF', 'DATA LATIH', 'Mulholland Drive sendiri digadang-gadang sebagai salah satu film terbaik dari seorang David Lynch karena bukan hanya memiliki plot dengan tingkat kerumitan luar biasa membingungkan dan didukung dengan teknis sinematik tingkat tinggi namun juga ‘memaksa’ penontonnya untuk memasang mata dan telinga baik-baik, bahkan dari awal film karena banyak sekali ‘potongan-potongan’ petunjuk simbolik yang sudah disebar sutradara Amerika berusia 66 tahun ini dalam setiap adegan-adegannya. Untuk ukuran sebuah film indie, Mulholland Drive mampu memberikan impact luar biasa kepada para penontonnya.'),
(206, 'Mutants', 'POSITIF', 'DATA LATIH', 'Meski secara keseluruhan jalinan kisahnya mudah ditebak, namun tetap saja film berdurasi 95 menit ini tetap menarik untuk dinikmati hingga akhir karena selain mencoba mengangkat tema yang sedikit berbeda, pengembangan karakternya juga menjadi perhatian lain yang membuat film ini menjadi lebih hidup. Helene de Fougerolles sudah melakukan tugasnya dengan baik menjadi karakter Sonia, seorang petugas medis yang harus terjebak dalam situasi dilematis. Menariknya lagi karakter Sonia mampu berkembang dinamis sepanjang film. Chemistry yang dibangun dengan kekasihnya Marco mampu membuat film yang seharusnya ‘keras’ dan sadis ini menjadi sedikit lebih lembut dan melankolis.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(207, 'My Girl', 'POSITIF', 'DATA LATIH', 'Racikan pas antara romansa puppy love yang manis, persahabatan dan pendewasaan berpadu padan dengan komedi ringan dan penyajian yang renyah menjadi alasan-alasan kenapa My Girl susah untuk tidak disukai oleh penontonnya, bukan hanya buat audiens cilik namun para penonton dewasa pun akan merasakan efek nostalgia personal terutama jika memiliki pengalaman yang sama. Dan saya belum menyebut bagaimana performa para pemain ciliknya yang tampil sama asyiknya dengan presentasinya.'),
(208, 'My Mom', 'POSITIF', 'DATA LATIH', 'Tentu saja sesuai judulnya, karakter ibu yang dibawakan dengan luar biasa oleh artis senior Kim Hae Sook begitu mendominasi di sepanjang film, nyaris tanpa cela, bahkan ia sanggup  menenggelamkan karakter lain termasuk karakter Ji Suk sendiri yang seharusnya bisa berdiri sama tinggi.\r\n'),
(209, 'My Neighbor Totoro', 'POSITIF', 'DATA LATIH', 'Sama seperti kebanyakan karya-karya Miyazaki lainnya, Dunia Tonari no Totoro pun digarap dengan penuh warna dengan animasi indah khas Mizayaki yang lengkap dengan elemen-elemen fantasi dan magical, namun untuk Tonari no Totoro sutradara ini membuat cerita ringan dan lebih bersahabat dibanding dengan karya lainnya.'),
(210, 'Neighbors', 'POSITIF', 'DATA LATIH', 'Pastinya kita masih akan melihat guyonan-guyonan kurang ajar yang keluar dari mulut kotor penuh improvisasi Rogen tanpa henti, sementara Byrne yang manis seperti menjadi satu-satunya cast perempuan yang berarti bisa dibilang sanggup menandingi pesona kotor dari duet Rogen dan Efron yang berjibaku. Kehebohan dan kegilaan yang ditampilkan memang luar biasa, Stoller yang sudah makan asam garam di genre ini jelas tahu bagaimana menghadirkan setiap momen dengan sangat menghibur.'),
(211, 'Never Let Me Go', 'POSITIF', 'DATA LATIH', 'Melalui Never Let Me Go, baik Mark Romanek maupun Alex Garland bisa dibilang sukses menyampaikan pesan-pesan yang hendak disampaikan oleh Ishiguro dalam novelnya. Pesan tentang cinta, kematian, kepasrahan dan bagaimana manusia menghargai hidup yang sudah Tuhan karuniakan kepada mereka tersaji dalam balutan drama romantis indah nan suram ini.'),
(212, 'Nightcrawler', 'POSITIF', 'DATA LATIH', 'Satu lagi aspek menarik di Nightcrawler selain naskahnya yang pintar, pesan sosialnya yang menusuk dan teknisnya yang apik adalah bagaimana Gilroy sukses memaksimalkan pesona Gylenhaal yang bermain gemilang dan total, bahkan ia sampai harus menggerus berat badannya sebanyak 15 kilogram, menjadikan Lou Bloom sebagai tokoh anti hero baru tanpa cerita latar belakang. Ia adalah sosok  gila dan lihai memanipulasi.'),
(213, 'Nobody Knows', 'POSITIF', 'DATA LATIH', 'Selain karena sentuhan dingin Koreeda yang mampu membuat film ini menjadi lebih hidup, penampilan para aktor dan aktris ciliknya pun tak kalah hebatnya membangun emosi dan jiwa film ini, khususnya penampilan hebat Yuya Yagira yang berperan sebagai Akira. Hampir seluruh adegan dipastikan melibatkan aktor muda yang berhasil mendapatkan penghargaan sebagai aktor terbaik dan juga termuda sepanjang sejarah dalam ajang Festival Film Cannes 2004. Hirokazu Koreeda sukses menghadirkan sebuah heartbreaking drama dalam Nobody Knows.'),
(214, 'Non Stop', 'POSITIF', 'DATA LATIH', 'Membuat sebuah sajian dengan latar sesempit seperti di dalam pesawat memang menjadi tantangan tersendiri, beruntung Non Stop punya Collet Serra yang piawai mengolah jalan ceritanya, menggerakkan kameranya dengan dinamis untuk menciptakan adegan demi adegan yang jauh dari monoton meskipun parade aksinya baru datang menjelang akhir.'),
(215, 'Not One Less', 'POSITIF', 'DATA LATIH', 'Sebuah kisah sederhana tentang perjuangan seorang guru muda yang berusaha sekuat tenaga untuk mencari muridnya ini ternyata mampu disampaikan dengan sangat menarik oleh Yimou, terlebih lagi ia mengemasnya dengan pendekatan bergaya neorealist seperti yang sering digunakan sutradara Iran, Abbas Kiarostami, sehingga apa yang tersaji dalam film pemenang penghargaan Golden Lion pada Venice Film Festival 1999 tampak begitu natural dan apa adanya.'),
(216, 'Now You See Me', 'POSITIF', 'DATA LATIH', 'Now You See Me memang keren dan sanggup membuatmu duduk betah selama 115 menit melahap setiap kejutan di dalamnya, tetapi selalu ada sisi lain dalam sebuah cerita. Narasinya yang dipenuhi jebakan dan pengalih perhatian mungkin terlihat cerdas di kulit luarnya, namun di saat bersamaan jika menilik lebih dalam ia terkesan terlalu sempurna dan kurang manusiawi, apalagi jika kamu mau membandingkannya dengan The Prestige milik Nolan yang mampu digarap dengan solid.'),
(217, 'Oblivion', 'POSITIF', 'DATA LATIH', 'Mungkin bukan fiksi ilmiah paling orisinal yang pernah kamu tonton dengan segala ‘pinjaman’ ide sana-sini, tetapi meskipun basi,  premis tentang kehancuran bumi dan invasi alien plus pesona Tom Cruise yang masih bertaji itu sudah lebih dari cukup untuk menjadi sebuah kombinasi yang susah untuk ditolak, terlebih sutradaranya, Joseph Kosinski tahu benar bagaimana menghadirkannya dengan balutan teknis yang baik.'),
(218, 'Ode to My Father', 'POSITIF', 'DATA LATIH', 'Narasi Ode to My Father menjadi personal dan emosional, khususnya buat para penonton tua Korea, bukan hanya karena ia banyak menghadirkan petuah-petuah lawas tentang bagaimana pentingnya sosok ayah dalam keluarga, namun dalam perjalanannya yang disajikan secara kronologis, Yoon Je Kyoon juga mencoba mengeksploitasi sebuah momen reuni super emosional yang susah untuk dihindari di ujung ceritanya'),
(219, 'Oldboy', 'POSITIF', 'DATA LATIH', 'Park Chan Wook sukses menjadikan Oldboy sebagai salah satu film balas dendam terbaik sepanjang masa, dan Oldboy mempunyai shocking ending yang tidak bisa kita lupakan, terlalu sakit untuk diingat, terlalu gila untuk dibayangkan, memuakkan penontonnya. Buat saya film ini begitu powerful, mengaduk-aduk emosi kita ke level ekstrem.'),
(220, 'Once', 'POSITIF', 'DATA LATIH', 'Dengan biaya dan waktu  produksi terbatas namun dikerjakan dengan sepenuh hati, Once dibawah komando John Carney mampu tampil memesona dan emosional sebagai sebuah drama romantis dengan kekuatannya yang terletak pada pemilihan musik yang bagus, cerita yang sederhana dan chemistry kuat Glen Hansard dan Marketa Irglova. Sungguh pengalaman menonton sebuah romansa yang menyegarkan dengan segala lagu-lagunya yang keren, karakter yang kuat dan ending yang bagus.'),
(221, 'Zootopia', 'POSITIF', 'DATA LATIH', 'Zootopia punya semua elemen untuk membuatnya menjadi paket animasi keluarga ala Walt Disney Animation Studios yang menghibur, dari kualitas animasi penuh warna dan detail, cerita from hero to zero ringan penuh inspirasi  sampai ratusan karakter hewan yang unyu bin imut macam si kelinci Judy Hopps yang disuarakan sempurna oleh aktris Ginnifer Goodwin sampai Mr. Big si tikus Antartika bos Tundratown.'),
(222, 'Zodiac', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah thriller misteri kriminal berkualitas, David Fincher bersama Zodiac miliknya sudah memiliki segalanya. Naskah yang kuat dan cerdas, suguhan teknis yang mumpuni dan dukungan akting prima dari para pemainnya menjadikan Zodiac salah satu yang terbaik di genrenya, tidak peduli minus momen-momen aksi atau pun panjangnya durasi karena saya sangat menikmati setiap menitnya.'),
(223, 'Zero Dark Thirty', 'POSITIF', 'DATA LATIH', 'Zero Dark Thirty seperti versi layar lebar dari serial Homeland dengan kualitas naskah dan teknis penyajian yang jauh lebih solid, menantang dan realistis, bahkan ia juga punya Claire Danes sendiri dalam sosok Jessica Chastain yang tampil fantastis.'),
(224, 'Yours Truly', 'POSITIF', 'DATA LATIH', 'Jarang-jarang bisa melihat thriller buatan lokal dengan kualitas sebaik ini, baik naskah maupun teknis penggarapannya, apalagi mengingat keduanya tidak perlu terlalu banyak menyuguhkan adegan berdarah apalagi penampakan para dedemit untuk dapat membuat anda duduk terpaku selama 16 menit.'),
(225, 'Young Adult', 'POSITIF', 'DATA LATIH', 'Seperti kebanyakan film Jason Reitman yang banyak dihiasi dengan karakter-karakter kompleks, Young Adult juga punya semua hal itu sebagai sebuah ‘anti romcom’ dengan segala candaan gelap ala Diablo Cody yang tidak hanya sukses meninggalkan tawa namun juga kegetiran menusuk buat penontonnya yang diwakili melalui karakter Mavis Gary yang sukses dimainkan dengan sangat apik oleh Charlize Theron.'),
(226, 'Yasmine', 'POSITIF', 'DATA LATIH', 'Yasmine adalah pencapaian luar biasa. Kombinasi apik antara cerita keluarga sederhana yang berisi persahabatan, relasi ayah anak, pencarian jati diri, olah raga, rivalitas dan sedikit romansa serta komedi ringan bersama dukungan akting kuat dari pendatang baru Liyana Yus yang energik dan lovable. Di visualnya ada gambar-gambar cantik nan hangat dari bumi Brunei yang ditangkap kamera James Teh termasuk adegan pertarungan seru.'),
(227, 'X-Men: First Class', 'POSITIF', 'DATA LATIH', 'Ini adalah sebuah sebuah reboot hebat, sebuah prekuel luar biasa, sebuah suguhan summer movie ‘first class’ dengan segala kemeriahan spesial efeknya, komposisi cast apik dan yang paling penting X-Men: First Class sudah siap memulai saga X-men yang baru.'),
(228, 'Wish. Hope', 'POSITIF', 'DATA LATIH', 'Bagian terbaik dari film yang meraih penghargaan film terbaik di ajang Oscar Korea, Blue Dragon Film Awards ke 34 selain premisnya yang provokatif tentu saja adalah penampilan dari para pemainnya. Ada aktor veteran Sol Kyung Gu yang kembali bermain apik sebagai ayah So Won.'),
(229, 'Wild Tales', 'POSITIF', 'DATA LATIH', 'Semua tidak lepas dari kepiawaian Damian Szifron meramu narasinya dengan cerdas dan efektif memberi efek emosional tersendiri. Meskipun memiliki asas dan benang merah yang sama, namun setiap segmen mampu berdiri sendiri dengan ciri khas masing-masing, dengan kekuatan dan pesona masing-masing.'),
(230, 'Whiplash', 'POSITIF', 'DATA LATIH', 'Whiplash itu rumit, energik dan meledak-ledak dalam prosesnya namun tidak sampai menjadi terlalu liar ketika Damien Chazelle memfokuskan musikalitasnya pada jazz yang penuh sinergi, kendali dan perhitungan. Ya, pada akhirnya Whiplash menjadi tontonan sederhana namun padat berisi ketika narasi simpelnya berhasil dikembangkan Chazelle sampai ke titik didih tertinggi yang mampu menyerang sisi psikologismu.'),
(231, 'Whip It', 'POSITIF', 'DATA LATIH', 'Drew Barrymore bisa bernapas lega karena debutnya sebagai seorang sutradara ternyata bisa dibilang cukup berhasil, setidaknya ia sukses menyampaikan pesan pada filmnya secara efektif dengan menghadirkan sebuah cerita ringan dengan balutan komedi yang segar dan juga pesan-pesan moral yang disampaikan dengan baik.'),
(232, 'When Marnie Was There', 'POSITIF', 'DATA LATIH', 'Meski kental dengan nuansa suram dan mencekam di beberapa adegannya, susah untuk memberi label ‘horor’ kepada When Marnie Was There. Ya, ada nuansa kelam, duka dan kesepian dalam balutan surreal terpancar dari setiap pertemuan Anna dan Marnie, namun juga ada kelembutan di balik tragedi dan konfliknya yang berujung pada sebuah ending pahit manis menggetarkan.'),
(233, 'What We Do in the Shadows', 'POSITIF', 'DATA LATIH', 'Semua berhasil dirangkum dengan keriangan ala komedi hitam Selandia Baru yang kocak dengan sedikit bumbu gore berdarah-darah yang seperti ingin menegaskan bahwa ini masih berada di jalur horor meski diselimuti elemen komedi yang lebih tebal.'),
(234, 'Wer', 'POSITIF', 'DATA LATIH', 'Dengan kualitas narasi dan teori-teori ilmiah yang tidak terlalu kuat tidak butuh lama buat penontonnya untuk mencapai sebuah kesimpulan tentang apa yang sebenarnya terjadi. Tetapi bukan berarti itu mengurangi pesonanya. Wer tetap adalah tontonan horor yang seru dan mendebarkan. Di separuh durasinya, Bell menginjeksinya dengan aksi cepat dan brutal, melibatkan pembantaian besar-besaran yang menghancurkan sekelompok anggota SWAT bersama dukungan spesial efek garapan Robert Hall dari Almost Human yang meyakinkan.'),
(235, 'Warrior', 'POSITIF', 'DATA LATIH', 'Warrior dengan segala pertarungannya yang keras, brutal dan kejam, sekejam tatapan Tom Hardy di sini ia tetap adalah sebuah drama olahraga keluarga yang ‘lembut’ dan emosional. Gavin O’Connor bisa dibilang sudah berhasil mengerjakan pekerjaannya dengan sangat baik. Salah satu yang terbaik tahun ini.'),
(236, 'Warm Bodies', 'POSITIF', 'DATA LATIH', 'Ini adalah tontonan yang menyegarkan sekaligus menyenangkan, saya menikmati 97 menit pengalaman menonton kisah zombie yang konyol. Mungkin sedikit terasa dipaksakan di beberapa bagian, namun secara keseluruhan Jonathan Levine sudah melakukan tugasnya dengan baik dalam rangka menghadirkan sebuah versi lain dari romansa populer Romeo & Juliet dalam latar paska kiamat yang kotor.'),
(237, 'War Photographer', 'POSITIF', 'DATA LATIH', 'Sebuah foto memiliki sejuta makna. Melalui War Photographer Christian Frei sukses menghadirkan sebuah pengalaman luar biasa menonton dokumenter. Sebuah dokumenter kuat di mana segala permasalahan tentang kemanusiaan, perang, sosial dan politik mampu terlihat berbeda melalui mata seorang fotografer hebat bernama James Nachtwey.'),
(238, 'Wadjda', 'POSITIF', 'DATA LATIH', 'Tentu saja akan sangat aneh jika mengharapkan Wadjda akan menghadirkan sebuah perubahan besar pada perangai karakter-karakternya di akhir film, apalagi sampai membuat revolusi di negaranya, tetapi itu bagus dan membuatnya menjadi tontonan yang tidak mengada-ada. Tetapi seperti yang terjadi pada dirinya, jika Tuhan mengizinkan, selalu ada sedikit harapan akan sebuah kehidupan yang lebih baik di sana.'),
(239, 'Violet & Daisy', 'POSITIF', 'DATA LATIH', 'Fletcher menyajikannya dengan gaya komikal modern dengan sedikit sentuhan surreal, membagi-bagi satu jam setengah durasinya dalam 10 chapter pendek yang terus berlanjut dengan banyak kejutan-kejutan kecil. Di satu sisi, ini adalah sajian komedi hitam brutal yang menjadikan setiap momen pembunuhan brutalnya dengan cara yang santai, di satu sisi ini juga sebuah coming of age menarik yang menampilkan transformasi kedua karakternya dengan sebuah proses dinamis tanpa harus terkesan terburu-buru.'),
(240, 'Vertigo', 'POSITIF', 'DATA LATIH', 'Secara keseluruhan hampir di semua segi Vertigo tampil sangat solid. Hitchcock tidak hanya mampu membuat sebuah kisah misteri yang mengusik rasa penasaran namun juga dengan pintar menempatkan penontonnya berada dalam posisi sama tidak tahunya dengan karakter Scottie, hingga nanti di pertengahan film Hitchcock memberikan sebuah jawaban mengejutkan yang akan ‘menampar’ telak penontonnya. Naskah hebat tampaknya masih belum cukup jika tidak didukung dengan teknis penggarapan yang hebat pula.'),
(241, 'V for Vendetta', 'POSITIF', 'DATA LATIH', 'Sebagai sebuah film, efek dahsyat memanjakan mata mungkin tidak sebanyak trilogi The Matrix, namun tetap saja kemunculan adegan-adegan aksi pemacu adrenalin tersebut muncul di saat yang tepat dan tidak terlalu berlebihan sehingga membuat segalanya menjadi terasa pas. Dan akhir kisah perjuangan kebebasan ini berhasil ditutup oleh sebuah adegan dahsyat yang menyisakan pesan moral bagi penontonnya.'),
(242, 'Upstream Color', 'POSITIF', 'DATA LATIH', 'Dua film, dua ide besar yang terbungkus dalam semangat fiksi ilmiah yang kental, tidak pernah mudah menghadirkan konsep-konsep brilian seperti yang sudah dilakukan Shane Carruth, apalagi hampir semuanya ia lakukan sendiri. Upstream Color adalah contoh sebuah fiksi ilmiah kecil yang mampu berbicara besar, sebesar tema tentang kehidupan, cinta dan takdir yang ditawarkannya plus mengundang perdebatan asyik setelah menontonnya. Semuanya ini sukses dihadirkan dalam semangat indie ala Carruth yang memesona, subtle dan juga emosional.'),
(243, 'Unstoppable', 'POSITIF', 'DATA LATIH', 'Unstoppable adalah tontonan hiburan yang pas bagi anda para adrenalin junkie yang mendambakan ketegangan tanpa henti ala Tony Scott. Ya, cerita memang klise namun siapa lagi yang peduli soal cerita di saat momen-momen breathtaking super cepat tersebut tanpa sadar telah merasuki dan membuat napas anda tertahan cukup lama.'),
(244, 'Unknown', 'POSITIF', 'DATA LATIH', 'Porsi pas antara sisi misteri yang menarik, aksi seru nan menegangkan dan guyuran twist menarik membuat Unknown sudah lebih dari cukup untuk  menjadi sebuah suguhan thriller aksi yang layak tonton. Terlebih lagi ada sosok Liam Neeson di dalamnya yang belakangan mulai menunjukkan tajinya sebagai aktor laga baru nan menjanjikan.'),
(245, 'United', 'POSITIF', 'DATA LATIH', 'Tentu saja United menjadi personal buat para penggemarnya seperti yang sudah saya tulis di atas, karena ia mampu menginspirasi serta mengajak penontonnya untuk melihat bagaimana salah satu tim sepak bola paling hebat di jagat raya ini bangkit dari keterpurukan menjadi seperti yang kita lihat saat ini.'),
(246, 'Under the Shadow', 'POSITIF', 'DATA LATIH', 'Untuk ukuran sebuah horor domestik tentang arwah yang mengganggu, Under The Shadow punya caranya sendiri untuk menakut-nakuti penontonnya. Penampakan dan kejutan datang tak terduga dalam presisi yang tepat tanpa harus diekspos secara berlebihan, kadar seramnya juga dibangun oleh atmosfer tak nyaman yang dibarengi dengan kemampuan pemainnya yang memesona, hasilnya Under The Shadow menakutkan dengan caranya sendiri yang terbilang efektif dan pintar.'),
(247, 'Tyrannosaur', 'POSITIF', 'DATA LATIH', 'Studi karakter menjadi kunci utama bagaimana Tyrannosaur mampu tampil menggigit. Peter Mullan seperti biasa, aktor veteran ini memang piawai membawakan karakter pria keras bermasalah. Karakter Joseph itu menarik dan kompleks, bak bensin oktan tinggi yang mudah terbakar ketika ada sedikit percikan api saja yang menyentuhnya.'),
(248, 'Two Days, One Night', 'POSITIF', 'DATA LATIH', 'Jika premis tentang pilihan moral saja belum cukup, maka Dardenne membuatnya menjadi lebih pelik lagi ketika penontonnya juga dihadapkan pada  tokoh Sarah yang dimainkan cemerlang oleh Cotillard. Tidak peduli seberapa seringnya Sarah mengatakan ia dapat mengerti setiap penolakan, toh, kita langsung dapat melihat raut kekecewaan dari wajah meyakinkan Cotillard yang setia ditangkap melalui pergerakan kamera genggam sederhana, bersama take-take panjang khas Dardenne .'),
(249, 'Tucker & Dale vs Evil', 'POSITIF', 'DATA LATIH', 'Jujur saja saya termasuk penonton yang paling sulit untuk dibuat tertawa, dan Tucker & Dale vs Evil menjadi salah satu film langka nan unik yang berhasil membuat saya terpingkal-pingkal. Melihat bagaimana kelucuan demi kelucuan, kejutan demi kejutan mampu berjalan beriringan sempurna dengan elemen slasher adalah sebuah daya tarik terbesar dari film milik Eli Crai. Jarang-jarang ada horor komedi yang mampu tampil sesolid ini, apalagi mengingat film ini digarap dengan biaya murah dan sangat sederhana.'),
(250, 'Triangle', 'POSITIF', 'DATA LATIH', 'Triangle bisa dibilang adalah salah satu British horror film terbaik yang pernah dibuat oleh negara ratu Elizabeth itu. Film garapan Christopher Smith menawarkan sebuah pengalaman berbeda dari kebanyakan film sejenis dengan konsep cerita orisinal yang menggabungkan elemen thriller dan horror supernatural dengan balutan plot twist super rumit yang memaksa penontonnya untuk berkonsentrasi dan berpikir ekstra keras untuk dapat merangkai puzzle misteri yang ingin disampaikan film ini.'),
(251, 'Trance', 'POSITIF', 'DATA LATIH', 'Setelah 10 menit pembukaan yang sama memesonanya dengan penampilan James McAvoy, Trance terjerumus menjadi thriller rumit dan dalam. Ketiga karakter utamanya punya porsi yang seimbang, meskipun pada akhirnya Dawson yang menjadi jantung bagi narasinya yang kompleks. Tetapi yang terpenting dari semua kesenangan itu adalah Boyle tidak pernah kehilangan pesonanya dalam membungkus narasinya bersama ciri khasnya yang energik dan berkilau plus hantaman musik keren.'),
(252, 'Tjoet Nja'' Dien', 'POSITIF', 'DATA LATIH', 'Mungkin ini adalah biopik terbaik yang pernah dibuat oleh perfilman Indonesia, sebuah kisah sejarah tentang kepahlawanan penuh inspirasi dari seorang Cut Nyak Dien dalam usahanya merebut setiap jengkal tanah Rencong dari cengkeraman penjajah yang diisi dengan semangat patriotisme tinggi dan digarap dengan sangat serius bersama balutan teknis penyutradaraan luar biasa Eros Djarot plus dukungan para pemainnya yang hampir semuanya tampil solid, khususnya untuk penampilan cemerlang seorang Christine Hakim.'),
(253, 'This is the End', 'POSITIF', 'DATA LATIH', 'Humor-humornya mungkin tidak sampai terlalu lucu, tetapi bagaimana Rogen dan Goldberg menyajikannya dengan santai tanpa terlihat terlalu memaksakan diri itu yang membuat This is The End menjadi tontonan menyenangkan dan saya masih belum menyebut klimaksnya yang melibatkan iblis raksasa, pertobatan, surga dan Everybody (Backstreet’s Back), ya, This is the End mungkin menyajikan klimaks paling edan dari film-film komedi yang saya tonton beberapa tahun ini.'),
(254, 'The Yellow Sea', 'POSITIF', 'DATA LATIH', 'Dari segi teknis harus diakui Na Hong Jin sudah belajar banyak bagaimana harusnya mengeksekusi rangkaian adegan aksinya dengan baik, dan bagian itulah yang kemudian menjadikan The Yellow Sea terasa istimewa, apalagi pada akhirnya Na Hong Jin menutup rangkaian kisahnya ini dengan sebuah ending yang ‘sempurna’.'),
(255, 'Orphan', 'POSITIF', 'DATA LATIH', 'Yang membuat Orphan menjadi menarik adalah anak yang diadopsi bukanlah anak sembarangan, misteri tersebut ternyata mampu ditampilkan dengan baik dalam film yang diproduksi oleh Dark Castle Entertainment ini. Sepanjang kurang lebih 2 jam ini kita disuguhkan dengan suasana kelam penuh ketegangan dan rasa penasaran yang membuat para penontonnya setia menikmati adegan demi adegan yang ditampilkan.'),
(256, 'Osama', 'POSITIF', 'DATA LATIH', 'Adegan demi adegan ditampilkan secara real, tanpa adanya track musik film berbahasa Persia ini berjalan sangat alami, bahkan para pemainnya yang seluruhnya merupakan amatiran yang diambil dari jalan-jalan kota Kabul pun bermain sangat meyakinkan. Beberapa adegan simbolis juga tidak lupa disisipkan oleh Barmak sebagai bahan perenungan di akhir film nanti.'),
(257, 'Out of the Furnace', 'POSITIF', 'DATA LATIH', 'Out of Furnace berani mengambil resiko tak populer, sebuah jalan lain yang lebih berliku, lebih lama dan lebih terasa arthouse guna mencapai tujuannya dengan potensi besar menjadi sajian membosankan jika kamu tidak terlalu peduli dengan karakter-karakternya atau teknisnya yang ciamik.'),
(258, 'Pacific Rim', 'POSITIF', 'DATA LATIH', 'Rasanya seperti menjadi anak kecil lagi ketika menonton film ini, apalagi kalau bukan karena adegan-adegan yang membuat saya tepuk tangan di depan TV ketika masih seorang bocah, divisualisasikan dengan begitu realistis dan sangat masterful oleh seorang Guillermo del Toro.'),
(259, 'Pain & Gain', 'POSITIF', 'DATA LATIH', 'Para pemainnya sukses menjalankan peran mereka dengan baik, Whalberg yang  karismatik, Dwayne Johnson dengan peran yang sedikit berbeda plus Anthony Mackie yang asyik menjadi daya tarik utama  Pain & Gain, selain mungkin pesona Bay sendiri.'),
(260, 'Paper Towns', 'POSITIF', 'DATA LATIH', 'Paper Towns adalah drama remaja yang lengkap, ia punya romantika manis yang diwakili dengan perjuangan Q mencari sang pujaan hati yang hilang, sementara sisi misterinya meski tidak sampai terlalu kuat mampu bersatu dengan plot utama dan memberi warna tersendiri buat pergerakan kisahnya.'),
(261, 'Paranormal Activity', 'POSITIF', 'DATA LATIH', 'Paranormal Activity sudah menyajikan semuanya, segala ketakutan, kengerian dan keseraman sebuah horor ‘rumah angker’ dengan style mockumentary yang realistis di sepanjang kurang lebih 1 jam setengah melalui rekaman-rekaman amatiran yang dibuat Micah dan pasangannya Katie dari setiap ruang di rumah mereka yang nyaman. Tidak perlu terlalu berlebihan karena Peli tampaknya tahu benar bahwa sesuatu yang tidak terlihat itu akan lebih menakutkan dan lebih efektif mempermainkan imajinasi liar penontonnya.'),
(262, 'Paul', 'POSITIF', 'DATA LATIH', 'Tidak dapat dimungkiri kolaborasi komedi British Amrik dari ketiganya yang cenderung banyak diisi candaan, hinaan, fiksi ilmiah dan bromance, ditambah dengan dukungan naskah menyenangkan dan teknik penyutradaraan energik dari Greg Mottola sudah menahbiskan Paul sebagai salah satu komedi terbaik tahun ini.'),
(263, 'Pencarian Terakhir', 'POSITIF', 'DATA LATIH', 'Affandi Abdul Rachman bisa dibilang sukses meramu sebuah sajian horor menantang dan menegangkan yang tidak melulu terjebak dalam pengeksploitasian penampakan-penampakan makhluk halus semata untuk membangun atmosfer kengeriannya, namun bagaimana sisi psikologis karakter-karakternya serta dukungan set yang meyakinkan yang bisa dibilang menjadi ‘senjata utama’ film ini meneror rasa takut penontonnya sepanjang 110 menit.'),
(264, 'Perfect Sense', 'POSITIF', 'DATA LATIH', 'Cinta dan kiamat, kombinasi tidak biasa itu rupanya mampu menghadirkan tontonan fiksi ilmiah romance yang menarik. Perfect Sense bekerja dengan baik di sisi apokaliptik, mampu membuat penontonnya turut membayangkan kengerian jika suatu saat sampai benar-benar terjadi di dunia nyata.'),
(265, 'Philomena', 'POSITIF', 'DATA LATIH', 'Philomena adalah sebuah drama padat menggugah tentang pencarian, tidak hanya sekedar menjual narasi pencarian orang hilang dengan segala twist demi twist, namun juga sebuah sub teks tentang pencarian jati diri dari dari dua karakter utamanya, dua manusia berbeda yang dalam perjalanannya saling menguatkan satu sama lain.'),
(266, 'PK', 'POSITIF', 'DATA LATIH', 'PK adalah komedi satir sosial terbaik yang dimiliki Bollywood. PK adalah jenis film yang masih menyuapimu secara penuh dengan dialog-dialog pintar dan adegan konyol yang mengocok perut kamu. Tidak hanya itu, kekuatan film ini ada di tangan karakter utama, Aamir Khan yang kembali menunjukkan performanya dengan baik, mungkin kali ini adalah performa terbaik yang pernah ia tunjukkan. Tidak seemosional 3 Idiots, di beberapa adegan film ini terasa berlebihan, dan masih dibumbui dengan musik dan tarian yang asyik nan mengulur waktu.'),
(267, 'Poetry', 'POSITIF', 'DATA LATIH', 'Naskah yang luar biasa ini memang pantas diganjar penghargaan Cannes. Lee Chang Dong kembali sukses membuktikan bahwa dia adalah seorang pencerita yang luar biasa, sebuah narasi yang digarap dengan natural, indah dan penuh momen-momen ‘membius’ didalamnya, plus kombinasi karakter kuat dan tema sederhana dan juga getir membuat Poetry hadir sebagai salah satu film terbaik tahun ini.'),
(268, 'Porco Rosso', 'POSITIF', 'DATA LATIH', 'Walaupun unsur fantasi dan magic mungkin tidak banyak ditampilkan di sini namun rupanya hal itu tidak mengurangi pesona film ini. Kejeniusan Miyazaki masih mampu menyihir kita dengan kekuatan ceritanya yang memadukan unsur-unsur heroisme, politik, petualangan serta romantisme dengan animasinya yang sangat detail dan penuh warna.'),
(269, 'Prisoners', 'POSITIF', 'DATA LATIH', 'Ini adalah sebuah studi karakter menarik nan kompleks yang berhasil disajikan Villeneuve melalui karakter sang ayah. Sementara karakter Detektif Loki oleh Gyllenhaal dengan reputasinya yang berhasil memecahkan semua kasus yang ditanganinya mendapat beban hebat ketika kasus penculikan ini seperti sulit menemui titik terang. Kedua karakter ini dibawakan dengan fantastis baik Jackman dan Gyllenhaal. Jackman memberikan lagi salah satu performa terbaiknya setelah Les Misarables, emosinya ketika melihat foto-foto pakaian putrinya itu adalah momen terbaiknya.'),
(270, 'Project Almanac', 'POSITIF', 'DATA LATIH', 'Plotnya memang generik, namun semua kesenangan time travel dengan balutan adrenalin muda plus penggunaan spesial efek tak berlebihan berhasil dituangkan dengan baik oleh Israelite. Kita bisa melihat bagaimana suasana cair bersama kekuatan chemistry yang berhasil dibangun dengan serius tapi santai sejak awal film. Project Almanac tidak pernah menjadikan dirinya sebuah film yang rumit, sebaliknya Israelite memberinya sedikit elemen persahabatan dan percintaan yang mampu bersanding manis dengan plot utamanya.'),
(271, 'Rabbit Hole', 'POSITIF', 'DATA LATIH', 'Rabbit Hole adalah sebuah contoh metafora sempurna tentang kepedihan, tentang bagaimana memaafkan masa lalu, tentang bagaimana mencoba membangun kembali puing-puing kehidupan yang berserakan dengan cinta sebagai perekatnya, Ya, semua momen-momen tersebut sukses dirangkai dengan sangat baik dan indah oleh Mitchell, dan semuanya menjadi semakin terasa lebih perfect dengan kehadiran para aktor dan aktrisnya yang bermain luar biasa. Ya, sambutlah Rabbit Hole, salah satu drama terbaik tahun lalu.'),
(272, 'Raging Phoenix', 'POSITIF', 'DATA LATIH', 'Thailand rupanya tidak hanya jago menakut-nakuti penontonnya dengan sajian horor mereka yang berkualitas, namun juga berhasil memukau dengan aksi-aksi bela diri luar biasa dalam film-film laga mereka, seperti Ong Bak dan Chocolate. Jadi bagi para fans martial arts film, Raging Phoenix layak untuk dijadikan pilihan.'),
(273, 'Ran', 'POSITIF', 'DATA LATIH', 'Digarap dengan teknik yang nyaris sempurna, baik dari teknik visual sinematografinya yang indah sekaligus suram dan pengembangan karakternya yang luar biasa membuat kita terbius menyaksikan adegan demi adegan yang ditampilkan hingga nantinya mencapai klimaksnya yang tragis.'),
(274, 'Rango', 'POSITIF', 'DATA LATIH', 'Di bawah arahan Gore Verbinski, Rango rupanya sudah melakukan semua yang dapat dilakukan oleh sebuah animasi berkualitas. Ia jelas menghibur, cerdas dalam bertutur dan berkelakar dengan cara yang tidak biasa tanpa melupakan kandungan moralnya. Setiap momen petualangan disajikan dengan apik dan seru.'),
(275, 'Red', 'POSITIF', 'DATA LATIH', 'Kudos pantas diberikan kepada para pemainnya yang bermain apik serta dapat memanaskan suasana, sekaligus juga membuktikan jangan meremehkan para orang tua, apalagi jika mereka tergabung dalam Red, karena meskipun wajah mereka sudah penuh dengan keriput, rambut sudah mulai botak atau memutih namun bukan berarti mereka tidak berbahaya.'),
(276, 'Rigor Mortis', 'POSITIF', 'DATA LATIH', 'Saya menikmati setiap menit Rigor Mortis. Ya, ini masih menjadi sajian horor menyenangkan, masih menawarkan sebuah nostalgia dari genre yang sudah lama terlelap, masih ada aroma eerie yang terpancar dari setiap sudut dan ruangan bangunan apartemen kumuh nan gelap yang menjadi latarnya.'),
(277, 'Rise of the Planet of the Apes', 'POSITIF', 'DATA LATIH', 'Rise of the Planet of the Apes kembali meneruskan tradisi hebat sebuah reboot. Di awal tahun siapa yang pernah menyangka bahwa ia mampu menjadi sebuah tontonan fiksi ilmiah seluar biasa ini. Penyutradaraan apik tanpa pernah menjadi terlalu berlebihan dan terlalu bertele-tele, naskah yang solid dan tepat sasaran serta performa hebat dari Andy Serkis dalam balutan Simpanse CGI juga tanpa melupakan elemen-elemen pendahulunya.'),
(278, 'Robot & Frank', 'POSITIF', 'DATA LATIH', 'Ini tidak hanya menjadi sebuah film tentang relasi antara manusia dan teknologi bernama “robot”, Robot & Frank jauh lebih dalam dan lebih manusiawi dari itu ketika ia mampu menghadirkan sebuah buddy movie unik dengan chemistry kuat tanpa harus menjadi terlalu melodramatis dan konyol. Ya, mungkin naskahnya tidak terlampau solid, mungkin juga terlalu berfokus pada diri Frank, namun tetap saja kehadiran sosok robotnya menjadi bagian tidak terpisahkan dari perjalanan hangat seorang manusia di usia tuanya yang sendiri dan kesepian, plus sebuah twist manis di penghujung ceritanya menjadikan segalanya begitu manis sekaligus menyentuh.'),
(279, 'Roman Holiday', 'POSITIF', 'DATA LATIH', 'Hepburn tampil begitu cantik dan memesona di semua scene, sukses membius saya atau mungkin juga para juri-juri Oscar pada saat itu dengan aura magisnya sebagai putri bangsawan yang anggun dan penuh keceriaan, sampai-sampai piala emas untuk aktris terbaik pun jatuh ke tangannya.\r\nYup, Roman Holiday adalah salah satu contoh bagaimana romcom yang bagus itu dibuat.'),
(280, 'Room', 'POSITIF', 'DATA LATIH', 'Sutradara Lenny Abrahamson bisa dibilang cukup piawai mengolah panggung rapatnya dengan maksimal, menghadirkan sebuah kelembutan dan kepolosan dari balik temanya yang keras nan suram. Naskahnya pun terasa begitu kuat karena Emma Donoghue sang empunya novel dilibatkan langsung dalam penulisannya. Selain dukungan narasi yang solid. Abrahamson banyak dibantu dengan penampilan gemilang Brie Larson dan Jacob Tremblay yang harus diakui menjadi alasan kenapa Room bisa bekerja dengan sempurna.'),
(281, 'Rurouni Kenshin', 'POSITIF', 'DATA LATIH', 'Rurouni Kenshin, sebuah adaptasi yang setia yang dibuat dengan dedikasi dan semangat besar untuk menyenangkan hati para fans manga dan anime. Sedikit lemah di naskah dan tipisnya pendalaman beberapa karakter utamanya namun sisanya berhasil ditutupi dengan production value yang mengesankan, baik visual, sinematografi, setting, scoring dan koreografi, dan terutama pada sektor casting yang meyakinkan.'),
(282, 'Rush', 'POSITIF', 'DATA LATIH', 'Rush punya presentasi yang sama baiknya dengan naskahnya. Howard jelas tahu benar bagaimana mendramatisasi sebuah biopik kelas satu bersama  dukungan teknis artistik fantastisnya. Setiap balapan tidak hanya terasa nyata ketika Howard dengan cerdas menggabungkan segala footage-footage asli dan desain produksi dan kostum era ''70, namun ia juga terlihat  cantik dan keren dengan segala efek slow motion dan guyuran hujan yang ditempatkan pada saat yang tepat tanpa harus terkesan berlebihan bersama dukungan sinematografi ciamik dari veteran Anthony Dod Mantle yang berpadu padan dengan scoring epik nan heroik sang master, Hanz Zimmer yang sukses menciptakan aroma magis dunia balap penuh emosi dan adrenalin yang tidak ada duanya.'),
(283, 'Safe Haven', 'POSITIF', 'DATA LATIH', 'Yap, seperti yang saya katakan di atas tadi, Safe Haven itu benar-benar romansa tipikal Nicholas Sparks yang cheesy dan mellow lengkap dengan visual indah dan scoring lembut. Semuanya sudah pernah kita lihat sebelumnya, jadi tidak ada yang benar-benar baru di sini kecuali wajah cantik penyanyi country dan jebolan Dancing with the Stars, Julianne Hough yang dipasangkan dengan Josh Duhamel plus sedikit elemen crime thriller bersama chemistry yang cukup bagus.'),
(284, 'Sang Penari', 'POSITIF', 'DATA LATIH', 'Sang Penari itu adalah film Indonesia yang ‘sangat Indonesia’. Sudah lama rasanya tidak ada film dengan berlatar sejarah dan budaya yang digarap sebaik dan seserius ini. Sang Penari jelas punya segalanya untuk menjadikan dirinya sebagai film terbaik yang dimiliki Indonesia tahun ini, atau tidak berlebihan jika saya menyebutnya sebagai salah satu yang terbaik sepanjang masa.'),
(285, 'Scenic Route', 'POSITIF', 'DATA LATIH', 'Momen bertahan hidupnya mungkin tidak sampai terlalu dalam, tetapi kombinasi persahabatan dan survival itu adalah sesuatu yang unik dan berhasil melebur dengan cukup baik bersama narasi kuat garapan Kyle Kille, elemen psikologis, kekuatan akting terbaik dari Duhamel dan chemistry solid bersama Fogler.'),
(286, 'Secretariat', 'POSITIF', 'DATA LATIH', 'Tetap saja bagi saya Secretariat mampu memberikan sebuah hiburan menyenangkan, sebuah feel good dan heartwarming drama yang layak untuk disaksikan bersama keluarga tercinta.'),
(287, 'Senna', 'POSITIF', 'DATA LATIH', 'Saya menyukai bagaimana sutradara asal Inggris keturunan India ini merangkum semua kekagumannya kepada sosok Senna. Bagaimana ia dan rekan penulis naskahnya, Manish Pandey mampu membuat sebuah dokumenter tampil layaknya sebuah drama biopik olahraga dengan segala unsur dramatis dan momen-momen emosionalnya.'),
(288, 'Senyap', 'POSITIF', 'DATA LATIH', '‘Senyap’ bukan dokumenter biasa, ia adalah puisi dan teror yang menusuk hati kita sebagai penonton. Sebuah pengingat dan usaha keras bahwa kita harus berhenti, mengakui kehidupan yang telah dihancurkan, dan memaksa diri untuk mendengarkan kesenyapan yang menyusulnya. Adi yang selayaknya sebagai tukang kacamata keliling ini membantu kita melihat lebih jelas dalam kesenyapan, membantu mengobati sebuah miopia masal yang sedang kita alami di sekeliling kita, Sedangkan Joshua adalah perangkai dan penulis surat kesenyapan ini. Kedua orang ini sudah membuat ‘Senyap’ sebagai film dokumenter paling powerful tahun ini.'),
(289, 'Seven Psycopaths', 'POSITIF', 'DATA LATIH', 'Seperti film McDonanght sebelumnya, Seven Psycopaths itu tetap santai dibalik temanya yang serius, begitu menyenangkan untuk diikuti karena efek sentuhan komedi gelap, kejutan-kejutan luar biasa, dialog-dialog pintar penuh sindiran sana-sini yang kocak dan disesaki oleh karakter-karakter sinting bermulut kotor, namun sekali lagi bintangnya tetap naskah brilian garapan McDonanght yang tersusun rapi lapis demi lapis.'),
(290, 'Sherlock Holmes', 'POSITIF', 'DATA LATIH', 'Semua kisah di atas itu berhasil dipresentasikan dengan baik oleh Ritchie. Aksi- aksi utama yang berlatar di dermaga dan Jembatan London juga digarap dengan spesial efek yang pas dan tidak terlalu berlebihan. Kemampuan Holmes dalam menganalisis sesuatu juga sangat menarik untuk dilihat.'),
(291, 'Shinobi: Heart Under Blade', 'POSITIF', 'DATA LATIH', 'Dan pada akhirnya ketika theme Song ‘Heaven’ yang dikumandangkan oleh suara merdu Ayumi Hamasaki menutup kisah aksi romansa ini, ada sebuah perasaan yang tertinggal dari Shinobi: Heart Under Blade, bukan karena jualan adegan pertarungan aksi yang memang keren namun sebuah rasa kehilangan yang sukses ditularkan Oboro yang cantik nan malang, sebuah kisah cinta tak sampai yang harus diakui sudah meninggalkan kesan cukup dalam di benak saya.'),
(292, 'Shirome', 'POSITIF', 'DATA LATIH', 'Dari luar Shirome memang menawarkan premis menarik, menggabungkan sensasi kengerian sebuah urban legend kuno dan reality show modern yang diperankan oleh bintang pop sesungguhnya, apalagi mengetahui fakta bahwa Koji Shiraishi sama sekali tidak pernah memberitahu keenam gadis itu jika ia sedang membuat sebuah film horor, meninggalkan mereka dalam ketidak tahuan dan dikelilingi aktor-aktor serta spesial efek yang kemudian sukses menipu mereka, hasilnya apa yang akan anda lihat di sepanjang film ini murni reaksi terkejut dan ketakutan sesungguhnya dari para ABG ini.'),
(293, 'Short Term 12', 'POSITIF', 'DATA LATIH', 'Saya suka bagaimana Cretton memperlakukan karakternya, semua terlihat natural, kita bisa merasakan emosinya, merasakan bagaimana kepedihan mereka, terutama dari diri Marcus dan Grace yang dimainkan fantastis. Rasakan atmosfernya, nikmati dialog-dialog cerdasnya yang mengalir begitu bebas bersama balutan gambar-gambar cantik dan dukungan alunan musik latar dan soundtrack yang sama bagusnya.'),
(294, 'Shutter Island', 'POSITIF', 'DATA LATIH', 'Memang Shutter Island bukanlah karya terbaik dari seorang Martin Scorsese, namun setidaknya melalui film ini Scorsese sukses menghadirkan sebuah thriller psikologis mencekam dengan kualitas di atas rata-rata, apalagi ditunjang dengan segi teknis yang sangat baik dan penampilan apik dari aktor-aktor besar yang bermain di dalamnya'),
(295, 'Sicario', 'POSITIF', 'DATA LATIH', 'Jajaran casting bisa jadi salah satu andalan Sicario. Ada nama Emily Blunt didapuk menjadi karakter sentral dan harus diakui aktris Inggris ini kembali bermain baik menjalankan perannya, bukan karena hanya ia adalah satu-satunya perempuan di film yang didominasi oleh testosteron yang tangguh di luar dalam, sesuatu yang jarang kamu dapati di film sejenis, namun juga kompleksitas psikologis dan konsekuensi moral yang kemudian harus dihadapinya.'),
(296, 'Silver Linings Playbook', 'POSITIF', 'DATA LATIH', 'Silver Linings Playbook, sebuah romcom adaptasi pahit manis yang punya banyak kekuatan besar di dalamnya, naskah dan penyutradaraan solid dari David O. Russell, bagaimana piawainya menggabungkan semua tema kegilaan, studi karakter, romansa dan komedinya menjadi sebuah sinergi kuat yang akan ‘menjebakmu’ dalam kurang lebih dua jam durasinya bersama penampilan para pemainnya yang ciamik.'),
(297, 'Snowden', 'POSITIF', 'DATA LATIH', 'Saya suka bagaimana Stone tahu benar mengeksplorasi sisi personal nan kompleks Edward yang didukung pula oleh performa solid dari Joseph Gordon Levitt. Kita tahu kapasitas Levitt, bagaimana akhir-akhir ini ia pintar memilih peran untuk menguji sampai di mana batas kemampuannya, bagaimana ia bertransformasi dari karakter fun ke karakter lebih serius, dan harus diakui Levitt memang memesona di setiap filmnya, terakhir ia juga bermain sangat bagus sebagai Philippe Petit dalam The Walk, sementara di Snowden, Levitt lagi-lagi tampil meyakinkan.'),
(298, 'Sokola Rimba', 'POSITIF', 'DATA LATIH', 'Tampil solid di narasi dan aktingnya, Sokola Rimba juga mendapatkan perlakuan istimewa di teknisnya.  Sinematografi ciamik dari Gunnar Nimpuno sukses besar mengeksploitasi eksotisnya Taman Nasional Bukit Dua Belas dengan segala keindahan flora dan sedikit faunanya, memberikan kita sebuah pengalaman menonton berbeda yang mungkin belum pernah kita lihat sebelumnya.'),
(299, 'Son of Saul', 'POSITIF', 'DATA LATIH', 'Nemes memang tidak terlalu mengeksploitasi kekejamannya dengan menghadirkan gambar-gambar tentang pembantaian itu secara gamblang namun caranya mengambil perspektif berbeda menjadi sesuatu yang istimewa.'),
(300, 'The Song of the Sea', 'POSITIF', 'DATA LATIH', 'Sejak awal The Song of The Sea punya daya magis yang langsung mampu menarik perhatian penontonnya untuk tercebur dalam dunia dongeng versinya. Ada cerita rakyat lama tanah airnya yang disampaikan oleh Bronagh, ibu Ben, memberi landasan kuat yang memancarkan aura misterius dan magis, kental dengan aroma Irlandia. Dalam perjalanannya, narasinya menjadi semakin kuat, ada humor ringan yang dibalut dengan interaksi solid dari relasi benci cinta kakak kepada adiknya, ada kejutan yang menunggu di setiap pojok yang siap menyentilmu yang kemudian diakhiri dengan klimaks yang begitu indah dan secara bersamaan begitu emosional.'),
(301, 'Spirited Away', 'POSITIF', 'DATA LATIH', 'Menonton seluruh film ini terasa seperti sedang bermimpi, adegan demi adegan tak terduga mengalir dan begitu pas, banyak pesan tersembunyi dan karakter-karakter aneh yang tidak akan pernah kalian jumpai. Miyazaki menempatkan semacam emosi berbelit-belit di setiap konflik yang ada di filmnya membuat film ini lebih sekedar tontonan keluarga, saya yakin kalau setelah menonton film ini kalian tidak akan melupakan film ini selama beberapa bulan karena kesan yang didapat begitu melekat di kepala.'),
(302, 'Splinter', 'POSITIF', 'DATA LATIH', 'Mungkin banyak orang yang tidak menyangka, termasuk saya, bahwa sebuah film horror ‘kecil’ seperti Splinter ini di luar dugaan mampu memberikan sebuah sajian horor dengan kualitas ‘besar’. Ya, film garapan sutradara sekaligus penulis naskah, Toby Wilkins ini mampu menjadi salah satu dari sedikit horror berbiaya rendah yang sukses mendobrak anggapan bahwa horor murah itu identik dengan horor kelas B yang hanya mengumbar cerita murahan.'),
(303, 'Spotlight', 'POSITIF', 'DATA LATIH', 'Ada keseimbangan luar biasa berhasil dibuat McCarthy di sini ketika menerjemahkan naskah adaptasinya. Kamu bisa merasakan keasyikan dari sebuah thriller investigasi dengan tensi yang terjaga rapi di saat tim melakukan penyelidikan sebagai jurnalis. Setiap pemainnya bermain begitu cemerlang membawakan peran mereka masing-masing sesuai kapasitasnya tanpa terlihat harus terlalu berlebihan. Sementara elemen dramanya juga bekerja sama bagusnya. Saya suka bagaimana McCarthy mengakhiri semuanya dengan cara yang begitu elegan dan berkesan, ya, itu adalah ending yang bagus dari sebuah film yang sama bagusnya.'),
(304, 'Spring Breakers', 'POSITIF', 'DATA LATIH', 'Ada James Franco yang tampil fantastis sebagai gangster rasta, bisa jadi ini peran terbaik Franco setelah 127 Hours yang menyakitkan itu. Penampilannya sebagai Alien mungkin terlihat seperi badut di awal-awal kemunculannya dengan segala logat anehnya, namun pertemuannya dengan para babes kuliahan itu merubah karakternya menjadi lebih manusiawi di penghujung film yang nantinya ditutup dengan Lights milik Ellie Goulding yang energik.'),
(305, 'St. Vincent', 'POSITIF', 'DATA LATIH', 'Plotnya mungkin familiar, bahkan kita mungkin tahu bagaimana ia berakhir tetapi Theodore Melfi punya kekuatan dari dukungan casting bagus yang mampu membuat segalanya menjadi berbeda. Bill Murray menjalankan peran yang biasanya dimainkan fantastis oleh Jack Nicholson dengan sama baiknya. Sementara lawan mainnya, si kecil Jaeden Lieberher juga tidak kalah bersinarnya. Di balik wajah imut, Lieberher memberi kekuatan seimbang buat Murray dengan segala kepolosan, kecerdasan dan mulut yang tidak kalah tajamnya.'),
(306, 'Star Trek', 'POSITIF', 'DATA LATIH', 'JJ Abrams sukses menghadirkan Star Trek versinya dengan kombinasi cerita yang kuat dan adegan-adegan aksi seru yang seimbang, apalagi ditunjang dengan dukungan efek CGI yang mumpuni menjadikan dunia Star Trek yang luar biasa dapat digambarkan dengan sangat baik dan mendetail di sini. '),
(307, 'Star Trek: Beyond', 'POSITIF', 'DATA LATIH', 'Pondasi yang kuat sudah dibangun oleh JJ Abrams di dua seri pertamanya secara tidak langsung sudah membuat versi modern Star Trek ini bisa menjadi begitu kuat, terutama dari eksplorasi karakter-karakter utama dan chemistry di antara mereka. Star Trek 2009 adalah permulaan baru yang luar biasa, sementara Star Trek Into Darkness yang rilis 4 tahun kemudian pun tidak kalah hebatnya, termasuk menampilkan kembali salah satu villain paling powerful.'),
(308, 'Starlet', 'POSITIF', 'DATA LATIH', 'Saya suka perpaduan kekontrasannya, antara tua dan muda, antara modern dan kuno, keglamoran dan kesederhanaan yang dileburkan dengan sangat manis oleh sebuah perjalanan mencari jati diri dalam penceritaan Baker dan Chris Bergoch yang tidak pernah mengendur. Narasinya memang terkesan sederhana, namun di balik itu ada sebuah kekompleksan tersendiri yang coba perlahan dijabarkan Baker melalui dua karakter utamanya.'),
(309, 'Steve Jobs', 'POSITIF', 'DATA LATIH', 'Steve Jobs memang tidak menawarkan sebuah plot konvensional yang mungkin akan membuat sebagian penontonnya tak nyaman, tetapi setiap momen penting dalam hidup Jobs berhasil dibentuk dalam sebuah narasi padat dalam bungkusan rangkaian dialog-dialog luar biasa yang mungkin hanya bisa dibuat oleh kepiawaian seorang Aaron Sorkin.  Setiap momen begitu efektif membius penontonnya.'),
(310, 'Still Alice', 'POSITIF', 'DATA LATIH', 'Dengan memberikan pondasi kuat pada karakter Alice, plotnya menjadi lebih menarik dalam perjalanannya memasuki konflik nanti. Kita melihat Alice sebagai sosok perempuan yang nyaris sempurna, ia punya segalanya sampai kemudian ia terancam kehilangan segalanya. Ada sebuah proses yang berhasil dirangkum Glatzer dan Westmoreland dengan menggunakan pendekatan intim, depresif dan heartbreaking tanpa harus terkesan berusaha keras memanipulasi penontonnya dengan tetek bengek momen melodrama sentimentil.'),
(311, 'Straw Dogs', 'POSITIF', 'DATA LATIH', 'Sama seperti pendahulunya Straw Dogs buatan Rod Lurie ini bukan thriller yang terlampau istimewa, ia masih menawarkan cerita yang sama, karakter sama, dan pesan yang sama, tapi kemudian menjadi menarik karena ia disajikan dalam kemasan modern yang lebih menyegarkan, lebih mengasyikkan, lebih brutal, dan tentu saja lebih seksi ketimbang apa yang sudah dibuat versi aslinya 4 dekade lalu.'),
(312, 'Suicide Club', 'POSITIF', 'DATA LATIH', 'Suicide Club bisa dibilang adalah suguhan J-horror unik, aneh dan juga absurd, namun d isisi lain juga sebagai sebuah studi moral tentang gejolak sosial yang berkembang di masyarakat yang disajikan Sion Sono melalui rangkaian simbolisme dan metafora mengerikan di dalamnya.'),
(313, 'Sunny', 'POSITIF', 'DATA LATIH', 'Hangat, manis, kocak dan menyentuh, tidak ada drama Korea Selatan tentang persahabatan yang digarap sebaik ini sebelumnya. Ini adalah jenis film yang mampu memberikan efek langsung kepada penontonnya, membuat anda memikirkan,” hei, bagaimana ya kabar teman-teman SMU dan SMP?” Sunny akan membuat anda mengingat kembali masa-masa luar biasa itu.'),
(314, 'Super', 'POSITIF', 'DATA LATIH', 'Super sukses menempatkan dirinya sebagai sebuah drama superhero yang menarik, menghibur dan juga bisa dibilang gila. Perpaduan nyeleneh antara Kick-Ass dan Defendor. Sebuah black comedy dewasa, depresif dan brutal yang kemudian membungkus dirinya dengan sebuah satir sosial tentang kisah kepahlawanan dan pencarian jati diri seorang anak manusia dalam mencari tujuan hidupnya. Di beberapa poin Super bahkan terlihat lebih baik dari Kick-Ass.'),
(315, 'Swiss Army Man', 'POSITIF', 'DATA LATIH', 'Hal positif lainnya dari Swiss Army Man adalah kepiawaian Scheinert dan Kwan mengarahkan ke mana filmnya akan dibawa. Menjadikannya sulit ditebak, hingga ditutup dengan konklusi yang cukup menarik dan tak disangka-sangka. Swiss Army Man berhasil membawa sajian yang orisinal dan berbeda dengan suasana yang menyenangkan.'),
(316, 'Tabula Rasa', 'POSITIF', 'DATA LATIH', 'Ada nilai-nilai dan pesan besar di baliknya setiap rendang Batokok dan gulai kepala ikan, pesan-pesan tentang keragaman sosial-budaya, spirit gotong royong yang mulai memudar, tentang menyatukan perbedaan dalam semangat Bhinneka Tunggal Ika, tentang bagaimana untuk tidak pernah menyerah dalam menjalani hidup sesusah apapun itu dan tentang kesempatan kedua untuk memulai segala sesuatu kembali tanpa prasangka, seperti arti dari judulnya yang manis.'),
(317, 'Talaash: The Answers Lies WIthin', 'POSITIF', 'DATA LATIH', 'Naskah olahan Reema Kagti yang juga bertindak sebagai sutradara bersama bantuan rekannya Zoya Akhtar tersaji rapi, membuatmu mau tidak mau tejebak dalam pusaran teka-teki yang juga akan mengajakmu untuk bermain menjadi seorang detektif bersama Aamir Khan dengan kumis aneh dan muka jutek guna menerka-nerka apa yang sebenarnya terjadi di sana.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(318, 'Tanda Tanya', 'POSITIF', 'DATA LATIH', 'Di atas itu semua, Hanung sebagai sutradara berhasil menjadi dirigen yang baik, yang menyatukan kekuatan pendukung filmnya menjadi sebuah sajian yang lengkap, dihadirkan dalam rangkaian cerita yang mengena plus berbalut tatanan teknis yang mumpuni seperti sinematografi ciamik dari Yadi Sugandi yang berhasil menangkap gambar-gambar cantik perkampungan “Pasar Baru”.'),
(319, 'Tangled', 'POSITIF', 'DATA LATIH', 'Kisah putri dengan rambut sepanjang 70 kaki ini mampu dikemas dengan sangat baik, bersahabat dan menghibur plus balutan animasi dengan kualitas jempolan menjadikan Rapunzel cukup pantas untuk disejajarkan dengan animasi klasik terbaik Disney lainnya.'),
(320, 'Taxi Driver', 'POSITIF', 'DATA LATIH', 'Taxi Driver jelas adalah salah satu karya terbaik dari Martin Scorsese, dengan cerita yang kuat dan dengan dukungan aktor sekaliber Robert De Niro membuat film ini mampu memberikan sebuah gambaran yang cukup realistis tentang kehidupan masyarakat Amerika, khususnya masyarakat kota New York pada era ''70 lengkap dengan segala konflik sosial yang terjadi pada masyarakatnya.'),
(321, 'Terminator Genisys', 'POSITIF', 'DATA LATIH', 'Sang Terminator uzur dibalut dengan kulit sintetis yang menyelubungi tulang-belulang bajanya. Kulit bukan hanya sekedar kulit mirip manusia, namun juga mampu menua dan mengeriput layaknya sebuah kulit alami belum lagi Taylor memberi sentuhan humanis buat karakternya. Elemen ini yang kemudian mampu membuat terminator versi Genisys menjadi jauh lebih manusiawi ketimbang seri-seri sebelumnya lengkap dengan joke-joke one liner khas Arnie.'),
(322, 'Testament of Youth', 'POSITIF', 'DATA LATIH', 'Ini adalah biopik yang indah, setidaknya secara fisik yang terlihat kasat mata itulah faktanya. Dari menit-menit awal ia dibuka, Testament of Youth menampilkan lanskap-lanskap cantik, memancarkan sebuah aroma tenang namun sendu yang diperkuat dengan scoring garapan komposer Jerman-Inggris Max Richter yang lembut, meskipun di bagian pembuka ada wajah sedih dari karakter utama kita sebelum filmnya melompat beberapa tahun ke belakang.'),
(323, 'That Evening Sun', 'POSITIF', 'DATA LATIH', 'That Evening Sun adalah sebuah drama dengan semangat indie yang kental. Ceritanya yang simpel tidak membuat film satu ini kehilangan pesan-pesan kuatnya. Pesan tentang bagaimana manusia mempertahankan kenangan masa lalu yang menurutnya sangat berharga, pesan tentang pelajaran hidup, bahkan untuk orang lanjut usia sekalipun. Semuanya disajikan dengan kesederhanaan dan dukungan akting realistis dari para pemainnya.'),
(324, 'That Thing Called Tadhana', 'POSITIF', 'DATA LATIH', 'Tidak banyak film-film produksi Philipina yang saya tonton, namun beruntung, saya selalu sukses mendapatkan film-film bagus ketika mencoba menontonnya, misalnya, seperti komedi romantis indie milik sutradara pemula Antoinette Jadaone yang direkomendasikan oleh teman dan suhu saya dari Movievora. That Thing Called Tadhana bisa dibilang adalah kejutan yang benar-benar menyenangkan.'),
(325, 'The Accountant', 'POSITIF', 'DATA LATIH', 'O’Connor mampu memaksimalkan karisma Ben Affleck yang tampil oke di sepanjang film sebagai sosok tangguh, unik dan penuh kejutan. Tidak banyak adegan aksi yang dihadirkan namun ketika ada itu bisa sangat berkesan, lihat saja bagaimana koreografi aksinya dibuat dengan sangat baik, baik baku hantam jarak dekat atau menggunakan senjata begitu efektif, begitu mematikan tanpa harus terlihat berlebihan, yah, sedikit banyak mengingatkan saya pada John Wick yang keren itu.'),
(326, 'The Act of Killing', 'POSITIF', 'DATA LATIH', 'Apa yang disajikan Joshua Oppenheimer secara berani, provokatif,  jujur dan blakblakan ini seperti menjadi sebuah kenyataan pahit yang pada akhirnya harus kita terima, suka atau tidak.'),
(327, 'The Adventures of Tintin', 'POSITIF', 'DATA LATIH', 'Cepat, seru dan sangat menyenangkan. Sebuah tontonan yang tidak hanya ditujukan buat para veteran Tintin, tapi untuk siapa saja yang menyukai film petualangan yang menghibur. Yap, itulah yang saya rasakan dalam debut animasi perdana seorang Steven Spielberg. Spielberg tidak hanya sukses membuat Tintin merasakan kembali kejayaannya seperti yang pernah dialaminya beberapa dekade lalu, tapi bersama Peter Jackson ia juga sudah membuat sosok reporter yang haus petualangan dan misteri ini dan dunia di dalamnya menjadi terlihat jauh lebih bagus dan tentunya lebih hidup dari komiknya dalam balutan animasi yang luar biasa.'),
(328, 'The Age of Adaline', 'POSITIF', 'DATA LATIH', 'Disajikan dengan pace yang terjaga baik, membuat 112 menit terasa terbang begitu cepat. Teknis visual dihadirkan dengan lembut oleh David Lanzenberg, memancarkan aroma misterius sekaligus romantis. Tetapi kekuatan terbesar The Age of Adaline tidak hanya pada konsep fiksi ilmiahi fantasinya, tetapi juga pada diri Blake Lively yang tampil fantastis menggerakkan narasinya, tidak hanya pesona fisik dan kecantikannya namun bagaimana ia mengisi jiwa Adaline dengan sempurna lengkap dengan kekuatan dan kerapuhannya.'),
(329, 'The Artist', 'POSITIF', 'DATA LATIH', 'Jajaran pemainnya tampil solid, bahkan penampilan apik dari Jean Dujardin dan Berenice Bejo yang mungkin membuat anda percaya bahwa mereka adalah aktor dan aktris yang terlahir 100 tahun lalu, khususnya Dujardin yang sukses menghadirkan pesona kuat sebagai George Valentin, tidak heran jika kemudian ia banyak memperoleh penghargaan bergengsi di berbagai ajang penghargaan film Internasional. Dariadegan pembuka yang hebat, momen mimpi George yang mengejutkan sampai puncaknya, sebuah suguhan kolaborasi tap dance cantik dan dialog bersuara pertama, siapa yang kemudian menyangka bahwa The Artist dalam perjalanannya mampu menyeruak sebagai salah satu kandidat film terbaik tahun ini. '),
(330, 'The Bang-Bang Club', 'POSITIF', 'DATA LATIH', 'Melihat pekerjaan bagus yang sudah dibuat Steven Silver di sini dalam menghadirkan sebuah biopik semi dokumenter kisah nyata dari 4 orang foto jurnalis paling berani di dunia ini saya yakin bahwa novel The Bang-Bang Club pasti adalah sebuah bacaan yang bagus, sebagus filmnya yang mampu menginspirasi dan  menggugah sisi emosional saya di saat bersamaan.'),
(331, 'The Best of Me', 'POSITIF', 'DATA LATIH', 'Beruntung kisah percintaan dewasa di era kini digarap lebih baik. Adalah pesona James Marsden (ia menggantikan posisi almarhum Paul Walker) yang terlihat tua dan bijak serta kelembutan Michelle Monaghan berhasil menciptakan chemistry kuat.'),
(332, 'The Big Short', 'POSITIF', 'DATA LATIH', 'Dengan jajaran pemain sementereng ini, susah untuk tidak terpikat dengan The Big Short terlepas tidak atau tahunya kamu tentang apa yang ditawarkan isinya. Buat saya ini adalah sebuah pengalaman menonton sembari belajar yang mungkin paling menyenangkan yang bisa didapat dari sebuah film, dan sekali lagi saya katakan, Adam McKay adalah dosen ekonomi terbaik yang pernah saya jumpai.'),
(333, 'The Blind Side', 'POSITIF', 'DATA LATIH', 'Bagaimanapun The Blind Side tetap adalah sebuah drama ringan, menghibur dan yang terpenting mampu memberikan inspirasi kepada penontonnya, apalagi bila mengingat film ini diadaptasi dari kisah nyata. Tidak perlu harus mengerti American football untuk menyaksikannya, cukup duduk santai dan nikmati saja segala nilai kebaikan-kebaikan yang diberikan film ini.'),
(334, 'The Book Thief', 'POSITIF', 'DATA LATIH', 'The Book Thief punya casting bagus yang setiap karakternya penuh dengan kehangatan dan harapan di balik latar perang dan musim salju yang dingin. Geoffrey Rush membawa kembali pesona kebapakannya pasca The King’s Speech, menjadi pria paruh dengan hati yang besar dan permainan akordion yang mendamaikan. Emily Watson tampil prima sebagai Rosa, ibu angkat galak namun penyayang lengkap dengan aksen Jerman yang sempurna.'),
(335, 'The Borrower Arriety', 'POSITIF', 'DATA LATIH', 'Jelas bukan yang terbaik, namun juga bukan yang terburuk, The Borrower Arriety kembali hadir menambah daftar panjang tradisi animasi-animasi hebat jebolan Studio Ghibli yang legendaris itu, apalagi, meskipun kali ini mereka tidak memasang duo jagoannya untuk duduk di bangku sutradara, namun kehadiran Hiromasa Yonebayashi sebagai sutradara termuda yang pernah dimiliki Ghibli rupanya mampu mengusung semangat yang sama dengan para seniornya itu dalam menghadirkan animasi tradisional berkualitas.'),
(336, 'The Changeling', 'POSITIF', 'DATA LATIH', 'Klasik! Mungkin kata yang tepat untuk menggambarkan The Changeling sebagai suguhan horor ‘rumah hantu’. Mungkin tidak ada yang baru di sini jika anda menontonnya sekarang, tapi tetap saja saya harus angkat jempol buat Peter Medak yang menggarapnya dengan penyajian teknis yang rapi serta tidak pernah kehilangan sentuhan angkernya, membuat The Changeling menjadi salah satu horor jadul yang masih tetap segar ditonton sampai saat ini.'),
(337, 'The Conjuring', 'POSITIF', 'DATA LATIH', 'Faktanya The Conjuring memang sajian yang menakutkan, dan James Wan sukses mendramatisasi kisah nyatanya menjadi sajian horor supernatural seru dan cerdas yang nantinya bakal dikenang cukup lama.'),
(338, 'The Cove', 'POSITIF', 'DATA LATIH', 'The Cove adalah salah satu dari sedikit film dokumenter yang disajikan secara luar biasa, tidak hanya mendidik namun juga akan menghibur karena berani menyajikan sebuah tontonan penuh ketegangan yang ditampilkan secara nyata, dan yang terpenting adalah dapat menginspirasi penontonnya.'),
(339, 'The Crow', 'POSITIF', 'DATA LATIH', 'The Crow bisa dibilang adalah salah satu film adaptasi komik terbaik yang pernah dibuat, film dengan cerita cinta yang tragis dan gelap ini sukses melambungkan nama seorang Brandon Lee sebagai ikon gothic terkenal di jamannya, walaupun nasib baik rupanya tidak berpihak kepadanya.'),
(340, 'The Crucible', 'POSITIF', 'DATA LATIH', 'Provokatif, inspiratif dan depresif, The Crucible termasuk cukup baik menghadirkan segala horor tentang kekerasan seksual pada anak bawah umur dengan gamblang. Naskah adaptasinya mungkin tidak sempurna dan terlalu dramatis, tapi bagaimanapun ini adalah tonton drama yang membuat hati nurani terkoyak, terlebih para pemain ciliknya juga mampu tampil begitu meyakinkan membawakan peran mereka.'),
(341, 'The Dark Knight', 'POSITIF', 'DATA LATIH', 'Sutradara 41 tahun ini menaikkan tensi plot dengan megah, menggeber banyak klimaks kecil yang pada akhirnya ‘meledakkannya’ dengan berbagai twist sejak pertengahan film. Dimulai dengan adegan pembuka menarik di mana secara bersamaan Nolan juga memperkenalkan sosok Joker dengan rencana perampokan bank jeniusnya, pencidukan karakter antagonis, pesta pra kampanye Harvey Dent yang disambangi Joker hingga kejar-kejaran tegangan tinggi antara mobil boks dan truk pun dibesut dengan sangat baik oleh Nolan.'),
(342, 'The Deep End', 'POSITIF', 'DATA LATIH', 'Di sepanjang film kita tidak hanya merasakan sebuah suspense tingkat tinggi ala crime thriller yang meskipun hanyaada di ruang lingkup sederhana namun berhasil memberikan getaran-getaran besar nan efektif memancing rasa penasaran kita. Sementara di sisi lain drama kemanusiaannya juga tampil sama memesonanya.'),
(343, 'The Den', 'POSITIF', 'DATA LATIH', 'Tidak ada rasa bosan seperti yang sering kamu dapati di film-film mocku horor lainnya karena Donohue membangun plotnya dengan cerdas dari awal, memberi terlebih dahulu penontonnya sesuatu yang intim dan menarik terutama ketika melihat bagaimana ia memaksimalkan akting Melanie Papalia sebagai Liz.'),
(344, 'The Disappearance of Alice', 'POSITIF', 'DATA LATIH', 'Pintar, begitulah saya menggambarkan The Disappearance of Alice Creed, sebuah crime thriller debut Blakeson ini ternyata benar-benar mampu menyajikan sebuah suguhan kisah kriminal cerdas penuh ketegangan nyaris tanpa henti sepanjang 98 menit.'),
(345, 'The Duff', 'POSITIF', 'DATA LATIH', 'Tidak terlalu banyak romcom komedi remaja era milenium yang mampu meninggalkan kesan mendalam yang setelah beberapa lama filmnya dirilis. Masih mampu kamu ingat jika kemudian ada orang yang menanyakan, “Hei, apa sih romcom remaja yang bagus?” Jawabannya mungkin tidak jauh-jauh dari Mean Girls dari Mark Water dengan dukungan ensemble cast perempuan yang luar biasa atau mungkin juga pesona luar biasa Emma Stone yang mempu membuat Easy A susah untuk dilupakan. Dan saya senang bisa menemukan dan memasukkan The Duff ke dalam salah satu romcom remaja terbaik yang pernah dibuat di era twitter saat ini.'),
(346, 'The Edge of Tomorrow', 'POSITIF', 'DATA LATIH', 'Tom Cruise memang masih menjadi magnet terbesar buat The Edge of Tomorrow, meskipun kamu tidak tahu apa-apa soal premisnya, tetapi melihat sang action man pujaan mengenakan baju zirah canggih di posternya itu jelas akan memancing penonton awamnya, dan sekali lagi Cruise memang memberikan performa kuat buat karakternya seperti yang sering dilakukannya di film-filmnya. Lalu di sebelahnya ada Emily Blunt yang seperti saya bilang di atas tampil badass sebagai heroine tempur hebat, mencuri perhatian sejak kemunculannya yang dahsyat dan chemistry bersama Cruise.'),
(347, 'The Evil Dead', 'POSITIF', 'DATA LATIH', 'Evil Dead atau yang dikenal dengan nama lain The Book of the Dead ini memang layak menyandang predikat salah satu cult horror klasik terbaik. Hanya dengan biaya seadanya tidak membuat seorang Sam Raimi ciut untuk dapat menghadirkan sebuah tontonan sekaligus obat penghasil mimpi buruk paling manjur bagi penontonnya'),
(348, 'The Fifth Estate', 'POSITIF', 'DATA LATIH', 'Ritmenya dijaga stabil, dibangun dengan perlahan sejak awal dan kemudian terasa tensinya naik setiap kali Assange menemukan rahasia baru untuk dibagi sampai puncaknya, tentu saja Cablegate yang menggegerkan dunia itu dengan segala elemen politiknya.'),
(349, 'The Fighter', 'POSITIF', 'DATA LATIH', 'Beruntung seorang David Russel memiliki jajaran pemain-pemain hebat yang mampu menghidupkan setiap momen-momen emosional dalam The Fighter. Kombinasi kisah nyata, penyutradaraan dan akting yang luar biasa menjadikan The Fighter salah satu yang terbaik di genrenya.'),
(350, 'The Fly', 'POSITIF', 'DATA LATIH', 'Usia ‘body horror’ David Cronenberg satu ini memang sudah 25 tahun, tapi pesona menakjubkan remake The Fly tidak pernah luntur oleh waktu dikarenakan elemen-elemen pendukung kuat di dalamnya. Ia simpel namun juga kompleks , Jeff Goldbum dan Geena Davids memberikan akting hebat mereka, dan tentu saja  ia sangat menghibur dan mengerikan sebagai sebuah horor fiksi ilmiah dengan segala teknik spesial efek serta tata riasnya yang mengagumkan dan  juga menjijikkan di saat bersaman. Klasik!'),
(351, 'The Fourth Kind', 'POSITIF', 'DATA LATIH', 'Sang sutradara terbilang cukup berhasil menciptakan sebuah atmosfer penuh kengerian dan ketegangan berbalut adegan-adegan disturbing yang mampu membuat bergidik penontonnya. Plot yang sebenarnya sederhana dibuat sedemikian rupa sehingga menimbulkan kesan rumit, sehingga tidak jarang penontonnya diajak untuk ikut berputar-putar dalam memecahkan teka-teki tentang apa yang sebenarnya terjadi.'),
(352, 'The Gift', 'POSITIF', 'DATA LATIH', 'The Gift sendiri bisa dibilang adalah langkah besar buat Edgerton, selain menjadi salah satu tokoh utamanya, ia juga menuliskan naskah serta produser, namun yang terpenting, The Gift menjadi debut pertama Edgerton sebagai sutradara, dan lagi-lagi harus diakui, ia menjalani tugasnya dengan sangat baik.'),
(353, 'The Girl who Leapt Through Time', 'POSITIF', 'DATA LATIH', 'The Girl Who Leapt Through Time milik Taniguchi mungkin tidak akan memuaskan semua pihak, terutama bagi mereka yang sudah terlanjur menyukai versi anime yang lebih dahulu populer. Banding membandingkan pun dipastikan akan terjadi setelah menonton film ini, namun sekali lagi setiap versi pasti memiliki kelebihan dan kekurangannya sendiri, namun jika anda penyuka drama romantis ketimbang fiksi ilmiah, film ini bisa sangat menyenangkan sekaligus menyedihkan.'),
(354, 'The Girl with the Dragon Tattoo', 'POSITIF', 'DATA LATIH', 'Lagi-lagi sebuah adaptasi luar biasa dari seorang David Fincher. Lebih bagus dan lebih mencekam dari versi aslinya tanpa harus banyak mengkhianati novelnya. Dan siapa yang menyangka jika Rooney Mara mampu tampil sebaik ini sebelumnya. Sebuah thriller cerdas dan berani, salah satu yang terbaik dari David Fincher.'),
(355, 'The Good, the Bad, and the Weird', 'POSITIF', 'DATA LATIH', 'Kombinasi barat dan timur dalam balutan ala film-film koboi belum pernah tercampur seasyik dan sekreatif ini. Dengan kemampuannya meracik elemen aksi, petualangan, komedi dengan gayanya yang keren, The Good, The Bad, The Weird mampu bergerak lancar tanpa harus kehilangan elemen klasik dari inspirasi western lawasnya, sebaliknya dengan sentuhan modern, Kim Jee Won berhasil menjadikan The Good, The Bad, The Weird sebagai sebuah sajian unik yang seru dan menyenangkan.'),
(356, 'The Grand Budapest Hotel', 'POSITIF', 'DATA LATIH', 'Bagian terbaik dari The Grand Budapest Hotel adalah segalanya. Ya, segalanya. Jika kamu menganggap apa yang dilakukan Anderson kemarin dalam Moonrise Kingdom sudah kamu anggap luar biasa, maka bersiaplah, karena The Grand Budapest Hotel punya kadar jauh lebih dahsyat, meskipun harus diakui masih belum mampu menyaingi  The Royal Tenenbaums. Namun satu hal bisa dipastikan The Grand Budapest Hotel itu seru.'),
(357, 'The Great Passage', 'POSITIF', 'DATA LATIH', 'Dibungkus oleh tone hangat dan selipan joke ringan, perjalanan pembuatan kamus ala Yuta menjadi  sebuah proses menyenangkan, dan ketika klimaksnya datang menjemput, ada sebuah perasaan haru dan emosional melihat bagaimana pada akhirnya semua bisa tercapai setelah apa yang mereka lalui selama itu.'),
(358, 'The Grey', 'POSITIF', 'DATA LATIH', 'Naskahnya memang tidak istimewa, tapi bagaimana Joe Carnahan menyajikannya menjadi sebuah tontonan yang mencekam itulah yang menjadikan The Grey menarik. Dan Liam Nesson masih tampil garang dan lembut seperti biasanya memesona dengan karakternya yang garang dan lembut'),
(359, 'The Handmaiden', 'POSITIF', 'DATA LATIH', 'The Handmaiden menjadi tontonan menarik, tidak hanya karena ia dipenuhi oleh trademark Chan Wook, dari teknis artistik jempolan, sinematografi cantik, performa gemilang dari Kim Min Hee dan pendatang baru, Kim Tae Ri serta  tentu saja tidak ketinggalan darah dan kebrutalan dalam kanvas thriller yang gelap dan penuh belitan dan kejutan, tetapi The Handmaiden kemudian menjadi terasa lebih spesial karena ketika Chan Wook turut memasukkan tema lesbian nan kontroversial.'),
(360, 'The Hangover', 'POSITIF', 'DATA LATIH', 'The Hangover resmi menjadi salah satu film komedi favorit saya. Penyutradaraan yang bagus, naskah yang berkualitas, apalagi untuk ukuran film komedi, banyolan komikal serta rangkaian twist mengejutkan dan menyenangkan hingga jajaran pemain yang bermain gemilang menjadikan film ini sebuah paket hiburan lengkap.'),
(361, 'The Hateful Eight', 'POSITIF', 'DATA LATIH', 'Setiap dialog didukung oleh materi yang bagus termasuk di dalamnya isu-isu sensitif tentang ras pasca perang konfederasi dan pencarian keadilan yang mampu bersinergi lancar bersama joke-joke verbal menggelitik dan tensi ketegangan yang terjaga konsisten.'),
(362, 'The Help', 'POSITIF', 'DATA LATIH', 'The Help itu memiliki jajaran pemain luar biasa, bisa jadi ini adalah elemen yang paling kuat ketimbang naskahnya yang ‘santai’ itu. Nyaris semua pemainnya mampu menghadirkan akting prima, lihat saja duo maut Viola Davis dan Octavia Spencer yang begitu hebat membawakan karakter para pembantu pemberani, tidak ketinggalan Jessica Chastain yang memesona, atau si cantik Bryce Dallas Howard yang secara mengejutkan juga bisa tampil sangat menyebalkan.'),
(363, 'The Hole', 'POSITIF', 'DATA LATIH', 'The Hole termasuk berhasil menjalankan tugasnya dengan baik. Dante mampu membangun dam mengeksekusi kisahnya yang sebenarnya sederhana menjadi sebuah sajian menghibur..'),
(364, 'The House of the Devil', 'POSITIF', 'DATA LATIH', 'The House of the Devil adalah sebuah horor menyenangkan, sebuah tontonan yang menghasilkan efek de javu manis dari seorang sutradara muda yang begitu mencintai horor-horor jadul, mengajak para penontonnya untuk kembali bernostalgia dengan keseraman dan ketegangan ala horor era ''80 lengkap dengan segala pernak-pernik pendukungnya'),
(365, 'The Hunt', 'POSITIF', 'DATA LATIH', 'Mads Mikkelsen lulus dengan nilai dekat dari sempurna dalam memerankan Lucas. Aktingnya sangat restrained, tetapi semua emosi seolah dipancarkan oleh mata dan bahasa tubuhnya.'),
(366, 'The Ice Man', 'POSITIF', 'DATA LATIH', 'Dua elemen yang bertolak belakang plus karisma dingin seorang Shannon kemudian sukses melebur menjadi satu dalam sebuah plot crime thriller intens nan cepat yang tersaji secara periodik dan penuh kejutan.'),
(367, 'The Illusionist', 'POSITIF', 'DATA LATIH', 'Meskipun tipis peluangnya untuk memenangkan animasi terbaik,  namun  menyenangkan sekali rasanya masih ada animasi 2D tradisional yang ternyata mampu berbicara banyak dalam ajang Oscar tahun ini di tengah gempuran animasi-animasi CGI berbasis 3D.  Yup, Sylvain Chomet lagi-lagi membuktikan hal tersebut lewat The Illusionist, sebuah animasi old school cantik dengan dukungan cerita powerful.'),
(368, 'The Innkeepers', 'POSITIF', 'DATA LATIH', 'The Innkeepers tetap adalah sajian horor rumah hantu old fashioned mencekam ala Ti West yang bagus. Tidak banyak momen mengerikan, berjalan lambat dan berpotensi menjemukan jika tidak terbiasa dengan karya West sebelumnya, tapi semuanya dibayar lunas oleh latar yang meyakinkan, penampilan apik Sarah Paxton  dan 20 menit akhir yang mengerikan.'),
(369, 'The Intern', 'POSITIF', 'DATA LATIH', 'The Intern punya casting hebat. Kombinasi apik tua-muda yang diwakilkan De Niro-Hathaway menjadi daya tarik terbesar The Intern. Secara keseluruhan The Intern adalah jenis film ringan yang sangat enak dinikmati.'),
(370, 'The Intouchables', 'POSITIF', 'DATA LATIH', 'Mungkin The Intouchables bukan drama teraplegic terbaik yang pernah saya tonton, tapi saya suka setiap kehangatannya, setiap keceriaan dan segala tawa serta chemistry solid yang dihadirkan Olivier Nakache dan Éric Toledano beserta duo Cluzet-Sly. Ya, ini adalah tontonan  menyenangkan, sebuah feel-good movie tentang persahabatan, tentang perbedaan yang menguatkan dan juga menginspirasi.'),
(371, 'The Joneses', 'POSITIF', 'DATA LATIH', 'Premis yang diangkat dalam The Joneses termasuk sangat fresh dan orisinal. Film ini adalah sebuah drama komedi satir dengan sedikit unsur romance di dalamnya. Secara keseluruhan Borte bisa dibilang berhasil menyajikan sebuah tontonan drama ringan yang cukup berbobot.'),
(372, 'The Jungle Book', 'POSITIF', 'DATA LATIH', 'Narasinya sederhana dan bersahabat tanpa substansi macam-macam, humornya lucu dan enak dinikmati semua umur, petualangannya seru dan mendebarkan, sisi emosionalnya juga cukup mengena namun jika ada satu hal yang paling menonjol dari The Jungle Book selain visualnya yang ciamik itu adalah jajaran pengisi suaranya. Bukan hanya karena diisi oleh nama-nama besar saja namun bagaimana mereka memberi jiwa pada karakter-karakternya dengan sangat baik.'),
(373, 'The Kids Are All Right', 'POSITIF', 'DATA LATIH', 'Tampaknya tidak terlalu susah untuk menempatkan The Kids Are All Right sebagai salah satu drama terbaik tahun ini. Sebuah kisah keluarga yang berbeda dan sangat menarik yang berhasil disajikan dengan ringan oleh Lisa Cholodenko. Apalagi The Kids Are All Right juga didukung oleh jajaran aktris dan aktor kelas atas yang bermain dengan sangat fantastis disini.'),
(374, 'The Kings of Summer', 'POSITIF', 'DATA LATIH', 'Tidak hanya tangguh membuat para cast mudanya tampil brilian, Vogt-Roberts juga lihai membungkus kisah pendewasaan indie ini dengan teknis yang penuh dengan kepercayaan diri tinggi, terlebih untuk sutradara first timer sepertinya. Ada banyak gambar-gambar apik menyegarkan yang menguasai 94 menit durasinya.'),
(375, 'The King''s Speech', 'POSITIF', 'DATA LATIH', 'Dibuka dengan meyakinkan, berkembang dengan dinamis dan diakhiri dengan sangat emosional, itulah The King’s Speech, sebuah historical drama luar biasa yang diisi oleh orang-orang luar biasa. Sebuah film inspirasional dari seorang pemimpin hebat dalam usaha mencari kepercayaan dirinya.'),
(376, 'The Life of David Gale', 'POSITIF', 'DATA LATIH', 'Dukungan naskah yang kuat, presentasi yang bagus, akting prima dari para pemainnya serta ending yang mengejutkan sudah lebih dari cukup bagi saya untuk dapat menyukai film ini.'),
(377, 'The Little Prince', 'POSITIF', 'DATA LATIH', 'Mark Osborne mempresentasikan The Little Prince versinya dengan cukup baik, mungkin tidak sampai kelewat istimewa mengingat kualitas animasi, khususnya pada bagian cerita di dunia nyatanya terasa sedikit kurang menarik meski sebenarnya buat penonton yang lebih dewasa hal itu mungkin tidak terlalu menjadi masalah karena bisa ditutupi dengan kekuatan tema dan penceritaannya yang bagus.'),
(378, 'The Lobster', 'POSITIF', 'DATA LATIH', 'Ada elemen komedi hitam bekerja di dalamnya, membuat kita tersenyum getir ketika melihat Lanthimos. Sebuah satir tentang tragedi, komitmen dari sebuah cinta yang tersembunyi dalam keabsurdan premis fiksi ilmiahnya. Ada situasi kompleks di bawah permukaannya.'),
(379, 'The Lunchbox', 'POSITIF', 'DATA LATIH', 'Begitu sederhana namun begitu membekas. The Lunchbox diisi oleh dua karakter utamanya yang kuat.'),
(380, 'The Man from Earth', 'POSITIF', 'DATA LATIH', 'Saya selalu percaya kekuatan utama sebuah film itu berada di pundak narasinya, dan The Man from Earth membuktikan itu. Dengan sumber daya terbatas ia mampu memberikan sebuah suguhan drama fiksi ilmiah yang berbeda, menghipnotis dan membuatmu tercengang. Sebuah premis konyol yang mampu dieksekusi dengan sangat baik dengan balutan dialog-dialog cerdas.'),
(381, 'The Martian', 'POSITIF', 'DATA LATIH', 'Dengan durasi sepanjang ini, butuh sesuatu untuk membuat penontonnya betah berlama-lama di bangkunya, dan Scott tahu benar bagaimana menjaga pace The Martian dengan baik. Hampir tidak ada momen membosankan di dalamnya. Setiap adegan diisi dengan efektif dan jauh dari kesan lambat, belum lagi ditambah elemen humor yang memberi variasi santai di tone seriusnya.'),
(382, 'The Mechanic', 'POSITIF', 'DATA LATIH', 'Kombinasi West-Statham rupanya sanggup membuat The Mechanic tampil lebih baik yang dari saya perkirakan sebelumnya. Tidak istimewa memang, namun setidaknya tidak sampai terjebak dalam sajian action murahan kelas dua. The Mechanic bisa dibilang cukup berkelas. Saya sendiri  sangat menikmati bagaimana West mengemas tiap menitnya dalam dalam balutan visual menarik, tempo cepat dan jauh dari bertele-tele.'),
(383, 'The New World', 'POSITIF', 'DATA LATIH', 'Salah satu yang terbaik di genrenya. Setelah A Dirty Carnival butuh waktu 7 tahun untuk mendapatkan sebuah film  gangster ala negeri ginseng memuaskan yang tidak hanya menjual kekerasan dan segala tetek bengek dunia gelap mafia, namun juga sebuah plot cerdas yang kuat dan menegangkan tentang sisi mana yang kamu pilih dengan bumbu aksi berdarah-darah di sepanjang dua jam lebih plus dukungan para pemainnya yang bermain solid.'),
(384, 'The Past', 'POSITIF', 'DATA LATIH', 'Dibungkus dengan semangat kesederhanaan seperti film-film Farhadi lainnya yang juga mencerminkan sebuah realisme kental, nyaris tanpa manipulasi scoring dan dramatisasi berlebihan. Dalam perjalanannya kita akan banyak mendapati kejutan hebat yang sedikit demi sedikit membentuk wajah utuh The Past.'),
(385, 'The Raid', 'POSITIF', 'DATA LATIH', 'Gareth Evans jelas sudah mengerjakan pekerjaannya dengan sangat baik termasuk bagaimana ia memaksimalkan kemampuan dua pemainnya. Ya, The Raid mungkin sudah menjadi film aksi Indonesia terbaik yang pernah ada, bahkan dunia pun mengakuinya.'),
(386, 'The Reef', 'POSITIF', 'DATA LATIH', 'The Reef bisa jadi salah satu thriller tentang serangan hiu terbaik yang pernah dibuat setelah Jaws. Sedikit membosankan di awal, Andrew Traucki kemudian seakan-akan tidak mau membuang waktunya lagi dengan langsung memacu tensinya, memberikan penontonnya momen-momen penuh kengerian dan ketegangan yang efektif merangsang rasa takut kita tanpa harus terlihat berlebihan.'),
(387, 'The Runner', 'POSITIF', 'DATA LATIH', 'Hempasan debu, dan gersangnya iran ditampilkan dengan sempurna. Hampir tidak ada musik yang saya dengar muncul di film ini, dan juga banyaknya aktor dan aktris yang ada di film ini, inilah yang membuat film ini begitu dalam. saya sama sekali tidak melihat sang aktor berakting di sini, yang ada hanyalah benar-benar seorang Amiro. apalagi film ini mempunyai ending dramatis, yang bikin perasaan campur aduk sekaligus indah.'),
(388, 'The Sea of Trees', 'POSITIF', 'DATA LATIH', 'The Sea of Trees seakan membawa kita pada kisah haru biru perjuangan keduanya untuk tetap bertahan hidup dengan kondisi hutan yang terlihat berbahaya di malam hari, karena banyaknya jurang terjal yang tersembunyi dari pandangan, hingga hujan yang menerpa. Tak dinyana, makin ke ujung, alur cerita malah dibawa ke arah drama melankolis dengan penutup manis yang tidak disangka-sangka.'),
(389, 'The Shallows', 'POSITIF', 'DATA LATIH', 'Kemampuan Collet-Serra menghadirkan set piece dengan segala teknis yang luar biasa, lihat saja pengambilan gambarnya dan sound editing yang keren termasuk juga penggunaan CGI yang tepat guna, ini kemudian menjadikan The Shallows menjadi lebih istimewa, tentu saja juga tidak lepas dari akting solo hebat Blake Lively yang sukses berpadu padan sempurna, menghasilkan tensi ketegangan baik di atas maupun di dalam air yang luar biasa tinggi dan yang pasti juga sangat efektif mengguncang adrenalin penontonnya.'),
(390, 'The Shining', 'POSITIF', 'DATA LATIH', 'Tidak heran jika banyak penonton yang memasukkan The Shining dalam list film horror klasik favorit mereka, karena horror psikologis kolaborasi Kubrick-King ini memang yang terbaik di genrenya, bahkan sampai sekarang The Shining adalah salah satu ‘obat’ manjur yang dapat membuat penontonnya bermimpi buruk setelah menontonnya.'),
(391, 'The Snow White Murder Case', 'POSITIF', 'DATA LATIH', 'Meskipun tidak menawarkan nada gelap seperti Confessions atau kebanyakan thriller-thriller tentang kasus pembunuhan lain,  The Snow White Murder Case masih bisa tetap tampil solid dengan pesonanya uniknya sendiri. Dukungan naskah gubahannya yang berakar plot misteri pembunuhan digarap sangat rapi, kreatif berbaur sempurna dengan penyutradaraan lambat namun memikat ala Nakamura yang tidak pernah lupa membawa ciri khasnya.'),
(392, 'The Social Network', 'POSITIF', 'DATA LATIH', 'Cerita berjalan dengan rapi tanpa ada paksaan, dengan tempo yang pas namun tidak membosankan, Fincher bukan hanya menyajikan cerita tapi juga mengajak kita untuk berpikir dan menganalisis  “apa?” dan “mengapa?” kepada setiap karakter yang muncul di film ini. Selain itu film ini juga dipenuhi dialog slapstick tajam dan cerdas.'),
(393, 'The Spectacular Now', 'POSITIF', 'DATA LATIH', 'Kunci keberhasilan The Spectacular Now adalah bagaimana Ponsoldt tidak membuatnya menjadi sebuah teen drama yang lebay, sebaliknya secara natural menjadikan semuanya membumi, termasuk setiap konfliknya, The Spectacular Now itu seperti karakter Aimee, polos tanpa makeup namun tetap cantik dilihat di sepanjang film termasuk adegan seksnya yang “lugu". Sutter Keely yang dimainkan cemerlang oleh jebolan Rabbit Hole, Miles Teller adalah pusat segalanya.'),
(394, 'The Swimmer', 'POSITIF', 'DATA LATIH', 'Ada sebuah keseimbangan yang berhasil dihadirkan Sophon Sakdapisit di sini. Penceritaannya yang sederhana coba ditampilkan dengan cara tidak biasa ketika plotnya melompat-lompat dari masa lalu ke masa sekarang lalu kembali lagi ke masa lalu yang berpotensi membingungkan. Sementara kualitas horornya juga masih mampu dijaga dengan baik.'),
(395, 'The Terror Live', 'POSITIF', 'DATA LATIH', 'Thriller berbau aksi terorisme mungkin bukan barang baru untuk dipamerkan, tetapi dengan melakukan pendekatan berbeda siapa sangka kombinasi usang itu bisa menjadi sangat menggigit, coba lihat apa yang dilakukan Kim Byung Woo ketika ia berhasil memanfaatkan minimnya lokasi untuk menghasilkan teror maksimal.'),
(396, 'The Theory of Everything', 'POSITIF', 'DATA LATIH', 'The Theory of Everything itu punya tampilan secantik judulnya. Visual gloomy dari sinematografer veteran Benoît Delhomme berbalut scoring magical dari nada-nada elegan dan melankolis garapan komposer Islandia Johann Johannsson, menghasilkan kombinasi momen-momen sentimentil romantis yang mendukung penceritaan James Marsh di paruh pertamanya yang diisi banyak cinta.'),
(397, 'The Town', 'POSITIF', 'DATA LATIH', 'Affleck memang terbukti sukses menyutradarai film berdurasi 2 jam lebih ini dengan sangat baik, namun tidak sebagai aktor karena ada Jeremy Renner disini yang berhasil menjadi scene stealer sebagai seorang badass yang mampu menyuguhkan akting kuat di sepanjang film.'),
(398, 'The Tree of Life', 'POSITIF', 'DATA LATIH', 'Tidak terlalu berlebihan jika saya kemudian menyebut The Tree of Life adalah mahakarya agung, sebuah puisi bergerak, perjalanan spiritual dari seorang pujangga hebat bernama Terrence Malick yang dibalut dengan teknis sinematik nyaris sempurna.'),
(399, 'The Troll Hunter', 'POSITIF', 'DATA LATIH', 'Karya Andre Ovredal  satu ini layak diberi acungan dua jempol, bukan hanya karena sukses menghadirkan premis yang orisinal dan menyegarkan, namun juga bagaimana Ovredal mengemasnya dengan apik, serealistis mungkin dan sangat menghibur.'),
(400, 'The Tunnel', 'POSITIF', 'DATA LATIH', 'Saya harus mengakui bagaimana usaha keras para sineas dan para pemainnya dalam menyajikan The Tunnel ini  serealistis mungkin, ya, mereka sudah melakukannya dengan cukup baik, termasuk menyelipkan beberapa sesi wawancara dari para pelakunya yang terlibat langsung guna memperkuat kesan real film berdurasi 90 menit ini.'),
(401, 'The Voices', 'POSITIF', 'DATA LATIH', 'Dengan menampilkan sajian multi genre, The Voices jelas adalah film yang penuh resiko buat sutradara manapun. Tidak mudah menggabungkan hal-hal serius dalam sebuah thriller psikologis seperti masalah kejiwaan dan pembunuhan dengan elemen-elemen romansa, komedi dan melodrama. Itu seperti perpaduan busana yang tak cocok namun tetap menggoda.'),
(402, 'The Walk', 'POSITIF', 'DATA LATIH', 'Ada perekrutan anggota, perencanaan matang dan tentu saja eksekusi yang semuanya berhasil disajikan dengan cara yang menarik dan menghibur, tetapi momen puncak The Walk ada pada 15 menit menjelang akhir, momen ketika Petit berada di atas kawat baja, berada di puncak dunia katanya, ya, itu adalah momen luar biasa, mungkin salah satu yang terbaik tahun ini.'),
(403, 'The Wall', 'POSITIF', 'DATA LATIH', 'Selain visual vegetasi cantik ia juga dihiasi oleh banyak metafora dan momen emosional depresif yang terjadi dalam suasana intens dan kelam. Performa solo Gedeck yang solid menguasai keseluruhan panggung juga menjadi alasan kenapa The Wall bisa tampil memesona. Melihat karakternya tumbuh, beradaptasi, berinteraksi dengan hewan peliharaannya yang “berakting” sama bagusnya itu adalah pengalaman paling mengesankan menonton The Wall selain menikmati indahnya visual puitis yang disuguhkan.'),
(404, 'The Way He Looks', 'POSITIF', 'DATA LATIH', 'Tidak ada momen yang terlewat frontal, sebaliknya Ribeiro dengan lembut memperlakukan narasi dan karakternya selembut dan sehangat orangtua Leonardo memperlakukan putra semata wayangnya itu.'),
(405, 'The Witch', 'POSITIF', 'DATA LATIH', 'Kekuatan The Witch adalah bagaimana Eggers mampu membangun dunianya dengan sangat-sangat kuat sejak menit-menit pertama ia bergulir. Pemilihan palet warna kelabu mendominasi visualnya, dikombinasikan dengan scoring garapan Mark Korven yang menyayat menghasilkan aroma suram pekat.'),
(406, 'The Wolf of Wallstreet', 'POSITIF', 'DATA LATIH', 'The Wolf of Wall Street menunjukkan kehandalan Scorsese dalam mengeksekusi sebuah premis sederhana dengan teknis sinematis tingkat tinggi yang eksplosif dan over dramatis, ya itu sudah jelas. Dan bersama naskah gubahan Terence Winter (Broadwalk Empire), Scorsese tahu benar bagaimana menghadirkan sebuah biopik bagus namun secara bersamaan ia juga sukses mengeksploitasi sub teks tentang hedonisme total.'),
(407, 'The World’s End', 'POSITIF', 'DATA LATIH', 'Sebagai bagian penutup dari sebuah trilogi, The World’s End jelas diharapkan menjadi sebuah closure hebat untuk dua film sebelumnya, dan ia memang berhasil menjadi sebuah akhir yang bagus meskipun kualitasnya sedikit masih berada di bawah Shaun of the Dead yang punya tema serupa.'),
(408, '2014', 'NEGATIF', 'DATA LATIH', 'Saya tidak bisa memaafkan apa yang terjadi di 20 menit akhir. Ya, itu seperti sebuah lawakan besar dan konyol, sekonyol ketika 2014 masih menggunakan karakter banci untuk mengeksploitasi beberapa momen komedinya.'),
(409, '22 Jump Street', 'NEGATIF', 'DATA LATIH', 'Apa yang tersaji di sini menjadi membosankan, tidak hanya di plot yang minim kejutan namun juga kadar komedi yang bisa dibilang tidak segila dan sesegar seri pertamanya.'),
(410, '300: Rise of an Empire', 'NEGATIF', 'DATA LATIH', 'Sayang, jika kamu mengharapkan itu maka bersiaplah akan kecewa. Ya, memang ada proses bagaimana salah satu pemimpin Persia paling disegani itu terlahir kembali dari api dendam, tetapi ya, hanya sebatas perkenalan basa-basi biasa tanpa kedalaman, dan porsinya sama seperti yang terjadi di film pendahulunya'),
(411, '3SUM', 'NEGATIF', 'DATA LATIH', 'Saya juga merasa ketegangan dan kesan claustrophobic kurang terjaga setelah menonton kedua kalinya. Beberapa adegan juga terasa agak terlalu panjang dan beberapa lainnya terlalu repetitif.'),
(412, '47 Ronin', 'NEGATIF', 'DATA LATIH', 'Ini benar-benar terlihat medioker, tampak jelas seperti hasil pekerjaan seorang sutradara first timer yang hanya mencoba bermain aman dengan dukungan naskah yang sama lemahnya termasuk plotnya yang berjalan terseok-seok dan melelahkan apalagi ketika mereka mencoba memasukkan elemen romansa di dalamnya yang lagi-lagi tidak berhasil meninggalkan kesan.'),
(413, 'A Good Day to Die Hard', 'NEGATIF', 'DATA LATIH', 'A Good Day to Die Hard tampak benar-benar seperti sekuel sejati Die Hard, tetapi kamu hanya menemukan bagian terbaiknya muncul dan menghilang terlalu cepat digantikan dengan aksi-aksi membosankan dan naskah yang menggelikan.'),
(414, 'A Lonely Place to DIe', 'NEGATIF', 'DATA LATIH', 'Julian Gilbey memutuskan untuk membanting kemudi ceritanya dengan memasukkan dua penculik sebagai lawan mereka, meninggalkan lanskap pegunungan dan suasana pendakian dan mengubahnya menjadi sebuah slasher medioker yang mudah diprediksi ke mana arahnya lengkap dengan segala permainan kucing-tikusnya.'),
(415, 'A Nightmare on Elm Street', 'NEGATIF', 'DATA LATIH', 'Plot klise dan membosankan untuk ukuran film horor, terlebih bagi anda yang sudah menyaksikan versi aslinya. Minimnya jam terbang sutradara Samuel Bayer yang biasanya hanya menggarap video klip musik ini, dan yang paling parah adalah hilangnya sosok Englund semakin menambah ‘dosa’ Platinum Dunes. Semoga saja suatu saat Michael Bay bertobat untuk tidak lagi menghancurkan horror-horror klasik..'),
(416, 'Adore', 'NEGATIF', 'DATA LATIH', 'Bukan tanpa kekurangan, Adore dihiasi banyak dialog-dialog chessy,  beberapa momen emosinalnya terasa terlalu diberat-beratkan  dan ketika ia seharusnya bisa berhenti disatu titik,  Fontaine malah memilih untuk melanjutkan lagi lebih lama untuk memperpanjang dan memperjelas sesuatu yang sebenarnya tidak terlalu perlu.'),
(417, 'After Earth', 'NEGATIF', 'DATA LATIH', 'Semuanya terasa percuma ketika  Shyamalan tampak tidak terlalu percaya diri untuk membawanya ke mana. Yang terjadi kemudian After Earth malah terjebak antara drama tanpa emosi dan fiksi ilmiah yang kurang garam.'),
(418, 'After Life', 'NEGATIF', 'DATA LATIH', 'Overall, premis yang sangat menarik namun sayang tidak dibarengi dengan kekonsistenan cerita, sehingga membuat After Life harus menderita di paruh akhir, cerita menjadi kendur dan kurang greget.'),
(419, 'Allied', 'NEGATIF', 'DATA LATIH', 'Sulit memang untuk dibuat tak kecewa dengan hasil akhir Allied, apalagi melihat lemahnya naskah hingga plotnya yang kadang-kadang terasa begitu artifisial.'),
(420, 'Altitude', 'NEGATIF', 'DATA LATIH', 'Harus diakui secara teknis Altitude tampil mengecewakan, tidak jauh berbeda dari yang ditampilkan kebanyakan film-film kelas dua lainnya, lemah hampir di semua bagiannya.'),
(421, 'And Soon the Darkness', 'NEGATIF', 'DATA LATIH', 'And Soon the Darkness malah terjebak dalam sebuah thriller ‘kosong’ tanpa ‘jiwa’, bisa dibilang seperti menyaksikan sebuah sajian thriller kelas ‘B’ murahan lengkap dengan karakter-karakter bodoh, plot dangkal dan akting yang buruk.'),
(422, 'Annabelle', 'NEGATIF', 'DATA LATIH', 'Dosa besar Annabelle sebenarnya ada pada kualitas naskah garapan Gary Dauberman yang ngaco.  Oh, ya, saya belum menyebut bagaimana akhirnya. Percayalah, ending Annabelle adalah salah satu ending paling konyol dalam sejarah perhororan dunia.'),
(423, 'ATM', 'NEGATIF', 'DATA LATIH', 'Seperti kebanyakan thriller medioker lainnya, ATM punya cerita yang kelewat corny serta tidak luput dari rentetan kebodohan demi kebodohan, termasuk tipikal karakter pembunuh tanpa motif yang sok misterius dengan jaket tebal ala pembunuh dalam slasher Urban Legend.'),
(424, 'Attack on Titan', 'NEGATIF', 'DATA LATIH', 'Tidak semua terlihat keren, beberapa terkesan bodoh dan memaksa, namun overall, buat adegan aksinya, Attack on Titan tidak mengecewakan. Tetapi sayang di luar itu drama antar manusianya terkesan memble. Tidak ada pengembangan karakter, tidak ada konflik berarti di antara mereka dan kemudian memaksakan elemen cinta segitiga yang tanggung malah membuatnya semakin kacau dan membosankan.'),
(425, 'Bad Teacher', 'NEGATIF', 'DATA LATIH', 'Sungguh saya tidak pernah bisa mengetahui apa yang ingin disajikan di sini selain sebuah premis menarik dengan cerita kosong, super dangkal, rentetan pertunjukan kebodohan demi kebodohan dan wajah menyebalkan Diaz yang mendominasi di sepanjang 92 menit.'),
(426, 'Badoet', 'NEGATIF', 'DATA LATIH', 'Tidak ada yang salah memang mendaur ulang premis basi, tetapi ini seperti membuang percuma potensinya, belum lagi saya menyebut beberapa plot hole mencolok yang cukup mengganggu.'),
(427, 'Bangsal 13', 'NEGATIF', 'DATA LATIH', 'Sepertinya Ody terkesan terlalu serakah, tidak masalah jika kemudian hasilnya bisa bagus, nah ini malah sebaliknya. Lambat, berantakan, terlalu gelap, sok misterius dengan plot hole sebesar gajah di dalamnya.'),
(428, 'Battle: Los Angeles', 'NEGATIF', 'DATA LATIH', 'Sayang apa yang terjadi kemudian rupanya juga tidak berakhir sesuai ekspektasi kebanyakan orang, karena faktanya Battle: Los Angeles juga bukanlah sebuah film yang kelewat istimewa, tidak sedikit penonton dan kritikus-kritikus dunia yang terhormat mencapnya sebagai sebuah film buruk.'),
(429, 'Battleship', 'NEGATIF', 'DATA LATIH', 'Berg bisa jadi telah berhasil melakukan apa yang bisa dicapai Bay termasuk untuk bagian yang terburuknya macam kualitas naskah yang menyedihkan, rentetan plot hole, karakter-karakternya yang dangkal, rangkaian momen super berisik yang sayangnya, membosankan.'),
(430, 'Bel Ami', 'NEGATIF', 'DATA LATIH', 'Karakter Georges Duroy semestinya punya kedalaman dan kompleks, tapi yang ada, Pattinson malah menjadikannya seperti ‘gigolo’ bodoh murahan di sepanjang film. Salahkan juga naskah yang ditulis Rachel Bennette. Seperti yang sudah saya bilang Bel Ami punya potensi yang kemudian dirusak dengan kualitas cerita dan dialog-dialog dangkalnya yang membosankan.'),
(431, 'Bidadari Terakhir', 'NEGATIF', 'DATA LATIH', 'Meski Priesnanda Dwisatria selaku penulis naskah berupaya untuk memodifikasi sana-sini lembaran novel Agnes agar tidak sampai berakhir menjadi melodrama yang terlalu dangkal, namun memang susah untuk bisa mengangkatnya lebih tinggi lagi.'),
(432, 'Big Eyes', 'NEGATIF', 'DATA LATIH', 'Mengecewakan? Tentu saja Big Eyes terasa mengecewakan untuk film kelas Burton, apalagi Burton sebenarnya punya modal cerita bagus ketika menyorot komentar sosial tentang posisi perempuan di dekade ''60. Masalahnya Big Eyes seperti nyaris tidak punya keistimewaan lain.'),
(433, 'Billy Lynn''s Long Halftime Walk', 'NEGATIF', 'DATA LATIH', 'Alwyn yang tergolong hijau di Hollywood seakan kewalahan dan terlihat amatir saat harus beradu akting dengan nama-nama yang lebih berpengalaman. Adegan-adegan spiritual yang menyertakan Diesel juga sekan mentah dan tak relevan dengan plot utamanya. Begitu pula saat plot dialihkan pada acara pertandingan football imitasi, semuanya terlihat tidak penting, membosankan dan dituturkan dengan bertele-tele.'),
(434, 'Blackhat', 'NEGATIF', 'DATA LATIH', 'Tidak hanya gagal di naskah, Blackhat malah bisa dibilang nyaris kacau di semua elemennya. Belum lagi saya menyebut pengembangan karakternya yang nyaris nol. Memang Mann masih menampilkan semua ciri khasnya seperti pengunaan beberapa sudut kamera dinamis yang ditambah dengan editing cepat, tetapi semuanya terlihat sudah mulai usang dan tidak bertenaga, bahkan di beberapa adegan aksinya terkesan seperti merupakan versi medioker dari apa yang pernah dilakukannya di film-filmnya sebelumnya. '),
(435, 'Blended', 'NEGATIF', 'DATA LATIH', 'Banyak olok-olokan slapstik yang sebenarnya tidak terlalu lucu, pesan-pesan kacau dan maksa tentang bagaimana menjadi orangtua dengan terlebih dahulu mengejek kelakuan anak-anak mereka, romansa yang tidak terlalu terasa romantisnya untuk ukuran romcom sebelum menutupnya dengan momen-momen cheesy dengan ending klise. '),
(436, 'Blind', 'NEGATIF', 'DATA LATIH', 'Kondisi psikologis Soo-Ah yang merasa bersalah atas kecelakaan yang membuat adiknya terbunuh tidak memberikan pengaruh terlalu besar terhadap jalan ceritanya, yang ada malah membuatnya terlihat sedikit ‘cengeng’ terlebih untuk ukuran sebuah crime thriller, belum lagi diperparah paruh keduanya yang mengalami penurunan kualitas, dari satu jam pertama yang cerdas berubah menjadi sebuah thriller slasher corny yang tertebak tanpa sebuah penyelesaian yang bagus membuat Blind menjadi kurang greget di satu jam terakhirnya.'),
(437, 'Brooklyn''s Finest', 'NEGATIF', 'DATA LATIH', 'Cerita yang disajikan masih terkesan dangkal dan predictable khususnya pada bagian ending. Don Cheadle juga sebenarnya juga bermain cukup baik, sayang cerita miliknya terbilang biasa-biasa saja, terlalu banyak percakapan yang bertele-tele yang mungkin saja membuat penontonnya bosan. Richard Gere dan kisahnya mungkin yang bisa dibilang paling buruk.'),
(438, 'Bullet to the Head', 'NEGATIF', 'DATA LATIH', 'Bullet to the head adalah bagaimana untuk kesekian kalinya Sly berada di film yang salah. Kharisma besarnya jelas membantunya untuk menjadi daya tarik terbesar buat penontonnya untuk berbondong-bondong melihat sang Rambo kembali lagi terbang solo di layar lebar, tetapi tanpa bantuan teman-temannya Stallone terlihat begitu kepayahan dengan naskah yang lemah dan alur yang membosankan.'),
(439, 'Burning Bright', 'NEGATIF', 'DATA LATIH', 'Sayang memang ketidak becusan Brooks menjaga konsistensi yang sudah dibangun harus dirusak dengan banyaknya momen-momen tidak masuk akal yang terlalu dipaksakan. Andai saja Burning Bright dipegang oleh sutradara lain yang lebih kompeten tentu saja hasilnya bisa jauh lebih baik dari sekarang, tidak hanya menjadi sebuah thriller yang hanya meninggalkan premis menariknya semata'),
(440, 'Camp X-Ray', 'NEGATIF', 'DATA LATIH', 'Yang cukup mengganggu adalah bagaimana ketidak konsistenan yang dilakukan Sattler di akhir-akhir film. Itu seperti sebuah blunder yang bisa saja merusak apa yang sudah dibuatnya dengan baik sejak awal. Ya, sayang memang Sattler harus sedikit mencederai debutnya dengan bermain ‘curang’ untuk menguatkan pesan tetang kemanusiaannya meskipun sebenarnya juga tidak sampai benar-benar menghancurkannya.'),
(441, 'Cargo', 'NEGATIF', 'DATA LATIH', 'Entah kenapa Engler dan Etter pada kenyataannya tidak mampu menjaga ritme ceritanya dengan baik, membuat penontonnya terjebak dalam kebosanan dengan alurnya yang bertele-tele dan terkesan dipanjang-panjangkan serta membuang percuma sisi teknis yang sudah dikemas dengan sangat baik. Pada akhirnya Cargo menjadi tidak lebih dari sebuah thriller medioker yang dengan mudah dilupakan oleh penontonnya.'),
(442, 'Cars 2', 'NEGATIF', 'DATA LATIH', 'Kali ini para penggemar animasi pixar harus menyaksikan pertama kalinya film Pixar mendapat tomat busuk pertama di website rottentomatoes, wow ! Bayangkan orang dewasa penggemar Pixar berbondong bondong ke bioskop tanpa membawa anaknya, berharap cerita menyentuh dan penuh adegan emosional namun ternyata film ini memang diperuntukkan untuk anak-anak! Benar-benar di luar dugaan tapi inilah yang terjadi.\r\n'),
(443, 'Chappie', 'NEGATIF', 'DATA LATIH', 'Chappie memang punya konsep usang yang telah dimodifikasi sana-sini, namun masalah terbesar Chappie bukan karena premis familiernya yang sudah bolak-balik di pakai atau template Blomkamp yang itu-itu saja, namun ada pada kualitas naskahnya itu sendiri yang ditulis Blomkamp bersama Terri Tatchell. Memanjangkan narasinya dari sebuah film pendek menjadi feature film itu jelas penuh resiko, salah salah akan merusak dan sayangnya ini yang terjadi pada Chappie. Entah mungkin karena saya yang terlalu sok kritis, tetapi melihat bagaimana narasi olahan Blomkamp buaf film panjang Tetra Vaal itu terkesan sangat ‘compang-camping’ dan kacau. '),
(444, 'Chloe', 'NEGATIF', 'DATA LATIH', 'Apa yang ditampilkan Chloe selama 96 menit ini rupanya juga tidak jauh berbeda dari formula-formula erotic thriller lawas. Bedanya cerita yang ditampilkan dalam Chloe ini terlalu lemah , predictable dan terkesan flat, bahkan jauh sebelum klimaks akhir muncul, penonton pun sudah dapat mengetahui apa yang akan terjadi nanti. ');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(445, 'Your Highness', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya Your Highness tidak lebih dari komedi dangkal, tidak terlalu jauh dengan komedi-komedi lain yang judulnya berakhiran ‘Movie’. Ia terlihat jorok, kotor dan menjijikkan di saat bersamaan. Yah, cukup mengejutkan mengetahui film ini dibuat oleh sutradara yang pernah menghasilkan drama sekelas All the Real Girls dan Snow Angels. Ya, sungguh mengecewakan.'),
(446, 'Wrath of the Titans', 'NEGATIF', 'DATA LATIH', 'Harus diakui untuk kualitas naskahnya, ia masih sama buruknya dengan pendahulunya, tapi toh, sekali lagi hanya orang-orang bodoh yang kemudian ribut mempermasalahkan segala tetek bengek plot dan kedalaman ceritanya yang jelas-jelas memang sengaja di nomor sekiankan.'),
(447, 'Wild Card', 'NEGATIF', 'DATA LATIH', 'Untuk sebuah film yang mengandung kata “Wild” di dalamnya, Wild Card tidak sampai seliar itu, malah bisa dibilang ia adalah salah satu film aksi Statham yang ‘jinak’ dengan sekuens action yang meskipun cukup bad-ass tetapi bisa dihitung jari sebelah tangan. Dan untuk film yang mengandun kata “Card” di dalamnya, Wild Card walaupun gagal menyajikan dunia judi yang mendalam, setidaknya saya masih menikmati bagaimana seorang Jason Statham bermain black jack dengan gayanya yang keren.'),
(448, 'When In Rome', 'NEGATIF', 'DATA LATIH', 'Klise…….adalah kata yang paling pas untuk mengambarkan rom-com satu ini. Entah kenapa 4 dari 5 film-film bergenre komedi romantis yang diproduksi Hollywood akhir-akhir ini jarang sekali ada yang menampilkan sesuatu yang baru? selalu dan tidak pernah bosan-bosannya terjebak dalam formula yang itu lagi-itu lagi. Walaupun film-film tersebut nampak terlihat berbeda diawalnya namun toh ujung-ujungnya selalu berakhir sama, happy ending ala Hollywood yang predictable. Hal yang sama juga dapat kita temui pada When In Rome. Drama komedi romantis hasil garapan sutradara sekaligus penulis Mark Steven Johnson yang juga pernah menggarap Ghost Rider bersama Nicholas Cage. Meskipun memasukan sedikit elemen-elemen magic dan setting indah kota Roma (yang ternyata hanya ditampilkan 20% dari keseluruhan film) toh tidak terlalu banyak dapat menolong film ini untuk jatuh dalam ‘jurang’ ke klise-an.\r\nSeperti belum cukup, dialog-dialognya yang “jayus” dan beberapa lelucon slapstik nan garing seakan-akan melengkapai derita film ini. Bahkan duet Kristen Bell-Josh Duhamel sama sekali tidak terasa chemsitry-nya sebagai dua pasangan yang saling jatuh cinta. Dan puncaknya tarian-tarian ‘aneh’ di penghujung film semakin terasa sangat ‘pas’ menutup salah satu kisah komedi romantis terburuk tahun 2010 ini.'),
(449, 'What If', 'NEGATIF', 'DATA LATIH', 'Yang menjadi masalah dari tema friendzone-nya What If sebenarnya sama saja dengan film-film berpremis sama. Adalah bagaimana kedua karakter utamanya menyiksa diri mereka sendiri dengan menyangkal perasaan cinta masing-masing yang sebenarnya sudah tumbuh sejak hari pertama mereka bertemu. Di satu sisi Wallace yang galau jelas tidak ingin kehilangan Chantry dengan merusak hubungan Chantry dan Ben, karena ia pun punya pengalaman pahit yang sama ketika kekasihnya berselingkuh, sementara Chantry pun tidak ingin menjadi pihak yang disalahkan karena keputusannya untuk meyukai Wallace lebih dari sekedar teman. Jadi di sisa durasinya penonton akan diajak menyaksikan tarik ulur hubungan Wallace-Chantry yang diwakili dengan banyak momen-momen manis, termasuk dintaranya insiden kamar ganti pakaian sampai bermalam tanpa busana di pinggir pantai. Sayang setiap kemanisan itu terasa hambar bukan karena hanya plotnya yang mendadak klise namun juga karena chemistry lemah dari Radcliffe dan Kazan.'),
(450, 'Wedding Dress', 'NEGATIF', 'DATA LATIH', 'Cerita yang terlalu umum dan sederhana, plot jelas tertebak sejak di sepertiga awal film, disaat Kwon Hyeong-jin sudah menghadirkan penyakit mematikan buat karakter Go-eun. Sisanya kita akan diajak melihat rangkaian adegan dramatis nan corny bagaimana Go-eun melakukan ‘penebusan dosanya’ untuk membahagiakan So-ra semaksimal mungkin dengan memberikan apapun yang diinginkan putrinya itu.'),
(451, 'Water for Elephants', 'NEGATIF', 'DATA LATIH', 'Terlalu banyak konflik disini yang ingin diangkat tanpa diimbangi dengan pengolahan yang baik. Ini sebuah film dengan latar belakang Great Depression, tapi herannya penonton sama sekali tidak melihat ekspresi tertekan dari para penonton sirkus, atau bagaiman kondisi kesulitan masyarkat pada saat itu. Ini adalah sebuah kisah cinta segi tiga (segi empat jika anda mau memasukan Rosie si gajah tua pintar didalamnya) yang terlalu datar, sedatar chemistry yang dibangun Pattinson dan Witherspoon yang juga menjadi salah satu titik terlemah film berbiaya $38 juta ini. Ini juga film tentang bagaimana manusia memperlakukan hewan dengan kejam seperti yang dilakukan August dalam memberlakukan Rosie yang tidak patuh kepadanya. Ya, banyak problematika disini yang ingin dituangkan sekaligus, masalahnya, tidak diselesaikan dengan cara elegan dan teralalu terkesan menggampangkan plus minim momen emosioal, menjadikan kisah Water for Elephants kurang berbobot dan harus menderita cukup banyak di bagian penting satu ini.'),
(452, 'Warcraft: The Beginning', 'NEGATIF', 'DATA LATIH', 'Apa yang disajikan Duncan Jones mungkin tidak istimewa secara premis, penonton awam hanya menganggap ini hanya sekedar sajian fantasi konvensional yang mengekor kebesaran franchise milik Peter Jackson itu meski mungkin mereka akan terhibur dengan aksi dan kekuatan visual efeknya yang betul-betul dimaksimalkan hingga menghasilkan gambar-gambar yang begitu cantik dengan segala tetek bengek efek CGI-nya yang keren, tetapi sekali lagi, dari mata awam, Warcfrat: The Beginning hanya menjadi sekedar film hiburan tanpa kesan apa-apa.'),
(453, 'Victor Frankenstein', 'NEGATIF', 'DATA LATIH', 'Masalah Victor Frankenstein ada pada penyutradaraan dan naskah yang tidak konsisten. Jujur, 20 menit pertamanya ia mampu menghadirkan sajian menarik melalui perkenalan karakternya dengan cepat dan efektif bersama set London yang kotor dan suram yang seakan-akan menegaskan aroma gotik dari novelnya, namun dalam perjalanannya daya tarik mulai luntur seiring ketidakmampuan McGuigan menjaga ritmenya. Narasinya sendiri juga terkesan terburu-buru untuk mencapai tujuan utama membuat mayat hidup, melupakan bentukan jalinan karakter yang sebenarnya bisa dieksplorasi lebih jauh lagi, ujung-ujungnya tidak jauh dari action hingar bingar yang membuang potensinya menjadi drama horor yang kompleks dan menarik. Sementara beberapa sub-plot tidak penting seperti kisah percintaan Igor dan gadis akrobat, Lorelei (Jessica Brown Findlay) serta penyelidikan yang dilakukan detektif Roderick Turpin (Andrew Scott) sebenarnya bisa saja dienyahkan dengan mudah tanpa mengganggu plot utamanya.'),
(454, 'Veronica Mars', 'NEGATIF', 'DATA LATIH', 'ika kamu penonton baru, tidak usah protes jika Veronica Mars tidak sesuai ekspektasimu akan sebuah neo-noir mystery (seperti kata wikipedia), yang menghadirkan sajian misteri solid dan suspense tingkat tinggi, bisa dibilang Thomas lebih memfokuskan semuanya pada momen reuni dan nostalgianya ketimbang repot-repot harus memikirkan sebuah narasi misteri yang kuat, toh, versi televisinya sebenarnya juga lebih banyak berkutat pada urusan remaja dan komedi dari dialog-dialognya penuh humor cerdas, tidak pernah punya kasus atau misteri yang benar-benar kuat. Hasilnya memang terlihat murahan dan terlalu tv series sentris untuk ukuran film yang dibuat untuk layar lebar. Tetapi sepertinya memang itu tujuannya, sebuah penghormatan buat versi televisinya dan tentu saja penghormatan buat para fans fanatiknya.'),
(455, 'Vehicle 19', 'NEGATIF', 'DATA LATIH', 'meskipun kadar thrill-nya berhasil dijaga dengan baik dengan menawarkan banyak adegan-adegan cepat , namun pada akhirnya Vehicle 19 terjangkit dengan banyak plot hole menganggu, dialog-dialog cheesy, plot yang familiar dan klimaks yang tanggung di mana sedikit banyak sudah melukai keasikan menonton, belum lagi saya menyebut karakter menyebalkan yang dibawakan Walker.'),
(456, 'Underworld: Blood Wars', 'NEGATIF', 'DATA LATIH', 'Bukan berarti tidak ada sesuatu yang baru di sini, ada, hanya saja bukan sesuatu yang sampai bisa membuat Blood Wars menjadi seri yang lebih istimewa ketimbang pendahulunya, tidak dengan kehadiran Tobias Menzies sebagai komandan baru para lycan atau Lara Pulver sebagai Semira yang licik,  termasuk kejutan di ujung cerita yang tampak sekali terkesan terlalu dipaksakan tanpa memberi penjelasan yang cukup.'),
(457, 'Underworld: Awakening', 'NEGATIF', 'DATA LATIH', 'Soal bagaimana kualitas naskahnya sebetulnya tidak usah dipikirkan terlalu jauh, toh, franhcise Underworld memang tidak pernah menghadirkan sebuah jalinan kisah yang luar biasa tidak juga naskah Awekening yang bahkan sampai ‘dikeroyok’ 4 orang ini, malah kalau mau jujur ini menjadi seri Underworld dengan cerita yang paling buruk dan terlihat terlalu memaksa untuk membuatnya tetap berlanjut ke seri-seri selanjutnya.'),
(458, 'Tuyul Part 1', 'NEGATIF', 'DATA LATIH', 'Pakemnya sendiri memang tidak menawarkan sesuatu yang baru. Formulanya masih berada di wilayah horor generik yang terlalu mengandalkan teror audio-visual basi dan kaget-kagetan usang plus beberapa adegan yang terlihat konyol dan bodoh. Lihat saja rentetan adegan seramnnya yang seperti masih tidak percaya diri ketika harus selalu ditemani dengan scoring horor ‘jrang-jreng’ berlebihan yang hasilnya membuat saya malah terdengar menganggu.'),
(459, 'Tusk', 'NEGATIF', 'DATA LATIH', 'Smith memilih untuk menghabiskan banyak durasinya melalukan flash back yang melibatkan sahabat sekaligus rekan kerjanya, Teddy Craft dan kekasih cantiknya, Ally (Génesis Rodríguez), masalahnya, itu bukan kilas balik yang penting. Kebanyakan hanya diisi percakapan tidak penting dari tiga karakternya yang sebenarnya dengan mudah dipersingkat. Lalu transformasi habis-habisan Wallce menjadi “Mr.Tusk” tidak didukung konstum dan make-up meyakinkan, sehingga imbasnya, Tusk terkesan menjadi horor “bodoh” yang murahan.'),
(460, 'Trespass', 'NEGATIF', 'DATA LATIH', 'Untuk film yang dibintangi oleh duet maut kelas A, Trespass juga mengecewakan, khususnya untuk Nicolas Cage, sorry pak, anda sungguh sangat annoying dan cerewet disini, bahkan saya berharap para perampok itu seharusnya membunuh karakter anda secepat mungkin. Sedangkan Nicole Kidman sendiri sebenarnya juga tidak terlalu bersinar, ia tetap cantik seperti biasa, dan untuk artis sehebat dirinya, akting  terburuk pun masih tetap enak untuk dilihat.'),
(461, 'Transformers: Dark of the Moon', 'NEGATIF', 'DATA LATIH', 'Meskipun Masih menggunakan formula yang sama dari film-film sebelumnya Michael Bay pandai dalam mempertunjukan orkhestra ledakan demi ledakan di filmnya, durasi 150 menit tidak membuat film ini kehilangan alur meskipun masih mubazir dengan adegan buang-buang waktu seperti saat Sam Witwicky sedang mencari Pekerjaan, dan juga penampilan perdana model Victoria Secret Rossie Huntington dengan maksud menggantikan Megan Fox, tapi saya rasa tidak membawa pengaruh apa -apa di sini, saya pun masih lebih memilih Megan Fox, penampilan aktor kelas atas macam John Malkovich pun juga tidak banyak membantu, dan yang paling menggangu adalah peran Ken Jeong yang lebih menghancurkan suasana ketimbang komedinya meskipun tampil secuil saja di sini. Yahh pada akhirnya mungkin film ini adalah akhir dari Franchise Transformers, dan mungkin saja film ini akan mudah dilupakan penontonnya,'),
(462, 'Transformers: Age of Extinction', 'NEGATIF', 'DATA LATIH', 'Dengan durasi 165 menit, Age of Extinction menjadi terasa sangat lama, paling lama dibandingkan seri-seri pendahulunya. Subplot percintaanya digantikan dengan hubungan ayah-anak tidak memberi sesuatu yang benar-benar berarti di naskahnya yang masih digarap Ehren Kruger, kualitasnya masih sama dangkalnya, masih sama membosankannya dengan segudang plot hole mengganggu. Dan tidak lupa, selalu ada komedi di sela-sela peperangan para roboat yang untung saja kali ini tidak sampai senorak Dark of The Moon yang seperti ingin menjadi film komedi ketimbang aksi.'),
(463, 'Transendence', 'NEGATIF', 'DATA LATIH', 'Tetapi debutan tetaplah debutan, dan meskipun Transcendence terasa solid di  konsep dan visualnya ia masih punya banyak kekurangan mendasar. Selain menyia-nyiakan beberapa cast-nya macam Morgan Freeman dan Cillian Murphy, yang jelas terlihat adalah bentukan plotnya yang berjalan lambat, terutama pada pembukaan sampai 20-30 menit selanjutnya, yap, itu sedikit membosankan dan minim emosi belum lagi premisnya yang sedikit berat. '),
(464, 'Tower Heist', 'NEGATIF', 'DATA LATIH', 'Tentu saja yang namanya komedi pasti banyak rentetan kejadian konyol tak terduga, begitu juga Tower Heist. Sayang menginjak 1/3 akhir terlalu banyak adegan-adegan serba maksa, seperti terlalu diatur untuk menjadi lucu, termasuk ‘lubang’ besar di sana sini yang mungkin membuat penontonnya mengerutkan dahi. Yah, tapi sekali lagi karena ini komedi anda harus memaklumi kalau ia berlaku bodoh, sengaja ataupun tidak.'),
(465, 'Tower Block', 'NEGATIF', 'DATA LATIH', 'Jujur saja penyajian yang dihadirkan oleh James Nunn dan Ronnie Thompson terasa kurang matang, masih banyak sebenarnya potensi-potensi untuk membuatnya menjadi jauh lebih baik dan lebih cerdas lagi. Hasilnya, apa yang terjadi mungkin tidak akan membekas terlalu lama di ingatanmu setelah beberapa hari kamu menontonnya.'),
(466, 'Tomorrowland', 'NEGATIF', 'DATA LATIH', 'Brad Bird seperti tidak mampu mengolah ide besar yang dimilikinya menjadi sebuah penceritaan yang mulus meskipun sebenarnya ia sudah punya dasar cerita yang kuat dengan banyak potensi-potensi yang bagus. Terkadang ia begitu mudah dimengerti namun terkadang ia terasa susah dicerna, apalagi buat penonton muda yang tidak memahami konsepnya.\r\nBeruntung garapan teknisnya yang luar biasa memanjakan mata mampu sedikit banyak menambal kekurangan di penceritaannya yang setengah matang itu. Bird memang dikenal piawai menghadirkan sekuens aksi yang memukau, tidak terkecuali di sini. Didukung dengan CGI mahal, Bird bersama timnya berhasil menciptakan Tomorrowland dunianya sendiri, jauh lebih besar dari wahana permainannya sendiri. Pace-nya yang sedikit tidak konsisten mungkin membuat beberapa bagiannya terkesan terseok-seok dan membosankan,'),
(467, 'To the Wonder', 'NEGATIF', 'DATA LATIH', 'Tidak ada plot yang kuat, narasinya tampak mengambang di dalam ‘akuarium’ yang indah bersama ‘ikan-ikan’ yang hampa, membuatnya seperti video klip indah yang panjang dengan mood dan momen yang lebih intim nan personal. Ya, mungkin saja kali ini Malick terlalu cepat merilis karyanya, mungkin butuh 7 tahun lagi untuk membuat To The Wonder lebih sempurna.'),
(468, 'This Means War', 'NEGATIF', 'DATA LATIH', 'Ini memang mainan sutaradara Joseph McGinty Nichol atau biasa yang dikenal dengan McG. Ya, This Means War seperti Charlie’s Angels versi macho, semua tentang komedi berbalut spionase cepat ala McG yang tidak terlalu serius, tapi bedanya, kali ini ia mencoba memasukan bumbu romansa dan bromance di dalamnya, membiarkan Bane dan Kapten Kirk saling ‘bunuh’ untuk memperebutkan si blonde, Witherspoon. yang sudah terlihat terlalu tua untuk bermain di genre ini. Hasilnya? Tidak terlalu buruk, seperti kebanyakan romcom, This Means War ringan dan cukup menghibur walaupun pada kenyataannya ia sama bodohnya dengan lainnya, tidak peduli ada nama Simon Kinberg yang pernah menghasilkan naskah Sherlock Holmes 2009 lalu.'),
(469, 'The Woman in Black', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya The Woman in Black tidak lebih dari sekedar horor rumah hantu konvensional yang tugas utamanya hanya satu, menakut-nakuti penontonnya sesering dengan trik-trik oldschool nya yang mungkin sudah sering kita lihat di puluhan film sejenis macam benda-benda bergerak sendiri, kelebatan bayangan, penampakan hantu wanita,  padahal jika mau, Watkins dan Goldman bisa saja memberi ruang lebih banyak untuk perkembangan karakter Radcliffe, toh, cerita Susan Hill sebenarnya sangat mendukung untuk memberikan penontonnya dengan kisah masa lalu karakter Arthur Kipps yang kelam atau menelusuri sedikit lebih jauh sejarah Eel Marsh House dan hantu bergaun hitam itu.'),
(470, 'The Wind Rises', 'NEGATIF', 'DATA LATIH', 'Dan dengan banyaknya pesawat terbang yang meliuk-liuk lincah di udara dengan setting langit biru Jepang era Showa berbalut scoring megah garapan komposer veteran langganan Ghibli, Joe Hisaishi, sedikit banyak mengingatkan saya pada Porco Rosso yang luar biasa itu, hanya saja, tidak ada cerita seru tentang pilot babi yang dikutuk di sini, digantikan dengan sesuatu yang lebih membosankan, cerita tentang hidup, ambisi, cita-cita dan romansa Jiro Horikoshi yang lambat dan datar.'),
(471, 'The Whistleblower', 'NEGATIF', 'DATA LATIH', 'Pada akhirnya The Whistleblower hanya menjadi sebuah thriller politik medioker yang akan dengan mudah terlupakan dikarenakan Kondracki gagal untuk memanfaatkan sebaik mungkin modal besar kisah nyata yang diberikan kepadanya, menjadikan film yang seharunya bisa menarik ini menjadi sedatar permukaan meja makan. Yah untung saja masih ada wajah cantik Rachel Weisz diantara muka-muka kasar pemain prianya, dan beberapa fakta mengejutkan tentang PBB dengan segala kedok perdamaian yang sering mereka agung-agungkan selama ini.'),
(472, 'The Wave', 'NEGATIF', 'DATA LATIH', 'Paruh pertamanya mungkin tidak sampai terlalu buruk, Uthaug menghabiskan waktunya untuk memperkenalkan tokoh utamanya termasuk keluarga dan pekerjaan membosankannya sebagai geologis pemantau longsor yang terakhir terjadi setengah abad lalu. Dari sini juga Uthaug memberi banyak informasi tentang deretan pegunungan indah namun rapuh Åkerneset beserta kondisinya yang sampai harus ditusuk besi-besi besar untuk menahan patahannya agar tidak sampai terjatuh ke Fjord. Ya, kita tahu apa yang terjadi selanjutnya ketika tidak ada yang mendengar periangatan sang jagoan utama, BOOM! Longsor pun terjadi, dan hanya ada waktu 10 menit buat ia menyelamatkan diri, keluarga dan orang-orang sekitar sebelum air bah datang dan menghancurkan segala yang dilewatinya. CGI tsunaminya sendiri tidak buruk, meski sajian yang ditunggu-tunggu itu hanya berlangsung cepat dan sebentar. Sayang setelah konflik semua menjadi tidak lebih baik. Tensinya menurun drastis plotnya menjadi sangat klise, kita tahu persis apa yang akan terjadi dan kenyataannya memang benar-benar sesuai perkiraan.'),
(473, 'The Warrior''s Way', 'NEGATIF', 'DATA LATIH', 'Yah, lupakan saja memang soal bagaimana kisahnya yang sebenarnya memiliki premis menarik untuk sebuah film action bisa di garap selemah ini. Sngmoo Lee tampaknya terlalu ‘rakus’ menghidangkan terlalu banyak menu konflik tanpa mampu ‘menghabiskan’ semuanya dengan bersih. Disamping itu juga terlalu banyak karakter menarik yang berpotensi untuk dikembangkan lebih jauh yang pada akhirnya malah terbuang percuma begitu saja, tidak lebih menjadi karakter penghibur, mengihisi kisah percintaan Yang dan Lynne yang membosankan, apalagi kisah roman picisan tersebut nyaris mendominasi keseluruhan film bedurasi 100 menit ini.'),
(474, 'The Visit', 'NEGATIF', 'DATA LATIH', 'Kalau mau jujur, momen-momen horor yang ditawarkan The Visit tidak sampai taraf sangat menakutkan, berbeda dengan karya-karya horor  mungkin kombinasi antara seram sakaligus konyol. Ya, susah untuk tidak bergidik, terbelalak sekaligus tertawa kecil melihat apa yang disaksikan Becca dan Tyler melalui lensa kamera mereka. Ya, Shyamalan tahu benar bagaimana cara bersenang-senang tanpa harus menghilangkan ensensi misterinya yang selalu menempel di setiap momen yang melibatkan keanehan yang ditunjukan oleh Nana dan Pop-Pop (panggilan buat kakek nenek Jamison), ini mungkin juga yang membuat The Visit menjadi terasa spesial dibanding film-film Shyamalan lain yang lebih terkesan serius.'),
(475, 'The Vatican Tapes', 'NEGATIF', 'DATA LATIH', 'Ya, sebenarnya masih ada momen-momen creepy di dalamnya, tetapi jumlahnya tak banyak bahkan levelnya bisa dibilang hanya sekedar  untuk menakut-nakuti anak ingusan. Misterinya tidak diperlakukan dengan baik, tidak ada permulaan yang jelas, tiba-tiba saja BOOOM! Semua terjadi. Memang ada sedikit penjelasan yang menyangkut latar belakang tokoh Angela yang kemudian dihubungkan dengan tema bilbical, tetapi tetap saja prosesnya tidak jelas.'),
(476, 'The Twilight Saga: Eclipse', 'NEGATIF', 'DATA LATIH', 'Eclipse adalah seri Twilight yang paling membosankan, bahkan dari New Moon yang dianggap paling buruk sekalipun. Adegan-adegan penawar kantuk seperti aksi peperangan antara para vampire dan warewolf muncul terlalu lama dan ternyata juga tidak sehebat yang digembar gemborkan sebelumnya, bahkan adegan tersebut hanya berlangsung sebentar. Memang Eclipse bukanlah film aksi, naif sekali jika kita mengarapkan banyak adegan-adegan pemicu adrenalin disini, namun memang harus diakui selama kurang lebih dua jam penonton akan disugguhi dialog-dialog mononton dan tidak berbobot yang keluar diantara 3 karakter utamanya entah apa memang seperti itu juga dialog-dialog yang terdapat dalam novelnya?'),
(477, 'The Tower', 'NEGATIF', 'DATA LATIH', 'The Tower tampaknya memang didesain sedemikian rupa dengan tujuan murni untuk hiburan tanpa harus melibatkan cerita yang kompleks. Jadi kamu hanya melihat bagaimana para manusianya berusaha bertahan hidup dikurang lebih dua jam durasinya sementara dukungan efek mahal dengan segela tetek bengek ketegangan dan aksi-aksi penyelamatan heroik yang mungkin terasa berlebihan kemudian memegang kendali sepenuhnya, dan tentu saja tidak lupa bumbu melodrama khas Korea kemudian diselipkan di dalamnya untuk memberikan sebuah luapan emosi ditengah kerusakan besar, sayang hal itu tidak terlalu bekerja dengan baik.'),
(478, 'The Tourist', 'NEGATIF', 'DATA LATIH', 'Naskah buruk, performa mengecewakan dari kedua pemainnya, tidak ada nya adegan yang benar-benar seru dan menegangkan membuat The Tourist seakan-akan menjadi sebuah action-thriller yang serba ‘nanggung’. Jika ada satu-satunya yang bisa dinikmati di sepanjang kurang lebih satu jam setengah ini mungkin adalah pemandangan Venesia. Ya, kota cinta nan Indah yang terletak di bagian utara Italia ini memang sukses diekspos habis-habisan oleh Donnersmarck dengan dibantu oleh sinematografer John Seale (Prince of Persia: The Sands of Time, Harry Potter and the Sorcerer’s Stone). Sisanya, yah, seperti yang sudah saya katakan, “tanggung”.'),
(479, 'The Suspect', 'NEGATIF', 'DATA LATIH', 'Super spy, balas dendam, aksi kejar-kejaran di atap-atap rumah dan pertarungan tangan kosong yang seru. Ya, susah untuk tidak merasakan efek de javu dengan franchise Jason Bourne, bahkan ia juga punya tone gelap dan banyak shaky cam ala Paul Greengrass dengan editing cepat dam scoring mendebarkan yang sayangnya, terasa lebih berantakan dan memusingkan. Plotnya sendiri sebenarnya tidak terlalu solid, bahkan dibandingkan dengan koleganya, The Berlin File yang mengusung tema sama, The Suspect terlihat terlalu dangkal, terlalu lama dan bertele-tele sepanjang 137 menit dan berakhir sedikit cengeng dibalik segala konspirasi politik, kemachoan dan konflik balas dendamnya.'),
(480, 'The Stepfather', 'NEGATIF', 'DATA LATIH', 'ujur saja pendekatan yang dilakukan film ini secara tidak langsung merusak film ini secara keseluruhan, karena siapa sebenarnya sosok David Harris sudah diperlihatkan dengan gamblang dari menit-menit awal sehingga kesan misteriusnya sudah berkurang. Selanjutnya bisa dibilang cerita film yang didistribusikan oleh Screen Gems ini sangat klise dan mudah sekali ditebak bahkan untuk endingnya sekalipun.'),
(481, 'The Sorcerer’s Apprentice', 'NEGATIF', 'DATA LATIH', 'The Sorcerer’s Apprentice sendiri sebenarnya tidak berbeda jauh dengan tipe-tipe film-film summer blockbuster Bruckheimer lainnya, penuh dengan segala kemewahan efek CGI yang memanjakan mata, adegan-adegan cepat yang dihiasi dengan aksi-aksi spektakuler, dan mengandalkan nama besar bintang-bintangnya yang pada kenyataanya hanya berakting pas-pasan. Sayang lagi-lagi seperti sudah menjadi penyakit film-film popcorn kebanyakan, The Sorcerer’s Apprentice pun tidak lepas dari kelemahan mendasar, Ya, plot yang terlalu sederhana dan klise layaknya dongeng-dongeng klasik tiga babak buatan Disney yang dapat kita tebak bagaimana cerita tersebut berakhir tanpa harus repot-repot berpikir keras. Ya, The Sorcerer’s Apprentice, tidak ada plot njelimet dan berlapis-lapis yang memusingkan disini.'),
(482, 'The Saint', 'NEGATIF', 'DATA LATIH', 'Satu-satunya yang bisa dibilang menarik dari The Saint versi Noyce ini adalah bagaimana karakter Simon Temple melakukan keahliannya, mencuri? tidak, bagian itu sama sekali tidak menarik, adegan laga? terlalu biasa, penyamaran? ya,bagian di saat Ia melakukan perubahan penampilan inilah yang membuat The Saint menjadi sedikit tertolong, apalagi tidak hanya sekali, terhitung lebih dari 5 kali sepajang film ia menggunakan kemampuannya itu dan membuat saya cukup terhibur, walaupun harus jujur saya sedikit terganggu juga dengan penampilan Val Kilmer yang sangat berlebihan alias overacting dalam membawakan perannya.\r\nYa, pendek kata, The Saint versi Noyce ini terasa hanya menumpang ketenaran serial televisinya saja tanpa adanya kedalaman cerita, bahkan untuk ukuran film aksi spionase film ini juga tidak menawarkan adegan aksi yang “wah”, semuanya serba standar dan lurus-lurus saja kalau tidak mau dibilang buruk, belum lagi aksi jual tampang Val Kilmer yang cukup mengganggu sepanjang 116 menit.'),
(483, 'The Rite', 'NEGATIF', 'DATA LATIH', 'The Rite mungkin tidak lebih dari horror bertema exorcism biasa. Menghibur namun tidak istimewa, bahkan cenderung membosankan buat anda yang kurang menggemari horror beralur lambat, kecuali anda adalah fans berat dan sudah rindu dengan penampilan dingin dari seorang Sir Anthony Hopkins, karena mungkin hanya itu satu-satunya yang bisa dibilang menarik di sini.'),
(484, 'The Resident', 'NEGATIF', 'DATA LATIH', 'Kehadiran Hillary Swank jelas menjadi segalanya disini, mungkin saya sendiri tidak akan melirik film ini jika didalamnya hanya ada nama Jeffrey Dean Morgan, Lee Pace ataupun Christopher Lee. Meskipun tidak buruk, namun sangat disayangkan Swank harus membuang percuma talentanya dalam film sekelas ini. Menariknya, Swank seakan-akan membiarkan Joniken  dengan mudah mengeksploitasi keindahan tubuhnya dengan menghadirkan cukup banyak adegan-adegan tanpa busana artis peraih Oscar dalam Boys Don’t Cry dan Million Dollar Baby ini.\r\nSo, mencari sesuatu yang menarik di The Resident, mungkin anda hanya menemukan nama Hillary Swank didalamnya, karena jika nama besar itu dicabut maka sisanya hanya sebuah thriller medioker klise dari seorang sutradara video klip  yang sudah bersusah payah agar debut film panjangnya ini dapat laku dipasaran.'),
(485, 'The Quiet Ones', 'NEGATIF', 'DATA LATIH', 'Pouge kembali ke pakem lama yang melibatkan sedikit sentuhan modern dari elemen mockumentary, sentuhan klasik haunted house dan pengusiran setan dalam setting jadul berpanggung  rumah lama dengan perabot-perabot antik, termasuk meja bulat kecil berwarna coklat di mana para karakternya berpengangan tangan, lancang menantang kekuatan tak terlihat yang tidak mereka percayai. Tetapi sayang, semua kesenangan-kesenangan itu tidak dibarengi dengan kehadiran aura mencekam dan presentasi yang solid, semuanya tampak datar, tidak menakutkan dan bisa dibilang membosankan.'),
(486, 'The Purge: Anarchy', 'NEGATIF', 'DATA LATIH', 'DeMonaco juga seperti mencoba memasukan banyak elemen sosial-politis dengan melibatkan konspirasi pemerintah dan gerakan bawah tanah anti-purge yang sangat disayangkan menguap tak berbekas seiiring dengan berjalannya waktu. Apa yang terjadi setelah 20 menit, Anarchy kembali mengulangi kesalahan yang sama yang pernah dibuat pendahulunya: membuang percuma tema besarnya dan segala elemen pendukung yang seharusnya membuat sekuelnya ini menjadi lebih baik, sayang apa yang terjadi  di lapangan tidak lebih dari sebuah thriller aksi survival kosong kelas dua yang dihiasi dengan kebisingan tanpa arti dan pertempuran murahan dengan kadar gore yang disunat.'),
(487, 'The Purge', 'NEGATIF', 'DATA LATIH', 'Sebuah konsep gila yang punya potensi menjadi besar dan dalam, sayangnya pada akhirnya DeMonaco entah terlalu malas atau tidak tahu bagaimana mengembangkannya, The Purge kemudian hanya menjadi sajian home invasion thriller yang sering kamu lihat dengan segala aspek bertahan hidupnya yang juga familiar. Ya, sayang memang di mana ide brilian hanya sebatas menjadi ide semata.'),
(488, 'The Perfect House', 'NEGATIF', 'DATA LATIH', 'Sayang kualitas naskah yang ditulis Alim Sudio tidak sekokoh sisi teknisnya membuat ceritanya yang juga tidak lagi terlalu orisinil ini bergerak begitu lambat dan sedikit membosankan dengan rentetan misteri-misteri yang tidak mampu disembunyikan dengan aman. Bukan saya sok pintar, tapi sungguh teka-teki yang disajikan oleh The Perfect House  gagal mempermainkan saya, suka atau tidak ia memang begitu mudah ditebak bahkan sebelum pada akhirnya karakter Julie menemukannya sendiri, sama sekali tidak mampu mengusik rasa penasaran. Sisi psikologis yang ditonjolkan juga tidak maksimal karena saya hanya mendapati sediki adegan yang benar-benar bisa meneror mental di sini dan tentu saja imbas dari kekurangan-kekurangan di atas membuat ending The Perfect House yang seharusnya bisa mengejutkan menjadi cacat dan terasa hambar, anggap saja seperti menonton thriller untuk pemula.'),
(489, 'The Other Woman', 'NEGATIF', 'DATA LATIH', 'Meskipun punya premis menarik, naskah Melissa Stack sebenarnya tidak terlalu kuat, dan seperti kebanyakan romcom lainnya, ia akan memulainya dengan sesuatu yang cukup menyegarkan sampai kemudian berakhir cheesy, termasuk penyutradaraan Cassavetes junior yang juga tidak istimewa terutama ketika ia terlalu memaksakan memasukan beberapa gambar-gambar melankolis yang terasa tidak cocok.'),
(490, 'The Ninth Gate', 'NEGATIF', 'DATA LATIH', 'Ini mungkin salah satu film yang perjalanannya lebih baik ketimbang endingnya, ya, endingnya buruk, terlalu cepat, absurd dan tidak memberikan banyak jawaban dari pertanyaan-pertanyaan yang ada, seperti siapa sebenarnya wanita misterius itu? Apa hubungan adegan bunuh diri di awal film dengan buku itu sendiri, dan beberapa lubang lain di ceritanya. Banyak kritikus yang menanggap The Ninth Gate sebagai salah satu kesalahan besar Polanski'),
(491, 'The New Daughter', 'NEGATIF', 'DATA LATIH', 'Seperti ingin menyertai kegagalan film ini, nama Kevin Costner yang didapuk sebagai nilai jual dan daya tarik terbesar film yang juga merupakan adaptasi dari film pendek karya John Connolly juga kembali gagal menampilkan peran terbaiknya. Tidak ada sesuatu yang spesial yang membuat penontonnya bakal mengingat penampilan oleh aktor berusia 55 tahun ini, malah bisa dibilang penampilannya dalam The New Daughter semakin menambah daftar panjang kegagalannya mengangkat daya jual sebuah film. Mungkin satu2nya yang menarik adalah penampilan Ivana Baquero. Bagi yang pernah menonton Pan’s Labyrinth sudah tentu tidak akan melupakan wajah manis aktris yang kini sudah beranjak remaja ini, walaupun jika dibandingkan dalam Pan’s Labyrinth aktingnya disini terkesan biasa2 saja, namun setidaknya senang bisa melihat aktris kelahiran Barcelona 16 tahun lalu ini tumbuh menjadi gadis cantik.\r\nOverall, premis usang ditambah dengan eksekusinya yang payah dan di tutup dengan ending buruk jelas membuat The New Daughter bukanlah sajian horror yang dapat diharapkan dapat memuaskan para penggemarnya'),
(492, 'The Mothman Prophecies', 'NEGATIF', 'DATA LATIH', 'ama Richard Gare jelas di dapuk untuk menjadi daya pikat The Mothman Prophecies namun apa daya aktor yang memiliki cir khas berambut putih ini gagal memainkan perannya dengan maksimal, yang ada Gare malah terlihat seperti orang kebingungan yang tidak harus berbuat apa dengan sibuk belari kesana kemari. Bahkan artis sekaliber Laura Linney pun terlihat tidak memiliki peran signifikan dalam pengembangan ceritanya.\r\nPada akhirnya The Mothman Prophecies menjadi sebuah thriller misteri yang hanya meninggalkan premis menariknya semata, bahkan jika mau dibandingkan, menonton salah satu episoden dari serial televisi  X-Files yang berdurasi kurang dari 1 jam sepertinya masih terasa lebih menarik daripada duduk selama 120 menit menonton sebuah film  ‘garing’ seperti ini.'),
(493, 'The Mermaid', 'NEGATIF', 'DATA LATIH', 'Sementara unsur romansanya dibentuk secara paksa dan kasar, transisi untuk membangun rasa cinta terasa kelewat cepat, hanya melalui acara makan ayam panggang dan bersenang-senang beberapa jam di taman bermain, seakan-akan Chow tidak terlalu memedulikan bagian ini meski sebenarnya sangat penting untuk membangun ikatan emosi, bahkan kalau mau jujur, porsi cinta secuil yang ada di Kung Fu Hustle dengan gadis bisu penjual permen itu jauh lebih mengena. Dan terakhir soal CGI. Ya, kita tahu Chow senang bermain-main dengan efek komputer untuk mendukung narasi dan aksi-aksinya, dan tentu saja berbicara soal kualitasnya sudah sepantasnya kita tidak membandingkannya dengan apa yang dilakukan Hollywood, itu terlalu jauh, masalahnya kualitas CGI The Mermaid itu buruk, sangat buruk bahkan untuk sekedar dibandingkan dengan Shaolin Soccer atau Kung Fu Hustle sekalipun.'),
(494, 'The Machine', 'NEGATIF', 'DATA LATIH', 'Settingnya hanya berputar-putar di sebuah bungker militer besar, sebagian besar dananya mungkin hanya untuk menampilkan CGI berbentuk teknologi komputer canggih dan tentu saja sang mesin cantik dalam wujud  Caity Lotz yang dibangkitkan dari kematian untuk dijadikan tentara super yang berkilauan. Masalahnya adalah ketika ciptaan si dokter ternyata dlluar dugaan bisa berpikir dan memiliki emosi layaknya manusia yang berbuntut dan kompleksitas moral. Ya, berbicara soal moral dan pilihan-pilihan sulit, sepertinya hal-hal filosofis macam perkataan sang mesin yang dalam kepada McCarthy, “what makes my clever imitation of life any different from theirs? Apart from their flesh, what makes them any different from me?” coba ditonjolkan Caradog W. James guna mengalihkan presentasi klasik fiksi ilmiah suramnya yang minim kemewahan. Masalahnya, naskah besutan James bukan hanya terlalu klise dengan segala cerita tentang bagaimana robot yang ingin menjadi manusia, namun juga ia tidak pernah benar-benar kuat membentuk segala urusan moral, termasuk sentuhan dramanya yang juga gagal menciptakan emosi yang semestinya, belum lagi beberapa subplot tentang industri militer dan pemberontakan para ‘mesin’ yang coba dijejelkan ke dalamnya ternyata tidak terlalu berguna menopang plot utamanya.'),
(495, 'The Love of Siam', 'NEGATIF', 'DATA LATIH', 'Faktor minus terbesar adalah ketika The Love of Siam bergerak terlalu bertele-tele dan  terasa lama, sesuatu yang tidak baik untuk sebuah drama yang berdurasi dua jam setengah benar-benar perjuangan yang melelahkan ketika menontonya. Sebenarnya saya sangat menikmati 20 menit pertama, sebuah opening scene panjang yang juga menghadirkan prolog masa lalu kedua karakter utama kita. Semua berjalan lancar di bagian ini, pemicu romansa keduanya terbentuk dengan baik meskipun sedikit cheesy (adegan perkelahian di toilet sekolah), termasuk tragedi yang menimpa keluarga Tong yang kemudian membuat Miew dan Tong kecil harus berpisah dalam waktu yang lama. Nah, yang menjadi masalah ketika kemudian Sakveerakul sepertinya kebingungan untuk bagaiman mengembangkan kisahnya lebih lanjut, dan apa yang terjadi kemudian ia malah menambahkan sub plot lain yang parahnya kelewat ‘opera sabun’ alias terlalu ‘sinetron’ dan tidak penting, seperti memanjangkan tragedi keluarga Tong, membuat ayahnya menjadi alkoholik kemudian sakit parah, muncul karakter June, gadis yang mirip 100% dengan kakak perempuan Tong, cinta segi banyak dari tetangga yang tergila-gila pada Miew sampai Tong dan Donut kekasih ‘normal’ nya lengkap dengan segala melodrama picisannya. Pertanyaanya tentu saja apakah kehadiran sub-plot tersebut mampu memperkuat plot utamanya? Jika tidak kenapa tidak dibuang saja? Biarkan The Love of Siam memfokuskan dirinya pada tema romansa gay-nya, tanpa harus tercemari melodrama-melodrama tidak penting itu.'),
(496, 'The Losers', 'NEGATIF', 'DATA LATIH', 'Berisi adegan-adegan yang seperti langsung di robek dari komiknya, Sylvain White membuat adegan-adegan dalam The Losers berlari sangat cepat, bahkan saking cepatnya sampai membuat penontonnya tidak lagi sempat untuk memikirkan mana -mana adegan yang masuk akal dan mana yang tidak. Yang juga menarik adalah bagaimana White sukses meracik unsur-unsur humor dengan adegan-adegan serius sehingga hasilnya cukup efektif menghadirkan sebuah tontonan serius tapi santai kepada penontonnya. Jadi santai sajalah menikmati The Losers, tidak perlu pusing dengan plot-nya yang simple dan klise, toh filmnya sendiri memang diperuntukan sebagai hiburan semata.'),
(497, 'The Lorax', 'NEGATIF', 'DATA LATIH', 'Ya, The Lorax memang terlalu kekanak-kanakan. Setuju ia punya pesan yang bagus buat para generasi muda untuk menjaga kesinambungan alam mereka, saya juga suka bagaimana Illumination Mac Guff, studio yang bermarkas di Perancis itu membungkusnya dengan kualitas animasi cantik dan colorfull lengkap dengan karakter-karakternya yang lucu nan imut, bahkan 3D-nya juga tidak buruk, dan juga tidak ada yang salah bagaimana duet Chris Renaud – Kyle Balda menyajikannya dengan sedikit sentuhan musikal di dalamnya, yang salah bisa jadi adalah naskah yang ditulis Ken Daurio dan Cinco Paul, bukan masalah bagaimana mereka sudah memodifikasinya sana-sini, membuat karakter The Lorax yang semestinya menjadi tokoh sentral mendapat porsi lebih sedikit ketimbang tokoh Ted. Tapi yang menjadi persoalan adalah plotnya yang terlalu lurus, khususnya untuk penonton dewasa, efeknya bisa membosankan terlebih ketika homor-humor di paruh pertamanya yang menghibur itu sudah tidak lagi terlalu lucu ketika menginjak pertengahan film hingga kemudian ia berakhir klise.'),
(498, 'The Legend of Tarzan', 'NEGATIF', 'DATA LATIH', 'Masalahnya, dengan segala tetek bengek latar belakang historis dan fiksi, The Legend of Tarzan sebenarnya punya modal konsep yang besar yang membuatnya bisa berbeda dari kebanyakan adaptasi lain namun sayang pada akhirnya tidak dibarengi dengan kekuatan bercerita yang mumpuni dan eksplorasi karakter yang dalam, padahal di atas kertas ia punya dukungan cast mentereng, sebut saja Alexander Skarsgård, Margot Robbie, Samuel L. Jackson, Christoph Waltz sampai Djimon Hounsou. Tidak ada ikatan kuat antara Tarzan dan Jane meski harus diakui Skarsgård cukup tampil menyakinkan membawakan perannya sebagai penguasa rimba dengan segala permak fisik yg sangar dan trademark khas Tarzan yang selama ini kita kenal termasuk, bergelayutan di antara pohon-pohon, berkomunikasi dengan hewan serta teriakan ikoniknya. Sementara Robbie dan karakter-karakter lain seperti terbuang percuma oleh peran mereka karena naskah yang tidak pernah mampu membuat mereka berkembang dari sekedar karakter ‘hore-hore’ semata.'),
(499, 'The Lazarus Effect', 'NEGATIF', 'DATA LATIH', 'Masalahnya sedikit momen seram tidak mampu menutupi kekacauan yang akan hadir selanjutnya. Seiring dengan semakin jauhnya durasinya berjalan, The Lazarus Effect menjadi melempem, ia tidak lagi sekuat premis awalnya. Cakupan yang luas menjadi sempit seperti setting-nya yang hanya berputar-putar di laboratorium, ia lalu juga kehilangan pegangannya ketika Gelb tampak tidak tahu apa yang ingin ditonjolkannya. Kita tahu akan ada manusia yang kemudian terpaksa dijadikan percobaan karena sebuah kesalahan, ya kita tahu eksperimen itu kemudian menjadi mimpi buruk. Yang kita tidak tahu adalah kemudian elemen sci-fi, horor dan psikologisnya bercampur aduk tak karuan, alih-alih melebur menjadi kesatuan yang apik, narasi The Lazarus Effect menjadi tidak fokus, ia seperti sedang kebingungan untuk memilih satu tema utama agar kemudian bisa menutup segalanya dengan baik, sialnya itu tidak terjadi.  Dan berbicara soal ending-nya, percayalah, apa yang terjadi di ujungnya itu tidak lebih dari sebauh kekonyolan luar biasa seakan-akan melengkapi setiap bencana yang terjadi.'),
(500, 'The Last Witch Hunter', 'NEGATIF', 'DATA LATIH', 'Sementara narasi yang digarap trio Cory Goodman, Matt Sazama dan Burk Sharpless memang jauh dari kata istimewa, tidak ada kedalaman, tidak ada pengembangan cerirta berarti, termasuk karakter-karakternya yang terasa teralu datar dan tidak tergali dengan baik meski sebenarnya ada sedikit potensi yang sebenarnya bisa dikembangkan dalam karakter Klauder dengan sejumput masa lalunya yang suram. Toh, pada akhirnya film-film jenis ini kembali terjebak dalam pakem lama yang lebih menonjolkan otot dalam aksi pertarungan dan visual dalam CGI mahal seharga 90 juta dollar.'),
(501, 'The Last Song', 'NEGATIF', 'DATA LATIH', 'Setelah Dear John yang tampil kurang greget dan banyak mendapatkan respon negatif dari para kritikus, kali ini The Last Song pun nasibnya tidak jauh berbeda dari pendahulunya itu, malah bisa dibilang film yang dibidani oleh sutradara wanita, Julie Anne Robinson ini adalah film adaptasi novel Nicholas Spark terburuk yang pernah dibuat. Plot tidak menarik, datar dan membosankan, konfilk-konflik yang kurang digali serta tempo yang terlalu cepat menjadi penyebab-penyebab kegalalan The Last Song. Namun peyebab terbesar adalah pemilihan seorang Miley Cyrus yang didapuk menjadi pemeran utama film ini. Ya, film yang sudah banyak ‘menderita’ karena kelemahan-kelemahan teknisnya ini, harus diperburuk lagi dengan kehadiran pemeran Hannah Montana dengan aktingnya yang sangat buruk. Tidak hanya buruk, Cyrus sukses membuat penontonnya terganggu dengan suaranya aneh-nya dan juga ekspresinya yang sedatar plot film sepanjang 107 menit ini. Tidak ada chemistry yang kuat antara Cyrus dan Hemsworth juga menambah dafar panjang alasan-alasan untuk membuat film ini tidak layak tonton. Mungkin satu-satunya yang dapat menjadi hiburan adalah visual dan pemandangan-pemandangan pantai Tybee Island yang berhasil ditampilkan dengan indah, selebihnya tidak ada yang istimewa.\r\nSo, jika anda bukan salah satu penggemar berat Miley Cyrus, lebih baik hindari saja film membosankan satu ini. Ya, The Last Song benar-benar tampil sangat mengecewakan hampir di semua bagian, salah satu yang terburuk di tahun 2010 ini.'),
(502, 'The Last Exorcism Part 2', 'NEGATIF', 'DATA LATIH', 'Presentasinya buruk, alurnya kelewat lambat di awal-awal dan beberapa repetisi terasa hambar ketimbang menakutkan, ini lebih pantas kamu masukan dalam format yang lebih kecil macam FTV atau home video ketimbang film layar lebar, tidak peduli ada nama sebesar Eli Roth di bangku produsernya. Untung saja selain akhir yang bagus ada akting Ashley Bell yang kuat dalam menerjemahkan kekompleksan karakter Nell dengan segala kerapuhan kondisi mentalnya. Tetapi sekali lagi, ini adalah sekuel maksa yang tidak seharusnya dibuat.'),
(503, 'The Intruders', 'NEGATIF', 'DATA LATIH', 'Ya, untuk ukuran sebuah horor The Intruders jelas gagal melaksanakan tugasnya dengan baik. Selain naskahnya yang lemah, penyutradaraan Fresnadillo juga tidak maksimal dengan segala pace lambatnya yang terkesan terseok-seok, repetitif dan membosankan termasuk yang paling parah adalah  gagal menghadirkan aura menakutkan untuk memberikan teror kepada penontonnya, mungkin hanya scoringnya yang bekerja dengan baik untuk mengingatkan kita bahwa ini memang film horor, bukan drama tentang anak-anak yang bermasalah dengan tidurnya.'),
(504, 'The Incite Mills', 'NEGATIF', 'DATA LATIH', 'Ironisnya, dengan rentetan misteri semenarik itu, Nakata bisa dibilang gagal membangun tensi suspense alias keteganganya, belum lagi saya menyebut beberapa plot hole yang menganggu dari naskah Satoshi Suzuki yang diadaptasi dari novel milik Honobu Yonezawa ini. Meskipun banyak dihiasi dengan kematian mengerikan tapi Incite Mill tidak pernah mencapai ‘titik didih’ semestinya untuk sebuah thriller psikologis. Bahkan bumbu ‘krisis kepercayaan’ dan ‘survival’ yang memiliki potensi bagus untuk bisa lebih dieksplorasi juga terasa sedikit hambar, bisa jadi itu semua imbas dari banyaknya karakter yang dihadirkan menjadikan pendekatan personal ke masing-masing pesertanya tidak tergali maksimal. Parahnya lagi, ketimbang memasang nama-nama yang kurang dikenal untuk setidaknya dapat menjaga ‘kemurnian’ misterinya hingga akhir, Nakata malah memasang nama sebesar Tatsuya Fujiwara, bintang Battle Royale dan Death Note untuk dijadikan salah satu konsestan, bukan hanya itu, Fujiwara juga nyaris mendominasi semua scene yang secara tidak langsung sudah membocorkan bahwa karakternya akan bertahan hingga akhir nanti, tidak peduli dalam keadaan hidup atau mati.\r\n\r\nBukan suguhan thriller misteri psikologis yang solid, apalagi untuk ukuran seorang Hideo Nakata. Tapi meskipun banyak didera kekurangan sana-sini setidaknya Incite Mill yang juga menjadi film peserta iNAFFF 2011 ini masih menarik untuk dijadikan pilihan tontonan, apalagi buat anda yang mengandrungi kisah misteri ala Agatha Christie.'),
(505, 'The Huntsman: WInter''s War', 'NEGATIF', 'DATA LATIH', 'Kombinasi konsep dongeng modifikasi tanggung, petualangan yang tidak terlalu greget, romansa gombal dan penyutradaraan ‘lembek’ dari seorang debutan macam Cedric Nicolas-Troyan yang sebelumnya bertindak sebagai pengawas spesial efek di film pertamanya memang menjadi luka-luka besar buat The Huntsman: Winter’s War. Ya, ia bisa saja bertambah buruk jika tidak dibantu oleh pesona jajaran pemainnya yang tidak hanya bermodalkan nama-nama besar semata namun juga bermain cukup bagus. Hemsworth mungkin hanya mengulangi peran lamanya sebagai Eric, the Hunstman yang charming dan tangguh, ia ditemani oleh Jessica Chastain sebagai Sara yang juga tampil oke meski karakternya tidak disokong oleh cerita yang kuat. Tetapi kalau mau jujur, saya pribadi lebih terpesona dengan Emily Blunt sebagai Freya si ratu es dengan karakterisasi dan background cerita yang lebih kompleks plus bonusnya, dandanan dan pemilihan kostum yang sama kerennya. Sementara meski hanya tampil sebentar di awal dan akhir film, Charlize Theron kembali mengulangi performa mengerikan seperti di film pertamanya sebagai Ravenna yang kejam.'),
(506, 'The Human Centipede: First Sequence', 'NEGATIF', 'DATA LATIH', 'Lemah di plot dan didukung dengan penyajiannya yang serba nanggung dan sangat predictable membuat The Human Centipede sudah kalah di bagian yang bisa dibilang cukup vital ini. Dan hal itu masih diperparah dengan minimnya adegan2 gore dan disturbing yang ternyata juga tidak ditampilkan secara eksplisit, salah satunya adalah adegan operasi yang sebelumnya dikira bakal di shoot habis habisan dan berdarah darah ternyata hanya tampil sekilas dan jauh dari sadis atau menjijikkan. '),
(507, 'The Human Centipede 3: Final Sequence', 'NEGATIF', 'DATA LATIH', 'Ini bisa dibilang adalah seri terburuk, paling mengecewakan. Tidak hanya punya kualitas narasi palik jelek,  namun Six memindahkan jalurnya dari horor/thriller ke ranah dark comedy yang sedikit banyak sudah menghilangkan kesan seriusnya. Hasilnya, Final Sequence seperti parade sirkus bodoh yang dipimpin oleh cast dan plot yang sama bodohnya. Tidak seperti di seri pertamanya, Dieter Laser tidak lagi memancarkan aroma angker, sebaliknya ia seperti badut reot berseragam yang kerap berteriak dan bersumpah serapah tidak jelas. mengacungkan sejata kemana-mana, membunuh. Sementara Laurence R. Harvey pun tidak kalah buruknya. Memang tidak menampilkan akting kelas Oscar, namun melihat Six sudah membuat pemampilannya begitu berbeda dengan karakternya di Full Sequence jelas mengecewakan.\r\n'),
(508, 'The Human Centipede 2: Full Sequence', 'NEGATIF', 'DATA LATIH', 'Jika di seri pertamanya kita banyak menemukan hal-hal pendukung yang hilang seperti darah ataupun kotoran manusia, di sini saya pastikan Six akan memenuhi permintaan para penontonnya. Akan ada lebih banyak jeritan kesakitan ketika seorang tukang parkir psikopat yang sama sekali tidak memiliki pengalaman medis menusukan pisau dapur yang kotor di bokong para korbannya, atau disaat ia merontokkan satu per satu gigi mereka dengan palu setelah sebelumnya pria pendiam satu ini ‘membius’ mereka. Apa yang dilakukan Martin Lomax disini terangkai dalam gambar-gambar yang cukup frontal dan tidak bermoral, nyaris tanpa sensor, membuat penonton yang lemah hati bisa jadi akan dibuat sakit jantung dan mual.'),
(509, 'The Himalayas', 'NEGATIF', 'DATA LATIH', 'Tetapi di balik segala sumber dayanya yang mewah dan pesan kepahlawanan yang luar biasa itu tidak sulit untuk mengatakan bahwa The Himalayas adalah sebuah drama cengeng yang konyol. Kenapa konyol? Pikir saja secara logika sehat, misi membawa pulang jenazah dari puncak Everest yang mematikan bisa dibilang adalah sebuah tindakan bunuh diri yang bodoh dan tidak masuk akal, coba saja kamu tanyakan kepada pendaki profesional paling hebat sekalipun saya berani bertaruh ia tidak akan berpikir dua kali untuk menolaknya.'),
(510, 'The Hangover Part 2', 'NEGATIF', 'DATA LATIH', 'Mungkin The Hangover 2008 lalu sudah membuat batasan begitu tinggi bagi Phillips yang membuatnya kesulitan untuk melanjutkannya ke sekuel-sekuel selanjutnya. Yang terjadi dengan kepercayaan yang begitu tinggi pada akhirnya adalah bencana di seri keduanya, dan The Hangover Part III yang dipaksakan untuk dilanjutkan sebagai penutup juga bukan sekuel yang bagus, namun setidaknya ini masih lebih baik ketimbang part deux yang “malas” itu.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(511, 'The Green Inferno', 'NEGATIF', 'DATA LATIH', 'Eli Roth memang belum pernah membuat horor-horor yang luar biasa bagus dalam hal bercerita, dalam kasus The Green Inferno, Roth memulainya dengan banyak basa-basi tak perlu yang terlalu lama, dipenuhi narasi dan karakterisasi cheesy. Tetapi jika kamu hanya ingin sekedar mencari hiburan sederhana dalam bentuk blood and gore dengan sedikit bumbu humor gelap yang efektif maka kamu sudah berada di  tangan orang yang tepat. '),
(512, 'The Giver', 'NEGATIF', 'DATA LATIH', 'Ya, The Giver jelas punya modal kuat dari novelnya tetapi Michael Mitnick dan Robert B. Weide rupanya memilih untuk bermain aman dengan banyak memangkas segalanya, menyederhanakan narasi kompleksnya, membuang bagian-bagian penting untuk dijadikan tontonan yang benar-benar terasa seperti sebuah sajian young adult klise nan cheesy ala Hollywood ketimbang fiksi ilmiah pintar yang dipenuhi dengan kedalaman metafora, filosofi dan sindiran sosial. Ya, sayang memang setelah seperempat durasi awal yang cukup menyakinkan lengkap dengan sebuah proses perubahan warna ala Pleasentville, The Giver jatuh menjadi tontonan sci-fi remaja tumpul yang terlalu panjang dan membosankan oleh beberapa momen tak perlu yang seperti diulang-ulang. Lalu ada banyak casting bagus yang terasa mubazir karena minimnya porsi yang diberikan.'),
(513, 'The Forest', 'NEGATIF', 'DATA LATIH', 'Kesalahan pertama, sebagai gelaran horor ia tidak terlalu menakutkan, ya, itu fatal karena tugas utama sebuah horor adalah memberimu teror mental melalui audio dan visualnya. Memang sinematografer Mattias Troelstrup sudah bekerja dengan baik menghadirkan visual suram dan misterius Aokigahara yang sebenarnya disyut di taman nasional Tara di Serbia mengingat lokasi nyata Aokigahara terlarang untuk umum. Masalahnya kurangnya informasi dan sentuhan budaya setempat perlahan membuat kita lupa bahwa ini adalah hutan Aokigahara. Kita tidak lagi memedulikan hutan di mana karakater Dormer berlari-lari tak jelas ke sana kemari. Kesan creepy yang sebenarnya sudah dihadirkan dengan baik di awal-awal ketika tokoh Sara mulai memasuki Aokigahara menguap pelan-pelan, digantikan dengan parade jump scare yang lebih banyak “miss” ketimbang “hit”. Implentasi psikologis bisa dibilang gagal total dalam memberikan sebuah pengalaman horor yang kompleks, hasilnya, terlebih dengan ending yang terlalu mudah diprediksi, The Forest tidak lebih dari sebuah horor medioker yang berlindung di balik premis kisah nyatanya yang harus diakui jauh lebih  mampu membuatmu bergidik.'),
(514, 'The Flowers of War', 'NEGATIF', 'DATA LATIH', 'The Flowers of War jelas bukan pencapaian terbaik seorang Zhang Yimou, narasinya tidak sekuat temanya, tidak ada emosi yang dalam kecuali anda adalah penonton oversensitif, hanya ada gambar-gambar bagus dan adengan perang hebat di 20 menit pertamanya dan Christian Bale dengan akting pas-pasan, jauh jika dibandingkan karya-karya hebat Yimaou yang lain macam Raise the Red Lantern, Hero atau To Live yang luar biasa itu, mengecewakan memang untuk ukuran Yimaou tapi setidaknya saya masih bisa menikmatinya hingga akhir.'),
(515, 'The Expendables 3', 'NEGATIF', 'DATA LATIH', 'Berbeda dengan dua seri sebelumnya, seri ketiganya ini mungkin akan sedikit mengecewakan karena beberapa hal. Pertama, ia kembali mengulang formula plot yang sama, semuanya persis seperti yang sudah pernah kamu lihat, dimulai dengan opening heboh, misi yang gagal dan ditutup dengan pembalasan yang setimpal lengkap dengan guyonan-guyonan one liner-nya. Kedua, ia kembali menjadi terlalu serius dan ‘lembek’, padahal seri ke-dua nya sempat berhasil tampil lepas menghamburkan komedi dan aksinya dengan porsi sama asiknya, menjadi tontonan aksi yang super gila-gilaan. Ketiga, dengan memilih untuk menurunkan ratingnya menjadi PG-13, segala kekerasannya ‘disunat’ habis-habisan, tidak ada lagi darah bermuncratan, kepala pecah dan anggota tubuh yang terlepas, ya, ini seperti The Expendebles versi Disney.'),
(516, 'The Disappearance of Eleanor Rigby', 'NEGATIF', 'DATA LATIH', 'Untuk sebuah film yang berlebel “romansa” , The Disappearance of Eleanor Rigby terasa begitu dingin di balik segala kehangatan sinematografinya. Tidak hanya kontennya, namun bagaimana Beson mempersentasikan narasinya juga begitu depresif. Plotnya seperti berjalan terseok-seok, terasa begitu lama dan menjemukan terlebih Beson memilih untuk membiarkan kedukaanya bertahan begitu panjang dan terkesan repetitif tanpa memberi solusi bagaimana karakter di dalamnya berusaha menyembuhkan diri mereka.'),
(517, 'The Descent', 'NEGATIF', 'DATA LATIH', 'Para cast dimana semuanya perempuan juga tampil tidak mengecewakan, mereka tidak hanya bermodalkan tampang cantik yang bisanya cuma teriak2 saja, karakter mereka juga berkembang seiring berjalannya film. Sayang dibeberapa adegan banyak hal2 yang sepertinya dipaksakan dan sedikit tidak masuk akal. Para ” mahluk2 ” juga digambarkan terlalu sederhana, kurang cukup menakutkan. namun setidaknya kekurangan2 tersebut ditutup dengan ending yang menurut saya cukup keren walau sepertinya agak sedikit memaksa.'),
(518, 'The Collection', 'NEGATIF', 'DATA LATIH', 'Memang skalanya dinaikan menjadi lebih besar, dalam artian ada pabrik terbengkalai, tempat si kolekter bersemayam sebagai setnya, dan tentu saja masih ada jebakan-jebakan maut penuai nyawa yang muktakhir (lihat adegan pembantaian di diskotik itu) dan jujur, lebih banyak darah dan tubuh tercabik, tetapi kamu tidak akan menemukan lagi kadar suspense yang terjaga baik seperti pada film pertamanya. Yang terjadi di The Collection adalah ia nampak terlalu berupaya seperti Saw namun gagal. Ia kemudian juga menjadi terlalu ‘action’, membuang banyak ketegangan dan ‘keintiman’ personalnya, termasuk terlalu berfokus pada jebakan-jebakan dan gore-nya ketimbang unsur survivor yang dihadirkan karakternya, dan itu bisa menjadi sangat menghibur namun jelas ia juga sudah kehilangan banyak elemen horornya yang membuat tensinya jauh menurun ketimbang pendahulunya.\r\nTidak seintens The Collector yang sempit, tetapi ini bukan sekuel yang buruk mengingat banyak hal yang coba ditingkatan Dunstan di sini, dari setting, karakter dan bumbu gore yang semakin banyak. Sayang naskahnya tidak mengalami perkembangan berarti, ketegangan berkurang drastis karena Dunstan lebih banyak bermain pada area aksi ketimbang membangun pondasi horornya dengan kuat. Dan dari ending-nya sepertinya ini akan menjadi franchise horor baru.'),
(519, 'The Cold Light of Day', 'NEGATIF', 'DATA LATIH', 'Trailernya menarik, seperti menjanjikan tontonan spy thriller konspirasi tingkat tinggi yang seru ala trilogi Bourne, tapi fakta di lapangan berkata lain, The Cold Light of Day tidak lebih seperti sebuah B Movie dengan bintang kelas satu dari seorang sutradara medioker, Mabrouk El Mechri yang sebelumnya juga pernah membuat JCVD, semi-biografi aktor laga lawas Jean-Claude Van Damme. Ya, ini seperti parodi buruk dari Bourne, melihat si bakal Manusia baja, Henry Cavill berlari ke sana kemari di lorong-lorong kota Madrid dan di kejar-kejar oleh pihak-pihak yang ingin membunhnya seharusnya bisa menjadi sajian pemacu adrenalin yang mendebarkan, sayang El Mechri tidak lihai menghadirkannya. Setiap momennya terasa sangat lembek dan datar, tidak peduli seberapa keras scoring  Lucas Vidal memacunya, tidak peduli ada dua gaek, Bruce Wills dan Sigourney Weaver di sini. Rangkaian plot hole dan Naskahnya yang buruk juga menjadi salah satu faktor yang menghancurkannya.'),
(520, 'The Call', 'NEGATIF', 'DATA LATIH', 'Semuanya berjalan lancar sampai kemudian klimaksnya menjadi terlalu familiar dan dipaksakan. Tanpa perlu menjadi jenius kita sudah tahu apa yang akan terjadi dan seberapa kerasnya usaha Anderson untuk membuat endingnya terlihat berbeda, toh itu tidak terlalu berhasil, but still, The Call adalah tontonan crime thriller menyenangkan, tidak terlalu berat namun juga tidak sampai menjadi terlalu bodoh, Helle Berry bermain kuat sebagai operator 911 sementara Breslin juga tidak buruk.'),
(521, 'The Butler', 'NEGATIF', 'DATA LATIH', 'Tidak ada masalah dengan kualitas akting para pemainnya, hampir semuanya bermain bagus bahkan untuk peran yang terkecil sekalipun, yang menjadi masalah adalah narasinya yang tidak terlalu kuat itu terlalu banyak bergantung dengan kisah-kisah di luar Gedung Putih. Mungkin saja cerita aslinya terlalu membosankan dan tidak  menarik sampai-sampai Lee Daniels bersama Strong harus banyak melakukan permak sana sini dengan mengandalkan banyak sisipan sejarah yang dipaksa untuk dimasukan dan dikait-kaitkan dengan karkater Cecil, dalam kasus ini melalui putrannya Louis si pemberontak untuk membuat The Butler lebih bisa bergerak ke mana-manan ketimbang terjebak dalam rutinitas seorang pelayan, sayang itu membuat fokus filmnya menjadi terlalu melebar ke mana mana.'),
(522, 'The Boy', 'NEGATIF', 'DATA LATIH', 'Dalam perjalanannya misteri yang tampak menjanjikan di awal film berangsur-angsur menguap dan kehilangan daya cengkeramannya. Jangan salah, dari segi akting Lauren Cohan sendiri tampil baik, sama ketika Natalie Dormer menjadi bintang di The Forest, namun sayang Bell membuat karakternya menjadi terlihat bodoh dengan pemilihan dialog dan pengambilan keputusan yang konyol. Sementara pencarian petunjuk dan penemuan fakta-fakta dari masa lalu seperti menjadi terbuang percuma ketika twist yang dihadirkan Bell malah berakhir antiklimaks.'),
(523, 'The Berlin File', 'NEGATIF', 'DATA LATIH', 'Menderita cukup hebat pada pembukannya dengan segala konflik, motivasi dan sub plot yang cukup membuat penontonnya bertanya-tanya. The Berlin File mulai sedikit membaik ketika Seung-wa kemudian mengurangi segala kerumitannya di pertengahan film, menjadikannya jauh lebih sederhana bersama melodrama dan suspense khas Korea Selatan yang dibungkus dengan adegan-adegan aksi cepat dan berkelas. Mungkin susah untuk menyebutnya sebagai Bourne-nya Korea Selatan, tetapi setidaknya Seung-wa sudah mencoba menghadirkan sesuatu yang berbeda meskipun, yah, tidak sesuai ekspektasi.'),
(524, 'The Astronauts WIfe', 'NEGATIF', 'DATA LATIH', 'Seperti yang sudah dijelaskan sedikit diatas, film ini memang hanya sebatas ‘menjual’ premis dan dua nama besar pemainnya saja, terlihat dari bagaimana ketidakmampuan Ravich ‘memperpanjang’ premis tersebut menjadi sebuah plot yang solid dan menarik, alih-alih tampil kuat, The Astronaut’s Wife malah tampil dengan segala kedangkalan cerita dan lubang-lubang besar disepanjang 109 menit yang membuat misteri-misteri yang dihadirkan menjadi terasa ‘hambar’. belum lagi ending yang buruk dan klise semakin membuat film ini terasa seperti thriller murahan yang hanya mengumbar banyak adegan tidak perlu yang semata-mata hanya agar membuat film ini terlihat sebagai sebuah film thriller'),
(525, 'The Accused', 'NEGATIF', 'DATA LATIH', 'The Accused punya modal yang bagus untuk menjadikan dirinya sebuah drama pengadilan yang solid, apalagi ia punya Jodie Foster yang tampil baik, sayang kenyataannya tidak. Penyutradaraan dan naskah yang terlalu datar dan klise membuatnya tidak mampu meninggalkan kesan. Satu-satunya yang mungkin akan anda ingat adalah adegan mengerikan yang terjadi di atas mesin pinball itu.'),
(526, 'The 5th Wave', 'NEGATIF', 'DATA LATIH', 'Tetapi kegembiraan itu tidak berlangsung lama, dengan cepat setelah paruh pertama berakhir, The 5th Wave memasuki bagian paling buruknya, tercebur dalam kubangan drama remaja dengan segala romantika picisan yang kelewat familiar. Tidak hanya terasa generik namun sangat payah. Bagaimana Cassie sampai jatuh hati dengan Evan Walker (Alex Roe), penyelamat hidupnya yang misterius  juga tidak pernah melewati sebuah proses yang wajar. Terjadi begitu cepat, hanya dengan sedikit obrolan dengan mudah benci berubah menjadi cinta segampang membalikan telapak tangan.'),
(527, 'Focus', 'NEGATIF', 'DATA LATIH', 'Seperti dua sisi koin, begitu banyak twist bisa jadi menyenangkan, namun di sisi lain juga bisa menjadi bumerang ketika ternyata Focus menjadi teralalu asik  memusatkan segalanya pada elemen kejutannya, terlalu banyak tipu sana tipu sini sehingga penontonnya mungkin tidak tahu lagi bagaimana harus mempercayai jalan ceritanya yang bisa dipastikan selalu ada rekayasa baru, selalu ada desain bohong lagi yang ironisnya terasa repetitif dan menjadi mudah tertebak langkah demi langkahnya, ujung-ujungnya Focus menjadi tidak sefokus judulnya, tidak mengerti tujuannya, tidak mengerti apa yang sebenarnya ingin dicapai karena terlalu sibuk mempertontonkan trik-triknya muktakhirnya dari awal sampai akhir. Sementara kadar romansa dan komedinya sendiri tidak pernah benar-benar disentuh dengan baik meskipun harus diakui pesona besar Smith dan Robbie masih mampu memberikan penampilan dan chemistry mereka dengan cukup intim.'),
(528, 'Frankenstein''s Army', 'NEGATIF', 'DATA LATIH', 'Mungkin teknis mokumentarinya kacau dan naskahnya juga sama berantakannya dengan presentasi ala dokumenternya yang terlalu memusingkan, tetapi pada dasarnya Frankenstein’s Army memang dimaksudkan sebagai tontonan yang ringan, ia tidak pernah terlalu serius namun masih sanggup memberikanmu sebuah keasikan horor found footage indie orisnil dengan sekarung potongan tubuh, galonan darah segar dan sajian utamanya: monster-monster keren mematikan.'),
(529, 'Colombiana', 'NEGATIF', 'DATA LATIH', 'Ketimbang menanganinya sendiri Besson mendapuk Olivier Megaton, sutradara yang sebelumnya pernah bekerja sama dengannya dalam Transporter 3 untuk membidani filmnya satu ini, sementara ia duduk di bangku produser dan penulis naskah. Sayangnya ini bukan salah satu yang terbaik dari soerang Luc Besson. Skrip lemah, penuh lubang sana-sani, subplot romansanya yang konyol, karakterisasi yang seharusnya bisa berekmbang lebih baik, peran-peran yang mubazir dan penyutradaraan yang payah dari Megaton membuat Colombiana ‘babak belur’ bak sajian action kelas dua, bahkan From Paris with Love yang konon dikatakan sebagai salah satu film terburuk Besson saja masih jauh lebih meyenangkan dari pada menikmati 108 menit Colombiana. Jadi meskipun ia terlihat bergerak begitu cepat dan banyak mengobral rangkaian momen aksinya dari menit awal bergulir Colombiana sebenarnya termasuk film yang membosankan.'),
(530, 'Crush', 'NEGATIF', 'DATA LATIH', 'Cerita standar, kengerian yang minim, darah dan kesadisan yang kelewat sedikit dan karakter yang tidak dipoles dengan baik serta penyajian ala kadarnya, Crush tampak seperti sinetron thriller yang tumpul dan membosankan, usaha untuk membuatnya menjadi berbeda dengan memunculkan twist di klimaksnya juga gagal. Ya, ini seperti tontonan thriller buat anak-anak. Bahkan posternya saja sudah membocorkan semuanya.'),
(531, 'Dead Man Down', 'NEGATIF', 'DATA LATIH', 'Mungkin tidak terlalu kuat di sektor naskahnya, tetapi pengaruh eropa yang  tenang plus sedikit suspense dan drama yang  dibawa Oplev untuk membungkus setiap momennya membuat Dead Man Down mampu tampil menghayutkan yang sayangnya harus dirusak oleh endingnya yang terlalu Hollywood. Ya, klimaks di penghujungnya menjadikan Dead Man Down seperti dua film yang berbeda, begitu tenang dan terlihat solid di hampir keselurhan tetapi penutupnya seperti membuang segala hal-hal yang bagus itu ke tempat sampah dan menghacurkan dirinya sendiri.'),
(532, 'Death Tube', 'NEGATIF', 'DATA LATIH', 'Tentu saja tidak ada situs seperti Death Tube di dunia nyata, dan saya bersyukur karena itu. Tidak pernah bisa membayangkan jika ada orang sesakit itu yang tega membunuh manusia lain bahkan sampai kemudian mempertontonkan tindakan biadabnya itu secara live lewat internet. Nah, berbekal premis nyeleneh seperti itu yang juga sedikit banyak mengingatkan saya pada thriller medioker lain yang dibintangi Diane Lane, Untraceable atau seperti Saw, dengan segalan permainan maut ala Jigsaw, kemudian Death Tube lahir dibawah arahan Yohei Fukuda, sutrdara yang sebelumnya pernah menelurkan Grotesque. Sayangnya Death Tube sepertinya hanya meninggalkan konsep yang ambius tanpa dibarengi eksekusi yang mumpuni, menjadikannya sebuah horror-thriller yang membosankan tanpa tahu mau dibawa kemana tujuan akhir film ini, padahal kalau mau jujur ia memiliki potensi untuk dapat berkembang lebih jauh.'),
(533, 'Deliver Us From Evil', 'NEGATIF', 'DATA LATIH', 'Di tempat lain Derrickson juga memberi karakter Eric Bana konflik pribadi, seperti skeptisme stereotip dan pergolakan antara pekerjaan atau keluarga. Sementara di tempat lain ada aktor Édgar Ramírez tampil menjadi pastur gaul yang membantu penyelidikan Ralph Sarchie secara spiritual. Sayang ketika dengan begitu banyak pertanyaan dari misteri yang sepertinya akan menjadi besar di klimaks, kita akhirnya tidak mendapatkan jawaban sepatasnya. Apa yang dilakukan Derrickson adalah sebuah antiklimaks, terlepas dari sekuens exorcism medebarkan di ujungnya, Ia seperti memilih bermain aman dan terkesan ‘malas’ memberi sentuhan akhir berupa penjelasan setimpal yang semestinya bisa membuat Deliver Us From Evil tidak berakhir menjadi horor medioker yang begitu saja berlalu tanpa kesan apa-apa.'),
(534, 'Devil''s Pass', 'NEGATIF', 'DATA LATIH', 'Ya, mengawinkan peristiwa nyata misterius dengan sebuah dokumenter palsu bisa jadi sebuah tontonan menarik. Tetapi Devil’s Pass mungkin akan membuat penonton yang bosan dengan mocku horor akan eneg. Tidak ada yang baru di sini, semua masih sama seperti yang sudah-sudah, dari dominasi sudut pandang orang pertama bersama banyak penggunaan kamera gengam, dialog-dialog kasual serta tempo pelan membosankan dengan segala basa-basinya sebelum akhirnya ‘meledak’ di ujungnya.\r\nKombinasi realisme found footage, setting yang meyakinkan dan kandungan misterinya yang berujung narasi kompleks dan twist membuat Devil’s Pass milik Harlin sebenarnya tidak terlalu buruk andai saja ia tahu bagaimana menghindari beberapa kesalahan macam yang paling fatal, ketidak konsistenan pengunaan kameranya yang terkadang terasa janggal untuk ukuran film dengan tampilan dokumenter. Belum lagi penyakit lama dari horor jenis ini yang seperti terlalu memaksakan kameranya untuk harus terus merekam segalanya, apapun yang terjadi, seakan-akan  membuat keselamatan kamera lebih penting dari nyawa mereka sendiri, terasa aneh dan menganggu memang.'),
(535, 'Dream House', 'NEGATIF', 'DATA LATIH', 'ni mungkin yang terburuk dari Sheridan, tapi hasilnya bisa jadi akan berbeda andai saja pihak Morgan Creek tidak pernah turut campur tangan dalam urusan naskahnya. Ya, konon terjadi perselisihan antara Sheridan dan Morgan Creek selaku studio produksi yang berujung dengan tidak pernah digunakannya naskah Sheridan yang dirasa tidak komersil itu. Ironisnya perubahan yang dilakukan sepihak tersebut ternyata juga tidak membuahkan hasil berarti, selain filmnya sendiri banyak dicerca di sana sini termasuk oleh Sheridan, Craig dan Weisz sendiri yang sampai-sampai tidak mau mempromosikannya,  hasilnya box-ofiice nya pun anjlok, menjadikannya salah satu horor-thriller paling mengecewakan tahun ini.'),
(536, 'Drive Angry', 'NEGATIF', 'DATA LATIH', 'Drive Angry sepertinya berusaha keras untuk menjadi sebuah film aksi tanpa otak gila-gilaan yang sayangnya tidak berjalan dengan baik. Patrick Lussier seakan-akan tidak rela jika filmnya terlihat terlalu ‘murahan’ namun disisi lain ia juga tidak ingin menjadikannya terlalu serius, nah kegalauan inilah yang  malah membuat Drive Angry menjadi sebuah film aksi ‘banci’ yang terkesan masih ‘malu-malu’ menunjukan kegilaannya'),
(537, 'Due Date', 'NEGATIF', 'DATA LATIH', 'Masih di tangan Todd Philips, sutradara yang selalu membuat film komedi ber rating R ini tidak menawarkan sesuatu yang wah buat saya, masih setype dengan film-film komedi road trip pada umumnya. meskipun di bintangi Robert Downey dan Zach Galifianakis tetap saja film ini tidak terlalu berpengaruh apa – apa bagi saya di karenakan naskah nya yang melempem. Selain itu kesalahan Todd Philips adalah improvisasinya menghancurkan segalanya, kalau di perhatikan ia lupa mau di kemanakan dua aktor ini. padahal chemistri dua orang yang berlawanan arah seharusnya menjadi daya tarik yang bagus. di suatu adegan Robert Downey kembali reuni dengan Jamie foxx (The Soloist) meskipun cuman tampil sebentar di sini, namun sekali lagi yang saya sayangkan kehadiran Jamie Fox sama sekali tak berpengaruh apa apa bagi film ini.'),
(538, 'Dumplings', 'NEGATIF', 'DATA LATIH', 'Walaupun dalam segi penceritaanya masih terdapat banyak lubang di sana sini, setidaknya Chan punya pesan yang ingin diangkat, tidak melulu menghadirkan horor yang berisi kesadisan dan kegilaan semata. Sentilan kecil di dalamnya tentang fenomena sosial yang sering kali terjadi dalam masyarakat Cina daratan dan obsesi manusia dalam usahanya untuk mencari kecantikan abadi, termasuk dengan cara yang paling menjijikan sekalipun. Ya, mungkin saja anda tidak akan berani makan pangsit dulu dalam beberapa waktu, terlebih ketika mendengar suara tulang-tulang kecil yang hancur di saat Nyonya Li menguyahnya dengan begitu lahap.'),
(539, 'Everest', 'NEGATIF', 'DATA LATIH', 'Kuat di teknis tidak diikuti dengan penceritaan yang mengesankan. Mencoba membuat Everest untuk tampil humble dan juga sebisa mungkin setia dengan sumber aslinya sedikit banyak sudah memaksa Kormákur untuk mengurangi kadar dramatisasinya, bukan berati naskah Everest sampai menjadi buruk dan tak layak tonton. Kamu mungkin bisa menyebutnya sebagai sajian dokudrama yang lebih memfokuskan pada kronologis peristiwa, masalahnya hal ini terkadang akan menjadi terasa lama dan membosankan, setidaknya itu yang saya rasakan di paruh awal film yang terlalu banyak menghabiskan waktu untuk memperkenalkan karakter-karakter utamanya.'),
(540, 'Exodus: Gods and Kings', 'NEGATIF', 'DATA LATIH', 'Untuk ukuran film reliji, Exodus tergolong terlalu bermain aman. Tidak ada upanya maksimal mengiring rasa emosi dan spiritual penontonnya, apa yang tersaji di sepanjang dua jam setengah Exodus terasa seperti film sejarah membosankan dengan sedikit adegan spektakuler yang tidak sebanding dengan kesabaran para penonton yang tersiksa menunggunya, termasuk adegan penting yang berada di ujung film. Tidak hanya membuang banyak waktu untuk sesuatu yang kurang penting, Exodus bisa jadi adalah salah satu film yang memubazirkan jajaran cast-nya. Christian Bale tidak tampil di performa terbaiknya meskipun ia juga tidak buruk memerankan salah satu karakter ikonis di ranah agama. Scott membagi porsi Bale 60:40 dengan Edgerton yang didapuk sebagai Ramesses II sang antagonis. Edegerton tampil bagus, sayang narasinya yang lemah membuat karakternya menjadi tidak bisa berkembang. Sementara nama-nama besar lain macam Sigourney Weaver dan Ben Kingsley harus rela menjadi ‘figuran’ tak penting.'),
(541, 'Fantastic Four', 'NEGATIF', 'DATA LATIH', 'emang untuk ukuran film superhero, 62 juta Dollar bukan budget yang kelewat besar, tetapi jika ia mampu mengubah 12 juta menjadi tontonan sekelas Chronicle, secara logika dengan dukungan dana yang mencapai lima kali lipat, Trank seharusnya bisa melakukan sesuatu yang jauh lebih baik dan lebih besar, tetapi seperti yang bisa kamu lihat Fantastic Four miliknya punya ruang lingkup yang sesempit narasinya. Tidak ada set besar, semua pemandangan yang terlihat hanya melibatkan gudang besar dan banyak layar hijau untuk menampilkan scene Planet Zero yang gersang, gelap dan sepi, bahkan yang lebih mengecewakan dari cerita yang buruk adalah kualitas aksi yang medioker, tanpa greget, tensi dan emosi, sungguh sangat disayangkan franchise sebesar Fantastic Four harus dimulai lagi dengan start yang buruk.'),
(542, 'Fatal Frame', 'NEGATIF', 'DATA LATIH', 'Ya, harus diakui beberapa momen masih berhasil menghadirkan sebuah atmosfer kelam mencekam, setiap koridor gelap dari bagunan asrama masih memberikan efek tidak nyaman, namun untuk ukuran J-horor, Fatal Frame masih berada di wilayah aman buat penonton penakut, tidak sampai terlalu mengerikan, malah bisa dibilang ia membosankan karena alurnya bergerak terlalu pelan. Sementara narasinya sendiri sebenarnya tidak terlalu buruk. Di mulai dengan menawarkan misteri tentang kutukan aneh yang mengkibatkan para siswi mendadak menghilang pasca mencium foto salah satu primandona asrama, plot Fatal Frame meskipun lemah namun ia masih mampu menghadirkan rasa penasaran penontonnya untuk mengetahui tentang apa yang sebenarnya terjadi termasuk dengan kejutan di akhir film.'),
(543, 'Gangster Squad', 'NEGATIF', 'DATA LATIH', 'Ini mungkin film gangster dengan cerita dan karakterisasi terlemah yang pernah saya tonton, tetapi jika kamu adalah salah satu audiens yang tidak pernah peduli soal hal-hal penting itu maka Gangster Squad akan memuaskanmu dengan parade aksi seru nan brutal, sedikit komedi lengkap dengan segala aroma gangster ala Amerika  klasik yang kuat dipresentasinya, plus ensemble cast yang sudah sedikit banyak memberikan pesona terbesar untuk film yang sebenarnya tidak istimewa ini.'),
(544, 'Ghastly', 'NEGATIF', 'DATA LATIH', 'Pertama, untuk ukuran horor dengan tema klasik, rumah hantu ia tidak  menakutkan. Tidak ada sesuatu yang benar-benar sampai membuat bergidik di sini kecual mungkin ketika melihat sosok Bin, bocah yatim-piatu yang diperankan dengan baik aktor cilik Hyung-Suk. Kedua, Yun-Ho sudah kerap ‘menipu’ penontonnya dengan cara yang sama sekali tidak elegan, lihat saja ketika ia terlalu banyak  melibatkan adegan mengerikan yang ternyata hanya jelmaan mimpi dari tokoh-tokoh didalamnya, benar-benar sebuah cara yang bodoh. Dan ketiga, yang paling fatal adalah kualitas naskahnya. Ceritanya begitu lemah dan dipaksakan, terlalu banyak lubang-lubang besar di sana-sini yang sangat menggangu, tentu saja saya tidak akan menjabarkannya disini untuk menghindari spoiler, tapi sungguh rangkaian plot hole yang bertebaran di sepanjang kurang lebih 90 menit, bahkan endingnya pun sangat tertebak dan menggelikan.\r\nSebuah penantian yang berakhir antiklimaks, ya, itulah yang terjadi ketika saya berharap terlalu banyak pada horor Korea satu ini. Bukan hanya tidak istimewa, tapi Ghastly juga begitu banyak didera ‘borok-borok’ besar pada skripnya yang sangat menggangu kenikmatan menonton. Yah, untung saja masih beberapa  yang terlihat mengerikan disini, selain potongan-potongan kaki palsu yang terlihat sangat meyakinkan itu, karakter bocah setan yang sadis, ada Hyomin, salah satu personil T-ara yang setidaknya memberi sedikit ‘kesegaran’ di 92 menit yang ‘kering’.'),
(545, 'Grand Piano', 'NEGATIF', 'DATA LATIH', 'Masalahnya adalah motif. Karakter Cusack tidak seidealis dan tidak sepintar yang kita kira, tidak seperti karakter yang dimainkan Kiefer Sutherland di Phone Booth ketika ia mengancam Colin Farell yang bermulut besar. Mungkin dari awal kita akan mengira bahwa ia seorang fans fanantik yang kecewa dengan pertunjukan terakhir Selznick, tetapi pada akhirnya kita tahu bahwa tujuannya sangat sederhana dan sangat cheesy, dan itu sedikit banyak sudah merusak segalanya, belum lagi mengetahui bahwa sang villain ternyata terlihat bodoh dan tidak pernah konsisten dengan ancamannya, lalu klimaksnya di atas panggung itu bisa dibilang konyol.'),
(546, 'Green Lantern', 'NEGATIF', 'DATA LATIH', 'Sebagai sebuah sugguhan superhero Green Lantern sebenarnya memiliki semua potensi untuk melebihi atau setidaknya menyaingi jagoan-jagoan Marvel tahun ini. Sayang ia tidak pernah mencapai titik puncak kepuasan menonton sebuah sajian pahlawan super karena harus menderita oleh kualitas naskah yang buruk, penggarapan yang pas-pasan, CGI yang terlihat cantik namun terlalu berlebihan termask juga kehadiran Ryan Reinolds yang overatted. Sepertinya untuk saat ini DC Comics lebih baik memfokuskan saja kepada reboot Superman atau The Dark Knight Rises yang mudah-mudahan bisa mengambalikan kejayaan mereka lagi.'),
(547, 'Green Zone', 'NEGATIF', 'DATA LATIH', 'Perang Irak memang bukanlah tema yang bersahabat untuk diangkat dalam sebuah film, walaupun kuat secara kualitas cerita namun jelas tidak menjamin film tersebut akan sukses di pasaran, contoh paling gampang adalah The Hurt Locker, yang di puji habis-habisan oleh para kritikus bahkan sampai mendapat Oscar sebagai film terbaik namun hasil box-office nya bisa dibilang biasa saja. Dan sepertinya kutukan itu kembali menerpa Green Zone, walaupun sudah memasang duet maut Greengrass-Damon dan didukung oleh penulis naskah Brian Helgeland (L.A. Confidential, Robin Hood) tampaknya untuk dapat balik modal saja sudah bagus. Memang kalau mau jujur walaupun cerita yang diangkat cukup menarik dan penuh dengan sindiran-sindiran dan intrik-intrik politik kental namun sepertinya masih terlalu berat untuk dinikmati sebagai sebuah film hiburan.'),
(548, 'Gulliver''s Travel', 'NEGATIF', 'DATA LATIH', 'Overall, tampaknya daripada menghadirkan daur ulang sebuah dongeng klasik ke dalam versi modern, Gulliver’s Travels malah lebih condong menjadi ajang Jack Black mempertontonkan segala kenarsisaan dan kegilaannya. Ya, film ini memang hanya sekedar menghibur, itupun kalau anda memang fans seorang Jack Black yang terbiasa dengan segala guyonannya yang nyeleh, jika tidak lebih baik lewatkan saja film satu ini, toh, anda tidak akan rugi apa-apa.'),
(549, 'Guru Bangsa Tjokroaminoto', 'NEGATIF', 'DATA LATIH', 'Dengan durasi kejam yang hampir menyentuh tiga jam tanpa kekuatan bercerita yang benar-benar bisa mengikat itu jelas adalah sebuah sikasaan tersendiri. Pesona teknis luar biasa dan dukungan ensemble cast-nya yang bermain gemilang hanya memberi rasa takjub instan yang perlahan memudar digerus durasi panjang nan memelahkan. Tidak ada momen yang benar-benar menghentak atau sampai emosional yang merengsek rasa patriotisme penontonnya, bahkan konflik demi konfliknya pun terasa lempeng dan dipanjang-panjangkan, termasuk penambahan karakter fiktif macam Stella yang tidak terlalu penting meskipun kenyataanya Chelsea Islan bermain fantastis.'),
(550, 'Haeundae', 'NEGATIF', 'DATA LATIH', 'Belum cukup dengan plot dan akting yang buruk, bak tsunami yang dahsyat film ini masih akan menerjang penontonnya dengan luapan besar kesalahan2 alias bloopers2 yang kelewatan banget terlihat, bukan hanya sekali dua kali, namun hampir disetiap adegan2 yang melibatkan bencana dipastikan diwarnai dengan adegan2 bodoh, tidak masuk akal dan sangat teramat dipaksakan, maksud hati sih ingin menghadirkan sebuah ketegangan yang mencekam namun hasilnya malah konyol.\r\nOverall, buruk adalah kata yang pas untuk menggambarkan keseluruhan film disaster Korea Selatan satu ini, bahkan 2012 yang notabene sudah terbilang mengecewakan terlihat jauh lebih baik dan masuk akal jika dibandingkan dengan film satu ini. benar2 membuang buang waktu saja.'),
(551, 'Halloween II', 'NEGATIF', 'DATA LATIH', 'Overall, walaupun masih bisa dibilang cukup Halloween II sukses menuai keuntungan secara komersil namun secara kualitas seri keduanya ini mengalami penurunan cukup besar, terutama pada bagian cerita yang tidak sebaik predesornya. Terlepas dari kelemahan2nya tersebut, ucapan terima kasih tetap layak diberikan oleh Rob Zombie yang mampu menghadirkan sosok baru sang legenda, Michael Mayers menjadi lebih baik dari versi orisinilnya.'),
(552, 'Haunt', 'NEGATIF', 'DATA LATIH', 'Sementara apa yang kamu dapat dalam Haunt bukan hanya sekedar sajian horor rumah angker dengan pakem ‘basi’ yang kembali diulang tanpa modifikasi berarti namun juga sebuah kebingungan untuk menjabarkan narasi dan misterinya. Hasilnya Haunt tidak lebih dari horor medioker dengan beberapa kebodohan (keluarga yang menempati rumahnya tahu bahwa tempat itu bekas dari kejadian-kejadian mengerikan dan mereka seperti tidak pernah terpengaruh sama sekali), cerita percintaan remaja maksa yang bertele-tele dan belum lagi gangguan plot hole..'),
(553, 'Headshot', 'NEGATIF', 'DATA LATIH', 'Headshot menderita banyak di berbagai sisi, cerita tentu saja salah satu yang paling mencolok. Narasi tentang balas dendam dari penjahat insaf dan pencarian identitas mungkin bukan konsep baru di ranah ini, Headshot sedikit banyak mengingatkan saya pada Kill Bill Vol. 1 milik Tarantino. Namun klise bukan masalah utamanya, adalah tidak adanya pengembangan yang cukup untuk membuat penontonnya bisa terlibat lebih dalam dengan konflik dan karakternya yang membuat naskah Headshot terasa dangkal dan compang-camping, padahal jujur saja, meski terasa familiar, premis ini sangat mungkin diolah lebih baik lagi guna menghasilkan tonjokan lebih emosional, apalagi kemudian ia membawa embel-embel romansa di dalamnya dengan melibatkan relasi antara Ishmael dan Ailin yang sayang lagi-lagi juga tidak pernah bisa dikemas dengan sempurna.'),
(554, 'Hide and Seek', 'NEGATIF', 'DATA LATIH', 'Sayang ketimbang memilih untuk tampil sederhana dan to the point layaknya thriller home invasion kebanyakan, Huh Jung berusaha membuat ceritanya menjadi lebih berbelit dengan memberikan karkater utamanya bermasalah dengan OCD- bukan trik diet ala pesulap lokal- dan masa lalu suram yang berusaha dilupakannya. plus sebuah satir sosial kontras tentang si kaya dan si miskin. Nah, sejak itu Hide and Seek mulai rusak. Ia terjebak dalam upayanya ingin mengalihkan perhatian penontonnya ke sesuatu yang lain, sialnya, semuanya terlalu dipaksakan, dan kebodohan fatal Huh Jung membocorkan identitas pelaku terlalu dini -entah disengaja atau tidak- sudah merusak twistnya.'),
(555, 'High Tension', 'NEGATIF', 'DATA LATIH', 'Mungkin yang sangat disayangkan adalah bagaimana Aja menutup kisah ini. Alih-alih menghadirkan sebuah twist-shocking ending yang cerdas ala The Sixth Sense, Aja malah seakan-akan memaksa penontonnya tertipu dengan cara yang terbilang ‘murahan’. Saya sendiri tidak percaya sutradara sekelas Aja bisa juga membuat ending seperti ini. Layaknya mencomot bagian penutup dari film lain dan menempelkannya disini, apa yang tersaji di klimaks ini begitu penuh kontrdiksi dengan apa yang sudah dihadirkan sepanjang film, sebuah plot hole besar yang seharusnya tidak perlu terjadi jika Aja memilih untuk menyelesaikan film ini dengan cara yang lebih normal.'),
(556, 'Hitman: Agent 47', 'NEGATIF', 'DATA LATIH', 'Tetapi akan menjadi kasus berbeda jika kamu datang memosisikan dirimu sebagai penonton awam yang tidak membawa ekspektasi apa-apa, ya, hasilnya Hitman: Agen 47 tidak terlalu buruk. Untuk sekelas sutradara iklan komersial, Basch sebenarnya cukup berhasil menghadirkan sebuah sensasi brainless action thriller yang seru dan enjoyable. Plot-nya mungkin sedikit berantakan, lemah dan tidak konsisten, beberapa elemen cerita akan terlihat tidak masuk akal dan menantang logika namun mengingat ini adalah cerita seorang agen super dari sebuah percobaan biologi rahasia yang mampu membuat jagoan kita lebih pintar, lebih cepat dan lebih mematikan dari manusia normal maka hal-hal yang terasa berlebihan tersebut masih bisa dibilang cukup wajar. Ya, ini adalah jenis film yang tidak perlu diambil pusing soal penceritaannya, tentang kenapa dan mengapa yang ujung-ujungnya nanti malah membuatmu tambah pusing.'),
(557, 'Home', 'NEGATIF', 'DATA LATIH', 'Jadi kenapa dengan materi teknis semenjanjikan itu Home malah tampil melempem? Pertama, melihat deretan animasi-animasi besutan Johnson, tentu saja ada rasa pesimis akan keberhasilan Home menjadi kartun yang bagus. Antz, Sinbad: Legend of the Seven Seas dan Over The Hedge jelas bukan termasuk dalam animasi ‘panas’ Dreamworks, malah bisa dibilang secara kualitas mereka termasuk kelas medioker dibandingkan franchise besar Dreamworks lain macam Shrek, Kung-Fu Panda dan How to Train Your Dragon. Dan apa yang terjadi di Home semakin memperkuat posisi Johnson sebagai sutradara animasi ‘kelas dua-nya’ Dreamworks. Johnson lagi-lagi gagal menghadirkan sesuatu yang spesial, termasuk desian karakternya untuk bisa tinggal lama di ingatan penontonnya. Narasinya terlalu generik, meskipun punya premis menarik yang meliputi petualangan intergalaksi, namun materinya sendiri terasa terlalu dipanjang-panjangkan untuk ukuran film dengan durasi 94 menit. Home dengan mudah menjadi membosankan dalam perjalannya menuju akhir.'),
(558, 'Horsemen', 'NEGATIF', 'DATA LATIH', 'Harus diakui memang setengah jam pertama Horsemen tampil sangat menjanjikan akan sebuah sajian thriller yang menarik. Atmosfer gelap dan mencekam serta misteri-misteri tentang peristiwa pembunuhan berantai misterius berhasil digarap dengan baik, sehingga membuat penontonnya tentu berharap banyak untuk mendapatkan sebuah kejutan di satu jam kedepan, namun apa yang terjadi adalah sebuah ‘bencana’. Cerita yang begitu menjanjikan di awal-awal film menjadi ‘babak belur’. Entah kenapa cerita menarik tersebut menjadi terlihat bodoh, penuh dengan penjelasan yang tidak jelas, dangkal dan terkesan dipaksakan, belum lagi ending-nya yang sangat mengecewakan. Kesemuanya itu masih diperparah lagi dengan akting Zhang Ziyi yang luar biasa buruk. Alih-alih tampil mengesankan sebagai seorang wanita misterius, aktris asal Cina ini malah lebih terlihat seperti pelacur murahan yang sedang merayu pelanggannya dengan bahasa Inggris-nya yang pas-pasan.\r\nOverall, Mencari sebuah crime-thriller yang pintar dan mencekam? Horseman jelas bukanlah sebuah pilihan yang bijak, karena film ini dijamin akan menghabiskan percuma waktu anda dengan sajian yang jauh dari berkualitas.'),
(559, 'Hostel Part III', 'NEGATIF', 'DATA LATIH', 'Sayang selain adegan menguliti wajah otomatis tidak ada lagi hal mengerikan yang bisa ditawarkan Spiegel. Ya, menggunakan kecoa-kecoa Madagaskar sebesar kepalan tangan anak kecil atau tembakan-tembakan anak panah besi untuk menyiksa korbannya jelas bukan cara yang kreatif untuk ukuran sebuah torture porn sekelas Hostel, parahanya lagi adegan-adegan tersebut terlihat begitu lembek, begitu ‘cupu’, jelas merusak apa yang sudah dibuat Roth sebelumnya. Satu-satunya yang mungkin sukses disiksa disini mungkin hanya para penontonnya yang harus duduk menyaksikan segala jeritan-jeritan sumbang dan kebodohan demi kebodohan,  membuat durasi 88 menit terasa berjam-jam.'),
(560, 'House at the End of the Street', 'NEGATIF', 'DATA LATIH', 'Ya, tidak butuh lama untuk membuat penontonnya bisa membenci HATES. Setelah opening yang menyakinkan, narasi garapan David Loucka (Dream House) dan Jonathan Mostow (Surrogates) ini perlahan namun pasti mulai terjun bebas ke jurang kehancuran. Dosis suspense-nya ompong, misterinya tiga babaknya tidak pernah terasa kuat dan menggigit, kamu dengan mudah melihat akhirnya jauh sebelum filmnya sendiri berakhir, terutama ketika karakter Ryan muncul dan ‘membeberkan’ segalanya.\r\nTwist ending-nya sebenarnya bagus, hanya saja proses menuju ke sana itu adalah sebuah kekacauan ditambah lagi selain penampilan apik J-Law yang lovable, karakter-karakter pendukung lainnya tidak pernah diberi porsi lebih dalam, mereka tampak lebih seperti figuran tanpa arti ketimbang membantu menggerakan plotnya. Memang Elizabeth Sue mampu menjalin relasi ibu-anak dengan Lawrence dengan cukup baik, tetapi hanya itu saja. Subplot lainnya seperti diada-adakan untuk memperpanjang narasinya yang sebenarnya bisa saja diakhiri setengah jam lebih cepat.'),
(561, 'I, Frankenstein', 'NEGATIF', 'DATA LATIH', 'Tetapi,  jujur saja, I, Frankenstein itu lebih kacau dari franchise Underworld dan Blade yang buat saya sudah termasuk medioker, bahkan parade pertarungan penuh CGI mewah antara pasukan Gargoyle pimpinan Miranda Otto dan iblis yang dikomandani oleh sang pangeran kegelapan dalam wujud Bill Nighy itu akan menjadi cepat usang dan membosankan.'),
(562, 'If I Stay', 'NEGATIF', 'DATA LATIH', 'Memang cerita tentang arwah cantik penasaran dalam drama bukan sekali ini saja dipakai. Meskipun sedikit ‘basi’ tetapi segmen penuh dengan aroma sedih dan kecemasan ini ini jelas jauh lebih menarik dan emosional ketimbang harus melihat banyak flashback membosankan tetang kehidupan bahagia Mia pra tragedi yang diisi banyak momen cheesy dalam iring-iringan musik cantik , nyaris tanpa konflik berarti. Mungkin bukan sepenuhnya salah sutradara spesialis dokumenter R. J. Cutler yang memulai debutnya di sini atau penulis naskahnya, Shauna Cross, mungkin saja memang novel Gayle Forman bukan live action material yang bisa dengan mudah dibuat versi filmnya dengan segala detil yang tak mungkin terangkut dalam 106 durasinya. '),
(563, 'Immortals', 'NEGATIF', 'DATA LATIH', 'Ya, film fantasi yang juga menjadi pembuka dalam ajang iNAFFF 2011kemarin ini memang gagal menghadirkan sebuah epik mitologi “sendal dan pedang” yang bagus dari segi kualitas cerita. Terlalu banyak modifikasi ekstrem di sana sini yang membuatnya malah terlihat konyol, lihat saja bagaimana Singh menurunkan derajat Theseus dari manusia setengah dewa menjadi tukan batu yang terlahir dari seorang ibu tanpa ayah, menggambarkan para Titan yang alih-alih berukuran raksasa sesuai namanya mereka malah terlihat mengelikan termasuk juga para dewa-dewanya. Ya, menjadi berbeda itu boleh-boleh saja, tetapi bukan berati harus konyol. Tapi di sisi lain Immortals punya daya tarik tersendiri selain visualnya yang luar biasa itu, tingkat kesadisan yang cukup frontal, membuatnya jelas bukan tontonan anak-anak seperti Clash of The Titans, lihat saja ketika Apollo menghabisi para anak buah Hyperion. Sebuah kombinasi tidak wajar, menggabungkan segala kecantikan dan kebrutalan penuh darah dan banyak kepala hancur menjadi kesatuan yang keren, ya, seperti 300, tapi tidak banyak editing  berlebihan yang dilakukan oleh Sighn di sini.'),
(564, 'Imperium', 'NEGATIF', 'DATA LATIH', 'Ya, di atas kertas Imperium menjanjikan sajian thriller yang menarik, tetapi narasinya yang tidak kuat membuatnya hanya terasa angker pada premis tidak dengan keseluruhan plotnya. Memang ada beberapa adegan yang terasa mendebarkan, kebanyakan melibatkan nyaris terbongkarnya penyamaran Nate Foster, tetapi secera keseluruhan Imperium bisa dibilang adalah thriller yang masih bermain di wilayah aman tanpa benar-benar punya keberanian lebih untuk menelusuri konsep kontroversialnya dengan lebih terbuka, terlebih dari interaksi antar karakternya yang terasa terlalu mudah dan memaksakan diri.'),
(565, 'In the Heart of the Sea', 'NEGATIF', 'DATA LATIH', 'Dengan durasi yang menyentuh 2 jam, Howard sebenarnya punya cukup banyak waktu untuk mengolah relasi antar karakternya, potensinya besar terutama ketika kita bisa melihat konsep rivalitas dan clash antara Owen Chase dan George Pollard, Jr yang sedikit banyak mengingatkan saya pada Niki Lauda dan James Hunt di Rush. Dari situ sebenarnya Howard bisa saja memperkuat naskah garapan Charles Leavitt (Blood Diamond) dan segala pergolakan emosi dengan modal perseteruan dua karakternya utamanya, sayang, nyatanya tidak demikian. Howard tampak lebih sibuk memperhatikan segala urusan teknis untuk bagaimana membuat In The Heart of The Sea secantik dan semegah mungkin, namun tanpa jiwa dan emosi.'),
(566, 'In Time', 'NEGATIF', 'DATA LATIH', 'Sungguh premis yang menjanjikan. Ketika pertama kali saya mendengarkan cerita film ini, apalagi mengetahui kalau Andrew Niccol yang menyutradarai sekaligus menulis ceritanya, saya langsung girang. Gattaca adalah salah satu film scifi favorit saya walaupun agak underrated. Selain Gattaca, Andrew Niccol juga menulis The Terminal, The Truman Show dan Lord of War yang juga termasuk dalam daftar film-film yang saya sukai. Tetapi In Time sayangnya menjadi film dengan ide yang sangat menarik tetapi eksekusi yang mengecewakan.'),
(567, 'Indigenous', 'NEGATIF', 'DATA LATIH', 'Jadi ketimbang lebih memusatkan segalanya pada pesona Chupacabra itu sendiri, Orr malah seperti lebih asik bermain-main dengan karakter-karakternya. Masalahnya, seperti Chupacabra, setiap tokohnya juga tidak mendapatkan perlakuan yang lebih baik. Mereka tidak jauh dari tipikal tokoh-tokoh sterotip dalam banyak sajian horor yang lebih cenderung bodoh, terutama dalam mengambil keputusan. Tidak jarang mereka menganggap remeh larangan yang ada. Ya, sepertinya dalam dunia horor peraturan, larangan atau himbauan itu memang paling asik untuk dilanggar, selanjutnya, bisa ditebak, sebuah penyesalan yang datang terlambat.\r\nIndigenous tidak hanya diisi oleh banyak karakter bodoh, namun juga presentasinya yang seperti tidak mau kalah. Naskahnya sudah bisa diduga, dangkal. padahal kalau mau sedikit lebih rajin, Max Roberts sang penulis bisa memberi lebih banyak.'),
(568, 'Into the Mirror', 'NEGATIF', 'DATA LATIH', 'Dari segi premis bisa dibilang Kim Sung-ho cukup berhasil mengusung benda sehari-hari sebagai medium penebar teror. Ya, benda bernama cermin ternyata bisa menjadi sangat mengerikan di bawah arahan Sung-ho, apalagi didukung dengan atmosfer kelam dan sunyi ala horror-horror Asia kebanyakan membuat film ini menjadi mencekam, sayang hanya pada paruh pertamanya saja. Menginjak paruh kedua kesan mengerikan pun perlahan mulai kedodoran, sampai akhirnya menginjak klimaks yang ternyata hanya terkesan begitu saja , walaupun harus diakui ending film ini sangat mengejutkan.\r\nOverall, entah karena sudah menonton versi Alexandre Aja atau kenapa, saya merasa Into The Mirror tampil tidak maksimal. Premis yang sebenarnya menarik harus terbuang begitu saja dikarenakan pengolahan cerita yang lemah. Untung saja Alexandre Aja mengetahui kekurangan ini dan mampu membuat Mirrors versinya menjadi jauh lebih menarik.'),
(569, 'Into the Strom', 'NEGATIF', 'DATA LATIH', 'Dibandingkan Twister, Into The Strom memang menderita banyak di narasinya. Terlalu cheesy dan klise, penulis naskah John Swetnam memang seperti tidak terlalu ingin membuat ceritanya terlalu rumit, toh ini adalah jenis film cenderung untuk “dilihat” ketimbang disimak. Jadi kamu akan menemukan pengenalan karakter yang kelewat standar dan pergerakan plot yang terlalu mudah dikenali, singkatnya, lupakan saja ceritanya, setidaknya meskipun dangkal, ia masih enak dinikmati tentu saja tidak lepas karena faktor lainnya.'),
(570, 'Jack and Jill', 'NEGATIF', 'DATA LATIH', 'Ya, Jack and Jill  sudah menjadi pengalaman menonton komedi yang mengerikan, selain harus menyaksikan karakter Sandler berwujud wanita dengan wig, payudara palsu lengkap dengan suara palsunya yang menganggu dan tingkah lakunya yang super bodoh nan menjijikan itu di selama satu jam setengah, naskah yang dikeroyok Sandler bersama tiga teman penulisnya juga terbilang sangat buruk, sama buruknya dengan segala humor-humor serta dialog-dialog garing, kurang ajar, jorok dan kasar ala Sandler yang kali ini sama sekali tidak berhasil membuat saya sulit untuk sekedar menyunggingkan senyum.'),
(571, 'Jack Reacher', 'NEGATIF', 'DATA LATIH', 'Sayang McQuarrie sepertinya tidak terlalu pintar mengeksekusi naskahnya menjadi sebuah kesatuan thirller yang solid, seperti yang pernah dilakukannya pada Valkyrie lalu. Intensitas keteganganya terasa ‘labil’, ketika di satu titik ia berhasil mencapai puncak (adegan kejar-kejaran mobil) di titik selanjutnya ia seperti terjun bebas menjadi menjemukan dan terseok-seok dengan segala dialog-dialognya yang lemah dan itu sering terjadi berulang-ulang, termasuk membuang percuma performa apik para peran pembantunya macam Warner Herzog yang tampil dingin sebagai The Zec atau Robert Duvall,  sampai kemudian ia diakhiri dengan ending antiklimaks yang masih belum menjawab sepenuhnya siapa sebenarnya sosok Jack Reacher itu (mungkin jika sukses akan dijelaskan dalam sekuel-sekuelnya).\r\nSaya kira ini bisa ditutup dengan pintar , ternyata saya salah, Jack Reacher tidak lebih dari sebuah thriller kriminal yang berusaha keras untu terlihat cerdas dan seru sama baiknya, sayang itu tidak terjadi di sini. Hanya terlihat bagus di 20 menit pertama selanjutnya kita hanya melihat McQuarrie lebih mengantungkan semuanya  kepada pesona bintang seorang Tom Cruise.'),
(572, 'Jack the Giant Slayer', 'NEGATIF', 'DATA LATIH', 'Tentu saja mengecewakan untuk ukuran sutradara sekaliber Bryan Singer terlebih dengan budget sebesar itu dan banyak nama-nama aktor kelas satu di dalamnya, Jack the Giant Slayer harusnya bisa lebih dari sekedar sebuah dongeng fantasi daur ulang untuk kelas film keluarga dengan CGI pas-pasan. Tetapi sekali lagi, saya masih sanggup menikmatinya, yah, setidaknya saya lebih suka yang satu ini ketimbang Hansel & Gratel: Witchs Hunter .'),
(573, 'Java Heat', 'NEGATIF', 'DATA LATIH', 'Eksploitasi besar-besaran kota Jogjakarta plus Candi Borobudur dengan segala kegemerlapan acara Waisak-nya mungkin hanya satu-satunya hal positif yang berhasil di garap Conor, sisanya Java Heat bak sebuah bencana berisik berbiaya besar yang gagal di semua sektornya, termasuk membuang percuma premis dan sumber daya utamanya. Kecuali ada fans film aksi kelas ‘B’ tanpa otak, saya sarankan untuk menghindari Java Heat yang tidak ada panas-panasnya ini.'),
(574, 'Jessabelle', 'NEGATIF', 'DATA LATIH', 'Mencampur elemen haunted house dan sihir-sihir voodoo lama dari selatan Amerika, Jessabelle tidak pernah tampil semeyakinkan posternya sejak menit-menit awal bergulir. Tentu saja ada misteri yang butuh jawaban sejak kaset-kaset VHS tua itu mulai diputar oleh Jessie yang malang, tentu saja ada banyak pertanyaan tentang siapa itu dan mengapa ini yang sedikit banyak sudah memaksa penontonnya untuk duduk bersabar menanti akhir, melewati serangkaian serangan lemah berupa jump scare murahan, akting pas-pasan dari artis Australia Sarah Snook, aroma creepy yang tak pernah mencapai titik didih dan kualitas narasi lembek dan bisa dibilang jauh lebih dangkal ketimbang selokan depan rumahmu lengkap dengan banyak basa-basi tak perlu kecuali mungkin untuk memanjangkan durasinya.');
INSERT INTO `sa_review` (`id_review`, `judul_review`, `sentimen_review`, `kategori_review`, `isi_review`) VALUES
(575, 'Jonah Hex', 'NEGATIF', 'DATA LATIH', 'Seperti yang sudah saya singgung di atas, tidak usah terlalu pusing memikirkan plot-nya yang memang berantakan. Jonah Hex jelas tidak menawarkan sesuatu yang spesial pada ceritanya, semuanya serba instan, klise, bahkan bisa dibilang jauh dibawah rata-rata film superhero yang paling standart sekalipun. Sebagai sutradara, Jimmy Hayward yang sebelumnya cukup sukses menggarap Horton Hears a Who! rupanya tidak mampu mengadaptasi dengan baik kisah komik yang seharusnya memiliki potensi untuk menjadi sebuah film lebih baik dari ini. Membuang talenta sebaik Josh Brolin dan John Malkovich -sorry, not you Megan, ’cause you sucks, like always- juga menjadi ‘dosa’ terbesar Hayward.\r\n\r\nSo, andai saja tidak ada Josh Brolin dan Malkovich di sini, saya tidak mampu membayangkan bagaimana nasib kisah superhero western satu ini. Namun meskipun begitu, dibalik segala keburukan-keburukannya, Jonah Hex tetap adalah sebuah film ringan yang menghibur. Definitely a nice gulity pleasure antihero movie, and I pretty much enjoyed it.'),
(576, 'Joy', 'NEGATIF', 'DATA LATIH', 'Russell memang masih mempertahankan segala ciri khasnya dari momen-momen depresi yang dibungkus humor, namun ia gagal menghadirkan sebuah proses yang masuk akal apalagi untuk ukuran drama berdasar kisah nyata. Transisi dari sebuah kegagalan menuju kesuksesan terasa digampangkan tanpa adanya sebuah penjelasan. Poof! seperti sulap, semua rintangan  mendadak dengan cepat menghilang ketika Joy menginginkannya. Proses transisi yang ajaib ini malah menghilangkan kesan realistisnya, membuatnya menjadi semacam fantasi yang tentu saja terasa aneh.'),
(577, 'Jupiter Ascending', 'NEGATIF', 'DATA LATIH', 'Masalahnya, tidak peduli seberapa dahsyat spesial efek dan hebohnya rentetan aksi yang tersaji, pesona Jupiter Ascending dengan cepat menurun drastis. Entah karena terkesan repetitif atau tidak ada lagi yang bisa ditawarkan ketika para Wachowskis ketika merka langsung mengobral cepat jualannya sejak awal tanpa menawarkan sesuatu yang lebih besar lagi dalam perjalannya. Ya, tidak butuh waktu lama buat saya untuk segera merasakan kejenuhan,  Wachowskis mengulangi lagi dan lagi sekuen yang sama dengan setting berbeda dengan suasan yang semakin berisik, hal negatif ini kemudian diperparah dengan kualitas narasi yang sama membosankannya. Konsep yang ditawarkan memang terlihat besar dan ambisius, bahkan Lana sesumbar ada elemen spritual bekerja di dalamnya. Masalahnya, entah saya tidak peka atau memang pesannya tidak berhasil tersampaikan dengan baik. Alih-alih menjadi versi baru The Matrix dan Cloud Atlas, Jupiter Ascending dengan cepat jatuh menjadi sajian sci-fi action garing dengan naskah kelas medioker. Saya tidak peduli dengan cerita, terlebih karakter-karakternya yang annoying dan gagal meninggalkan kesan, bahkan elemen yang seharusnya bisa memberikan hiburan lebih seperti aksi dan spesial efeknya juga dengan cepat meleleh menjadi semelahkan naskahnya, hingga akhirnya satu-satunya yang saya tunggu adalah kedatangan end credit roll-nya.'),
(578, 'Jurassic World', 'NEGATIF', 'DATA LATIH', 'Lantas apa yang kemudian ditawarkan Jurassic World? Ia bahkan hanya ditangani oleh sutradara sekaliber Colin Trevorrow yang terakhir menggarap sci-fi indie Safety Not Guaranteed. Ya, di dalamnya kita memang akan menemukan spesies baru dino yang lebih ganas, lebih kuat, lebih cerdas dan memiliki lebih banyak gigi dari T-rex bernama konyol; Indominus rex. Indominus rex pula lah yang kemudian menjadi alasan kenapa naskah dangkal Jurassic World masih bisa berjalan. Ada petualangan mendebarkan, khususnya di paruh ketiga dan momen puncaknya ketika karakter-karakter utamanya berusaha bertahan hidup dari serangan Indominus rex yang mengerikan, tentu saja semuanya itu dibungkus bersama adegan-adegan aksi dan kejar-kejaran seru nan mendebarkan dalam balutan CGI yang keren dan visual megah khas film musim panas yang mahal, plus tambahan gimmick efek 3D yang sayang tidak bekerja terlalu maksimal, sama tidak maksimalnya dengan pengembangan karakter yang terkesan apa adanya.'),
(579, 'Kata Hati', 'NEGATIF', 'DATA LATIH', 'Naskahnya lemah dan cenderung terlalu lurus, tidak peduli kemudian ia diberikan penghalang berupa seorang cantik bernama Kimberly Rider yang muncul ditengah-tengah dua hati yang sedang saling mengobati dan memperburuk keadaan toh ia tidak pernah menjadi terlalu rumit, bahkan kita bisa ‘mencium’ endingnya dari kejauhan tanpa harus menjadi anjing pelacak tapi sekali lagi bukan hanya itu masalahnya. Ekskusi yang dilakukan Iqbal Rais juga semakin memperparah segalanya. Alurnya lambat, terlalu bertele-tele tidak peduli ketika ia bersama DOP-nya berhasil menangkap gambar-gambar cantik kota Jogja atau bagaimana Andhika Triyadi mampu membungkusnya dengan soundtrack-soundtrack romantis, ini sama sekali tidak bekerja dengan baik, itu saya belum menyebut dua karakter utamanya yang tidak punya cukup chemistry untuk membuatmu percaya bahwa ada banyak cinta di dalamnya. Lalu ada sub plot bodoh tentang adik Fila yang sama sekali tidak penting kecuali untuk memperpanjang durasinya.'),
(580, 'Kidnapper', 'NEGATIF', 'DATA LATIH', 'Meskipun dimulai dengan berantakan, toh saya tetap harus melanjutkan film ini hingga habis karena sudah terlanjur penasaran dengan bagaimana nasib sang anak. Untung saja selanjutnya ternyata not so bad. Beberapa adegan tersaji cukup menarik dan menegangkan dengan tempo naik turun, plus beberapa momen melodrama yang (seharusnya) mengaharukan, namun tetap saja harus diakui adegan-adegan tersebut terkesan terlalu lebay atau berlebih-lebihan dalam penggarapannya sehingga cukup menganggu kenyamanan menonton.'),
(581, 'Killer Joe', 'NEGATIF', 'DATA LATIH', 'Masih beranggapan saya berlebihan? Ya, ini adalah jenis film yang menawarkan premis yang buruk (dalam artian positif), kotor dan cabul dengan banyak menampilkan gambar-gambar vulgar, lalu kamu akan tahu kenapa film jenis ini dibatasi dengan rating NC-17 di A.S sana yang jelas membuatnya sulit untuk mendapatkan banyak penonton, tetapi ini memang bukan film yang pantas untuk ditonton oleh banyak orang.'),
(582, 'Ladda Land', 'NEGATIF', 'DATA LATIH', 'Ketika drama keluarga dengan segala tetek bengek melodrama dan isu-isu sosialnya bisa tersaji lebih kuat dan menarik, Ladda Land malah harus menderita pada sisi horornya, malah membuat elemen yang seharunya mendapatkan porsi paling besar ini terkesan sebagai sebuah subplot tambahan yang buruk termasuk dengan hadirnya rentetan plot hole yang tidak pernah terungkap dan juga terkesan terlalu dipaksakan hanya untuk memenuhi tujuannya untuk menakut-nakuti penontonnya dengan cara murahan tanpa memberikan asas cerita yang kuat. Bukan berarti saya mengatakan Sukdapisit gagal total dalam menghadirkan segala momen mencekam dan atmosfer creepynya. Di beberapa bagian Ladda Land masih mampu memberikan terapi kejut yang efektif, sayang klimaksnya sedikit tertebak tetapi saya menyukai bagaimana kemudian Sukdapisit memilih sentuhan drama ketimbang horor untuk menutup kisahnya.'),
(583, 'Letters to Juliet', 'NEGATIF', 'DATA LATIH', 'Tidak ada yang terlalu istimewa dalam Letters to Juliet, semuanya tersaji serba standart, tidak sampai terlalu mengecewakan memang namun masih jauh juga untuk dikatakan sebagai sebuah film yang bagus. tipikal drama romantis Hollywood yang hanya mejual keindahan kulit luar ketimbang kedalaman ceritanya.'),
(584, 'Love, Rosie', 'NEGATIF', 'DATA LATIH', 'Tidak peduli seberapa memesonanya penampilan cantik Lily Collins dengan alis tebalnya itu, naskah Towhidi dengan cepat dan pasti membuatnya  menjadi tidak lebih dari karakter perempuan bodoh yang insecure, haus akan cinta yang tak kunjung datang, membuatnya seperti terlihat selalu putus asa dalam mengambil setiap keputusan yang kemudian di sesalinya. Tetapi penampilan Collins bisa dibilang terlihat jauh lebih baik ketimbang ketika narasinya memperlakukan tokoh Alex yang dibawakan jebolan The Hunger Games, Sam Claflin. Alex adalah jenis manusia yang jauh lebih menyedihkan ketimbang Rosie. Punya banyak kesempatan untuk mengakhiri konfliknya lebih cepat, namun yang terjadi adalah sebuah kebodohan demi kebodohan yang membuatnya seperti tidak pantas menjadi pria yang ditunggu selama 12 tahun.'),
(585, 'Man on a Ledge', 'NEGATIF', 'DATA LATIH', 'Man on a Ledge, thriller dengan premis menarik, eksekusi yang tidak terlalu buruk dan deretan bintang-bintang besar, sayang ia harus dirusak dengan kualitas naskah menyedihkan. Yah, masih untung ia tidak berakhir membosankan, dan sekali lagi mungkin anda harus ‘menutup sebelah mata’ untuk benar-benar bisa merasakan segala kebodohannya yang menghibur itu.'),
(586, 'Me Before You', 'NEGATIF', 'DATA LATIH', 'Di luar dari kepiawaian Clarke yang membawakan peran gadis kikuk manisnya, Me Before You juga untungnya didukung chemistry yang lumayan sepadan dari duet Clarke dan Claflin. Keduanya cukup mampu menjaga laju filmnya yang beralur lemah dan kelewat enteng. Sebagai sajian komedi romantis, Me Before You sudah memenuhi semua kriteria film mainstream sejenis, dari dua pemeran utama yang berwajah sedap dipandang, tempat-tempat berpanorama elok di mata, hingga lantunan lagu-lagu yang sedap didengar. Kurangnya ada di naskah tulisan Moyes sendiri yang berasa kelewat manis dan ringan bak gula kapas arumanis. Sebegitu manisnya hingga terkadang membuat enek, isu sensitif euthanasia yang bisa digali dengan mendalam juga dijadikan sekedar tempelan belaka di penghujung plotnya. Di tangan sineas Inggris, Thea Sharrock, Me Before You juga terkesan main aman. Tak berani bermain-main keluar dari zona aman stereotype komedi romantis kontemporer yang belakangan ini mulai terasa menjemukan.'),
(587, 'Minions', 'NEGATIF', 'DATA LATIH', 'Paruh pertama Minions bisa dibilang cukup menarik. Melihat bagaimana Coffin dan penulis naskah menciptakan origins kaum Minion, bagaimana melihat mereka bertahan hidup dari satu majikan ke majikan lain dalam sebuah rentang waktu sejarah yang sangat panjang dengan segala tingkah laku kocak yang sayangnya selalu berakhir buruk. Masalahnya kelucuan yang seharusnya bisa maksimal harus menjadi terasa hambar karena sebelumnya sudah bolak-balik dibocorkan oleh trailer-nya yang muncul dalam berbagai versi, nyaris tidak menyisakan sesuatu yang benar-benar berbeda untuk bisa membuat penontonnya kemudian bisa sampai terpingkal.\r\nSementara di paruh kedua ada lebih banyak momen aksi yang melibatkan set Amerika dan Inggris di era 60’an akhir lengkap dengan segala pernak-pernik budaya dan sejarahnya plus elemen spionase klasik.  Tetapi Coffin seperti sudah kehabisan amunisi untuk menghadirkan lelucon baru buat para minion-nya, hasilnya, kelucuan yang dihadirkan Minions perlahan namun pasti menjadi ‘garing’ dan annoying. Setiap lelucon kemudian hanya sebatas menghasilkan sedikit senyum ketimbang tawa lepas. Sementara kemunculan karakter villain baru macam Scarlet Overkill pun tidak mampu memberikan banyak pengaruh besar buat pergerakan plot-nya. Mungkin salah suara Sandra Bullock yang tidak sejahat penampilannya, atau mungkin juga salah penulis naskah Brian Lnych  yang tidak mampu mengolah sebuah narasi yang kuat buat para minion. Bahkan suara-suara yang dihadirkan bintang-bintang besar macam Michael Keaton, Jon Hamm, Steve Coogan sampai Geoffrey Rush seperti tidak memberi pengaruh apa-apa selain hanya menjadi label jualan.'),
(588, 'Miss Bala', 'NEGATIF', 'DATA LATIH', 'Narasinya menjebak anda untuk ikut tersesat seperti halnya Laura yang terombang ambing didalamnya, dimulai sejak peristiwa di klub malam itu, selanjutnya akan banyak kejutan tidak terduga yang membuat anda tetap terjaga, menantikan apa yang kira-kira akan terjadi kemudian pada Laura yang berada di tempat dan waktu yang salah. Sayang Naranjo menghadirkan film yang mewakili Meksiko dalam ajang Oscar 2012 ini sedikit bertele-tele dan terkesan repetitif. Pesannya sendiri juga tidak pernah mencapai sasaran kecuali satu hal, Meksiko itu memang keras bung! Tidak ada karakter yang benar-benar baik di sini, bahkan polisi sampai jenderal sekalipun semuanya korup, tapi selain itu kita benar-benar dibuat bingung apa yang sebenarnya ingin disampaikan Naranjo, tidak ada klimaks, bahkan terdapat beberapa bagian yang nampak konyol dan tidak masuk akal. '),
(589, 'Money Monster', 'NEGATIF', 'DATA LATIH', 'Memang di menit-menit awal Money Monster terasa menjanjikan ketika Foster memilih untuk tidak menjadikannya The Big Short versi 2.0 yang cerewet berbicara soal uang dan ekonomi dan langsung tancap gas ke konflik utamanya. Lalu presentasi thriller ruang sempitnya juga tidak buruk, perpindahan antara adegan di panggung dan di ruang kontrol digarap dengan baik. Di bagian ini Foster cukup pintar memberikan momen intensnya meski buat saya efek tegangnya dengan cepat berlalu bersama penampilan tokoh-tokohnya yang kurang bersimpati serta transisi antara komedi dan dramanya yang kacau, kecuali mungkin Julia Roberts yang bermain cukup oke sebagai director Money Monster meski ia selalu berada di belakang layar. Bagian terburuk Money Monster ada pada third act-nya, itu bukan sebuah puncak yang bagus, terkesan memaksakan diri dengan segala konklusi yang datang secara kebetulan dan bersamaan. Tetapi sekali lagi ini bukan tontonan yang buruk, setidaknya saya menikmati apa yang ditawarkan Foster di sini terlepas dari segala kekurangannya'),
(590, 'Monsters', 'NEGATIF', 'DATA LATIH', 'Beberapa kekurangan lain seperti dialog yang tidak berkembang disaat memasuki pertengahan film dan lemahnya chemistry yang terjalin antara Scoot McNairy dan Whitney Able menjadi catatan tersendiri disini. Cukup mengejutkan memang, mengingat keduanya sebenarnya juga adalah pasangan di dunia nyata namun  kenyataannya mereka tidak mampu menghasilkan pendekatan satu sama lain dengan meyakinkan.'),
(591, 'Mr. Go', 'NEGATIF', 'DATA LATIH', 'Jelas ini adalah film besar, lihat konsepnya, lihat budgetnya, lihat distribusi masalnya, lihat bagaimana para tim spesial efeknya berhasil melakukan pekerjaan rumah mereka dengan menciptakan gorilla CGI menggemaskan yang nyaris sempurna sebagai daya pikat terbesarnya, lalu memberikannya baseball sebagai pertunjukan utama. Tetapi yang terjadi pada narasinya bisa dikatakan berbanding terbalik dengan segala teknis canggihnya. Entah terlalu sibuk memfokuskan semuanya untuk menciptakan sosok gorilla sebagus mungkin (mereka bahkan membuat setiap helai bulu Ling Ling yang berjumlah 3,8 juta),  Kim Yong-hwa melupakan bahwa Mr. Go juga memerlukan kualitas cerita yang bagus, atau setidaknya tidak sampai sedangkal dan semudah ini.'),
(592, 'Negeri van Oranje', 'NEGATIF', 'DATA LATIH', 'Jujur saja, mudah kok untuk menebak siapa yang menjadi pilihan lintang, toh, ini bukan film Christopher Nolan yang njelimet atau Terrence Malick yang absurd. Petunjuk-petunjuknya sudah tersebar jelas di sepanjang film, dengan karakter Lintang yang cenderung serius dan sedikit manja, kandidat calon suami langsung mengerucut ke dua orang, belum lagi twist menjelang akhir film semakin memperjelas siapa yang akhirnya bersanding di pelaminan bersamanya. Mungkin saya tidak terlalu memusingkan pertanyaan “siapa”, itu mudah, namun dengan potensi premis yang sebenarnya menjanjikan akan sebuah proses pengenalan karakter yang dalam ternyata disia-siakan oleh Endri Pelita. Memang ada pengenalan satu per satu karakternya, namun itu masih dirasa terlalu minim dan hanya menyentuh permukaannya saja.'),
(593, 'Nine Dead', 'NEGATIF', 'DATA LATIH', 'ampir sepanjang 1 jam setengah tidak ada sesuatu yang istimewa yang ditawarkan disini, semuanya terkesan plain, membosankan, belum lagi akting-akting bodoh yang ditampilkan para pemainnya membuat saya berharap film ini untuk secepat mungkin berakhir dan berharap secepat mungkin menyaksikan ending-nya yang mungkin saja akan membuat saya ‘terbangun’. namun apa yang ditunggu ternyata jauh diluar dugaan. Jujur saja saya terkejut namun bukan dalam arti yang postif, saya terkejut karena seumur hidup belum pernah saya menonton sebuah thriller dengan ending sebodoh ini, bahkan hanya dengan membaca judulnya saja kita akan tahu bagaimana akhir film kelas “B” satu ini.'),
(594, 'No Escape', 'NEGATIF', 'DATA LATIH', 'Sementara kemunculan tokoh Hammond yang dimainkan Pierce Brosnan alih-alih menjadi daya tarik malah melemahkan. Tidak ada kejelasan karakter Hammond, siapa ia dan apa tugasnya Hammond muncul seenaknya dengan kharisma khas Brosnan, selalu di saat dan momen yang terlalu pas, membuat No Escape kehilangan elemen realistisnya. Karakter Hammond sama tidak jelas dengan latar belakang narasi utamanya yang sama sekali tidak pernah membahas mengapa dan kenapa situasi politik bisa memanas, yang kita tahu para pemberontak tidak terima karena Amerika menguasai sumber air dan mendirikan perusahaan di sana, masalahnya, apakah itu bisa menjadi motif kuat untuk memicu sebuah aksi pemberontakan. Meski set waktunya berlangsung cepat, terhitung hanya satu malam, tetapi melihat bagaimana pemerintah yang nyaris tidak bereaksi dan hanya muncul di awal konflik itu jelas menjadi sebuah plot hole yang mengganggu.'),
(595, 'Nurse 3D', 'NEGATIF', 'DATA LATIH', 'Masalah utama Nurse 3D bukan pada lemahnya naskah yang memang sangat-sangat cheesy atau efek 3D-nya yang norak, soal itu sudah sangat bisa dimaklumi, tetapi bagaimana ketidak konsistenan penyutradaraan Aarniokoski. Di awal-awal ia seperti ingin membungkus Nurse dengan kemasan grindhouse seksi dan erotis bersama segala unsur gotik-nya yang penyajiannya seakan-akan sengaja dibentuk dalam kemasan horor/thriller murahan,  namun dalam perjalanannya semua itu menguap, dan ironisnya, menjadikan Nurse benar-benar terasa murahan, termasuk efek 3D-nya -Ya, saya tidak pernah menyukai ide horor/thriller bercampur 3D'),
(596, 'Odd Thomas', 'NEGATIF', 'DATA LATIH', 'Ada hal-hal yang tidak konsisten dan dipaksakan dalam perjalannya menuju akhir yang membuat plotnya berlubang di beberapa bagian, belum lagi karakter-karakter baru yang seperti selalu muncul silih berganti, seperti ingin membuat penontonnya bingung untuk menebak siapa pelakunya tanpa adanya latar belakang yang jelas. Entah karena Sommers tidak lihai mengubah narasi novelnya ke naskah film tanpa dukungan Koontz (FYI, Sommers menulis sendiri naskahnya setelah membaca novelnya karena tidak mendapatkan hak cipta dari Dean Koontz sebelum akhirnya diberikan pada juni 2012 lalu ) atau sederhana, memang novelnya sendiri yang tidak kuat (saya tidak terlalu percaya yang ini), menjadikan Odd Thomas kedodoran di setengah jam terakhir, plus twist ending yang memaksa.'),
(597, 'Ondine', 'NEGATIF', 'DATA LATIH', 'Tempo yang dibangun sudah pas, tidak terlalu lambat dan tidak kelewat cepat, namun entah kenapa masih terkesan dangkal dan kurang menyentuh. Mitos tentang Celtic creature yang menjadi tema utama sepertinya hanya dijadikan ‘pajangan’ disepanjang film. Pertanyaan tentang siapa sebenarnya Ondine memang terjawab di akhir film, namun sekali lagi tidak membuat film ini menjadi istimewa karenanya.'),
(598, 'Only You', 'NEGATIF', 'DATA LATIH', 'Bukan pilihan romcom yang tepat untuk menghabiskan malam valentine bersama pasanganmu, terlalu medioker dan mudah dilupakan tanpa sebuah romantisme dan chemistry yang kuat. Untung saja masih ada Italia dan wajah cantik Tomei yang setidaknya mampu membuat saya, atau mungkin penonton pria lainnya mampu bertahan menyaksikan Only You sampai akhir.'),
(599, 'Open Grave', 'NEGATIF', 'DATA LATIH', 'Pasca opening-nya tensinya langsung melorot drastis meskipun tidak sampai mengerucutkan niatmu untuk melihat akhirnya. López-Gallego jelas harus banyak berterima kasih kepada Sharlto Copley yang menjadi alasan besar kenapa Open Grave masih layak ditonton selain misterinya, dan tentu saja ending yang kamu tunggu-tunggu. Sebenarnya tidak perlu menunggu sampai habis untuk mencerna semuanya, toh López-Gallego terlalu baik untuk memberikan banyak petunjuk dan flashback tentang apa yang sebenarnya terjadi. Dan ketika akhir itu datang hasilnya tidak terlalu mengejutkan lagi, sebuah akhir yang ternyata sangat familiar hanya saja seperti nasib para karakternya, kita seperti dibuat tidak tahu apa-apa dari awal.'),
(600, 'Paranormal Activity: The Marked Ones', 'NEGATIF', 'DATA LATIH', 'Jujur, meskipun mengakui sebagai fans beratnya saya tidak pernah berharap banyak pada instalemen terbaru PA ini, apalagi mengingat ini sebuah spin-off. Dan benar saja, The Marked Ones mengecewakan, termasuk buat penonton yang memuja franchise ini macam saya. Tidak ada hal baru di sini, seperti berjalan di tempat yang sama, semuanya sudah pernah kamu lihat, parahnya The Marked Ones tersaji dengan kualitas keangkeran yang menurun jauh , bahkan dari seri ke-empatnya sekalipun yang digadang-gadang sebagai seri terburuk.'),
(601, 'Passion', 'NEGATIF', 'DATA LATIH', 'Yang menjadi permasalahan bukan karena plotnya yang familiar, namun untuk sebuah film yang katanya menjual erotic thriller, Passion jelas kurang unsur erotisnya, ia terasa lebih berat ke arah misteri dan crime-nya yang sempit termasuk mengekslpoitasi pesona McAdams dan Repace dengan akting kuat namun sayang  karkater-karakter mereka seperti kurang punya movitasi dan datar. Ini terasa seperti salah satu episode serial televisi ketimbang sebuah sajian layar lebar, tidak peduli seberapa banyaknya De Palma menginjeksinya dengan “serum” Hitchcockian dan segala ciri khas-nya (Teknik Split-screen, Dutch angle, shot-shot panjang) Passion  terasa “kecil”.  Belum lagi saya menyebut banyak kejutan-kejutan murahan macam sekuen mimpi yang berulang-ulang dan twist yang bisa dikatakan sedikit bodoh. Tetapi toh,  meskipun lebih banyak kekurangnnya, ujung-ujungnya yang paling penting adalah bagaimana saya menikmati semuanya, baik teknis sinematis jempolannya maupun plotnya yang lemah.'),
(602, 'Pitch Perfect', 'NEGATIF', 'DATA LATIH', 'Jujur saya menikmati setiap lagu-lagu modifikasi (tidak pernah menyangka bahwa The Sign legendarisnyaAce of Base bisa dimodif seperti itu) yang dihadirkan di sini, mereka sungguh terdengar keren, dan itu jelas adalah bagian terbaiknya, tetapi tetap saja sebagai sebuah film utuh ia tidak boleh hanya bergantung pada satu elemen saja sementara elemen lainnya tidak bekerja maksimal. Maka inilah Pitch Perfect, sebuah drama komedi kompetisi dengan cerita ‘tipis’ yang punya humor-humor ‘garing’, romansa dangkal dan banyak karakter-karakter bodoh. Tetapi jika kamu mencari tontonan seringan kapas dan sedangkal selokan depan rumah dengan kualitas musikalitas yang bagus, silahkan.'),
(603, 'Pitch Perfect 2', 'NEGATIF', 'DATA LATIH', 'Jika film pertamanya menggantungkan dirinya pada pengenalan dan banyak hal-hal baru yang menarik, Pitch Perfect 2 seperti terkesan malas untuk membuat plot-nya menjadi lebih greget. Memang ada kompetisi yang lebih besar dan kompetitor yang lebih ganas dalam wujud Das Sound Machine yang kerap menghadirkan performa mengesankan, dan masih ada perang lagu, tetapi hampir separuhnya adalah pengulang demi pengulangan, belum lagi hampir diisi oleh sub-plot tak penting misalnya kisah percintaan Fat Amy dengan mantan pemimpin The Treblemakers, Bumper Allen yang masih dimainkan Adam DeVine, atau kisah Beca yang mencoba meraih karier sebagai musisi selepas lulus nanti. Sebenarnya bukan sampai tidak terlalu penting namun yang menjadi masalah adalah ia seperti tidak mempunyai tujuan, tidak ada spirit dan antusiasme besar dari para Bellas seperti yang pernah dihadirkan di seri pertamanya, semua terkesan canggung termasuk beberapa guyonan garing yang masih mengandalkan Rabel Wilson dan beberapa anggota Bellas macam Lilly Onakurama, pendatang baru si anak hispanik, Flo  dengan segala keanehan komedinya.'),
(604, 'Pixels', 'NEGATIF', 'DATA LATIH', 'Harus diakui narasinya setipis kertas dan pengembangan karkaternya nyaris nol, termasuk di dalamnya romansa antara Sam Brenner dan Lieutenant Colonel Violet van Patten yang dimainkan Michelle Monaghan, tetapi ini bukan jenis film yang mesti kamu anggap terlalu serius dari segi penceritaan apalagi karakter. Berbekal premis ‘ajaib’ yang seperti persilangan antara Independece Day, Ghostbusters, Wreck It Ralph dan Futurama, spesial efek mahal, visual yang memanjakan mata dan guyonan khas Sandler dengan kadar kekurang ajaran yang sedikit dikompres bersama spirit nostalgia dari era 80’an yang tidak pernah ketinggalan di setiap filmnya plus momen-momen aksi seru mendebarkan. Ya, Pixels masih bisa lah kamu masukan ke dalam golongan film keluarga yang paling menghibur tahun ini.'),
(605, 'Priest', 'NEGATIF', 'DATA LATIH', 'Ah, sayang sekali Scott Steward tampaknya terlalu percaya dengan diri membuang sebagaian besar elemen-elemen penting dalam komiknya, meninggalkan Priest ‘telanjang’ dengan segala  kekurangan-kekurangannya, baik dalam naskah maupun bagaimana menghadirkan momen-momen aksinya yang seharusnya bisa menjadi bagian paling menghibur disini. Yah, untuk menghibur anda, Priest setidaknya sedikit lebih baik dari Legion.'),
(606, 'Primal Fear', 'NEGATIF', 'DATA LATIH', 'Jujur saja, untuk sebuah film yang diadaptasi dari novel, secara keseluruhan (terlepas dari twist2nya) cerita Primal Fear memiliki lubang yang cukup banyak, walaupun itu terbatas hanya pada subplotnya saja namun cukup menganggu. Banyak hal2 yang ditinggalkan mengambang tanpa penjelasan begitu saja, seakan2 akan, subplot2 tersebut hanya digunakan untuk memperpanjang durasi film tanpa berpengaruh besar pada cerita utamanya.'),
(607, 'PVC-1', 'NEGATIF', 'DATA LATIH', 'Dengan premis yang menantang dan teknis sinematik serumit dan semengagumkan itu itu PVC-1 seharusnya bisa tampil perkasa, sayang pada akhirnya thriller satu ini tidak pernah berhasil membuat kita benar-benar merasakan sebuah sensai ketegangan yang seharusnya di sepanjang kurang lebih satu jam setengah durasinya. Ya, Jujur saja saya memang kagum dengan bagaimana Stathoulopoulos mempresentasikannya tapi disaat bersamaan ia juga berhasil membuat saya cukup frustasi disaat menontonnya.'),
(608, 'R.I.P.D.', 'NEGATIF', 'DATA LATIH', 'Lalu datanglah bencana itu. Dipertengahan naskahnya menjadi amburadul. Entah apa yang terjadi ketika Robert Schwentke mencoba mencampurkan alam baka dan dunia manusia menjadi satu. Ya, manusia dapat melihat apa yang dilakukan R.I.P.D meskipun senjata mereka terlihat seperti pisang, dan yang lebih para dari CGI setengah matang untuk ukuran film berbiaya ratusan juta dan momen aksi yang mudah terlupakan adalah plot hole besar.'),
(609, 'Ragini MMS', 'NEGATIF', 'DATA LATIH', 'Jujur saja horor satu ini termasuk salah satu mockumentary yang buruk. Pawan Kripalani sebagai sutradara telah gagal mengeksekusi setiap momen didalamnya. Niatnya sih boleh saja besar, ingin menampilkan Ragini MMS layaknya sebuah crossover antara Paranormal Activity dan The Blair Witch Project dengan berusaha  menampilkan tampilan Indoor maupun Outdoor se creepy mungkin, sayang usahanya tidak berhasil. Semua yang disajikan disini terkesan terburu-buru, asal-asalan dan terlihat murahan. Penampatan kamera-kamera cctv kelewat banyak dan  tidak logis malah menambah kesan tidak realistis. Penampakan mahkluk halusnya beserta segala ganguan-ganguannya terlalu di obral habis-habisan sejak keduanya menginjak rumah itu sedari pertama kali,  parahanya lagi Kripalani juga nyaris tidak mampu menghadirkan sesuatu yang menakutkan disini, kecuali setting rumah itu sendiri.'),
(610, 'REC 2', 'NEGATIF', 'DATA LATIH', 'Overall, [REC]2 mungkin adalah salah satu dari sekian banyak sequel mengecewakan yang juga seharusnya tidak perlu dibuat, karena film pertamanya sebenarnya sudah berhasil ditutup dengan sangat baik. Namun apa daya, lagi-lagi faktor komersial untuk mengeruk untung lebih banyak dengan tidak diimbangi dengan kualitas yang memadai menjadi noda besar pada film ini. Mudah-mudahan saja nanti seri ke-3 nya bisa tampil lebih baik dari seri keduanya ini.'),
(611, 'Remember Me', 'NEGATIF', 'DATA LATIH', 'Bagaimana dengan ceritanya? seperti yang sudah dijelaskan sedikit diatas, tema cerita seperti ini sudah sering diangkat dalam sebuah film oleh sineas-sineas dunia, sehingga tidak ada sesuatu yang bisa diandalkan dalam ceritanya kalau tidak mau dibilang membosankan dan tidak fokus terhadap masalah yang ingin disampaikan. Mungkin satu-satunya yang menyelamatkan film ini sehingga masih layak ditonton hingga akhir adalah endingnya yang cukup powerfull. Ya, akhir yang luar biasa untuk ukuran film yang tergolong biasa-biasa ini benar-benar membuat penontonnya bak ‘tersengat’ listrik dan membangunkan mereka dari kebosanan yang melanda hampir kurang lebih 2 jam.\r\nOverall, untuk sebuah film yang tidak isitmewa yang hanya mengandalkan seorang Robert Pattinson semata sebagai nilai jual terbesar, Remember Me tampil terlalu lama dan membosankan. Tampaknya R-Pratz masih harus giat belajar akting lebih banyak lagi jika tidak mau dibilang sebagai aktor yang hanya mengandalkan tampang semata.'),
(612, 'Resident Evil: Afterlife', 'NEGATIF', 'DATA LATIH', 'Jadi dengan menurunkan ekpektasi saya serendah-rendahnya saya membaranikan diri untuk duduk dan menonton kisah terbaru petualangan Alice di negeri para Zombie ini. Seperti yang sudah bisa ditebak memang tidak ada hal yang baru yang ditawarkan Anderson dalam Resident Evil: Afterlife, terutama dari segi cerita yang seakan-akan mengulang kembali formula yang sama dengan seri-seri sebelumnya, yah seperti yang sudah saya bilang tadi saya sama sekali tidak terkejut dan sangat memaklumi “kekonsistenan” Anderson dalam menggarap ceritan dan dialog-dialog yang sangat dangkal dan klise ini, bahkan judul Resident Evil sendiri sepertinya sama sekali tidak mewakili kisah di versi game-nya, jadi kita langsung saja membahas senjata utama film yang membuat film ini terasa istimewa, yaitu pengunaan 3D Fusion Camera System.'),
(613, 'Retreat', 'NEGATIF', 'DATA LATIH', 'Ya, Retreat membosankan dan terlalu lama bergerak, naskahnya tidak sekuat idenya. Eksekusinya lemah hingga ia tidak pernah mampu mencapai potensi ketegangan yang semestinya bisa jauh lebih baik, walaupun harus diakui juga Tibbets sempat membuat saya mengalami keraguan sejenak tentang kebenaran kabar kiamat yang dihebuskan oleh karakter Jack disini, dan senang mengetahui endingnya mampu mengobati kekecewaan saya dengan sedikit twist yang cerdas. Tidak ada yang menonjol dari ketiga karakter utamanya. Cillian Murphy nyaris bermain tanpa emosi dan pemilihan Jamie Bell adalah sebuah kesalahan, bukan karena aktingnya buruk tapi ia terlalu ‘lugu’ untuk kemudian didapuk sebagai tokoh antagonis disini.'),
(614, 'Riddick', 'NEGATIF', 'DATA LATIH', 'Kualitas narasinya mungkin bukan yang terbaik, namun sudah cukup untuk menegaskan kembali franchise ini masih punya daya tarik, dan ia tidak sebodoh seri keduanya. Riddick juga banyak dihiasi dengan dialog-dialog canggung, tetapi kamu pastinya tidak menonton Riddick untuk mencari dialog pintar bukan? Terlalu banyak karkater tanpa ada waktu memberikan mereka kedalaman, tidak seperti Pitch Black yang membaginya sama rata, di sini hanya Riddick yang berkuasa penuh.'),
(615, 'Sabotage', 'NEGATIF', 'DATA LATIH', 'Ada premis bagus dari novel bagus, sutradara dan penulis naskah menjanjikan dan sebuah ensemble cast menarik, tetapi bagi penonton awam ini hanya film terbaru dari Arnie, tidak lebih, tidak kurang. Tetapi jangan terlalu banyak berharap ini akan diwarnai banyak ledakan dan keributan ala kebanyakan film Schwarzenegger.Ya, memang Sabotage sendiri memang masih tidak jauh-jauh dari otot, senjata berat, dialog humor one liner dan sedikit aksi, tetapi Ayer ingin menjual misteri dan sisi psikologis karakternya ketimbang parade aksi, hasilnya, Sabotage dengan kandungan misteri gelap dan kadar violence cukup vulgar terlihat seperti sebuah horor slasher beralut kemachoan yang sayang tidak mampu berjalan beriringan dengan sempurna.'),
(616, 'Sadako vs Kayako', 'NEGATIF', 'DATA LATIH', 'Tidak usahlah membahas plotnya yang tipis dan serba memaksakan diri, kita tahu benar dari awal bahwa Sadako vs. Kayako memang akan berakhir menggelikan ketimbang mengerikan, bersama humor-humor yang datang dari celetukan-celetukan bodoh karakternya serta momen-momen kematian yang terkesan berlebihan alias over the top, tetapi bukan berarti kamu tidak bisa menikmati setiap menit yang disajikan Shiraishi di sini. Aspek horor khas negeri matahari terbit itu tetap dipertahankan sejak awal film dibuka, masih ada aura creepy yang masih cukup sanggup menggoyang para penonton berhati lembek dengan segala penampakan-penampakan mengerikan yang muncul dari koridor-koridor gelap.'),
(617, 'Safe', 'NEGATIF', 'DATA LATIH', 'Polisi korup, uang kotor, gengster, baku hantam, peluru di mana mana dan kejar-kejaran dengan kualitas cerita apa adanya, Safe seperti kebanyakan film Statham lainnya, yang memang didesain cepat untuk sekedar menjadi suguhan murni hiburan buat penontonnya, sayang tidak bekerja terlalu baik, bahkan untuk sekedar menikmati porsi aksi tanpa otaknya yang tak pernah bisa mencapai kadar maksimunya.'),
(620, 'zz test', 'POSITIF', 'DATA LATIH', 'mengaku mengekor mengisap menguap mengolah mengoper mengikis mengatasi mengobati mengolok');
